(2, 1048585, 77, 1, '2022-05-26 17:27:36', NULL, '\"propes propes\" <submissoescpic@gmail.com>', '\"Dener Ottolini\" <dnredson@hotmail.com>', NULL, NULL, '[Teste] Solicita avaliação de artigo', '<p>Dener Ottolini:<br><br>Eu acredito que você seria um(a) excelente parecerista para o manuscrito, \"TESTE,\" que foi submetido ao periódico Teste3. O resumo da submissão segue abaixo e eu espero que você considere o aceite desta tarefa importante.<br><br>Por gentileza, logue no site do periódico até 2022-06-02 para indicar se você aceita fazer o parecer ou não, além de acessar a submissão para registrar sua avaliação e recomendação.<br><br>O prazo para entrega do parecer é 2022-06-09.<br><br>URL da submissão: <a href=\'http://177.104.62.12/index.php/teste3/reviewer/submission?submissionId=77&reviewId=1&key=kq3SPc\' class=\'submissionReviewUrl-style-class\'>http://177.104.62.12/index.php/teste3/reviewer/submission?submissionId=77&reviewId=1&key=kq3SPc</a><br><br>Obrigado por considerar este pedido.<br><br>propes propes<br>submissoescpic@gmail.com<br><br>\"TESTE\"<br><br></p>\r\n<p>JJIJJIOJOJJ</p><br/><br>\n________________________________________________________________________<br>\n<a href=\"http://177.104.62.12/index.php/teste3\">Teste3</a>'),
(3, 1048585, 77, 4, '2022-05-26 17:29:25', 1073741829, '\"Dener Ottolini\" <dnredson@hotmail.com>', '\"Celia Antunes\" <celia.antunes@ufabc.edu.br>, \"Celia Antunes\" <celia.antunes@ufabc.edu.br>, \"Felipe Dantas\" <felipe.dantas@ufabc.edu.br>, \"Celia Antunes\" <celia.antunes@ufabc.edu.br>', NULL, NULL, '[Teste] Disponível para realizar avaliação', 'Prezados editores, <br />\n<br />\nEu tenho disponibilidade para dar um parecer para a submissão, &quot;TESTE,&quot; para o periódico Teste3. Agradeço por lembrar de mim, e pretendo enviar o parecer até 2022-06-09, se não antes.<br />\n<br />\nAtenciosamente,\n<br />\nDener Ottolini<br/><br>\n________________________________________________________________________<br>\n<a href=\"http://177.104.62.12/index.php/teste3\">Teste3</a>'),
(4, 1048585, 77, 1, '2022-05-26 17:37:17', 805306369, '\"propes propes\" <submissoescpic@gmail.com>', '\"Celia Antunes\" <celia.antunes@ufabc.edu.br>', NULL, NULL, '[Teste] Decisão editorial', '<p>Celia Antunes, Felipe Dantas:<br><br>Nós chegamos a uma decisão referente a sua submissão para o periódico Teste3, \"TESTE\".<br><br>Nossa decisão é de: Revisões Requeridas</p>\r\n<p><br><br>------------------------------------------------------<br>Avaliador A:<br>Recomendação: Aceitar<br><br>------------------------------------------------------<br><br></p>\r\n<p>Objetivo</p>\r\n<blockquote>Excelente</blockquote>\r\n<p>&nbsp;</p>\r\n<p>Dados obtidos</p>\r\n<blockquote>Excelente</blockquote>\r\n<p>&nbsp;</p>\r\n<p>Comentários</p>\r\n<blockquote>`Ótimo</blockquote>\r\n<p>------------------------------------------------------<br><br><br></p><br/><br>\n________________________________________________________________________<br>\n<a href=\"http://177.104.62.12/index.php/teste3\">Teste3</a>'),
(5, 1048585, 77, 3, '2022-05-26 17:41:31', 536870913, '\"Celia Antunes\" <celia.antunes@ufabc.edu.br>', '\"Celia Antunes\" <celia.antunes@ufabc.edu.br>, \"Celia Antunes\" <celia.antunes@ufabc.edu.br>, \"Felipe Dantas\" <felipe.dantas@ufabc.edu.br>, \"Celia Antunes\" <celia.antunes@ufabc.edu.br>', NULL, NULL, '[Teste] Envio de versão atualizada', 'Editores: <br />\n<br />\nUma versão revisada de &quot;TESTE&quot; foi carregada pelo autor Celia Antunes. <br />\n<br />\nURL da Submissão: <a href=\'http://177.104.62.12/index.php/teste3/workflow/index/77/3\' class=\'submissionUrl-style-class\'>http://177.104.62.12/index.php/teste3/workflow/index/77/3</a> <br />\n<br />\nDivisão de Iniciação Cientifica<br/><br>\n________________________________________________________________________<br>\n<a href=\"http://177.104.62.12/index.php/teste3\">Teste3</a>'),
(6, 1048585, 77, 1, '2022-05-26 17:43:52', 805306369, '\"propes propes\" <submissoescpic@gmail.com>', '\"Celia Antunes\" <celia.antunes@ufabc.edu.br>', NULL, NULL, '[Teste] Decisão editorial', '<p>Celia Antunes, Felipe Dantas:<br><br>Nós chegamos a uma decisão referente a sua submissão para o periódico Teste3, \"TESTE\".<br><br>Nossa decisão é de: Aceitar a Submissão</p><br/><br>\n________________________________________________________________________<br>\n<a href=\"http://177.104.62.12/index.php/teste3\">Teste3</a>'),
(7, 1048585, 77, 1, '2022-05-26 17:44:43', 805306369, '\"propes propes\" <submissoescpic@gmail.com>', '\"Celia Antunes\" <celia.antunes@ufabc.edu.br>', NULL, NULL, '[Teste] Decisão do Editor', '<p>Celia Antunes, Felipe Dantas:<br><br>A edição de texto da sua submissão, \"TESTE,\" está completa. Agora ela está sendo enviada para editoração.<br><br>URL da submissão: <a class=\"submissionUrl-style-class\" href=\"http://177.104.62.12/index.php/teste3/authorDashboard/submission/77\">http://177.104.62.12/index.php/teste3/authorDashboard/submission/77</a></p><br/><br>\n________________________________________________________________________<br>\n<a href=\"http://177.104.62.12/index.php/teste3\">Teste3</a>'),
