(47, 1048585, 154, 67, '2022-06-20 02:04:43', NULL, '\"CPIC - ProPes\" <submissoes.propes@ufabc.edu.br>', '\"Maria Cleofé Valverde Brambila\" <maria.brambila@ufabc.edu.br>', NULL, 'juliana.marchi@ufabc.edu.br, andre.pasti@ufabc.edu.br, a.gallego@ufabc.edu.br, patricia.maria@ufabc.edu.br', '[042022PROJ] Agradecimento pela submissão', '<p>Prezado(a) Prof(a) Maria Cleofé Valverde Brambila,<br /><br />Agradecemos a submissão do projeto \"As inundações na sub-bacia Guarará em Santo André - SP e sua relação com os eventos extremos de precipitação\" ao Edital 04/2022 - PIC/PIBIC/PIBITI/PIBIC-AF.</p>\n<p>Acompanhe o progresso da sua submissão por meio do sistema.</p>\n<p>URL da Submissão: <a href=\'https://submissoesic.propes.ufabc.edu.br/index.php/042022PROJ/authorDashboard/submission/154\' class=\'submissionUrl-style-class\'>https://submissoesic.propes.ufabc.edu.br/index.php/042022PROJ/authorDashboard/submission/154</a><br />Login: maria_brambila</p>\n<p>Em caso de dúvidas, entre em contato conosco.</p>\n<p> </p>\n<p>Atenciosamente.</p>\n<p>CPIC - ProPes</p><br/><p>________________________________________________________________________<br><a href=\"http://177.104.62.12/index.php/052022\">Edital 05/2022 - PIC/PIBIC/PIBITI/PIBIC-AF</a></p>'),
(48, 1048585, 137, 1, '2022-06-20 14:02:43', 805306369, '\"propes propes\" <submissoescpic@gmail.com>', '\"Célia teste\" <celia.antunes.ufabc@gmail.com>, \"Juliana Merino\" <juliana.merino@ufabc.edu.br>', NULL, NULL, '[TI] Decisão editorial', '<p>Célia teste, Juliana Merino:<br><br>Nós chegamos a uma decisão referente a sua submissão para o periódico TesteInterno, \"teste de avaliação edital 04/2022\".<br><br>Nossa decisão é de: Revisões Requeridas</p><br/><br>\n________________________________________________________________________<br>\n<a href=\"https://submissoesic.propes.ufabc.edu.br/index.php/ti\">TesteInterno</a>'),
(49, 1048585, 100, 1, '2022-06-20 14:51:26', NULL, '\"propes propes\" <submissoescpic@gmail.com>', '\"Célia teste\" <celia.antunes.ufabc@gmail.com>', NULL, NULL, '[042022PROJ] O Edital 04/2022 - PIC/PIBIC/PIBITI/PIBIC-AF solicita avaliação ', '<p>Prezado(a) Prof(a) Célia teste,<br><br>Acredito que seu conhecimento será fundamental para realizar a avaliação do projeto \"Teste \", submetido ao Edital 04/2022 - PIC/PIBIC/PIBITI/PIBIC-AF. O resumo da submissão está inserido abaixo e espero que você considere realizar essa importante tarefa para nós.</p>\r\n<p>De acordo com os Editais de Iniciação Científica, uma das obrigações do orientador é \"emitir pareceres referentes a projetos de iniciação científica deste ou de outros editais\".</p>\r\n<p><span style=\"font-size: 0.875rem;\">Informações sobre a submissão encontram-se nesta mensagem.</span></p>\r\n<p>Pedimos que acesse o sistema para nos informar, se possível em até três dias úteis a partir da data do envio desta mensagem, se estará disponível ou não para realizar a avaliação. A ausência de manifestação contrária indica concordância do aceite da avaliação.</p>\r\n<p>Caso não seja possível efetuar a avaliação, informe a justificativa através do e-mail acessível no sistema ao clicar em \"indisponível para avaliação\", com cópia para iniciacao@ufabc.edu.br</p>\r\n<p>Efetue login no sistema antes de 2022-06-27 para indicar sua disponibilidade, bem como para acessar a submissão e registrar sua avaliação e recomendação. O link é <a class=\"contextUrl-style-class\" href=\"https://submissoesic.propes.ufabc.edu.br/index.php/042022PROJ\">https://submissoesic.propes.ufabc.edu.br/index.php/042022PROJ</a>.<br><br>O prazo para a conclusão da avaliação é 2022-07-04.<br><br>Se você não tiver seu nome de usuário e senha para o site do periódico, poderá usar este link para redefinir sua senha (que será enviada por e-mail juntamente com seu nome de usuário). <a class=\"passwordResetUrl-style-class\" href=\"https://submissoesic.propes.ufabc.edu.br/index.php/042022PROJ/login/lostPassword\">https://submissoesic.propes.ufabc.edu.br/index.php/042022PROJ/login/lostPassword</a>.</p>\r\n<p>Lembramos que o avaliador do projeto poderá também ser solicitado para avaliar o relatório parcial e o final encaminhados posteriormente.</p>\r\n<p>Agradecemos desde já sua atenção.</p>\r\n<p>&nbsp;</p>\r\n<p>propes propes<br>submissoescpic@gmail.com</p>\r\n<p>---------------------------------------------------------------------------------</p>\r\n<p>URL da submissão: <a href=\'https://submissoesic.propes.ufabc.edu.br/index.php/042022PROJ/reviewer/submission?submissionId=100\' class=\'submissionReviewUrl-style-class\'>https://submissoesic.propes.ufabc.edu.br/index.php/042022PROJ/reviewer/submission?submissionId=100</a><br><br>\"Teste \"<br><br></p>\r\n<p>Teste sistema de submissões IC. Teste sistema de submissões IC. Teste sistema de submissões IC. Teste sistema de submissões IC. Teste sistema de submissões IC. Teste sistema de submissões IC. Teste sistema de submissões IC. Teste sistema de submissões IC.&nbsp;</p><br/><p>________________________________________________________________________<br><a href=\"http://177.104.62.12/index.php/052022\">Edital 05/2022 - PIC/PIBIC/PIBITI/PIBIC-AF</a></p>'),
(50, 1048585, 100, 21, '2022-06-20 15:02:59', 1073741829, '\"Célia teste\" <celia.antunes.ufabc@gmail.com>', '\"Celia Antunes\" <celia.antunes@ufabc.edu.br>', NULL, NULL, '[042022PROJ] Disponível para realizar avaliação', '<p>Prezado editor, <br /><br />Estou disponível para avaliar a submissão , \"Teste ,\" em Edital 04/2022 - PIC/PIBIC/PIBITI/PIBIC-AF. Agradeço a consideração e pretendo concluir a avaliação até a data definida 2022-07-04, ou antes do prazo.<br /><br />Atenciosamente, <br />Célia teste</p><br/><p>________________________________________________________________________<br><a href=\"http://177.104.62.12/index.php/052022\">Edital 05/2022 - PIC/PIBIC/PIBITI/PIBIC-AF</a></p>'),
(51, 1048585, 137, 1, '2022-06-20 16:08:35', NULL, '\"propes propes\" <submissoescpic@gmail.com>', '\"Dener Ottolini\" <dnredson@hotmail.com>', NULL, NULL, '[TI] A revista TesteInterno solicita avaliação de artigo', '<p>Dener Ottolini:<br><br>Acredito que você poderia servir como um(a) excelente avaliador(a) do manuscrito, \"teste de avaliação edital 04/2022,\" que foi submetido ao periódico TesteInterno. O resumo da submissão está inserido abaixo e espero que você considere realizar essa importante tarefa para nós.<br><br>Faça o login no site do periódico antes de 2022-06-27 para indicar sua disponibilidade, bem como para acessar submissão e registrar sua avaliação e recomendação. O site é <a class=\"contextUrl-style-class\" href=\"https://submissoesic.propes.ufabc.edu.br/index.php/ti\">https://submissoesic.propes.ufabc.edu.br/index.php/ti</a><br><br>A avaliação em si tem como prazo 2022-07-04.<br><br>Se você não tiver seu nome de usuário e senha para o site do periódico, poderá usar este link para redefinir sua senha (que será enviada por e-mail juntamente com seu nome de usuário). <a class=\"passwordResetUrl-style-class\" href=\"https://submissoesic.propes.ufabc.edu.br/index.php/ti/login/lostPassword\">https://submissoesic.propes.ufabc.edu.br/index.php/ti/login/lostPassword</a><br><br>URL da submissão: <a href=\'https://submissoesic.propes.ufabc.edu.br/index.php/ti/reviewer/submission?submissionId=137\' class=\'submissionReviewUrl-style-class\'>https://submissoesic.propes.ufabc.edu.br/index.php/ti/reviewer/submission?submissionId=137</a><br><br>Agradeço por considerar esta solicitação.<br><br>propes propes<br>submissoescpic@gmail.com<br><br>\"teste de avaliação edital 04/2022\"<br><br></p>\r\n<p>lkjd djdjljldkjdljsadlkjd djdjljldkjdljsadlkjd djdjljldkjdljsadlkjd djdjljldkjdljsadlkjd djdjljldkjdljsadlkjd djdjljldkjdljsadlkjd djdjljldkjdljsadlkjd djdjljldkjdljsadlkjd djdjljldkjdljsadlkjd djdjljldkjdljsadlkjd djdjljldkjdljsadlkjd djdjljldkjdljsadlkjd djdjljldkjdljsa