(52, 1048585, 155, 4, '2022-06-20 16:14:31', NULL, '\"CPIC - ProPes\" <submissoes.propes@ufabc.edu.br>', '\"Dener Ottolini\" <dnredson@hotmail.com>', NULL, 'dnredson@hotmail.com, dnredson@hotmail.com', '[TI] Agradecimento pela submissão', 'Dener Ottolini:<br />\n<br />\nObrigado por submeter o manuscrito, &quot;Teste&quot; ao periódico TesteInterno. Com o sistema de gerenciamento de periódicos on-line que estamos usando, você poderá acompanhar seu progresso através do processo editorial efetuando login no site do periódico:<br />\n<br />\nURL da Submissão: <a href=\'https://submissoesic.propes.ufabc.edu.br/index.php/ti/authorDashboard/submission/155\' class=\'submissionUrl-style-class\'>https://submissoesic.propes.ufabc.edu.br/index.php/ti/authorDashboard/submission/155</a><br />\nUsuário: dnredson<br />\n<br />\nSe você tiver alguma dúvida, entre em contato conosco. Agradecemos por considerar este periódico para publicar o seu trabalho.<br />\n<br />\nCPIC - ProPes<br/><br>\n________________________________________________________________________<br>\n<a href=\"https://submissoesic.propes.ufabc.edu.br/index.php/ti\">TesteInterno</a>'),
