(54, 1048585, 100, 1, '2022-06-20 17:01:08', 805306369, '\"propes propes\" <submissoescpic@gmail.com>', '\"Juliana Merino\" <juliana.merino@ufabc.edu.br>', NULL, NULL, '[042022PROJ] Decisão editorial - Iniciação Científica', '<p>Prezado(a) Prof(a) Juliana Merino,<br><br>Foi tomada uma decisão sobre o projeto submetido ao Edital 04/2022 - PIC/PIBIC/PIBITI/PIBIC-AF, \"Teste \".</p>\r\n<p>A decisão é: revisões são necessárias.</p>\r\n<p>O arquivo com as correções deverá ser encaminhado pelo sistema em até três dias a partir do envio dessa mensagem.</p>\r\n<p>Para encaminhar o arquivo:</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Atenciosamente,</p>\r\n<p>propes propes&lt;br/&gt;submissoescpic@gmail.com</p>\r\n<p><br><br>------------------------------------------------------<br>Avaliador A:<br>Recomendação: Correções obrigatórias<br><br>------------------------------------------------------<br><br></p>\r\n<p>Objetivo</p>\r\n<blockquote>Excelente</blockquote>\r\n<p>&nbsp;</p>\r\n<p>Originalidade</p>\r\n<blockquote>Bom</blockquote>\r\n<p>&nbsp;</p>\r\n<p>Metodologia</p>\r\n<blockquote>Regular</blockquote>\r\n<p>&nbsp;</p>\r\n<p>Mérito Científico</p>\r\n<blockquote>Com deficiências</blockquote>\r\n<p>&nbsp;</p>\r\n<p>Viabilidade</p>\r\n<blockquote>Excelente</blockquote>\r\n<p>&nbsp;</p>\r\n<p>Comentários</p>\r\n<blockquote>efetuar revisões</blockquote>\r\n<p>------------------------------------------------------<br><br><br></p><br/><p>________________________________________________________________________<br><a href=\"http://177.104.62.12/index.php/052022\">Edital 05/2022 - PIC/PIBIC/PIBITI/PIBIC-AF</a></p>'),
(55, 1048585, 93, 1, '2022-06-20 17:18:52', NULL, '\"propes propes\" <submissoescpic@gmail.com>', '\"Célia teste\" <celia.antunes.ufabc@gmail.com>', NULL, NULL, '[042022PROJ] O Edital 04/2022 - PIC/PIBIC/PIBITI/PIBIC-AF solicita avaliação ', '<p>Prezado(a) Prof(a) Célia teste,<br><br>Acredito que seu conhecimento será fundamental para realizar a avaliação do projeto \"Teste_1 2705\", submetido ao Edital 04/2022 - PIC/PIBIC/PIBITI/PIBIC-AF. O resumo da submissão está inserido abaixo e espero que você considere realizar essa importante tarefa para nós.</p>\r\n<p>De acordo com os Editais de Iniciação Científica, uma das obrigações do orientador é \"emitir pareceres referentes a projetos de iniciação científica deste ou de outros editais\".</p>\r\n<p><span style=\"font-size: 0.875rem;\">Informações sobre a submissão encontram-se nesta mensagem.</span></p>\r\n<p>Pedimos que acesse o sistema para nos informar, se possível em até três dias úteis a partir da data do envio desta mensagem, se estará disponível ou não para realizar a avaliação. A ausência de manifestação contrária indica concordância do aceite da avaliação.</p>\r\n<p>Caso não seja possível efetuar a avaliação, informe a justificativa através do e-mail acessível no sistema ao clicar em \"indisponível para avaliação\", com cópia para iniciacao@ufabc.edu.br</p>\r\n<p>Efetue login no sistema antes de 2022-06-27 para indicar sua disponibilidade, bem como para acessar a submissão e registrar sua avaliação e recomendação. O link é <a class=\"contextUrl-style-class\" href=\"https://submissoesic.propes.ufabc.edu.br/index.php/042022PROJ\">https://submissoesic.propes.ufabc.edu.br/index.php/042022PROJ</a>.<br><br><strong>O prazo para a conclusão da avaliação é </strong>2022-07-04.<br><br>Se você não tiver seu nome de usuário e senha para o site do periódico, poderá usar este link para redefinir sua senha (que será enviada por e-mail juntamente com seu nome de usuário). <a class=\"passwordResetUrl-style-class\" href=\"https://submissoesic.propes.ufabc.edu.br/index.php/042022PROJ/login/lostPassword\">https://submissoesic.propes.ufabc.edu.br/index.php/042022PROJ/login/lostPassword</a>.</p>\r\n<p>Lembramos que o avaliador do projeto poderá também ser solicitado para avaliar o relatório parcial e o final encaminhados posteriormente.</p>\r\n<p>Agradecemos desde já sua atenção.</p>\r\n<p>&nbsp;</p>\r\n<p>propes propes<br>submissoescpic@gmail.com</p>\r\n<p>---------------------------------------------------------------------------------</p>\r\n<p>URL da submissão: <a href=\'https://submissoesic.propes.ufabc.edu.br/index.php/042022PROJ/reviewer/submission?submissionId=93\' class=\'submissionReviewUrl-style-class\'>https://submissoesic.propes.ufabc.edu.br/index.php/042022PROJ/reviewer/submission?submissionId=93</a><br><br>\"Teste_1 2705\"<br><br></p>\r\n<p>lafj dflksj sdjflsdj flsdkfj sfsjk fskfj sfsjf sjfks fs dflafj dflksj sdjflsdj flsdkfj sfsjk fskfj sfsjf sjfks fs dflafj dflksj sdjflsdj flsdkfj sfsjk fskfj sfsjf sjfks fs dflafj dflksj sdjflsdj flsdkfj sfsjk fskfj sfsjf sjfks fs dflafj dflksj sdjflsdj flsdkfj sfsjk fskfj sfsjf sjfks fs dflafj dflksj sdjflsdj flsdkfj sfsjk fskfj sfsjf sjfks fs dflafj dflksj sdjflsdj flsdkfj sfsjk fskfj sfsjf sjfks fs dflafj dflksj sdjflsdj flsdkfj sfsjk fskfj sfsjf sjfks fs dflafj dflksj sdjflsdj flsdkfj sfsjk fskfj sfsjf sjfks fs dflafj dflksj sdjflsdj flsdkfj sfsjk fskfj sfsjf sjfks fs dflafj dflksj sdjflsdj flsdkfj sfsjk fskfj sfsjf sjfks fs dflafj dflksj sdjflsdj flsdkfj sfsjk fskfj sfsjf sjfks fs dflafj dflksj sdjflsdj flsdkfj sfsjk fskfj sfsjf sjfks fs df</p><br/><p>________________________________________________________________________<br><a href=\"http://177.104.62.12/index.php/052022\">Edital 05/2022 - PIC/PIBIC/PIBITI/PIBIC-AF</a></p>'),
(56, 1048585, 93, 1, '2022-06-20 17:21:55', NULL, '\"propes propes\" <submissoescpic@gmail.com>', '\"Celia Antunes\" <celia.antunes@ufabc.edu.br>', NULL, NULL, '[042022PROJ] Tarefa editorial', '<p>Celia Antunes:<br><br>A submissão, \"Teste_1 2705,\" ao periódico Edital 04/2022 - PIC/PIBIC/PIBITI/PIBIC-AF lhe foi designada para acompanhar o processo editorial em sua função como Editor de Seção.<br><br>URL da Submissão: <a href=\'https://submissoesic.propes.ufabc.edu.br/index.php/042022PROJ/workflow/access/93\' class=\'submissionUrl-style-class\'>https://submissoesic.propes.ufabc.edu.br/index.php/042022PROJ/workflow/access/93</a><br>Usuário: celia<br><br>Obrigado.</p><br/><p>________________________________________________________________________<br><a href=\"http://177.104.62.12/index.php/052022\">Edital 05/2022 - PIC/PIBIC/PIBITI/PIBIC-AF</a></p>'),
