(64, 1048585, 165, 75, '2022-06-21 11:28:43', NULL, '\"CPIC - ProPes\" <submissoes.propes@ufabc.edu.br>', '\"Pedro Moraes\" <moraes.phrs@gmail.com>', NULL, 'juliana.marchi@ufabc.edu.br, denise.criado@ufabc.edu.br, marine.pereira@ufabc.edu.br, hana.masuda@ufabc.edu.br', '[042022PROJ] Agradecimento pela submissão', '<p>Prezado(a) Prof(a) Pedro Moraes,<br /><br />Agradecemos a submissão do projeto \"A PERSISTÊNCIA DO PRINCÍPIO COSMOLÓGICO\" ao Edital 04/2022 - PIC/PIBIC/PIBITI/PIBIC-AF.</p>\n<p>Acompanhe o progresso da sua submissão por meio do sistema.</p>\n<p>URL da Submissão: <a href=\'https://submissoesic.propes.ufabc.edu.br/index.php/042022PROJ/authorDashboard/submission/165\' class=\'submissionUrl-style-class\'>https://submissoesic.propes.ufabc.edu.br/index.php/042022PROJ/authorDashboard/submission/165</a><br />Login: pedromoraes</p>\n<p>Em caso de dúvidas, entre em contato conosco.</p>\n<p> </p>\n<p>Atenciosamente.</p>\n<p>CPIC - ProPes</p><br/><p>________________________________________________________________________<br><a href=\"http://177.104.62.12/index.php/052022\">Edital 05/2022 - PIC/PIBIC/PIBITI/PIBIC-AF</a></p>'),
(65, 1048585, 156, 1, '2022-06-21 12:31:43', NULL, '\"propes propes\" <submissoescpic@gmail.com>', '\"Célia teste\" <celia.antunes.ufabc@gmail.com>', NULL, NULL, '[042022PROJ] O Edital 04/2022 - PIC/PIBIC/PIBITI/PIBIC-AF solicita avaliação ', '<p>Prezado(a) Prof(a) Célia teste,<br><br>Acredito que seu conhecimento será fundamental para realizar a avaliação do projeto \"Teste\", submetido ao Edital 04/2022 - PIC/PIBIC/PIBITI/PIBIC-AF. O resumo da submissão está inserido abaixo e espero que você considere realizar essa importante tarefa para nós.</p>\r\n<p>De acordo com os Editais de Iniciação Científica, uma das obrigações do orientador é \"emitir pareceres referentes a projetos de iniciação científica deste ou de outros editais\".</p>\r\n<p><span style=\"font-size: 0.875rem;\">Informações sobre a submissão encontram-se nesta mensagem.</span></p>\r\n<p>Pedimos que acesse o sistema para nos informar, se possível em até três dias úteis a partir da data do envio desta mensagem, se estará disponível ou não para realizar a avaliação. A ausência de manifestação contrária indica concordância do aceite da avaliação.</p>\r\n<p>Caso não seja possível efetuar a avaliação, informe a justificativa através do e-mail acessível no sistema ao clicar em \"indisponível para avaliação\", com cópia para iniciacao@ufabc.edu.br</p>\r\n<p>Efetue login no sistema antes de 2022-06-28 para indicar sua disponibilidade, bem como para acessar a submissão e registrar sua avaliação e recomendação. O link é <a class=\"contextUrl-style-class\" href=\"https://submissoesic.propes.ufabc.edu.br/index.php/042022PROJ\">https://submissoesic.propes.ufabc.edu.br/index.php/042022PROJ</a>.<br><br>O prazo para a conclusão da avaliação é 2022-07-05.<br><br>Se você não tiver seu nome de usuário e senha para o site do periódico, poderá usar este link para redefinir sua senha (que será enviada por e-mail juntamente com seu nome de usuário). <a class=\"passwordResetUrl-style-class\" href=\"https://submissoesic.propes.ufabc.edu.br/index.php/042022PROJ/login/lostPassword\">https://submissoesic.propes.ufabc.edu.br/index.php/042022PROJ/login/lostPassword</a>.</p>\r\n<p>Lembramos que o avaliador do projeto poderá também ser solicitado para avaliar o relatório parcial e o final encaminhados posteriormente.</p>\r\n<p>Agradecemos desde já sua atenção.</p>\r\n<p>&nbsp;</p>\r\n<p>propes propes<br>submissoescpic@gmail.com</p>\r\n<p>---------------------------------------------------------------------------------</p>\r\n<p>URL da submissão: <a href=\'https://submissoesic.propes.ufabc.edu.br/index.php/042022PROJ/reviewer/submission?submissionId=156\' class=\'submissionReviewUrl-style-class\'>https://submissoesic.propes.ufabc.edu.br/index.php/042022PROJ/reviewer/submission?submissionId=156</a><br><br>\"Teste\"<br><br></p>\r\n<p></p><br/><p>________________________________________________________________________<br><a href=\"http://177.104.62.12/index.php/052022\">Edital 05/2022 - PIC/PIBIC/PIBITI/PIBIC-AF</a></p>'),
(66, 1048585, 156, 21, '2022-06-21 12:32:51', 1073741829, '\"Célia teste\" <celia.antunes.ufabc@gmail.com>', '\"Juliana Marchi\" <juliana.marchi@ufabc.edu.br>, \"Elizabeth Teodorov\" <elizabeth.teodorov@ufabc.edu.br>, \"Elisabete  Marcon Mello\" <elisabete.marcon@ufabc.edu.br>, \"Fernando Teubl Ferreira\" <fernando.teubl@ufabc.edu.br>, \"Rafael Santos Alves\" <alves.rafael@ufabc.edu.br>', NULL, NULL, '[042022PROJ] Disponível para realizar avaliação', '<p>Prezado editor, <br /><br />Estou disponível para avaliar a submissão , \"Teste,\" em Edital 04/2022 - PIC/PIBIC/PIBITI/PIBIC-AF. Agradeço a consideração e pretendo concluir a avaliação até a data definida 2022-07-05, ou antes do prazo.<br /><br />Atenciosamente, <br />Célia teste</p><br/><p>________________________________________________________________________<br><a href=\"http://177.104.62.12/index.php/052022\">Edital 05/2022 - PIC/PIBIC/PIBITI/PIBIC-AF</a></p>'),
