(79, 1048585, 129, 4, '2022-06-22 14:18:44', NULL, '\"Dener Ottolini\" <dnredson@hotmail.com>', '\"Dener Ottolini\" <dnredson@hotmail.com>', NULL, NULL, '[TI] A revista TesteInterno solicita avaliação de artigo', '<p>Dener Ottolini:<br><br>Acredito que você poderia servir como um(a) excelente avaliador(a) do manuscrito, \"Teste avaliação projeto 3,\" que foi submetido ao periódico TesteInterno. O resumo da submissão está inserido abaixo e espero que você considere realizar essa importante tarefa para nós.<br><br>Faça o login no site do periódico antes de 2022-06-29 para indicar sua disponibilidade, bem como para acessar submissão e registrar sua avaliação e recomendação. O site é <a class=\"contextUrl-style-class\" href=\"https://submissoesic.propes.ufabc.edu.br/index.php/ti\">https://submissoesic.propes.ufabc.edu.br/index.php/ti</a><br><br>A avaliação em si tem como prazo 2022-07-06.<br><br>Se você não tiver seu nome de usuário e senha para o site do periódico, poderá usar este link para redefinir sua senha (que será enviada por e-mail juntamente com seu nome de usuário). <a class=\"passwordResetUrl-style-class\" href=\"https://submissoesic.propes.ufabc.edu.br/index.php/ti/login/lostPassword\">https://submissoesic.propes.ufabc.edu.br/index.php/ti/login/lostPassword</a><br><br>URL da submissão: <a href=\'https://submissoesic.propes.ufabc.edu.br/index.php/ti/reviewer/submission?submissionId=129\' class=\'submissionReviewUrl-style-class\'>https://submissoesic.propes.ufabc.edu.br/index.php/ti/reviewer/submission?submissionId=129</a><br><br>Agradeço por considerar esta solicitação.<br><br>Dener Ottolini<br>UFABC<br>dnredson@hotmail.com<br><br>\"Teste avaliação projeto 3\"<br><br></p>\r\n<p>klfj&nbsp; jklj jdlkjf lkjdl kjdslkjdsfjdsklfj&nbsp; jklj jdlkjf lkjdl kjdslkjdsfjdsklfj&nbsp; jklj jdlkjf lkjdl kjdslkjdsfjdsklfj&nbsp; jklj jdlkjf lkjdl kjdslkjdsfjdsklfj&nbsp; jklj jdlkjf lkjdl kjdslkjdsfjdsklfj&nbsp; jklj jdlkjf lkjdl kjdslkjdsfjdsklfj&nbsp; jklj jdlkjf lkjdl kjds