(86, 1048585, 100, 1, '2022-06-22 18:27:52', NULL, '\"propes propes\" <submissoescpic@gmail.com>', '\"Celia Antunes\" <celia.antunes@ufabc.edu.br>', NULL, NULL, '[042022PROJ] Solicitação de avaliação de projeto de IC revisado', '<p>Prezado Prof(a) Celia Antunes:<br><br>Informamos que os autores submeteram uma versão revisada do projeto \"Teste \", o qual está sendo avaliado no edital de IC Edital 04/2022 - PIC/PIBIC/PIBITI/PIBIC-AF.</p>\r\n<p>Por gentileza, acesse o sistema de submissões até 2022-06-29 para informar sua disponibilidade,&nbsp; acessar a submissão e registrar sua avaliação e recomendação. O site é <a class=\"contextUrl-style-class\" href=\"https://submissoesic.propes.ufabc.edu.br/index.php/042022PROJ\">https://submissoesic.propes.ufabc.edu.br/index.php/042022PROJ</a>.<br><br>O prazo para envio do parecer é 2022-07-06.<br><br>Caso você não possua login e senha para o sistema, você pode usar este link para solicitar uma nova senha (que lhe será, então, enviada por e-mail junto ao seu login). <a class=\"passwordResetUrl-style-class\" href=\"https://submissoesic.propes.ufabc.edu.br/index.php/042022PROJ/login/lostPassword\">https://submissoesic.propes.ufabc.edu.br/index.php/042022PROJ/login/lostPassword</a><br><br>URL da submissão: <a href=\'https://submissoesic.propes.ufabc.edu.br/index.php/042022PROJ/reviewer/submission?submissionId=100\' class=\'submissionReviewUrl-style-class\'>https://submissoesic.propes.ufabc.edu.br/index.php/042022PROJ/reviewer/submission?submissionId=100</a></p>\r\n<p>Agradecemos novamente por sua colaboração.</p>\r\n<p><br>Atenciosamente,<br><br>propes propes<br>submissoescpic@gmail.com<br><br>\"Teste \"<br><br></p>\r\n<p>Teste sistema de submissões IC. Teste sistema de submissões IC. Teste sistema de submissões IC. Teste sistema de submissões IC. Teste sistema de submissões IC. Teste sistema de submissões IC. Teste sistema de submissões IC. Teste sistema de submissões IC.&nbsp;</p><br/><p>_________________________________________