(87, 1048585, 100, 3, '2022-06-22 18:51:15', 1073741829, '\"Celia Antunes\" <celia.antunes@ufabc.edu.br>', '\"Celia Antunes\" <celia.antunes@ufabc.edu.br>', NULL, NULL, '[042022PROJ] Disponível para realizar avaliação', '<p>Prezado editor, <br /><br />Estou disponível para avaliar a submissão , \"Teste ,\" em Edital 04/2022 - PIC/PIBIC/PIBITI/PIBIC-AF. Agradeço a consideração e pretendo concluir a avaliação até a data definida 2022-07-06, ou antes do prazo.<br /><br />Atenciosamente, <br />Celia Antunes</p><br/><p>________________________________________________________________________<br><a href=\"http://177.104.62.12/index.php/052022\">Edital 05/2022 - PIC/PIBIC/PIBITI/PIBIC-AF</a></p>'),
