(91, 1048585, 183, 72, '2022-06-23 12:45:36', NULL, '\"CPIC - ProPes\" <submissoes.propes@ufabc.edu.br>', '\"Flávia da Fonseca Feitosa\" <flavia.feitosa@ufabc.edu.br>', NULL, 'juliana.marchi@ufabc.edu.br, andre.pasti@ufabc.edu.br, a.gallego@ufabc.edu.br, patricia.maria@ufabc.edu.br', '[042022PROJ] Agradecimento pela submissão', '<p>Prezado(a) Prof(a) Flávia da Fonseca Feitosa,<br /><br />Agradecemos a submissão do projeto \"Segregação Urbana Individual nos Espaços de Atividades da Região Metropolitana de São Paulo\" ao Edital 04/2022 - PIC/PIBIC/PIBITI/PIBIC-AF.</p>\n<p>Acompanhe o progresso da sua submissão por meio do sistema.</p>\n<p>URL da Submissão: <a href=\'https://submissoesic.propes.ufabc.edu.br/index.php/042022PROJ/authorDashboard/submission/183\' class=\'submissionUrl-style-class\'>https://submissoesic.propes.ufabc.edu.br/index.php/042022PROJ/authorDashboard/submission/183</a><br />Login: flafeitosa</p>\n<p>Em caso de dúvidas, entre em contato conosco.</p>\n<p> </p>\n<p>Atenciosamente.</p>\n<p>CPIC - ProPes</p><br/><p>________________________________________________________________________<br><a href=\"http://177.104.62.12/index.php/052022\">Edital 05/2022 - PIC/PIBIC/PIBITI/PIBIC-AF</a></p>'),
(92, 1048585, 156, 1, '2022-06-23 14:20:08', NULL, '\"propes propes\" <submissoescpic@gmail.com>', '\"Célia teste\" <celia.antunes.ufabc@gmail.com>', NULL, NULL, '[042022PROJ] Solicitação de avaliação de projeto de IC revisado', '<p>Prezado(a) Prof(a) Célia teste,<br><br>Informamos que os autores submeteram uma versão revisada do projeto \"Teste\", o qual está sendo avaliado no edital de IC Edital 04/2022 - PIC/PIBIC/PIBITI/PIBIC-AF.</p>\r\n<p>Por gentileza, acesse o sistema de submissões até 2022-06-30 para informar sua disponibilidade,&nbsp; acessar a submissão e registrar sua avaliação. O site é <a class=\"contextUrl-style-class\" href=\"https://submissoesic.propes.ufabc.edu.br/index.php/042022PROJ\">https://submissoesic.propes.ufabc.edu.br/index.php/042022PROJ</a>.<br><br>O prazo para envio do parecer é 2022-07-07.<br><br>Caso não possua login e senha para o sistema, você pode usar este link para solicitar uma nova senha (que lhe será, então, enviada por e-mail junto ao seu login). <a class=\"passwordResetUrl-style-class\" href=\"https://submissoesic.propes.ufabc.edu.br/index.php/042022PROJ/login/lostPassword\">https://submissoesic.propes.ufabc.edu.br/index.php/042022PROJ/login/lostPassword</a><br><br>URL da submissão: <a href=\'https://submissoesic.propes.ufabc.edu.br/index.php/042022PROJ/reviewer/submission?submissionId=156\' class=\'submissionReviewUrl-style-class\'>https://submissoesic.propes.ufabc.edu.br/index.php/042022PROJ/reviewer/submission?submissionId=156</a></p>\r\n<p>Agradecemos novamente por sua colaboração.</p>\r\n<p><br>Atenciosamente,<br><br>propes propes<br>submissoescpic@gmail.com<br><br>\"Teste\"<br><br></p>\r\n<p></p><br/><p>________________________________________________________________________<br><a href=\"http://177.104.62.12/index.php/052022\">Edital 05/2022 - PIC/PIBIC/PIBITI/PIBIC-AF</a></p>'),
(93, 1048585, 99, 3, '2022-06-23 14:22:44', NULL, '\"Celia Antunes\" <celia.antunes@ufabc.edu.br>', '\"Célia teste\" <celia.antunes.ufabc@gmail.com>', NULL, NULL, '[042022PROJ] O Edital 04/2022 - PIC/PIBIC/PIBITI/PIBIC-AF solicita avaliação ', '<p>Prezado(a) Prof(a) Célia teste,<br><br>Acredito que seu conhecimento será fundamental para realizar a avaliação do projeto \"teste 3005\", submetido ao Edital 04/2022 - PIC/PIBIC/PIBITI/PIBIC-AF. O resumo da submissão está inserido abaixo e espero que você considere realizar essa importante tarefa.</p>\r\n<p>De acordo com os Editais de Iniciação Científica, uma das obrigações do orientador é \"emitir pareceres referentes a projetos de iniciação científica deste ou de outros editais\".</p>\r\n<p><span style=\"font-size: 0.875rem;\">Informações sobre a submissão encontram-se nesta mensagem.</span></p>\r\n<p>Pedimos que acesse o sistema para nos informar, se possível em até três dias úteis a partir da data do envio desta mensagem, se estará disponível ou não para realizar a avaliação. A ausência de manifestação contrária indica concordância do aceite da avaliação.</p>\r\n<p>Caso não seja possível efetuar a avaliação, informe a justificativa através do e-mail acessível no sistema ao clicar em \"indisponível para avaliação\", com cópia para iniciacao@ufabc.edu.br</p>\r\n<p>Efetue login no sistema antes de 2022-06-30 para indicar sua disponibilidade, bem como para acessar a submissão e registrar sua avaliação e recomendação. O link é <a class=\"contextUrl-style-class\" href=\"https://submissoesic.propes.ufabc.edu.br/index.php/042022PROJ\">https://submissoesic.propes.ufabc.edu.br/index.php/042022PROJ</a>.<br><br>O prazo para a conclusão da avaliação é 2022-07-07.<br><br>Se você não tiver seu nome de usuário e senha para o site do periódico, poderá usar este link para redefinir sua senha (que será enviada por e-mail juntamente com seu nome de usuário). <a class=\"passwordResetUrl-style-class\" href=\"https://submissoesic.propes.ufabc.edu.br/index.php/042022PROJ/login/lostPassword\">https://submissoesic.propes.ufabc.edu.br/index.php/042022PROJ/login/lostPassword</a>.</p>\r\n<p>Lembramos que o avaliador do projeto poderá também ser solicitado para avaliar o relatório parcial e o final encaminhados posteriormente.</p>\r\n<p>Agradecemos desde já sua atenção.</p>\r\n<p>&nbsp;</p>\r\n<p>Celia Antunes<br>celia.antunes@ufabc.edu.br</p>\r\n<p>---------------------------------------------------------------------------------</p>\r\n<p>URL da submissão: <a href=\'https://submissoesic.propes.ufabc.edu.br/index.php/042022PROJ/reviewer/submission?submissionId=99\' class=\'submissionReviewUrl-style-class\'>https://submissoesic.propes.ufabc.edu.br/index.php/042022PROJ/reviewer/submission?submissionId=99</a><br><br>\"teste 3005\"<br><br></p>\r\n<p>ldskdskljf lsjdfjdslkfj sldkfjskfjsd lfjlaldskdskljf lsjdfjdslkfj sldkfjskfjsd lfjlaldskdskljf lsjdfjdslkfj sldkfjskfjsd lfjlaldskdskljf lsjdfjdslkfj sldkfjskfjsd lfjlaldskdskljf lsjdfjdslkfj sldkfjskfjsd lfjlaldskdskljf lsjdfjdslkfj sldkfjskfjsd lfjlaldskdskljf lsjdfjdslkfj sldkfjskfjsd lfjlaldskdskljf lsjdfjdslkfj sldkfjskfjsd lfjlaldskdskljf lsjdfjdslkfj sldkfjskfjsd lfjlaldskdskljf lsjdfjdslkfj sldkfjskfjsd lfjlaldskdskljf lsjdfjdslkfj sldkfjskfjsd lfjlaldskdskljf lsjdfjdslkfj sldkfjskfjsd lfjlaldskdskljf lsjdfjdslkfj sldkfjskfjsd lfjlaldskdskljf lsjdfjdslkfj sldkfjskfjsd lfjla</p><br/><p>________________________________________________________________________<br><a href=\"http://177.104.62.12/index.php/052022\">Edital 05/2022 - PIC/PIBIC/PIBITI/PIBIC-AF</a></p>'),
(94, 1048585, 100, 21, '2022-06-23 14:32:51', 1073741829, '\"Célia teste\" <celia.antunes.ufabc@gmail.com>', '\"Celia Antunes\" <celia.antunes@ufabc.edu.br>', NULL, NULL, '[042022PROJ] Disponível para realizar avaliação', '<p>Prezado editor, <br /><br />Estou disponível para avaliar a submissão , \"Teste ,\" em Edital 04/2022 - PIC/PIBIC/PIBITI/PIBIC-AF. Agradeço a consideração e pretendo concluir a avaliação até a data definida 2022-07-06, ou antes do prazo.<br /><br />Atenciosamente, <br />Célia teste</p><br/><p>________________________________________________________________________<br><a href=\"http://177.104.62.12/index.php/052022\">Edital 05/2022 - PIC/PIBIC/PIBITI/PIBIC-AF</a></p>'),
