(205, 1048585, 155, 1, '2022-06-30 16:55:49', NULL, 'propes <submissoescpic@gmail.com>', '\"Célia teste\" <celia.antunes.ufabc@gmail.com>', NULL, NULL, '[TI] A revista TesteInterno solicita avaliação de artigo', '<p>Célia teste:<br><br>Acredito que você poderia servir como um(a) excelente avaliador(a) do manuscrito, \"Teste,\" que foi submetido ao periódico TesteInterno. O resumo da submissão está inserido abaixo e espero que você considere realizar essa importante tarefa para nós.<br><br>Faça o login no site do periódico antes de 2022-07-07 para indicar sua disponibilidade, bem como para acessar submissão e registrar sua avaliação e recomendação. O site é <a class=\"contextUrl-style-class\" href=\"https://submissoesic.propes.ufabc.edu.br/index.php/ti\">https://submissoesic.propes.ufabc.edu.br/index.php/ti</a><br><br>A avaliação em si tem como prazo 2022-07-14.<br><br>Se você não tiver seu nome de usuário e senha para o site do periódico, poderá usar este link para redefinir sua senha (que será enviada por e-mail juntamente com seu nome de usuário). <a class=\"passwordResetUrl-style-class\" href=\"https://submissoesic.propes.ufabc.edu.br/index.php/ti/login/lostPassword\">https://submissoesic.propes.ufabc.edu.br/index.php/ti/login/lostPassword</a><br><br>URL da submissão: <a href=\'https://submissoesic.propes.ufabc.edu.br/index.php/ti/reviewer/submission?submissionId=155\' class=\'submissionReviewUrl-style-class\'>https://submissoesic.propes.ufabc.edu.br/index.php/ti/reviewer/submission?submissionId=155</a><br><br>Agradeço por considerar esta solicitação.<br><br>propes<br>submissoescpic@gmail.com<br><br>\"Teste\"<br><br></p>\r\n<p></p><br/><br>\n________________________________________________________________________<br>\n<a href=\"https://submissoesic.propes.ufabc.edu.br/index.php/ti\">TesteInterno</a>'),
(206, 1048585, 280, 159, '2022-06-30 17:07:55', NULL, '\"CPIC - ProPes\" <submissoes.propes@ufabc.edu.br>', '\"Andre Lessa\" <andre.lessa@ufabc.edu.br>', NULL, 'juliana.marchi@ufabc.edu.br, denise.criado@ufabc.edu.br, marine.pereira@ufabc.edu.br, hana.masuda@ufabc.edu.br, juliana.toneli@ufabc.edu.br', '[042022PROJ] Agradecimento pela submissão', '<p>Prezado(a) Prof(a) Andre Lessa,<br /><br />Agradecemos a submissão do projeto \"Aplicações de Aproximações Analíticas para Decaimentos de Partículas de Vida Longa em Modelos da Nova Física\" ao Edital 04/2022 - PIC/PIBIC/PIBITI/PIBIC-AF.</p>\n<p>Acompanhe o progresso da sua submissão por meio do sistema.</p>\n<p>URL da Submissão: <a href=\'https://submissoesic.propes.ufabc.edu.br/index.php/042022PROJ/authorDashboard/submission/280\' class=\'submissionUrl-style-class\'>https://submissoesic.propes.ufabc.edu.br/index.php/042022PROJ/authorDashboard/submission/280</a><br />Login: andrelessa</p>\n<p>Em caso de dúvidas, entre em contato conosco.</p>\n<p> </p>\n<p>Atenciosamente.</p>\n<p>CPIC - ProPes</p><br/><p>________________________________________________________________________<br><a href=\"http://177.104.62.12/index.php/052022\">Edital 05/2022 - PIC/PIBIC/PIBITI/PIBIC-AF</a></p>'),
(207, 1048585, 156, 19, '2022-06-30 17:17:05', NULL, '\"Rafael Santos Alves\" <alves.rafael@ufabc.edu.br>', '\"Dener Ottolini\" <dnredson@hotmail.com>', NULL, NULL, '[042022PROJ] Solicitação de avaliação de projeto de IC revisado', '<p>Prezado(a) Prof(a) Dener Ottolini,<br><br>Informamos que os autores submeteram uma versão revisada do projeto \"Teste\", o qual está sendo avaliado no edital de IC Edital 04/2022 - PIC/PIBIC/PIBITI/PIBIC-AF.</p>\r\n<p>Por gentileza, acesse o sistema de submissões até 2022-07-07 para informar sua disponibilidade,&nbsp; acessar a submissão e registrar sua avaliação. O site é <a class=\"contextUrl-style-class\" href=\"https://submissoesic.propes.ufabc.edu.br/index.php/042022PROJ\">https://submissoesic.propes.ufabc.edu.br/index.php/042022PROJ</a>.<br><br>O prazo para envio do parecer é 2022-07-14.<br><br>Caso não possua login e senha para o sistema, você pode usar este link para solicitar uma nova senha (que lhe será, então, enviada por e-mail junto ao seu login). <a class=\"passwordResetUrl-style-class\" href=\"https://submissoesic.propes.ufabc.edu.br/index.php/042022PROJ/login/lostPassword\">https://submissoesic.propes.ufabc.edu.br/index.php/042022PROJ/login/lostPassword</a><br><br>URL da submissão: <a href=\'https://submissoesic.propes.ufabc.edu.br/index.php/042022PROJ/reviewer/submission?submissionId=156\' class=\'submissionReviewUrl-style-class\'>https://submissoesic.propes.ufabc.edu.br/index.php/042022PROJ/reviewer/submission?submissionId=156</a></p>\r\n<p>Agradecemos novamente por sua colaboração.</p>\r\n<p><br>Atenciosamente,<br><br>Rafael Santos Alves<br>alves.rafael@ufabc.edu.br<br><br>\"Teste\"<br><br></p>\r\n<p></p><br/><p>________________________________________________________________________<br><a href=\"http://177.104.62.12/index.php/052022\">Edital 05/2022 - PIC/PIBIC/PIBITI/PIBIC-AF</a></p>'),
