(502, 1048585, 92, 1, '2022-07-05 17:08:17', NULL, 'propes <submissoescpic@gmail.com>', '\"Juliana  C. Merino\" <juliana.merino@ufabc.edu.br>', NULL, NULL, '[042022PROJ] O Edital 04/2022 - PIC/PIBIC/PIBITI/PIBIC-AF solicita avaliação ', '<p>Prezado(a) Prof(a) Juliana  C. Merino,<br><br>Acredito que seu conhecimento será fundamental para realizar a avaliação do projeto \"desconsiderar\", submetido ao Edital 04/2022 - PIC/PIBIC/PIBITI/PIBIC-AF. O resumo da submissão está inserido abaixo e espero que você considere realizar essa importante tarefa.</p>\r\n<p>De acordo com os Editais de Iniciação Científica, uma das obrigações do orientador é \"emitir pareceres referentes a projetos de iniciação científica deste ou de outros editais\".</p>\r\n<p><span style=\"font-size: 0.875rem;\">Informações sobre a submissão encontram-se nesta mensagem.</span></p>\r\n<p>Pedimos que acesse o sistema para nos informar, se possível em até três dias úteis a partir da data do envio desta mensagem, se estará disponível ou não para realizar a avaliação. A ausência de manifestação contrária indica concordância do aceite da avaliação.</p>\r\n<p>Caso não seja possível efetuar a avaliação, informe a justificativa através do e-mail acessível no sistema ao clicar em \"indisponível para avaliação\", com cópia para iniciacao@ufabc.edu.br</p>\r\n<p>Efetue login no sistema antes de 2022-07-12 para indicar sua disponibilidade, bem como para acessar a submissão e registrar sua avaliação e recomendação. O link é <a class=\"contextUrl-style-class\" href=\"https://submissoesic.propes.ufabc.edu.br/index.php/042022PROJ\">https://submissoesic.propes.ufabc.edu.br/index.php/042022PROJ</a>.<br><br>O prazo para a conclusão da avaliação é 2022-07-19.<br><br>Se você não tiver seu nome de usuário e senha para o site do periódico, poderá usar este link para redefinir sua senha (que será enviada por e-mail juntamente com seu nome de usuário). <a class=\"passwordResetUrl-style-class\" href=\"https://submissoesic.propes.ufabc.edu.br/index.php/042022PROJ/login/lostPassword\">https://submissoesic.propes.ufabc.edu.br/index.php/042022PROJ/login/lostPassword</a>.</p>\r\n<p>Lembramos que o avaliador do projeto poderá também ser solicitado para avaliar o relatório parcial e o final encaminhados posteriormente.</p>\r\n<p>Agradecemos desde já sua atenção.</p>\r\n<p>&nbsp;</p>\r\n<p>propes<br>submissoescpic@gmail.com</p>\r\n<p>---------------------------------------------------------------------------------</p>\r\n<p>URL da submissão: <a href=\'https://submissoesic.propes.ufabc.edu.br/index.php/042022PROJ/reviewer/submission?submissionId=92\' class=\'submissionReviewUrl-style-class\'>https://submissoesic.propes.ufabc.edu.br/index.php/042022PROJ/reviewer/submission?submissionId=92</a><br><br>\"desconsiderar\"<br><br></p>\r\n<p></p><br/><p>________________________________________________________________________<br><a href=\"http://177.104.62.12/index.php/052022\">Edital 05/2022 - PIC/PIBIC/PIBITI/PIBIC-AF</a></p>'),
