INSERT INTO `email_templates_default_data` (`email_key`, `locale`, `subject`, `body`, `description`) VALUES
('ANNOUNCEMENT', 'pt_BR', '{$title}', '<b>{$title}</b><br />\n<br />\n{$summary}<br />\n<br />\nVisite nosso site para ler o <a href=\"{$url}\"> comunicado completo </a>.', 'Este email é enviado quando um novo comunicado é criado.'),
('CITATION_EDITOR_AUTHOR_QUERY', 'pt_BR', 'Edição de citação', '{$authorFirstName}, <br />\n<br />\nVocê poderia verificar ou fornecer a citação adequada para a seguinte referência do seu artigo, {$submitTitle}: <br />\n<br />\n{$rawCitation} <br />\n<br />\nObrigado! <br />\n<br />\n{$userFirstName} <br />\nEditor de Cópia, {$contextName} <br />\n', 'Solicitação ao autor de detalhes sobre referência, enviada pelo editor de texto.'),
('COPYEDIT_REQUEST', 'pt_BR', 'Solicitação de edição de texto', '{$participantName}: <br />\n<br />\nPeço que você realize a revisão textual de &quot;{$submissionTitle}&quot; para {$contextName} seguindo estas etapas. <br />\n1. Clique no URL da Submissão abaixo. <br />\n2. Abra todos os arquivos disponíveis em \"Arquivos de Versão Final\" e faça sua revisão textual, adicionando quaisquer discussões em \"Discussão da edição de texto\" conforme necessário. <br />\n3. Salve os arquivos revisados e faça o carregamento no painel \"Texto editado\". <br />\n4. Notifique o Editor de que todos os arquivos foram preparados e que o processo de \"Editoração\" pode começar. <br />\n<br />\nURL de {$contextName}: {$contextUrl} <br />\nURL de Submissão: {$submitUrl} <br />\nNome de usuário: {$participantUsername}', 'Mensagem enviada pelo Editor de Seção solicitando a realização de uma tarefa de edição ao Editor de Texto, com informações sobre e como acessar o documento.'),
('EDITOR_ASSIGN', 'pt_BR', 'Tarefa editorial', '{$editorialContactName}:<br />\n<br />\nA submissão, &quot;{$submissionTitle},&quot; ao periódico {$contextName} lhe foi designada para acompanhar o processo editorial em sua função como Editor de Seção.<br />\n<br />\nURL da Submissão: {$submissionUrl}<br />\nUsuário: {$editorUsername}<br />\n<br />\nObrigado.', 'Mensagem notifica o Editor de Seção que uma nova tarefa de acompanhamento de submissão lhe foi designada pelo Editor-Gerente. Oferece informações sobre a submissão e como acessar o sistema.'),
('EDITOR_DECISION_ACCEPT', 'pt_BR', 'Decisão editorial', 'Prezado(a) Prof(a) {$authorName},\r\n\r\n\r\nFoi tomada uma decisão sobre o projeto submetido ao {$contextName}, \"{$submissionTitle}\".\r\n\r\nA decisão é: projeto aprovado.\r\n\r\nAbaixo segue a avaliação do parecerista.\r\n\r\n \r\n\r\nAtenciosamente,\r\n\r\n{$editorialContactSignature}', 'Esta é uma mensagem do Editor/Editor de Seção ao autor para notificá-lo da decisão editorial (final) tomada sobre a submissão.'),
('EDITOR_DECISION_DECLINE', 'pt_BR', 'Decisão editorial', 'Prezado(a) Prof(a) {$authorName},\r\n\r\nFoi tomada uma decisão sobre o projeto submetido ao {$contextName}, \"{$submissionTitle}\".\r\n\r\nA decisão é: projeto reprovado.\r\n\r\nAbaixo segue a avaliação do parecerista.\r\n\r\n \r\n\r\n \r\n\r\nAtenciosamente,\r\n\r\n{$editorialContactSignature}', 'Esta mensagem do Editor/Editor de Seção ao autor notifica sobre a decisão final tomada sobre a submissão.'),
('EDITOR_DECISION_INITIAL_DECLINE', 'pt_BR', 'Decisão do Editor', '\n			{$authorName}: <br />\n<br />\nChegamos a uma decisão sobre sua submissão para {$ contextName}, &quot;{$submissionTitle}&quot;. <br />\n<br />\nNossa decisão é: Recusar Submissão', 'Este email será enviado ao autor se o editor recusar o envio inicialmente, antes da fase de revisão'),
('EDITOR_DECISION_RESUBMIT', 'pt_BR', 'Decisão editorial', '{$authorName}:<br />\n<br />\nNós chegamos a uma decisão referente a sua submissão para o periódico {$contextName}, &quot;{$submissionTitle}&quot;.<br />\n<br />\nNossa decisão é de: Ressubmeter para Avaliação', 'Esta mensagem do Editor/Editor de Seção ao autor notifica sobre a decisão editorial final tomada sobre a submissão.'),
('EDITOR_DECISION_REVISIONS', 'pt_BR', 'Decisão editorial', '{$authorName}:<br />\n<br />\nNós chegamos a uma decisão referente a sua submissão para o periódico {$contextName}, &quot;{$submissionTitle}&quot;.<br />\n<br />\nNossa decisão é de: Revisões Requeridas', 'Esta mensagem é enviada pelo Editor ou Editor de Seção ao autor, notificando-o da decisão final de \"<strong>Revisões Requeridas</strong>\" tomada sobre a sua submissão.'),
('EDITOR_DECISION_SEND_TO_EXTERNAL', 'pt_BR', 'Decisão do Editor', '{$authorName}:<br />\n<br />\nNós chegamos a uma decisão referente a sua submissão para o periódico {$contextName}, &quot;{$submissionTitle}&quot;.<br />\n<br />\nNossa decisão é de: Enviar para avaliação<br />\n<br />\nURL da submissão: {$submissionUrl}', 'Este e-mail enviado pelo Editor ou Editor de Seção para um autor serve para notificar o mesmo de que sua submissão foi enviada para avaliadores externos.'),
('EDITOR_DECISION_SEND_TO_PRODUCTION', 'pt_BR', 'Decisão do Editor', '{$authorName}:<br />\n<br />\nA edição de texto da sua submissão, &quot;{$submissionTitle},&quot; está completa. Agora ela está sendo enviada para  editoração.<br />\n<br />\nURL da submissão: {$submissionUrl}', 'Este e-mail do Editor ou Editor de Seção para um Autor notifica-os de que seus envios estão sendo enviados para produção.'),
('EDITOR_RECOMMENDATION', 'pt_BR', 'Recomendação do Editor', '{$editors}:<br />\n<br />\nA recomendação referente à submissão para o periódico {$contextName}, &quot;{$submissionTitle}&quot; é: {$recommendation}', 'Este e-mail do Editor que recomenda ou do Editor de Seção para os Editores que tomam decisões ou Editores de Seção notifica-os de uma recomendação final sobre a submissão.'),
('EMAIL_LINK', 'pt_BR', 'Artigo interessante para sua leitura', 'Acredito ser de seu interesse o artigo \"{$submissionTitle}\", de {$authorName}, publicado na revista {$contextName}, V. {$volume}, n. {$number}, Ano {$year}, disponível em \"{$articleUrl}\".', 'Mensagem enviada por um leitor a um colega, sobre um artigo considerado de seu interesse, com link para acesso e informações sobre a revista e a edição onde o documento foi publicado.'),
('LAYOUT_COMPLETE', 'pt_BR', 'Composições concluídas', '{$editorialContactName}: <br />\n<br />\nAs provas topográficas já foram preparadas para o manuscrito &quot;{$submissionTitle} &quot; para {$contextName} e estão prontas para a revisão.<br />\n<br />\nSe você tiver alguma dúvida, favor entrar em contato comigo. <br />\n<br />\n{$participantName}', 'Mensagem enviada pelo Editor de Layout ao Editor de Seção, informando sobre a conclusão das composições.'),
('LAYOUT_REQUEST', 'pt_BR', 'Solicitação de composições', '{$participantName}:<br />\n<br />\nA submissão &quot;{$submissionTitle}&quot; para {$contextName} de provas tipográficas, conforme as seguintes etapas. <br />\n1. Clique na URL de Submissão abaixo. <br />\n2. Faça login no periódico e use os arquivos Prontos para Produção para criar as provas de acordo com os padrões do periódico. <br />\n3. Carregue as provas na seção Arquivos de Prova. <br />\n4. Notifique o Editor, usando as Discussões de Produção, informando de que as provas estão carregadas e prontas. <br />\n<br />\nURL de {$contextName}: {$contextUrl} <br />\nURL da submissão: {$submitUrl} <br />\nNome de usuário: {$participantUsername} <br />\n<br />\nSe você não conseguir realizar esse trabalho no momento ou tiver alguma dúvida, entre em contato comigo. Obrigado por sua contribuição para este periódico.', 'Mensagem enviada pelo Editor de Seção ao Editor de Layout, solicitando que sejam preparadas as Composições do texto final, com informações de acesso.'),
('LOCKSS_EXISTING_ARCHIVE', 'pt_BR', 'Solicitação para Arquivamento de {$contextName}', 'Prezado(a) [bibliotecário(a) da universidade]<br />\n<br />\n{$contextName} &amp;lt;{$contextUrl}&amp;gt;, é um periódico para o qual um membro de sua instituição, [nome do membro], serve como [título da posição]. O periódico está buscando estabelecer um arquivo compatível com LOCKSS (Lots of Copies Keep Stuff Safe) com esta e outras bibliotecas universitárias.<br />\n<br />\n[Breve descrição do periódico]<br />\n<br />\nA URL do Manifesto do Publicador LOCKSS para nosso periódico é: {$contextUrl}/gateway/lockss<br />\n<br />\nEntendemos que você já está participando do LOCKSS. Se pudermos fornecer metadados adicionais para registrar nosso periódico com sua versão do LOCKSS, teremos prazer em fornecê-los.<br />\n<br />\nAtenciosamente,<br />\n{$principalContactSignature}', 'Esta mensagem solicita ao mantenedor de um repositório LOCKSS que considere incluir este periódico em seu acervo, informando a URL para o Manifesto LOCKSS da editora.'),
('LOCKSS_NEW_ARCHIVE', 'pt_BR', 'Solicitação de inclusão da revista {$contextName} em seu arquivo', 'Prezado(a) [Bibliotecário(a) da Universidade]<br />\n<br />\n{$contextName} &amp;lt;{$contextUrl}&amp;gt;, é um periódico no qual um membro de sua instituição, [nome do membro], serve como [título da posição]. O periódico está buscando estabelecer um acervo compatível com o LOCKSS (Lots of Copies Keep Stuff Safe) com esta e outras bibliotecas universitárias.<br />\n<br />\n[Breve descrição do periódico]<br />\n<br />\nO Programa LOCKSS &amp;lt;http://lockss.org/&amp;gt;, uma iniciativa internacional entre bibliotecas e editoras, é um exemplo prático de um repositório de preservação e arquivamento distribuído, conforme detalhes adicionais abaixo. O software, que roda em um computador pessoal comum, é gratuito; o sistema é facilmente colocado online; e pouca manutenção é necessária.<br /> \n<br />\nPara ajudar no arquivamento de nosso periódico, convidamos você a se tornar um membro da comunidade LOCKSS, para ajudar a coletar e preservar títulos produzidos por seu corpo docente e por outros acadêmicos no mundo todo. Para fazer isso, peça a alguém da sua equipe que visite o site da LOCKSS para obter informações sobre como este sistema opera. Agradeço seu retorno a respeito da viabilidade de fornecer esse suporte de arquivamento para este periódico. <br />\n<br />\nAtenciosamente,<br />\n{$principalContactSignature}', 'Mensagem convida o destinatário a participar da iniciativa LOCKSS e incluir a revista no seu repositório. O e-mail oferece informações iniciais e sobre como participar na iniciativa LOCKSS e formas de se envolver.'),
('MANUAL_PAYMENT_NOTIFICATION', 'pt_BR', 'Notificação de pagamento manual', 'É necessário realizar o processamento de um pagamento manual de assinatura da revista {$contextName}, pelo usuário {$userFullName} (login &quot;{$userName}&quot;).<br />\n<br />\nO item adquirido é &quot;{$itemName}&quot;.<br />\nValor em ({$itemCurrencyCode}): {$itemCost}<br />\n<br />\nEsta é uma mensagem automática da ferramenta de Pagamento manual do Open Journal Systems.', 'Mensagem automática notificando editor-gerente que um pagamento manual foi realizado e exige processamento.'),
('NOTIFICATION', 'pt_BR', 'Nova notificação de {$siteTitle}', 'Você tem uma nova notificação de {$siteTitle}:<br />\n<br />\n{$notificationContents}<br />\n<br />\nLink: {$url}<br />\n<br />\n{$principalContactSignature}', 'Esta mensagem é enviada a usuários cadastrados que escolheram habilitar este tipo de notificação via email.'),
('NOTIFICATION_CENTER_DEFAULT', 'pt_BR', 'Uma mensagem sobre {$contextName}', 'Insira a sua mensagem por gentileza.', 'A mensagem padrão (em branco) usada no Criador de lista de mensagens do Notification Center.'),
('OPEN_ACCESS_NOTIFY', 'pt_BR', 'Nova edição de Acesso Livre', 'Leitores: <br />\n<br />\n{$contextName} acabou de disponibilizar em um formato de acesso aberto a seguinte edição. Convidamos você a verificar o sumário abaixo e, em seguida, visitar nosso site ({$contextUrl}) para conferir os artigos e itens de interesse. <br />\n<br />\nObrigado pelo interesse em nosso trabalho, <br />\n{$editorialContactSignature}', 'Esta mensagem é enviada a leitores cadastrados que solicitam o recebimento do sumário de uma nova edição de Acesso Livre.'),
('ORCID_COLLECT_AUTHOR_ID', 'pt_BR', 'ORCID da submissão', 'Prezado(a) {$authorName},<br>\n<br>\nVocê foi listada(o) como um coautor(a) em uma submissão de manuscrito \"{$submissionTitle}\" para {$contextName}.<br/>\nPara confirmar sua autoria, por favor adicione sua id ORCID a esta submissão, visitando o link fornecido abaixo.<br/>\n<br/>\n<a href=\"{$authorOrcidUrl}\"><img id=\"orcid-id-logo\" src=\"https://orcid.org/sites/default/files/images/orcid_16x16.png\" width=\'16\' height=\'16\' alt=\"ORCID iD icon\" style=\"display: block; margin: 0 .5em 0 0; padding: 0; float: left;\"/>Registre ou conecte seu ORCID iD</a><br/>\n<br/>\n<br>\n<a href=\"{$orcidAboutUrl}\">Mais informações sobre o ORCID em {$contextName}</a><br/>\n<br/>\nSe você tiver quaisquer dúvidas, por favor entre em contato comigo.<br/>\n<br/>\n{$editorialContactSignature}<br/>\n', 'Este modelo de e-mail é utilizado para coletar os id ORCID dos coautores.'),
('ORCID_REQUEST_AUTHOR_AUTHORIZATION', 'pt_BR', 'Solicitando acesso ao registro ORCID', 'Prezado(a) {$authorName}, <br>\n<br>\nVocê foi listado como autor na submissão do manuscrito \"{$submissionTitle}\" to {$contextName}.\n<br>\n<br>\nPermita-nos adicionar seu ID do ORCID a essa submissão e também adicioná-lo ao seu perfil do ORCID na publicação. <br>\nVisite o link para o site oficial do ORCID, faça o login com seu perfil e autorize o acesso seguindo as instruções. <br>\n<a href=\"{$authorOrcidUrl}\"> <img id =\"orcid-id-logo\" src = \"https://orcid.org/sites/default/files/images/orcid_16x16.png\" width = \'16 \' height = \'16 \' alt = \"Ícone ORCID iD\" style = \"display: block; margin: 0 .5em 0 0; padding: 0; float: left;\" /> Registre ou conecte seu ORCID ID </a> <br/>\n<br>\n<br>\n<a href=\"{$orcidAboutUrl}\"> Mais sobre o ORCID em {$contextName} </a> <br/>\n<br>\nSe você tiver alguma dúvida, entre em contato comigo. <br>\n<br>\n{$principalContactSignature} <br>\n', 'Este modelo de e-mail é usado para solicitar o acesso ao registro ORCID dos autores.'),
('PASSWORD_RESET', 'pt_BR', 'Senha Redefinida', 'Sua senha foi redefinida com sucesso para uso com o site {$siteTitle}. Favor guardar esse nome de usuário e senha, pois são necessários para todo o trabalho com o periódico.<br />\n<br />\nSeu usuário: {$username}<br />\nSenha: {$password}<br />\n<br />\n{$principalContactSignature}', 'Esta mensagem é enviada a um usuário cadastrado quando ele redefiniu sua senha com sucesso, seguindo o processo descrito na mensagem PASSWORD_RESET_CONFIRM.'),
('PASSWORD_RESET_CONFIRM', 'pt_BR', 'Confirmação de Redefinição de Senha', 'Recebemos uma solicitação para redefinir sua senha para o site {$siteTitle}.<br />\n<br />\nSe você não fez essa solicitação, favor ignorar este e-mail e sua senha não será alterada. Se você deseja redefinir sua senha, clique na URL abaixo.<br />\n<br />\nRedefinir minha senha: {$url}<br />\n<br />\n{$principalContactSignature}', 'Esta mensagem é enviada a um usuário cadastrado quando o mesmo indica que tenha esquecido sua senha ou não consiga efetuar login. Um link é fornecido que permite ao usuário redefinir sua senha.'),
('PAYPAL_INVESTIGATE_PAYMENT', 'pt_BR', 'Atividade incomum na conta PayPal', 'O sistema encontrou atividade incomum relacionada ao suporte a pagamentos via PayPal da revista {$contextName}. Esta atividade pode exigir investigação mais profunda ou intervenção manual.<br />\n                       <br />\nEsta é uma mensagem automática da ferramenta de Pagamento via PayPal do Open Journal Systems.<br />\n<br />\nInformações detalhadas da notificação:<br />\n{$postInfo}<br />\n<br />\nInformações adicionais (caso informado):<br />\n{$additionalInfo}<br />\n<br />\nVariáveis do servidor:<br />\n{$serverVars}<br />\n', 'Esta mensagem notifica o contato principal da revista sobre atividades suspeitas, ou atividades que exijam intervenção manual, detectadas pelo Plugin de Pagamento via PayPal.'),
('PUBLISH_NOTIFY', 'pt_BR', 'Nova Edição Publicada', 'Caros leitores:<br />\n<br />\n{$contextName} acaba de publicar sua edição mais recente em {$contextUrl}. Convidamos a consultar o sumário abaixo e, em seguida, visitar o site para verificar os artigos e itens de interesse.<br />\n<br />\nAgradecemos pelo interesse em nosso trabalho,<br />\n{$editorialContactSignature}', 'Esta mensagem é enviada para leitores cadastrados através do link \"notificação de usuários\" na página do Editor. Ela avisa os leitores a respeito de uma nova edição e os convida a acessar o periódico através da URL informada.'),
('REVIEWER_REGISTER', 'pt_BR', 'Cadastrado como Avaliador em {$contextName}', 'Devido à sua experiência, tomamos a liberdade de cadastrar seu nome no banco de dados de avaliadores para {$contextName}. Isso não implica qualquer forma de compromisso de sua parte, mas simplesmente nos permite lhe contatar com uma submissão para uma possível avaliação. Ao ser convidado(a) a avaliar, você terá a oportunidade de ver o título e o resumo do artigo em questão e poderá sempre aceitar ou recusar o convite. Você também pode pedir a qualquer momento para remover seu nome desta lista de avaliadores.<br />\n<br />\nEstamos fornecendo a você um nome de usuário e senha, que são usados em todas as interações com o periódico por meio de seu site. Você pode, por exemplo, atualizar seu perfil, incluindo seus interesses de avaliação.<br />\n<br />\nUsuário: {$username}<br />\nSenha: {$password}<br />\n<br />\nAtenciosamente,<br />\n{$principalContactSignature}', 'Esta mensagem é enviada a um avaliador recém-cadastrado para dar-lhe as boas-vindas e deixar registrado o seu nome de login e senha.'),
('REVIEW_ACK', 'pt_BR', 'Agradecimento pela avaliação', 'Prezado(a) Prof(a) {$reviewerName},\r\nAgradecemos ter concluído a avaliação do projeto \"{$articleTitle}\" ao {$journalName}. \r\nSua contribuição é fundamental para a qualidade da pesquisa na UFABC.\r\nAtenciosamente,\r\n\r\n{$editorialContactSignature}\r\n', 'Mensagem enviada pelo Editor de Seção ao Avaliador para confirmar recebimento e agradecer o avaliador pela conclusão da avaliação.'),
('REVIEW_CANCEL', 'pt_BR', 'Cancelamento de solicitação de avaliação', '{$reviewerName}:<br />\n<br />\nNós decidimos cancelar o pedido de avaliação da submissão, &quot;{$submissionTitle},&quot; para o periódico {$contextName}. Nós pedimos desculpas por qualquer inconveniência que isso lhe causou e esperamos poder contar com sua assistência no processo de avaliação por pares deste periódico no futuro.<br />\n<br />\nSe tiver alguma dúvida, por gentileza, entre em contato comigo.', 'Mensagem enviada pelo Editor de Seção com um processo de avaliação em andamento, notificando que o processo em questão foi cancelado.'),
('REVIEW_CONFIRM', 'pt_BR', 'Disponível para realizar avaliação', 'Prezados editores, <br />\n<br />\nEu tenho disponibilidade para dar um parecer para a submissão, &quot;{$submissionTitle},&quot; para o periódico {$contextName}. Agradeço por lembrar de mim, e pretendo enviar o parecer até {$reviewDueDate}, se não antes.<br />\n<br />\nAtenciosamente,\n<br />\n{$reviewerName}', 'Mensagem enviada pelo Avaliador ao Editor de Seção, em resposta à solicitação de avaliação, para notificar disponibilidade para realizar a tarefa e de que a mesma será concluída no prazo especificado.'),
('REVIEW_DECLINE', 'pt_BR', 'Indisponível para realizar avaliação', 'Editores(as):<br />\n<br />\nTemo não poder dar um parecer à submissão &quot;{$submissionTitle},&quot; para o periódico {$contextName} no momento. Agradeço por lembrar de mim, e fiquem à vontade para me convidar novamente em um outro momento.<br />\n<br />\n{$reviewerName}', 'Mensagem enviada pelo Avaliador ao Editor de Seção, em resposta à solicitação de avaliação, para notificar sua NÃO disponibilidade para realizar a tarefa, rejeitando a solicitação.'),
('REVIEW_REINSTATE', 'pt_BR', 'Solicitação de revisão restabelecida', '{$reviewerName}:<br />\n<br />\nNós gostaríamos de convidá-lo(a) novamente para dar um parecer à submissão, &quot;{$submissionTitle},&quot; para o periódico {$contextName}. Nós esperamos que você possa nos ajudar no processo de avaliação por pares deste periódico.<br />\n<br />\nSe tiver alguma dúvida, por favor, entre em contato comigo.', 'Este e-mail é enviado pelo Editor de Seção a um Avaliador que possui uma avaliação de uma submissão em andamento para notificá-lo de que uma avaliação cancelada foi restabelecida.'),
('REVIEW_REMIND', 'pt_BR', 'Lembrete de solicitação de avaliação', '{$reviewerName}:<br />\n<br />\nEste é apenas um lembrete amigável do nosso pedido de avaliação da submissão, &quot;{$submissionTitle},&quot; ao periódico {$contextName}. Esperávamos ter recebido sua avaliação até {$reviewDueDate}, então gostaríamos de recebê-la assim que você conseguir prepará-la.<br />\n<br />\nSe você não tiver seu nome de usuário e senha para o site do periódico, poderá usar este link para redefinir sua senha (que será enviada por e-mail juntamente com seu nome de usuário). {$passwordResetUrl}<br />\n<br />\nURL da submissão: {$submissionReviewUrl}<br />\n<br />\nPor favor, confirme que poderá completar essa contribuição vital ao trabalho do periódico. Aguardo seu retorno.<br />\n<br />\n{$editorialContactSignature}', 'Mensagem enviada pelo Editor de Seção ao Avaliador como lembrete da tarefa de avaliação em andamento ainda não concluída.'),
('REVIEW_REMIND_AUTO', 'pt_BR', 'Lembrete automático de solicitação de avaliação', '{$reviewerName}:<br />\n<br />\nEste é apenas um lembrete amigável do nosso pedido de avaliação da submissão, &quot;{$submissionTitle},&quot; ao periódico {$contextName}. Esperávamos ter recebido sua avaliação até {$reviewDueDate}, então este email foi gerado automaticamente com o passar daquele prazo. Nós ainda assim ficaríamos gratos em recebê-la assim que você conseguir prepará-la.<br />\n<br />\nSe você não tiver seu nome de usuário e senha para o site do periódico, poderá usar este link para redefinir sua senha (que será enviada por e-mail juntamente com seu nome de usuário). {$passwordResetUrl}<br />\n<br />\nURL da submissão: {$submissionReviewUrl}<br />\n<br />\nPor favor, confirme que poderá completar essa contribuição vital ao trabalho do periódico. Aguardo seu retorno.<br />\n<br />\n{$editorialContactSignature}', 'Mensagem enviada automaticamente ao avaliador quando a data de conclusão de avaliação for ultrapassada (veja as Opções de Avaliação no Passo 2 da Configuração da Revista). Tarefas agendadas devem ser habilitadas e configuradas (veja o arquivo de configuração do sistema).'),
('REVIEW_REMIND_AUTO_ONECLICK', 'pt_BR', 'Lembrete automático de solicitação de avaliação', '{$reviewerName}:<br />\n<br />\nEste é apenas um lembrete amigável do nosso pedido de avaliação da submissão, &quot;{$submissionTitle},&quot; ao periódico {$contextName}. Esperávamos ter recebido sua avaliação até {$reviewDueDate}, então este email foi gerado automaticamente com o passar daquele prazo. Nós ainda assim ficaríamos gratos em recebê-la assim que você conseguir prepará-la.<br />\n<br />\nURL da submissão: {$submissionReviewUrl}<br />\n<br />\nPor favor, confirme que poderá completar essa contribuição vital ao trabalho do periódico. Aguardo seu retorno.<br />\n<br />\n{$editorialContactSignature}', 'Mensagem enviada automaticamente ao avaliador quando a data de conclusão de avaliação for ultrapassada (veja as Opções de Avaliação no Passo 2 da Configuração da Revista) e o acesso 1-Clique estiver ativado. Tarefas agendadas devem ser habilitadas e configuradas (veja o arquivo de configuração do sistema).'),
('REVIEW_REMIND_ONECLICK', 'pt_BR', 'Lembrete de solicitação de avaliação', '{$reviewerName}:<br />\n<br />\nEste é apenas um lembrete amigável do nosso pedido de avaliação da submissão, &quot;{$submissionTitle},&quot; ao periódico {$contextName}. Esperávamos ter recebido sua avaliação até {$reviewDueDate}, então gostaríamos de recebê-la assim que você conseguir prepará-la.<br />\n<br />\nURL da submissão: {$submissionReviewUrl}<br />\n<br />\nPor favor, confirme que poderá completar essa contribuição vital ao trabalho do periódico. Aguardo seu retorno.<br />\n<br />\n{$editorialContactSignature}', 'Mensagem enviada pelo Editor de Seção ao Avaliador como lembrete da tarefa de avaliação em andamento ainda não concluída.'),
('REVIEW_REQUEST', 'pt_BR', 'A revista {$contextName} solicita avaliação de artigo', '{$reviewerName}:<br />\n<br />\nAcredito que você poderia servir como um(a) excelente avaliador(a) do manuscrito, &quot;{$submissionTitle},&quot; que foi submetido ao periódico {$contextName}. O resumo da submissão está inserido abaixo e espero que você considere realizar essa importante tarefa para nós.<br />\n<br />\nFaça o login no site do periódico antes de {$responseDueDate} para indicar sua disponibilidade, bem como para acessar submissão e registrar sua avaliação e recomendação. O site é {$contextUrl}<br />\n<br />\nA avaliação em si tem como prazo {$reviewDueDate}.<br />\n<br />\nSe você não tiver seu nome de usuário e senha para o site do periódico, poderá usar este link para redefinir sua senha (que será enviada por e-mail juntamente com seu nome de usuário). {$passwordResetUrl}<br />\n<br />\nURL da submissão: {$submissionReviewUrl}<br />\n<br />\nAgradeço por considerar esta solicitação.<br />\n<br />\n{$editorialContactSignature}<br />\n<br />\n&quot;{$submissionTitle}&quot;<br />\n<br />\n{$submissionAbstract}', 'Mensagem do Editor de Seção para solicitar ao Avaliador que indique disponibilidade ou não para realizar uma avaliação. Oferece informações sobre a submissão, como título e resumo, além da data para a conclusão dos trabalhos e como acessar o documento. Esta mensagem é usada quando se utiliza o Processo Padrão de Avaliação, definido no Passo 2 de Configuração da Revista. (Caso contrário veja REVIEW_REQUEST_ATTACHED.)'),
('REVIEW_REQUEST_ATTACHED', 'pt_BR', 'A revista {$contextName} solicita avaliação de artigo', '{$reviewerName}:<br />\n<br />\nEu acredito que você seria um ótimo(a) parecerista para o manuscrito, &quot;{$submissionTitle},&quot; e estou pedindo que considere aceitar esta importante tarefa para nós. As Diretrizes de Avaliação deste periódico seguem abaixo, e a submissão está anexa ao email. Sua avaliação da submissão, junto à sua recomendação, devem ser enviadas por email para mim até {$reviewDueDate}.<br />\n<br />\nPor gentileza, indique se você aceita dar o parecer ou não por e-mail até {$responseDueDate}.<br />\n<br />\nObrigado por considerar este pedido.<br />\n<br />\n{$editorialContactSignature}<br />\n<br />\n<br />\nDiretrizes de Avaliação<br />\n<br />\n{$reviewGuidelines}<br />\n', 'Este email é enviado pelo Editor de Seção para um Avaliador solicitando que ele aceite ou decline a tarefa de dar um parecer para uma submissão. A submissão é enviada anexada ao e-mail. A mensagem é utilizada quando o Processo de Avaliação por Anexo de E-mail é selecionado em Gerenciamento > Configurações > Fluxo de Trabalho > Avaliação. (Alternativamente veja REVIEW_REQUEST)'),
('REVIEW_REQUEST_ATTACHED_SUBSEQUENT', 'pt_BR', 'Solicitação de avaliação de artigo', '{$reviewerName}:<br />\n<br />\nEsta mensagem é referente ao manuscrito &quot;{$submissionTitle},&quot; que está sendo considerado para publicação pelo periódico {$contextName}.<br />\n<br />\nApós a avaliação da versão anterior do manuscrito, os autores submeteram uma versão revisada do artigo. Nós agradeceríamos se você pudesse ajudar com uma avaliação.<br />\n<br />\nAs Diretrizes de Avaliação deste periódico seguem abaixo e a submissão está anexa ao e-mail. Sua avaliação da submissão, junto à recomendação, deve ser enviada por e-mail até {$reviewDueDate}.<br />\n<br />\nPor gentileza, envie um email de retorno até{$responseDueDate} indicando se você poderá dar o parecer ou não.<br />\n<br />\nObrigado por considerar este pedido.<br />\n<br />\n{$editorialContactSignature}<br />\n<br />\n<br />\nDiretrizes de Avaliação<br />\n<br />\n{$reviewGuidelines}<br />\n', 'Esta mensagem é enviada pelo Editor de seção ao avaliador, perguntando se estaria disponível para enviar a avaliação de uma submissão em uma segunda rodada ou superior. A mensagem inclui a submissão como anexo. Ela é usada quando o processo de avaliação via e-mail é escolhido em  Configurações > Fluxo de trabalho > Avaliação.  (Caso contrário, veja REVIEW_REQUEST_SUBSEQUENT.)'),
('REVIEW_REQUEST_ONECLICK', 'pt_BR', 'Solicita avaliação de artigo', '{$reviewerName}:<br />\n<br />\nEu acredito que você seria um(a) excelente parecerista para o manuscrito, &quot;{$submissionTitle},&quot; que foi submetido ao periódico {$contextName}. O resumo da submissão segue abaixo e eu espero que você considere o aceite desta tarefa importante.<br />\n<br />\nPor gentileza, logue no site do periódico até {$responseDueDate} para indicar se você aceita fazer o parecer ou não, além de acessar a submissão para registrar sua avaliação e recomendação.<br />\n<br />\nO prazo para entrega do parecer é {$reviewDueDate}.<br />\n<br />\nURL da submissão: {$submissionReviewUrl}<br />\n<br />\nObrigado por considerar este pedido.<br />\n<br />\n{$editorialContactSignature}<br />\n<br />\n&quot;{$submissionTitle}&quot;<br />\n<br />\n{$submissionAbstract}', 'Mensagem do Editor de Seção para solicitar ao Avaliador que indique disponibilidade ou não para realizar uma avaliação. Oferece informações sobre a submissão, como título e resumo, além da data para a conclusão dos trabalhos e como acessar o documento. Esta mensagem é usada quando se utiliza o Processo Padrão de Avaliação, definido no Passo 2 de Configuração da Revista e a opção de acesso de avaliadores com 1-clique esteja habilitada.'),
('REVIEW_REQUEST_ONECLICK_SUBSEQUENT', 'pt_BR', 'Solicitação de avaliação de artigo', '{$reviewerName}:<br />\n<br />\nEsta mensagem é referente ao manuscrito &quot;{$submissionTitle},&quot; que está sendo considerado para publicação pelo periódico {$contextName}.<br />\n<br />\nApós uma avaliação da versão anterior do manuscrito, os autores submeteram uma versão revisada do artigo. Nós agradeceríamos se você pudesse ajudar com um parecer.<br />\n<br />\nPor gentileza, logue no site do periódico até {$responseDueDate} para indicar se você irá aceitar dar o parecer ou não, e também para acessar a submissão e registrar sua avaliação e recomendação.<br />\n<br />\nO prazo para envio do parecer é {$reviewDueDate}.<br />\n<br />\nURL da submissão: {$submissionReviewUrl}<br />\n<br />\nObrigado por considerar este pedido.<br />\n<br />\n{$editorialContactSignature}<br />\n<br />\n&quot;{$submissionTitle}&quot;<br />\n<br />\n{$submissionAbstract}', 'Este e-mail do Editor de Seção para um Avaliador solicita que o avaliador aceite ou recuse a tarefa de avaliar uma submissão para uma segunda ou maior rodada de avaliação. Ele fornece informações sobre a submissão, como título e resumo, uma data limite para avaliação e como acessar a própria submissão. Esta mensagem é usada quando o processo de avaliação está selecionado em Configuração > Fluxo de Trabalho > Avaliação e a opção \"Habilitar acesso 1-clique\" na área do avaliador está ativada.'),
('REVIEW_REQUEST_REMIND_AUTO', 'pt_BR', 'A revista {$contextName} solicita avaliação de artigo', '{$reviewerName}:<br />\nEste é apenas um lembrete amigável do nosso pedido de avaliação da submissão, &quot;{$submissionTitle},&quot; ao periódico {$contextName}. Esperávamos ter recebido sua resposta até {$responseDueDate}, assim este email foi gerado e enviado automaticamente com o passar dessa data.\n<br />\nAcredito que você serviria como um(a) excelente avaliador(a) do manuscrito. O resumo da submissão está inserido abaixo e espero que você considere realizar essa importante tarefa para nós.<br />\n<br />\nFaça login no site do periódico para indicar se você fará a avaliação ou não, bem como para acessar a submissão e registrar sua avaliação e recomendação. O site é {$contextUrl}<br />\n<br />\nA avaliação em si tem como prazo {$reviewDueDate}.<br />\n<br />\nSe você não tiver seu nome de usuário e senha para o site do periódico, poderá usar este link para redefinir sua senha (que será enviada por e-mail juntamente com seu nome de usuário). {$passwordResetUrl}<br />\n<br />\nURL da submissão: {$submissionReviewUrl}<br />\n<br />\nAgradeço por considerar esta solicitação.<br />\n<br />\n{$editorialContactSignature}<br />\n<br />\n&quot;{$submissionTitle}&quot;<br />\n<br />\n{$submissionAbstract}', 'Este e-mail é automaticamente enviando quando o prazo para confirmação de um avaliador vence (veja as Opções para avaliação em Configurações > Fluxo de trabalho > Avaliação) e a opção de habilitar acesso 1-clique para o avaliador está desabilitada. Tarefas agendadas devem ser habilitadas e configuradas (veja o arquivo de configuração do site).'),
('REVIEW_REQUEST_REMIND_AUTO_ONECLICK', 'pt_BR', 'Solicita avaliação de artigo', '{$reviewerName}:<br />\nEste é apenas um lembrete amigável do nosso pedido de avaliação da submissão, &quot;{$submissionTitle},&quot; ao periódico {$contextName}. Esperávamos ter recebido sua resposta até {$responseDueDate}, assim este email foi gerado e enviado automaticamente com o passar dessa data.\n<br />\nEu acredito que você seria um ótimo(a) parecerista para o manuscrito. O resumo da submissão segue abaixo e eu espero que você considere o aceite desta tarefa tão importante para nós.<br />\n<br />\nPor gentileza, logue no site do periódico para indicar se você irá aceitar dar o parecer ou não, e também para acessar a submissão e registrar sua avaliação e recomendação.<br />\n<br />\nO prazo para envio do parecer é {$reviewDueDate}.<br />\n<br />\nURL da submissão: {$submissionReviewUrl}<br />\n<br />\nObrigado por considerar este pedido.<br />\n<br />\n{$editorialContactSignature}<br />\n<br />\n&quot;{$submissionTitle}&quot;<br />\n<br />\n{$submissionAbstract}', 'Esse e-mail é enviado automaticamente quando a data de limite de confirmação do avaliador termina (consulte Opções de avaliação em Configurações> Fluxo de trabalho> Avaliação) e o acesso do avaliador com 1-clique está ativado. As tarefas agendadas devem ser ativadas e configuradas (consulte o arquivo de configuração do site).'),
('REVIEW_REQUEST_SUBSEQUENT', 'pt_BR', 'Solicitação de avaliação de artigo', '{$reviewerName}:<br />\n<br />\nEsta mensagem é referente ao manuscrito &quot;{$submissionTitle},&quot; que está sendo avaliado para publicação pelo periódico {$contextName}.<br />\n<br />\nApós a avaliação da versão anterior do manuscrito, os autores submeteram uma versão revisada do artigo. Nós apreciaríamos se você pudesse ajudar com um parecer.<br />\n<br />\nPor gentileza, logue no site do periódico até {$responseDueDate} para indicar se você irá aceitar dar o parecer ou não, e também para acessar a submissão e registrar sua avaliação e recomendação. O site é {$contextUrl}<br />\n<br />\nO prazo para envio do parecer é {$reviewDueDate}.<br />\n<br />\nCaso você não possua login e senha para o site deste periódico, você pode usar este link para solicitar uma nova senha (que lhe será, então, enviada por email junto ao seu login). {$passwordResetUrl}<br />\n<br />\nURL da submissão: {$submissionReviewUrl}<br />\n<br />\nObrigado por considerar este pedido.<br />\n<br />\n{$editorialContactSignature}<br />\n<br />\n&quot;{$submissionTitle}&quot;<br />\n<br />\n{$submissionAbstract}', 'Este e-mail do Editor de Seção para um Avaliador, que solicita ao usuário aceitar ou recusar a tarefa de avaliar uma submissão para uma segunda ou maior rodada de avaliação. Ele fornece informações sobre a submissão, como o título e resumo, uma data de limite de avaliação, e como acessar a própria submissão. Essa mensagem é usada quando o Processo de Avaliação Padrão é selecionado em Configurações> Fluxo de trabalho> Avaliação. (Caso contrário, consulte REVIEW_REQUEST_ATTACHED_SUBSEQUENT.)'),
('REVISED_VERSION_NOTIFY', 'pt_BR', 'Envio de versão atualizada', 'Editores: <br />\n<br />\nUma versão revisada de &quot;{$submissionTitle}&quot; foi carregada pelo autor {$authorName}. <br />\n<br />\nURL da Submissão: {$submissionUrl} <br />\n<br />\n{$editorialContactSignature}', 'Este email é enviado automaticamente ao editor designado quando o autor faz o upload de uma versão revisada de um artigo.'),
('STATISTICS_REPORT_NOTIFICATION', 'pt_BR', 'Atividade editorial para {$month}, {$year}', '\n{$name}, <br />\n<br />\nSeu relatório do estado atual do sistema do mês de {$month}, {$year} está disponível. Suas estatísticas-chave deste mês seguem abaixo.<br />\n<ul>\n	<li>Novas submissões este mês: {$newSubmissions}</li>\n	<li>Submissões rejeitadas este mês: {$declinedSubmissions}</li>\n	<li>Submissões aceitas este mês: {$acceptedSubmissions}</li>\n	<li>Total de submissões no sistema {$totalSubmissions}</li>\n</ul>\nEfetue login no site do periódico para obter uma visão mais detalhada das <a href=\"{$editorialStatsLink}\">tendências editoriais</a> e <a href=\"{$publicationStatsLink}\">estatísticas de artigos publicados</a>. Uma cópia completa do relatório de tendencias editoriais deste mês segue anexa.<br />\n<br />\nAtenciosamente,<br />\n{$principalContactSignature}', 'Este e-mail é automaticamente enviado todo mês aos editores e gerentes do sistema para dar-lhes uma visão geral do estado do sistema.'),
('SUBMISSION_ACK', 'pt_BR', 'Agradecimento pela submissão', '{$authorName}:<br />\n<br />\nObrigado por submeter o manuscrito, &quot;{$submissionTitle}&quot; ao periódico {$contextName}. Com o sistema de gerenciamento de periódicos on-line que estamos usando, você poderá acompanhar seu progresso através do processo editorial efetuando login no site do periódico:<br />\n<br />\nURL da Submissão: {$submissionUrl}<br />\nUsuário: {$authorUsername}<br />\n<br />\nSe você tiver alguma dúvida, entre em contato conosco. Agradecemos por considerar este periódico para publicar o seu trabalho.<br />\n<br />\n{$editorialContactSignature}', 'Mensagem enviada automaticamente pelo sistema ao autor, quando habilitada, ao ser concluído o processo de submissão de um manuscrito à revista. Oferece informações sobre os mecanismos para acompanhamento da submissão durante o processo editorial, e serve como registro e confirmação da submissão.'),
('SUBMISSION_ACK_NOT_USER', 'pt_BR', 'Agradecimento pela submissão', 'Olá,<br />\n<br />\n{$submitterName} submeteu o manuscrito, &quot;{$submissionTitle}&quot; ao periódico {$contextName}. <br />\n<br />\nSe você tiver alguma dúvida, entre em contato conosco. Agradecemos por considerar este periódico para publicar o seu trabalho.<br />\n<br />\n{$editorialContactSignature}', 'Quando habilitada, esta mensagem é enviada automaticamente aos coautores informados durante o processo de submissão, que não estão cadastrados no OJS.'),
('SUBSCRIPTION_AFTER_EXPIRY', 'pt_BR', 'Expiração de assinatura', '{$subscriberName}: <br />\n<br />\nSua assinatura do {$contextName} expirou. <br />\n<br />\n{$subscriptionType} <br />\nData de validade: {$expiryDate} <br />\n<br />\nPara renovar sua assinatura, acesse o site da revista. Você pode fazer login no sistema com seu nome de usuário, &quot;{$username}&quot;. <br />\n<br />\nSe você tiver alguma dúvida, por favor não hesite em contactar-me. <br />\n<br />\n{$subscriptionContactSignature}', 'Esta mensagem avisa o assinante da expiração da assinatura. Informa a URL da revista e instruções de acesso.'),
('SUBSCRIPTION_AFTER_EXPIRY_LAST', 'pt_BR', 'Expiração de assinatura - Lembrete final', '{$subscriberName}: <br />\n<br />\nSua assinatura do {$contextName} expirou. <br />\nObserve que este é o lembrete final que lhe será enviado por e-mail. <br />\n<br />\n{$subscriptionType} <br />\nData de validade: {$expiryDate} <br />\n<br />\nPara renovar sua assinatura, acesse o site da revista. Você pode fazer login no sistema com seu nome de usuário, &quot;{$username}&quot;. <br />\n<br />\nSe você tiver alguma dúvida, não hesite em contactar-me. <br />\n<br />\n{$subscriptionContactSignature}', 'Esta mensagem é o último aviso ao assinante da expiração da assinatura. Informa a URL da revista e instruções de acesso.'),
('SUBSCRIPTION_BEFORE_EXPIRY', 'pt_BR', 'Aviso de expiração de assinatura', '{$subscriberName}: <br />\n<br />\nSua assinatura do {$contextName} está prestes a expirar. <br />\n<br />\n{$subscriptionType} <br />\nData de validade: {$expiryDate} <br />\n<br />\nPara garantir a continuidade do seu acesso a esta revista, acesse o site da revista e renove sua assinatura. Você pode fazer login no sistema com seu nome de usuário, &quot;{$username}&quot;. <br />\n<br />\nSe você tiver alguma dúvida, não hesite em contactar-me. <br />\n<br />\n{$subscriptionContactSignature}', 'Esta mensagem avisa o assinante da proximidade do término da assinatura. Informa a URL da revista e instruções de acesso.'),
('SUBSCRIPTION_NOTIFY', 'pt_BR', 'Confirmação de assinatura', '{$subscriberName}: <br />\n<br />\nAgora você foi registrado como assinante em nossa {$contextName}, com a seguinte assinatura: <br />\n<br />\n{$subscriptionType} <br />\n<br />\nPara acessar o conteúdo disponível apenas para assinantes, basta fazer login no sistema com seu nome de usuário,  &quot;{$username} &quot;. <br />\n<br />\nDepois de fazer login no sistema, você poderá alterar os detalhes e a senha do seu perfil a qualquer momento. <br />\n<br />\nObserve que se você possui uma assinatura institucional, não é necessário que os usuários da sua instituição efetuem login, pois as solicitações de conteúdo da assinatura serão automaticamente autenticadas pelo sistema. <br />\n<br />\nSe você tiver alguma dúvida, por favor não hesite em contactar-me. <br />\n<br />\n{$subscriptionContactSignature}', 'Mensagem notifica o leitor cadastrado que o Editor criou sua Assinatura. Proporciona todas as informações necessárias para acesso ao conteúdo.'),
('SUBSCRIPTION_PURCHASE_INDL', 'pt_BR', 'Aquisição de Assinatura: Individual', 'Uma assinatura individual foi comprada on-line para {$contextName} com os seguintes detalhes. <br />\n<br />\nTipo de Assinatura: <br />\n{$subscriptionType} <br />\n<br />\nUsuário: <br />\n{$userDetails} <br />\n<br />\nInformações Assinatura (se informado): <br />\n{$membership} <br />\n<br />\nPara visualizar ou editar esta assinatura, use a seguinte URL. <br />\n<br />\nURL da Assinatura: {$subscriptionUrl} <br />\n', 'Esta mensagem notifica o Gerente de Assinaturas que uma assinatura individual foi adquirida online. Oferece informações sobre a assinatura e um link para acesso rápido à mesma.'),
('SUBSCRIPTION_PURCHASE_INSTL', 'pt_BR', 'Aquisição de Assinatura: Institucional', 'Uma assinatura institucional foi comprada on-line para {$contextName} com os seguintes detalhes. Para ativar esta assinatura, use a URL fornecida e defina o status da assinatura como \'Ativo\'. <br />\n<br />\nTipo de Assinatura: <br />\n{$subscriptionType} <br />\n<br />\nInstituição: <br />\n{$institutionName} <br />\n{$institutionMailingAddress} <br />\n<br />\nDomínio (se fornecido): <br />\n{$domain} <br />\n<br />\nIntervalos de IP (se houver): <br />\n{$ipRanges} <br />\n<br />\nPessoa de Contato: <br />\n{$userDetails} <br />\n<br />\nInformações sobre a Assinatura (se houver): <br />\n{$membership} <br />\n<br />\nPara visualizar ou editar esta assinatura, use a seguinte URL. <br />\n<br />\nURL da Assinatura: {$subscriptionUrl} <br />\n', 'Esta mensagem notifica o Editor Gerente que uma assinatura institucional foi adquirida online. Oferece informações sobre a assinatura e um link para acesso rápido à mesma.'),
('SUBSCRIPTION_RENEW_INDL', 'pt_BR', 'Renovação de Assinatura Individual', 'Uma assinatura individual foi renovada online para {$contextName} com os seguintes detalhes. <br />\n<br />\nTipo de Assinatura: <br />\n{$subscriptionType} <br />\n<br />\nUsuário: <br />\n{$userDetails} <br />\n<br />\nInformações sobre a Assinatura (se houver): <br />\n{$membership} <br />\n<br />\nPara visualizar ou editar esta assinatura, use a seguinte URL. <br />\n<br />\nURL de inscrição: {$subscriptionUrl} <br />\n', 'Esta mensagem notifica o Editor Gerente que uma assinatura individual foi renovada online. Oferece informações sobre a assinatura e um link para acesso rápido à mesma.'),
('SUBSCRIPTION_RENEW_INSTL', 'pt_BR', 'Renovação de Assinatura Institucional', 'Uma assinatura institucional foi renovada online para {$contextName} com os seguintes detalhes. <br />\n<br />\nTipo de Assinatura: <br />\n{$subscriptionType} <br />\n<br />\nInstituição: <br />\n{$institutionName} <br />\n{$institutionMailingAddress} <br />\n<br />\nDomínio (se fornecido): <br />\n{$domain} <br />\n<br />\nIntervalos de IP (se houver): <br />\n{$ipRanges} <br />\n<br />\nPessoa de Contato: <br />\n{$userDetails} <br />\n<br />\nInformações sobre membros (se houver): <br />\n{$membership} <br />\n<br />\nPara visualizar ou editar esta assinatura, use a seguinte URL. <br />\n<br />\nURL da Assinatura: {$subscriptionUrl} <br />\n', 'Esta mensagem notifica o Editor Gerente que uma assinatura institucional foi renovada online. Oferece informações sobre a assinatura e um link para acesso rápido à mesma.'),
('TESTE', 'pt_BR', 'Teste', 'Prezado(a) docente,\r\n\r\n{$contextName} acaba de publicar sua edição mais recente em {$contextUrl}. Convidamos a consultar o sumário abaixo e, em seguida, visitar o site.\r\n\r\nAgradecemos pelo interesse em participar.\r\n{$editorialContactSignature}', 'Teste de banco'),
('USER_REGISTER', 'pt_BR', 'Cadastro no Periódico', '{$userFullName}<br />\n<br />\nAgora você foi cadastrado como um usuário em {$contextName}. Incluímos seu nome de usuário e senha neste e-mail, necessários para todo o trabalho neste periódico por meio de seu site. A qualquer momento, você pode pedir para ser removido da lista de usuários da revista entrando em contato comigo.<br />\n<br />\nUsuário: {$username}<br />\nSenha: {$password}<br />\n<br />\nAtenciosamente,<br />\n{$principalContactSignature}', 'Esta mensagem é enviada aos usuários recém-cadastrados no sistema, para dar-lhes as boas-vindas e deixar registrado seu login e senha.'),
('USER_VALIDATE', 'pt_BR', 'Valide seu Cadastro', '{$userFullName}<br />\n<br />\nVocê criou uma conta no periódico {$contextName}, mas antes de começar a usá-la, você precisa validar sua conta de e-mail. Para fazer isso, basta clicar no link abaixo:<br />\n<br />\n{$activateUrl}<br />\n<br />\nAtenciosamente,<br />\n{$principalContactSignature}', 'Esta mensagem é enviada a um novo usuário cadastrado, para validação do cadastro.');
INSERT INTO `email_templates_settings` (`email_id`, `locale`, `setting_name`, `setting_value`) VALUES
(1, 'pt_BR', 'body', '<p>Prezado(a) Prof(a) {$authorName},</p>\n<p><br />Foi tomada uma decisão sobre o projeto submetido ao {$contextName}, \"{$submissionTitle}\".</p>\n<p>A decisão é: projeto aprovado.</p>\n<p>Abaixo segue a avaliação do parecerista.</p>\n<p> </p>\n<p>Atenciosamente,</p>\n<p>{$editorialContactSignature}<br /><br /></p>'),
(1, 'pt_BR', 'subject', 'Decisão editorial - Iniciação Científica'),
(2, 'pt_BR', 'body', '<p>Prezado(a) Prof(a) {$authorName},<br /><br />Foi tomada uma decisão sobre o projeto submetido ao {$contextName}, \"{$submissionTitle}\".</p>\n<p>A decisão é: revisões são necessárias.</p>\n<p>O arquivo com as correções deverá ser encaminhado pelo sistema em até três dias a partir do envio dessa mensagem.</p>\n<p>Para encaminhar o arquivo:</p>\n<p> </p>\n<p> </p>\n<p>Atenciosamente,</p>\n<p>{$editorialContactSignature}</p>'),
(2, 'pt_BR', 'subject', 'Decisão editorial - Iniciação Científica'),
(3, 'pt_BR', 'body', '<p>Prezado(a) Prof(a) {$authorName},<br /><br />Foi tomada uma decisão sobre o projeto submetido ao {$contextName}, \"{$submissionTitle}\".</p>\n<p>A decisão é: projeto reprovado.</p>\n<p>Abaixo segue a avaliação do parecerista.</p>\n<p> </p>\n<p> </p>\n<p>Atenciosamente,</p>\n<p>{$editorialContactSignature}</p>'),
(3, 'pt_BR', 'subject', 'Decisão editorial - Iniciação Cientifica'),
(4, 'pt_BR', 'body', '<p>Recebemos uma solicitação para redefinir sua senha para o site {$siteTitle}.<br /><br />Caso não tenha feito a solicitação, favor ignorar este e-mail e sua senha não será alterada. Se você deseja redefinir sua senha, clique na URL abaixo.<br /><br />Redefinir minha senha: {$url}</p>\n<p> </p>\n<p>Atenciosamente,</p>\n<p>{$principalContactSignature}</p>'),
(4, 'pt_BR', 'subject', 'Solicitação de atualização de senha'),
(5, 'pt_BR', 'body', '<p>Sua senha foi redefinida com sucesso para uso em {$siteTitle}. Favor guardar esse usuário e senha, pois são necessários para todas as atividades relacionadas ao sistema.<br /><br />Seu usuário: {$username}<br />Sua nova senha: {$password}</p>\n<p> </p>\n<p>Atenciosamente,</p>\n<p>{$principalContactSignature}</p>'),
(5, 'pt_BR', 'subject', 'Senha Redefinida'),
(6, 'pt_BR', 'body', '<p>Prezado(a) Prof(a) {$reviewerName},<br /><br />Agradecemos ter concluído a avaliação do projeto \"{$submissionTitle},\" ao {$contextName}.</p>\n<p>Sua contribuição é fundamental para a qualidade da pesquisa na UFABC.</p>\n<p>Atenciosamente,</p>\n<p> </p>\n<p>{$editorialContactSignature}</p>\n<p>{$principalContactSignature}</p>'),
(6, 'pt_BR', 'subject', 'Agradecimento pela avaliação'),
(7, 'pt_BR', 'body', '<p>Prezado (a) Prof(a) {$reviewerName},<br /><br />Estamos cancelando a solicitação de avaliação da submissão \"{$submissionTitle},\" ao {$contextName}.</p>\n<p>Lamentamos qualquer inconveniente causado e esperamos poder contar com seus préstimos em outra oportunidade.</p>\n<p>Em caso de dúvidas, entre em contato.</p>\n<p> </p>\n<p>Atenciosamente,</p>\n<p>{$principalContactSignature}</p>'),
(7, 'pt_BR', 'subject', 'Cancelamento de solicitação de avaliação'),
(8, 'pt_BR', 'body', '<p>Prezado editor, <br /><br />Estou disponível para avaliar a submissão , \"{$submissionTitle},\" em {$contextName}. Agradeço a consideração e pretendo concluir a avaliação até a data definida {$reviewDueDate}, ou antes do prazo.<br /><br />Atenciosamente, <br />{$reviewerName}</p>'),
(8, 'pt_BR', 'subject', 'Disponível para realizar avaliação'),
(9, 'pt_BR', 'body', '<p>Prezado editor,<br /><br />Sinto informar que estou indisponível no momento para realizar a avaliação da submissão \"{$submissionTitle},\" para {$contextName}.</p>\n<p>Agradeço a consideração, e espero poder ser convocado e estar disponível em outra oportunidade.</p>\n<p>Estou ciente de que a justificativa será analisada pelo Comitê dos Programas de Iniciação Científica.</p>\n<p>Justificativa:</p>\n<p> </p>\n<p>Atenciosamente,</p>\n<p>{$reviewerName}</p>'),
(9, 'pt_BR', 'subject', 'Indisponível para realizar avaliação'),
(10, 'pt_BR', 'body', '<p>Prezado(a) Prof(a) {$reviewerName},<br /><br />Este é apenas um lembrete quanto à solicitação de avaliação da submissão \"{$submissionTitle}\" ao {$contextName}. Esperamos receber sua avaliação até {$reviewDueDate}, e aguardamos o recebimento assim que for possível.<br /><br />URL da submissão: {$submissionReviewUrl}<br /><br />Por favor, confirme sua disponibilidade para concluir sua avaliação, uma contribuição vital para a qualidade da pesquisa na UFABC.</p>\n<p> </p>\n<p>Atenciosamente,<br /><br />{$editorialContactSignature}</p>'),
(10, 'pt_BR', 'subject', 'Lembrete de solicitação de avaliação'),
(11, 'pt_BR', 'body', '<p>Prezado(a) Prof(a) {$reviewerName},<br /><br />Acredito que seu conhecimento será fundamental para realizar a avaliação do projeto \"{$submissionTitle}\", submetido ao {$contextName}. <span style=\"font-size: 0.875rem;\">Informações sobre a submissão encontram-se nesta mensagem </span><span style=\"font-size: 0.875rem;\">e espero que considere realizar essa importante tarefa.</span></p>\n<p>De acordo com os editais de Iniciação Científica, uma das obrigações do orientador é \"emitir pareceres referentes a projetos de iniciação científica deste ou de outros editais\".</p>\n<p>Peço que acesse o sistema para informar, se possível em até três dias úteis a partir da data do envio desta mensagem, se estará disponível ou não para realizar a avaliação. A ausência de manifestação contrária indica concordância do aceite da avaliação.</p>\n<p>Caso não seja possível efetuar a avaliação, informe através do sistema.</p>\n<p>Efetue seu login antes de {$responseDueDate} para indicar a disponibilidade, bem como para acessar a submissão e registrar sua avaliação e recomendação. <br /><br />O prazo para a conclusão da avaliação é {$reviewDueDate}.</p>\n<p>Link da submissão: {$submissionReviewUrl}</p>\n<p>Acesse o tutorial para efetuar a avaliação, disponível na página https://propes.ufabc.edu.br/ic/sistema-de-submissoes.</p>\n<p>Lembramos que o avaliador do projeto poderá também ser solicitado para avaliar o relatório parcial e o final encaminhados posteriormente.</p>\n<p>Caso não lembre seu usuário e senha para o sistema de submissões, utilize este link para redefinir sua senha (que será enviada por e-mail juntamente com seu nome de usuário). {$passwordResetUrl}.</p>\n<p>Agradecemos desde já sua atenção.</p>\n<p> </p>\n<p>{$editorialContactSignature}</p>\n<p>---------------------------------------------------------------------------------</p>\n<p><br /><br />\"{$submissionTitle}\"<br /><br />{$submissionAbstract}</p>'),
(11, 'pt_BR', 'subject', 'O {$contextName} solicita avaliação '),
(12, 'pt_BR', 'body', '<p>Prezado(a) Prof(a) {$authorName},<br /><br />Agradecemos a submissão do projeto \"{$submissionTitle}\" ao {$contextName}.</p>\n<p>Acompanhe o progresso da sua submissão por meio do sistema.</p>\n<p>URL da Submissão: {$submissionUrl}<br />Login: {$authorUsername}</p>\n<p>Em caso de dúvidas, entre em contato conosco.</p>\n<p> </p>\n<p>Atenciosamente.</p>\n<p>{$editorialContactSignature}</p>'),
(12, 'pt_BR', 'subject', 'Agradecimento pela submissão'),
(13, 'pt_BR', 'body', '<p>{$userFullName}<br /><br />Agradecemos o seu cadastro no sistema de submissões do {$contextName}.</p>\n<p>Guarde o login e a senha, pois serão necessários para todo o acompanhamento junto ao sistema. Caso deseje remover seu usuário, entre em contato.</p>\n<p>Usuário: {$username}<br />Senha: {$password}<br /><br />Atenciosamente,<br />{$principalContactSignature}</p>'),
(13, 'pt_BR', 'subject', 'Novo usuário cadastrado'),
(14, 'pt_BR', 'body', '<p>Prezado(a) Prof(a),</p>\n<p>Devido à sua experiência, tomamos a liberdade de cadastrar seu nome no banco de dados de avaliadores para {$contextName}. Isso não implica qualquer forma de compromisso de sua parte, mas simplesmente nos permite lhe contatar com uma submissão para uma possível avaliação. Ao ser convidado(a) a avaliar, você terá a oportunidade de ver o título e o resumo do projeto em questão e poderá sempre aceitar ou recusar o convite. Você também pode pedir a qualquer momento para remover seu nome desta lista de avaliadores.<br /><br />Estamos fornecendo a você um usuário e senha, que são usados em todas as interações com o sistema de submissões da Iniciação Científica. Você pode, por exemplo, atualizar seu perfil, incluindo seus interesses de avaliação.<br /><br />Usuário: {$username}<br />Senha: {$password}<br /><br />Atenciosamente,<br />{$principalContactSignature}</p>'),
(14, 'pt_BR', 'subject', 'Cadastro como Avaliador em {$contextName}'),
(15, 'pt_BR', 'body', '<p>Prezado(a) docente,<br /><br />{$contextName} acaba de publicar sua edição mais recente em {$contextUrl}. Convidamos a consultar o sumário abaixo e, em seguida, visitar o site.<br /><br />Agradecemos pelo interesse em participar.<br />{$editorialContactSignature}</p>'),
(15, 'pt_BR', 'subject', 'Nova chamada de IC publicada'),
(16, 'pt_BR', 'body', '<p>Prezado(a),<br /><br />Informamos, para conhecimento, que {$submitterName} submeteu o projeto \"{$submissionTitle}\" ao {$contextName}, onde seu nome foi incluído em coorientação.<br /><br />Em caso de dúvidas, entre em contato conosco. </p>\n<p> </p>\n<p>Atenciosamente,<br /><br />{$editorialContactSignature}</p>'),
(16, 'pt_BR', 'subject', 'Agradecimento pela submissão'),
(17, 'pt_BR', 'body', '{$editorialContactName}:<br />\n<br />\nA submissão, &quot;{$submissionTitle},&quot; ao periódico {$contextName} lhe foi designada para acompanhar o processo editorial em sua função como Editor de Seção.<br />\n<br />\nURL da Submissão: {$submissionUrl}<br />\nUsuário: {$editorUsername}<br />\n<br />\nObrigado.'),
(17, 'pt_BR', 'subject', 'Tarefa editorial'),
(18, 'pt_BR', 'body', '{$reviewerName}:<br />\n<br />\nNós gostaríamos de convidá-lo(a) novamente para dar um parecer à submissão, &quot;{$submissionTitle},&quot; para o periódico {$contextName}. Nós esperamos que você possa nos ajudar no processo de avaliação por pares deste periódico.<br />\n<br />\nSe tiver alguma dúvida, por favor, entre em contato comigo.'),
(18, 'pt_BR', 'subject', 'Solicitação de revisão restabelecida'),
(19, 'pt_BR', 'body', '<ul class=\"list\">\n<li class=\"listItem listPanel__item--emailTemplates__body\">\n<ul class=\"list\">\n<li class=\"listItem listPanel__item--emailTemplates__body\">\n<p>Prezado(a) Prof(a),</p>\n<p>Recebemos uma solicitação para redefinir sua senha para o site {$siteTitle}.<br /><br />Caso não tenha feito a solicitação, favor ignorar este e-mail e sua senha não será alterada. Se você deseja redefinir sua senha, clique na URL abaixo.<br /><br />Redefinir minha senha: {$url}</p>\n<p> </p>\n<p>Atenciosamente,</p>\n<p>{$principalContactSignature}</p>\n</li>\n</ul>\n</li>\n</ul>'),
(19, 'pt_BR', 'subject', 'Solicitação de atualização de senha'),
(20, 'pt_BR', 'body', '<ul class=\"list\">\n<li class=\"listItem listPanel__item--emailTemplates__body\">Prezado(a) Prof(a),</li>\n<li class=\"listItem listPanel__item--emailTemplates__body\">\n<p>Sua senha foi redefinida com sucesso para uso em {$siteTitle}. Favor guardar esse usuário e senha, pois são necessários para todas as atividades relacionadas ao sistema.<br /><br />Seu usuário: {$username}<br />Sua nova senha: {$password}</p>\n<p> </p>\n<p>Atenciosamente,</p>\n<p>{$principalContactSignature}</p>\n</li>\n</ul>'),
(20, 'pt_BR', 'subject', 'Senha Redefinida'),
(21, 'pt_BR', 'body', '<p>Prezado(a) Prof(a) {$userFullName},<br /><br />Agradecemos o seu cadastro no sistema de submissões do {$contextName}.</p>\n<p>Guarde o login e a senha, pois serão necessários para todo o acompanhamento junto ao sistema. Caso deseje remover seu usuário, entre em contato.</p>\n<p>Usuário: {$username}<br />Senha: {$password}<br /><br />Atenciosamente,<br />{$principalContactSignature}</p>'),
(21, 'pt_BR', 'subject', 'Novo usuário cadastrado'),
(22, 'pt_BR', 'body', '<ul class=\"list\">\n<li class=\"listItem listPanel__item--emailTemplates__body\">\n<p>Prezado(a) Prof(a),</p>\n<p>Devido à sua experiência, tomamos a liberdade de cadastrar seu nome no banco de dados de avaliadores para {$contextName}. Isso não implica qualquer forma de compromisso de sua parte, mas simplesmente nos permite lhe contatar com uma submissão para uma possível avaliação. Ao ser convidado(a) a avaliar, você terá a oportunidade de ver o título e o resumo do projeto em questão e poderá sempre aceitar ou recusar o convite. Você também pode pedir a qualquer momento para remover seu nome desta lista de avaliadores.<br /><br />Estamos fornecendo a você um usuário e senha, que são usados em todas as interações com o sistema de submissões da Iniciação Científica. Você pode, por exemplo, atualizar seu perfil, incluindo seus interesses de avaliação.<br /><br />Usuário: {$username}<br />Senha: {$password}<br /><br />Atenciosamente,<br />{$principalContactSignature}</p>\n</li>\n</ul>'),
(22, 'pt_BR', 'subject', 'Cadastro como Avaliador em {$contextName}'),
(23, 'pt_BR', 'body', '<ul class=\"list\">\n<li class=\"listItem listPanel__item--emailTemplates__body\">\n<p>Prezado(a) Prof(a) {$authorName},<br /><br />Agradecemos a submissão do projeto \"{$submissionTitle}\" ao {$contextName}.</p>\n<p>Acompanhe o progresso da sua submissão por meio do sistema.</p>\n<p>URL da Submissão: {$submissionUrl}<br />Login: {$authorUsername}</p>\n<p>Em caso de dúvidas, entre em contato conosco.</p>\n<p> </p>\n<p>Atenciosamente.</p>\n<p>{$editorialContactSignature}</p>\n</li>\n</ul>'),
(23, 'pt_BR', 'subject', 'Agradecimento pela submissão'),
(24, 'pt_BR', 'body', '<p>Prezado(a),</p>\n<p>Informamos, para conhecimento, que {$submitterName} submeteu o projeto \"{$submissionTitle}\" ao {$contextName}, onde seu nome foi incluído em coorientação.</p>\n<p>Em caso de dúvidas, entre em contato conosco. <br /><br />Atenciosamente,</p>\n<p>{$editorialContactSignature}</p>'),
(24, 'pt_BR', 'subject', 'Agradecimento pela submissão'),
(25, 'pt_BR', 'body', '{$editorialContactName}:<br />\n<br />\nA submissão, &quot;{$submissionTitle},&quot; ao periódico {$contextName} lhe foi designada para acompanhar o processo editorial em sua função como Editor de Seção.<br />\n<br />\nURL da Submissão: {$submissionUrl}<br />\nUsuário: {$editorUsername}<br />\n<br />\nObrigado.'),
(25, 'pt_BR', 'subject', 'Tarefa editorial'),
(26, 'pt_BR', 'body', '<ul class=\"list\">\n<li class=\"listItem listPanel__item--emailTemplates__body\">\n<p>Prezado (a) Prof(a) {$reviewerName},<br /><br />Estamos cancelando a solicitação de avaliação da submissão \"{$submissionTitle},\" ao {$contextName}.</p>\n<p>Lamentamos qualquer inconveniente causado e esperamos poder contar com seus préstimos em outra oportunidade.</p>\n<p>Em caso de dúvidas, entre em contato.</p>\n<p> </p>\n<p>Atenciosamente,</p>\n<p>{$principalContactSignature}</p>\n</li>\n</ul>'),
(26, 'pt_BR', 'subject', 'Cancelamento de solicitação de avaliação'),
(27, 'pt_BR', 'body', '{$reviewerName}:<br />\n<br />\nNós gostaríamos de convidá-lo(a) novamente para dar um parecer à submissão, &quot;{$submissionTitle},&quot; para o periódico {$contextName}. Nós esperamos que você possa nos ajudar no processo de avaliação por pares deste periódico.<br />\n<br />\nSe tiver alguma dúvida, por favor, entre em contato comigo.'),
(27, 'pt_BR', 'subject', 'Solicitação de revisão restabelecida'),
(28, 'pt_BR', 'body', '<ul class=\"list\">\n<li class=\"listItem listPanel__item--emailTemplates__body\">\n<p>Prezado(a) Prof(a) {$reviewerName},<br /><br />Acredito que seu conhecimento será fundamental para realizar a avaliação do projeto \"{$submissionTitle}\", submetido ao {$contextName}. O resumo da submissão está inserido abaixo e espero que você considere realizar essa importante tarefa.</p>\n<p>De acordo com os Editais de Iniciação Científica, uma das obrigações do orientador é \"emitir pareceres referentes a projetos de iniciação científica deste ou de outros editais\".</p>\n<p>Informações sobre a submissão encontram-se nesta mensagem.</p>\n<p>Pedimos que acesse o sistema para nos informar, se possível em até três dias úteis a partir da data do envio desta mensagem, se estará disponível ou não para realizar a avaliação. A ausência de manifestação contrária indica concordância do aceite da avaliação.</p>\n<p>Caso não seja possível efetuar a avaliação, informe a justificativa através do e-mail acessível no sistema ao clicar em \"indisponível para avaliação\", com cópia para iniciacao@ufabc.edu.br</p>\n<p>Efetue login no sistema antes de {$responseDueDate} para indicar sua disponibilidade, bem como para acessar a submissão e registrar sua avaliação e recomendação. O link é {$contextUrl}.<br /><br />O prazo para a conclusão da avaliação é {$reviewDueDate}.<br /><br />Se você não tiver seu nome de usuário e senha para o site do periódico, poderá usar este link para redefinir sua senha (que será enviada por e-mail juntamente com seu nome de usuário). {$passwordResetUrl}.</p>\n<p>Lembramos que o avaliador do projeto poderá também ser solicitado para avaliar o relatório parcial e o final encaminhados posteriormente.</p>\n<p>Agradecemos desde já sua atenção.</p>\n<p> </p>\n<p>{$editorialContactSignature}</p>\n<p>---------------------------------------------------------------------------------</p>\n<p>URL da submissão: {$submissionReviewUrl}<br /><br />\"{$submissionTitle}\"<br /><br />{$submissionAbstract}</p>\n</li>\n</ul>'),
(28, 'pt_BR', 'subject', 'O {$contextName} solicita avaliação'),
(29, 'pt_BR', 'body', '<ul class=\"list\">\n<li class=\"listItem listPanel__item--emailTemplates__body\">\n<p>Prezado editor,<br /><br />Estou disponível para avaliar a submissão , \"{$submissionTitle},\" em {$contextName}. Agradeço a consideração e pretendo concluir a avaliação até a data definida {$reviewDueDate}, ou antes do prazo.<br /><br />Atenciosamente,<br />{$reviewerName}</p>\n</li>\n</ul>'),
(29, 'pt_BR', 'subject', 'Disponível para realizar avaliação'),
(30, 'pt_BR', 'body', '<ul class=\"list\">\n<li class=\"listItem listPanel__item--emailTemplates__body\">\n<p>Prezado editor,<br /><br />Sinto informar que estou indisponível no momento para realizar a avaliação da submissão \"{$submissionTitle},\" para {$contextName}.</p>\n<p>Agradeço a consideração, e espero poder ser convocado e estar disponível em outra oportunidade.</p>\n<p>Estou ciente de que a justificativa será analisada pelo Comitê dos Programas de Iniciação Científica.</p>\n<p>Justificativa:</p>\n<p> </p>\n<p>Atenciosamente,</p>\n<p>{$reviewerName}</p>\n</li>\n</ul>'),
(30, 'pt_BR', 'subject', 'Indisponível para realizar avaliação'),
(31, 'pt_BR', 'body', '<ul class=\"list\">\n<li class=\"listItem listPanel__item--emailTemplates__body\">\n<p>Prezado(a) Prof(a) {$reviewerName},<br /><br />Agradecemos ter concluído a avaliação do projeto \"{$submissionTitle},\" ao {$contextName}.</p>\n<p>Sua contribuição é fundamental para a qualidade da pesquisa na UFABC.</p>\n<p>Atenciosamente,</p>\n<p> </p>\n<p>{$editorialContactSignature}</p>\n<p>{$principalContactSignature}</p>\n</li>\n</ul>'),
(31, 'pt_BR', 'subject', 'Agradecimento pela avaliação'),
(32, 'pt_BR', 'body', '<ul class=\"list\">\n<li class=\"listItem listPanel__item--emailTemplates__body\">\n<p>Prezado(a) Prof(a) {$reviewerName},<br /><br />Este é apenas um lembrete quanto à solicitação de avaliação da submissão \"{$submissionTitle}\" ao {$contextName}. Esperamos receber sua avaliação até {$reviewDueDate}, e aguardamos o recebimento assim que for possível.<br /><br />URL da submissão: {$submissionReviewUrl}<br /><br />Por favor, confirme sua disponibilidade para concluir sua avaliação, uma contribuição vital para a qualidade da pesquisa na UFABC.</p>\n<p> </p>\n<p>Atenciosamente,<br /><br />{$editorialContactSignature}</p>\n</li>\n</ul>'),
(32, 'pt_BR', 'subject', 'Lembrete de solicitação de avaliação'),
(33, 'pt_BR', 'body', '<p>Prezado(a) Prof(a) {$authorName},</p>\n<p><br />Foi tomada uma decisão sobre o projeto submetido ao {$contextName}, \"{$submissionTitle}\".</p>\n<p>A decisão é: projeto aprovado.</p>\n<p>Abaixo segue a avaliação do parecerista.</p>\n<p> </p>\n<p>Atenciosamente,</p>\n<p>{$editorialContactSignature}</p>'),
(33, 'pt_BR', 'subject', 'Decisão editorial - Iniciação Científica'),
(34, 'pt_BR', 'body', '<ul class=\"list\">\n<li class=\"listItem listPanel__item--emailTemplates__body\">\n<p>Prezado(a) Prof(a) {$authorName},<br /><br />Foi tomada uma decisão sobre o projeto submetido ao {$contextName}, \"{$submissionTitle}\".</p>\n<p>A decisão é: revisões são necessárias.</p>\n<p>O arquivo com as correções deverá ser encaminhado pelo sistema em até três dias a partir do envio dessa mensagem.</p>\n<p>Para encaminhar o arquivo:</p>\n<p> </p>\n<p> </p>\n<p>Atenciosamente,</p>\n<p>{$editorialContactSignature}</p>\n</li>\n</ul>'),
(34, 'pt_BR', 'subject', 'Decisão editorial - Iniciação Científica'),
(35, 'pt_BR', 'body', '<ul class=\"list\">\n<li class=\"listItem listPanel__item--emailTemplates__body\">\n<p>Prezado(a) Prof(a) {$authorName},<br /><br />Foi tomada uma decisão sobre o projeto submetido ao {$contextName}, \"{$submissionTitle}\".</p>\n<p>A decisão é: projeto reprovado.</p>\n<p>Abaixo segue a avaliação do parecerista.</p>\n<p> </p>\n<p> </p>\n<p>Atenciosamente,</p>\n<p>{$editorialContactSignature}</p>\n</li>\n</ul>'),
(35, 'pt_BR', 'subject', 'Decisão editorial - Iniciação Cientifica'),
(36, 'pt_BR', 'body', '\n{$name}, <br />\n<br />\nSeu relatório do estado atual do sistema do mês de {$month}, {$year} está disponível. Suas estatísticas-chave deste mês seguem abaixo.<br />\n<ul>\n	<li>Novas submissões este mês: {$newSubmissions}</li>\n	<li>Submissões rejeitadas este mês: {$declinedSubmissions}</li>\n	<li>Submissões aceitas este mês: {$acceptedSubmissions}</li>\n	<li>Total de submissões no sistema {$totalSubmissions}</li>\n</ul>\nEfetue login no site do periódico para obter uma visão mais detalhada das <a href=\"{$editorialStatsLink}\">tendências editoriais</a> e <a href=\"{$publicationStatsLink}\">estatísticas de artigos publicados</a>. Uma cópia completa do relatório de tendencias editoriais deste mês segue anexa.<br />\n<br />\nAtenciosamente,<br />\n{$principalContactSignature}'),
(36, 'pt_BR', 'subject', 'Atividade editorial para {$month}, {$year}'),
(37, 'pt_BR', 'body', '<p>Prezado(a) Prof(a) {$reviewerName},<br /><br />Informamos que os autores submeteram uma versão revisada do projeto \"{$submissionTitle}\", o qual está sendo avaliado no edital de IC {$contextName}.</p>\n<p>Por gentileza, acesse o sistema de submissões até {$responseDueDate} para informar sua disponibilidade,  acessar a submissão e registrar sua avaliação. O site é {$contextUrl}.<br /><br />O prazo para envio do parecer é {$reviewDueDate}.<br /><br />Caso não possua login e senha para o sistema, você pode usar este link para solicitar uma nova senha (que lhe será, então, enviada por e-mail junto ao seu login). {$passwordResetUrl}<br /><br />URL da submissão: {$submissionReviewUrl}</p>\n<p>Agradecemos novamente por sua colaboração.</p>\n<p><br />Atenciosamente,<br /><br />{$editorialContactSignature}<br /><br />\"{$submissionTitle}\"<br /><br />{$submissionAbstract}</p>'),
(37, 'pt_BR', 'subject', 'Solicitação de avaliação de projeto de IC revisado'),
(38, 'pt_BR', 'body', '<p>Prezado(a) Prof(a) {$reviewerName},<br /><br />Informamos que os autores submeteram uma versão revisada do projeto \"{$submissionTitle}\", o qual está sendo avaliado no edital de IC {$contextName}.</p>\n<p>Por gentileza, acesse o sistema de submissões até {$responseDueDate} para informar sua disponibilidade,  acessar a submissão e registrar sua avaliação. O site é {$contextUrl}.<br /><br />O prazo para envio do parecer é {$reviewDueDate}.<br /><br />Caso não possua login e senha para o sistema, você pode usar este link para solicitar uma nova senha (que lhe será, então, enviada por e-mail junto ao seu login). {$passwordResetUrl}<br /><br />URL da submissão: {$submissionReviewUrl}</p>\n<p>Agradecemos novamente por sua colaboração.</p>\n<p><br />Atenciosamente,<br /><br />{$editorialContactSignature}<br /><br />\"{$submissionTitle}\"<br /><br />{$submissionAbstract}</p>'),
(38, 'pt_BR', 'subject', 'Solicitação de avaliação de projeto de IC revisado');
