(9, 'pt_BR', 'additionalHomeContent', '<p>Edital para submissão de projetos de alunos veteranos concorrendo a bolsas e voluntários. </p>\n<p><strong>INSCRIÇÕES PRORROGADAS</strong></p>\n<p>As submissões devem ser efetuadas <strong>SOMENTE</strong> pelos orientadores até o dia <strong>01/07/22</strong>. Os arquivos dos projetos <strong>NÃO</strong> devem conter qualquer informação sobre os autores.</p>\n<p> </p>\n<p>No primeiro acesso será necessário criar um login, o qual pode ser igual ao utilizado anteriormente para efetuar as submissões (no sistema antigo). <strong>Atenção: o campo usuário não aceita ponto ou letras maiúsculas.</strong></p>\n<p>Acesse os tutoriais para verificar os novos procedimentos.</p>\n<p>Em caso de dúvidas, encaminhe um e-mail para <a href=\"mailto:iniciacao@ufabc.edu.br\">iniciacao@ufabc.edu.br</a></p>', NULL),
(9, 'pt_BR', 'clockssLicense', 'Esta revista utiliza o sistema CLOCKSS para criar um sistema de arquivos distribuídos entre bibliotecas participantes e permite que tais bibliotecas mantenham cópias permanentes da revista para propósitos de preservação e recuperação. <a href=\"http://clockss.org/\">Saiba mais...</a>', NULL),
(9, 'pt_BR', 'description', '<p>Edital para submissão de projetos de alunos veteranos concorrendo a bolsas e voluntários. </p>\n<p><strong><span style=\"font-size: 0.875rem;\">INSCRIÇÕES PRORROGADAS</span></strong></p>\n<p><span style=\"font-size: 0.875rem;\">As submissões devem ser efetuadas</span><span style=\"font-size: 0.875rem;\"> </span><span style=\"font-size: 0.875rem; font-weight: bolder;\">SOMENTE</span><span style=\"font-size: 0.875rem;\"> </span><span style=\"font-size: 0.875rem;\">pelos orientadores até o dia</span><span style=\"font-size: 0.875rem;\"> </span><span style=\"font-size: 0.875rem; font-weight: bolder;\">01/07/22</span><span style=\"font-size: 0.875rem;\">.</span><span style=\"font-size: 0.875rem;\"> </span><span style=\"font-size: 0.875rem;\">Os arquivos dos projetos</span><span style=\"font-size: 0.875rem;\"> </span><span style=\"font-size: 0.875rem; font-weight: bolder;\">NÃO</span><span style=\"font-size: 0.875rem;\"> </span><span style=\"font-size: 0.875rem;\">devem conter qualquer informação sobre os autores.</span></p>', NULL),
(9, 'pt_BR', 'lockssLicense', 'Este periódico utiliza o sistema LOCKSS para criar um sistema de arquivamento distribuído entre as bibliotecas participantes e permite que essas bibliotecas criem arquivos permanentes do periódico para fins de preservação e restauração. <a href=\"http://www.lockss.org/\">More...</a>', NULL),
(9, 'pt_BR', 'name', 'Edital 04/2022 - PIC/PIBIC/PIBITI/PIBIC-AF', NULL),
(9, 'pt_BR', 'openAccessPolicy', 'Esta revista oferece acesso livre imediato ao seu conteúdo, seguindo o princípio de que disponibilizar gratuitamente o conhecimento científico ao público proporciona maior democratização mundial do conhecimento.', NULL),
(9, 'pt_BR', 'privacyStatement', '<p>Os nomes e endereços informados nesta chamada serão usados exclusivamente para o processo de avaliação, não sendo disponibilizados para outras finalidades ou a terceiros.</p>', NULL),
(9, 'pt_BR', 'reviewGuidelines', '<p>Na próxima tela será disponibilizado o formulário para preenhimento, incluindo um campo de comentários.<br />Ao final será necessário selecionar sua <strong>recomendação</strong> e clicar no botão \"<strong>Enviar avaliação</strong>\".<br />Para <strong>projetos</strong>, as opções devem ser selecionadas entre \"<strong>Aprovado</strong>\" , \"<strong>Revisões requeridas</strong>\" ou \"<strong>Rejeitado</strong>\".<br />- <strong>Aprovado</strong> - finaliza o processo;<br />- <strong>Revisões Requeridas</strong> - ser´´a solicitado ao autor uma versão revisada do projeto para nova avaliação (durante o período disponível para as avaliações);<br />- <strong>Rejeitado</strong> - caso o avaliador entenda que revisões não serão suficientes para a aprovação do projeto.</p>', NULL),
(9, 'pt_BR', 'submissionChecklist', '[{\"order\":1,\"content\":\"Li e estou de acordo com as regras do edital do qual participo, disponível no site da ProPes.\"},{\"order\":2,\"content\":\"ESTOU CIENTE DE QUE O PROJETO NÃO DEVERÁ CONTER IDENTIFICAÇÃO DO ORIENTADOR E DO ALUNO.\"},{\"order\":3,\"content\":\"Estou ciente de que o processo de submissão do projeto somente estará finalizado após a correta anexação do arquivo contendo o projeto.\"},{\"order\":4,\"content\":\"Estou ciente de que a submissão do projeto deverá ser efetuada somente pelo orientador.\"},{\"order\":5,\"content\":\"Estou ciente de que o resumo do projeto deve ser informado em campo específico do sistema, agilizando o processo de avaliação\"},{\"order\":5,\"content\":\"Estou ciente de que, como orientador, irei me dispor a emitir pareceres a projetos de Iniciação Cientifica e seus respectivos relatórios parciais e finais, deste ou de outros editais, salvo apresentação de justificativa fundamentada por escrito, a qual será analisada pelo CPIC, podendo ou não ser aceita.\"}]', NULL),
