(11, 'pt_BR', 'authorInformation', 'Interessado em enviar para esta revista? Recomendamos que você analise a <a href=\"https://submissoesic.propes.ufabc.edu.br/index.php/ti/about\">About the Journal</a> página para as políticas de seção da revista, bem como as <a href=\"https://submissoesic.propes.ufabc.edu.br/index.php/ti/about/submissions#authorGuidelines\">Diretrizes para autores</a>. Autores precisam <a href=\"https://submissoesic.propes.ufabc.edu.br/index.php/ti/user/register\">registrar-se</a> com a revista antes de enviar ou, se já estiver registrado, pode simplesmente <a href=\"https://submissoesic.propes.ufabc.edu.br/index.php/index/login\"> fazer log in</a> e iniciar o processo de cinco etapas.', NULL),
(11, 'pt_BR', 'clockssLicense', 'Esta revista utiliza o sistema CLOCKSS para criar um sistema de arquivos distribuídos entre bibliotecas participantes e permite que tais bibliotecas mantenham cópias permanentes da revista para propósitos de preservação e recuperação. <a href=\"http://clockss.org/\">Saiba mais...</a>', NULL),
(11, 'pt_BR', 'librarianInformation', 'Encorajamos bibliotecários de pesquisa a listar este periódico entre os itens de periódicos eletrônicos de sua biblioteca. Além disso, pode ser interessante notar que o sistema de publicação de código aberto desta revista é adequado para as bibliotecas hospedarem seus professores para usarem com os periódicos envolvidos na edição (veja <a href=\"http://pkp.sfu.ca/ojs\">Open Journal Systems</a>).', NULL),
(11, 'pt_BR', 'lockssLicense', 'Este periódico utiliza o sistema LOCKSS para criar um sistema de arquivamento distribuído entre as bibliotecas participantes e permite que essas bibliotecas criem arquivos permanentes do periódico para fins de preservação e restauração. <a href=\"http://www.lockss.org/\">More...</a>', NULL),
