(11, 'pt_BR', 'privacyStatement', '<p>Os nomes e endereços informados nesta revista serão usados exclusivamente para os serviços prestados por esta publicação, não sendo disponibilizados para outras finalidades ou a terceiros.</p>', NULL),
(11, 'pt_BR', 'readerInformation', 'Incentivamos os leitores a se inscreverem no serviço de notificação de publicação deste periódico. Use o <a href=\"https://submissoesic.propes.ufabc.edu.br/index.php/ti/user/register\">Registrar</a> link na parte superior da página inicial da revista. Esse registro fará com que o leitor receba o Índice por e-mail para cada nova edição da revista. Essa lista também permite que o periódico reivindique um certo nível de suporte ou leitores. Veja a <a href=\"https://submissoesic.propes.ufabc.edu.br/index.php/ti/about/submissions#privacyStatement\">Declaração de privacidade da revista</a>, que garante aos leitores que seu nome e endereço de e-mail não serão usados para outros fins.', NULL),
