(12, 'pt_BR', 'lockssLicense', 'Este periódico utiliza o sistema LOCKSS para criar um sistema de arquivamento distribuído entre as bibliotecas participantes e permite que essas bibliotecas criem arquivos permanentes do periódico para fins de preservação e restauração. <a href=\"http://www.lockss.org/\">More...</a>', NULL),
(12, 'pt_BR', 'name', 'Edital X', NULL),
(12, 'pt_BR', 'openAccessPolicy', 'Esta revista oferece acesso livre imediato ao seu conteúdo, seguindo o princípio de que disponibilizar gratuitamente o conhecimento científico ao público proporciona maior democratização mundial do conhecimento.', NULL),
(12, 'pt_BR', 'privacyStatement', '<p>Os nomes e endereços informados nesta revista serão usados exclusivamente para os serviços prestados por esta publicação, não sendo disponibilizados para outras finalidades ou a terceiros.</p>', NULL),
(12, 'pt_BR', 'readerInformation', 'Incentivamos os leitores a se inscreverem no serviço de notificação de publicação deste periódico. Use o <a href=\"https://submissoesic.propes.ufabc.edu.br/index.php/email/user/register\">Registrar</a> link na parte superior da página inicial da revista. Esse registro fará com que o leitor receba o Índice por e-mail para cada nova edição da revista. Essa lista também permite que o periódico reivindique um certo nível de suporte ou leitores. Veja a <a href=\"https://submissoesic.propes.ufabc.edu.br/index.php/email/about/submissions#privacyStatement\">Declaração de privacidade da revista</a>, que garante aos leitores que seu nome e endereço de e-mail não serão usados para outros fins.', NULL),
(12, 'pt_BR', 'submissionChecklist', '[{\"order\":1,\"content\":\"Li e estou de acordo com as regras do edital do qual participo, disponível no site da ProPes.\"},{\"order\":2,\"content\":\"ESTOU CIENTE DE QUE O PROJETO NÃO DEVERÁ CONTER IDENTIFICAÇÃO DO ORIENTADOR E DO ALUNO.\"},{\"order\":3,\"content\":\"Estou ciente de que o processo de submissão do projeto somente estará finalizado após a correta anexação do arquivo contendo o projeto.\"},{\"order\":4,\"content\":\"Estou ciente de que a submissão do projeto deverá ser efetuada somente pelo orientador.\"},{\"order\":5,\"content\":\"Estou ciente de que o resumo do projeto deve ser informado em campo específico do sistema, agilizando o processo de avaliação\"},{\"order\":5,\"content\":\"Estou ciente de que, como orientador, irei me dispor a emitir pareceres a projetos de Iniciação Cientifica e seus respectivos relatórios parciais e finais, deste ou de outros editais, salvo apresentação de justificativa fundamentada por escrito, a qual será analisada pelo CPIC, podendo ou não ser aceita.\"}]', NULL);
