(73, 1048586, 72, 187, '2022-07-01 02:54:57', '2022-07-01 03:01:41', 'Documentos da Escola', '<p>Prezadas,&nbsp;</p>\r\n<p>Como não havia compreendido onde submeter na inscrição a documentação da escola, deixo em anexo nessa mensagem a Ficha de Inscrição da Aluna, a Autorização dos Pais e o Termo de Credenciamento da Escola, de modo a deixar com vocês a documentação para este cadastro</p>'),
(74, 1048586, 73, 165, '2022-07-02 00:20:49', '2022-07-02 00:20:49', NULL, NULL),
(75, 1048586, 74, 187, '2022-07-02 00:37:52', '2022-07-02 00:39:33', 'Condição do Projeto - Trocar de Bolsista para Voluntário', '<p>Prezadas,&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Embora eu tenha cadastrado esse projeto como bolsista, já havia acordado com o aluno que o projeto estaria como voluntário.&nbsp;</p>\r\n<p>Como posso alterar esse cadastro?</p>'),
