(102, 'pt_BR', 'abstract', '<p>O cobre é o terceiro metal de transição mais abundante no meio biológico, e é elemento essencial à manutenção da vida. Dado a sua capacidade redox bastante versátil dentre os elementos da primeira série de transição, o cobre pode assumir as mais diferentes formas geométricas de coordenação e consequentemente sua alta reatividade pode ser controlada desta forma. Assim, sendo um elemento endógeno, cujas células possuem plena capacidade de regulação e transporte, e possuindo uma atividade redox que pode ser controlada, o cobre pode ser usado como um potencial fármaco contra células cancerígenas, e exatamente isso tem sido feito nos últimos 30 anos. Nosso grupo tem feito de maneira sistemática estas modificações na esfera de coordenação do cobre tanto alterando-se os ligantes ao formar complexos ou alterando o delicado equilíbrio do metal no interior da célula de modo a simular alterações metabólicas, patologias relacionadas ao estresse oxidativo e neurodegenerações. Seguindo nossa linha de trabalho, neste projeto de IC são propostas a utilização de novos complexos de cobre(II) com ligantes de origem vegetal obtidos naturalmente a partir de extratos de plantas que foram sintetizados e caracterizados em nosso laboratório, em estudos de viabilidade celular. Para isso serão utilizadas linhagens de neuroblastomas em cultura celular 3D. Os modelos 3D serão preparados através de técnica de agitação controlada em estufa de cultivo, e os novos complexos serão testados em relação a capacidade de causar morte nos esferoides formados. Este projeto faz parte de projeto de pesquisa regular FAPESP, e compõe importante estudo para compor um estudo fase 2 dos melhores complexos com ação anticancerígena, além de introduzir no grupo a cultura celular 3D.&nbsp;</p>'),
(102, 'pt_BR', 'areaSubarea', 'Química; Bioquímica'),
