(103, '', 'categoryIds', '[]'),
(103, 'pt_BR', 'abstract', '<p><span style=\"font-weight: 400;\">Um dos grandes focos da neurociência contemporânea é determinar os correlatos neurais de processos cognitivos. Apesar das inúmeros avanços técnicos e ampla disponibilidade de dados experimentais em neurofisiologia — desde medidas macroscópicas como sinais de eletroencefalografia (EEG), até a atividade de sinapses individuais&nbsp; — consolidar toda esta informação na forma de princípios gerais e descrições mecanicistas tem se mostrado um desafio. Neste projeto, pretendemos empregar modelos computacionais para investigar a relação entre sinais corticais macroscópicos (eletroencefalografia, EEG) classicamente associados à detecção de novidade auditiva (</span><em><span style=\"font-weight: 400;\">Mismatch Negativity, MMN</span></em><span style=\"font-weight: 400;\">), e processos de adaptação observados a nível celular (</span><em><span style=\"font-weight: 400;\">Stimulus Specific Adaptation, </span></em><span style=\"font-weight: 400;\">SSA), através da simulação de redes de modelos neuronais biofísicos e processos de geração de campos elétricos extracelulares. Desta forma, será possível determinar as características dos sinais de EEG gerados por redes neuronais que comportam o fenômeno de SSA. Escolhendo então parâmetros de entrada talâmica compatíveis com um protocolo de novidade auditiva, pretendemos investigar se os fenômenos de </span><em><span style=\"font-weight: 400;\">SSA</span></em><span style=\"font-weight: 400;\"> e </span><em><span style=\"font-weight: 400;\">MMN</span></em><span style=\"font-weight: 400;\"> são na verdade manifestações de um mesmo processo, operando porém em escalas espaciais e temporais distintas.</span></p>'),
(103, 'pt_BR', 'areaSubarea', 'Neurociência; Audição; Modelagem'),
