(105, '', 'categoryIds', '[]'),
(105, 'pt_BR', 'abstract', '<p>O Exame Nacional do Ensino Médio (ENEM) refere-se ao instrumento de diagnóstico para balizar modificações no sistema pedagógico promovidas pela Lei de Diretrizes e Bases da Educação Nacional, 9.394/1996. No entanto, ao longo dos anos, esse objetivo primeiro foi transmutado para o enfoque atual: uso do resultado do ENEM para o ingresso em instituições público-privada do ensino superior.</p>\r\n<p>Anualmente, o INEP (Instituto Nacional de Estudos e Pesquisas Educacionais Aníısio Teixeira) provê resumos descritivos que retratam o perfil dos participantes e suas respectivas escolas. Porém, esses resumos não representam análises profundas capazes de suportar o objetivo original do ENEM.</p>\r\n<p>A reunião de análises sobre os resultados do ENEM possibilita a identificação de padrões ou correlações que explicitam oportunidades de aprimoramento da educação básica como um todo: o sistema pedagógico, os conteúdos e as disciplinas, a condição dos seus estudantes e professores. Portanto, estudos com esse mote são estratégicos para o desenvolvimento da educação no país. \\\\</p>\r\n<p>Baseados nessa perspectiva, a literatura apresenta vários estudos sobre diferentes aspectos do ENEM, incluindo o conteúdo das questões e o desempenho dos candidatos~\\cite{lima19}. Especificamente sobre a língua espanhola, interesse do presente trabalho, os estudos enfocam as estratégias de leitura dos participantes ou os fatores que os estudantes consideram na seleção da língua estrangeira~\\cite{moteler16}. Contudo, não identificamos estudos que analisam a influência das questões sócio-econômicas na seleção da língua espanhola.</p>\r\n<p>Para contribuir com a literatura acima, o objetivo do presente trabalho recai sobre a aplicação da inferência estatística para examinar se certas questões socio-econômicas (e.g., realização de curso de língua estrangeira ou cursinho) e o tipo da escola estão correlacionadas à seleção da língua espanhola nas provas do ENEM. Este trabalho adotará uma visão temporal ao analisar as variáveis acima mencionadas para os participantes que realizaram o ENEM entre os anos de 2010 e 2020 inclusive.</p>'),
