(106, 'pt_BR', 'abstract', '<p>A modelagem de banco de dados é essencial para suportar o desenvolvimento das aplicações e a melhoria dos processos empresariais com menores riscos. Essa atividade delimita um ramo dentro da área de banco de dados que congrega práticas, técnicas e fatores humanos inerentes ao ciclo de vida de projeto (ou engenharia) de bancos de dados corporativos. Tal ciclo é formado por três macro etapas que suportam o estabelecimento dos dados necessários a uma organização (Modelagem Conceitual), a representação (Modelagem Lógica) e a implementação eficiente (Modelagem Física) em qualquer tecnologia de Sistema Gerenciador de Banco de Dados (SGBD). </p>\r\n<p>Apesar do alto inter-relacionamento, a literatura de ensino da ciência da computação (e cursos correlatos) provê atenção distinta a cada ciclo do projeto de banco de dados. Enquanto inúmeros trabalhos contribuem com o ensino da modelagem conceitual por meio de abordagens pedagógicas diversas (e.g., aprendizado baseado em problemas, sistemas tutores inteligentes) a etapa de modelagem lógica desfruta de menor destaque. </p>\r\n<p>A etapa de modelagem lógica de dados é responsável traduzir as necessidades abstratas de dados de um universo de discurso (expressas no modelo conceitual) para uma ou mais tecnologias de SGBD. Essa etapa é composta por duas atividades primárias relevantes para a implementação de modelos de dados de boa qualidade, quais sejam a normalização e a transformação. De interesse do presente trabalho, a segunda atividade requer ponderar diferentes possibilidade de representação em uma tecnologia fundeado pelos requisitos e restrições de um universo de discurso. </p>\r\n<p>Durante algumas décadas, transformar consistia na conversão de um modelo conceitual para a sua representação lógica relacional (a tecnologia dominante) correspondente. A maturidade dessas regras de conversão alinhadas a uma parcial automatização oferecida por ferramentas CASE (Computer-aided Software Engineering) podem simbolizar a escassez no número de abordagens ou recursos pedagógicos no ensino dessa atividade.</p>\r\n<p>No entanto, abordagens tradicionais ou baseada em ferramentas CASE não externalizam claramente a conexão entre as decisões (e heurísticas) de transformação e seus resultados sobre os modelos de dados. A abordagem tradicional é fortemente dependente da proposta pedagógica do professor (e.g., forma de explanação, materiais) que pode simplificar ou pular passos decisórios. Já a segunda reduz tais decisões a um conjunto de parâmetros funcionais cujas conexões as necessidades do universo de discurso dependem do operador da ferramenta. </p>\r\n<p>Nesse cenário, faz-se necessário um recurso dinâmico para o ensino da atividade de transformação de um modelo conceitual de dados para um modelo lógico que ilustrem seus passos decisórios e seus resultados de modo espacial e temporal. Seu objetivo é permitir ao estudante construir uma representação mental mais adequada da referida atividade. </p>\r\n<p>Animações podem explicar o funcionamento de processos complexos o que está acontencendo e retratar o racional posterior aos processos porque está acontencendo. Em vista dessa capacidade, o objetivo do presente trabalho é desenvolver uma animação 2D interativa que explicite todos os passos decisórios da atividade de transformar um modelo conceitual para modelos lógicos destinados às tecnologias de SGBD relacional.</p>'),
