(110, 'pt_BR', 'abstract', '<p>Drogas antipsicóticas (APDs) são frequentemente usadas para o tratamento de sintomas comportamentais e psicológicos de algumas demências (<em>behavioral and psychological symptoms of dementia</em>, BPSD), especialmente a psicose e distúrbios comportamentais (por exemplo, agressão e agitação). Entre as drogas para o tratamento da doença de Alzheimer (DA), os inibidores da colinesterase (ChEIs, por exemplo, donepezil e galantamina) têm uma propensão a potencializar os efeitos colaterais extrapiramidais (EPS) induzidos pelas APDs, incluindo sintomas parkinsonianos (bradicinesia, acinesia, tremor e rigidez muscular), os quais são estudados em modelos animais por meio do teste da catalepsia, e do desempenho motor no teste do <em>rotarod</em>. Portanto, a escolha adequada do antipsicótico, determinar o intervalo das doses consideradas sem EPS, assim como a estratégia de combinação com os medicamentos utilizados na DA, termina sendo crucial na medicina para o tratamento dos BPSD. Também é possível identificar, que aqueles antipsicóticos com efeito ChEIs podem ajudar a estabilizar a função cognitiva nos pacientes com DA, além do seu efeito sobre os BPSD. Esse resultado sinérgico pode ser também explicado pelo efeito antimuscarínico das APDs, possivelmente bloqueando o receptor M2 (acoplados a uma proteína Gi/0, inibitória, que atua inibindo a&nbsp;adenilciclase), ou promovendo os efeitos terapêuticos da inibição da colinesterase (ChE) na DA. Assim, no presente estudo, pretende-se avaliar: (I) o efeito do antipsicótico típico haloperidol (Hal) sobre a atividade enzimática da colinesterase (ChE) no homogeneizado de proteínas de diferentes regiões do encéfalo de camundongos, com o interesse farmacológico na identificação deste &nbsp;antipsicótico com efeito ChEIs; (II) a atividade da ChE nas regiões do encéfalo de camundongos previamente tratados com o Hal, em diferentes doses consideradas terapêuticas, como estratégia para correlacionar se o efeito adverso da catalepsia estaria associada à inibição da ChE. Serão utilizados camundongos adultos (3 a 4 meses de idade) machos ou fêmeas de linhagem <em>Swiss</em> com maturidade sexual, provenientes do Biotério da UFABC. Inicialmente, os tecidos encefálicos (córtex pré-frontal, corpo estriado, septum, hipocampo, tronco encefálico, cerebelo e hipotálamo) de animais saudáveis serão coletados para obtenção do homogeneizado de proteínas solúveis. O efeito do Hal sobre a atividade da ChE será avaliado por reação colorimétrica, utilizando o método de Ellman. Em outro protocolo experimental, animais tratados com o Hal, dose cataléptica ou não, assim como o seu grupo controle serão utilizados para coletar os mesmos tecidos citados acima para avaliar a atividade da ChE. Os dados obtidos serão expressos por concentração do substrato hidrolisado por tempo de hidrólise em 1 min por peso do de cada região encefálica (µmol/min/g). As análises estatísticas serão realizadas com o auxílio do software Graph Prisma 5.0, utilizando o teste ANOVA de uma via com o pós-teste de Tukey.</p>'),
