(113, 'pt_BR', 'abstract', '<p>Os foguetes de sondagem não guiados são veículos espaciais que embarcam experimentos científicos e/ou sensores que tem por finalidade coletar dados durante sua trajetória e também são denominados foguetes sub-orbitais. Tais foguetes não possuem controle ativo e podem ultrapassar a atmosfera terrestre, mas não possuem energia suficiente para colocar um satélite em órbita.<br>É fundamental que os parâmetros relativos ao voo sejam devidamente analisados em seu projeto preliminar. Tais parâmetros estão diretamente relacionados com a análise da estabilidade do veículo durante o voo. Por consequência, esses fatores são críticos no que tange a missão do veículo espacial, uma vez que um foguete instável pode facilmente sair de sua rota programada.<br>O software de simulação de voo Open Rocket é um projeto de código aberto desenvolvido por Sampo Niskanen amplamente usado por entusiastas e equipes de foguetemodelismo no âmbito universitário. No entanto, o mesmo apresenta algumas limitações frente a sua documentação que não especifica os cálculos de parâmetros criticos para a estabilidade do foguete durante sua trajetória de voo. Em complemento, o software também não calcula os dados relativos à estabilidade dinâmica, este relacionado às correções que o sistema dará às pertubações durante a sua trajetória.<br>Sendo assim o presente projeto de pesquisa tem por finalidade elaborar um algoritmo para simular o voo de um foguete com 6 graus de liberdade no Matlab/ Simulink e posteriormente compará-lo com o Open Rocket. Tal abordagem permitirá mapear as limitações de ambos os softwares e documentá-las para suprir a demanda existente, assim como simular os parâmetros relacionados à estabilidade dinâmica.</p>'),
