(114, 'pt_BR', 'abstract', '<p>Este Projeto de Pesquisa de Iniciação Científica aborda o projeto de um controlador PID (Proporcional Integral Derivativo) para o posicionamento do eixo de um motor elétrico de corrente contínua (motor CC) implementado em ARDUINO. A metodologia de projeto do controlador PID é baseada na sintonia dos ganhos proporcional (P), integral (I) e derivativo (D), com base nos parâmetros do seu modelo matemático de nas especificações desejadas para a resposta transitória, tais como máximo sobressinal, tempo de pico e tempo de acomodação, para uma entrada de referência de ângulo em degrau. Considerando o fato de que este sistema é monovariável, linear e invariante no tempo e descrito por uma função de transferência de primeira ordem, resulta que os seus parâmetros são o ganho de malha aberta e a constante de tempo. Ambos os parâmetros do modelo matemático da planta podem ser determinados experimentalmente através da sua resposta transitória em malha aberta para entradas em degrau e em rampa. O foco principal deste Projeto de Pesquisa de Iniciação Científica será o estudo desta técnica de controle, a simulação computacional e a implementação experimental pelo discente com a possibilidade de aplicação no controle de atitude de um veículo controlado remotamente em estudos futuros.</p>'),
