(115, 'pt_BR', 'abstract', '<p>Segundo os dados coletados pelo Instituto Brasileiro de Geografia e Estatística (IBGE) de 2010, a dificuldade motora estava presente em 2,3% da população brasileira. A classificação de deficiência motora utilizada pelo Censo era quando o indivíduo respondia ter grande ou total dificuldade para andar ou subir escadas. Na pesquisa, o entrevistado poderia estar utilizando próteses, bengala ou aparelho auxiliar enquanto respondia seu grau de dificuldade. As próteses são estruturas que são formuladas de modo a ajudar o paciente a conseguir realizar a função do membro lesado, essa ajuda pode ser ministrada complementando o membro residual com a estrutura de auxílio ou substituindo o antigo membro pela prótese. Os objetivos desse projeto são primeiramente, realizar uma ampla revisão bibliográfica sobre o estado da arte referente à projeto estrutural: simulação e otimização de próteses e órteses para aplicação em humanos, bem com a seleção de estudos de casos práticos para tentativa de reprodução da metodologia. Em sequência, utilizar os dados/ modelos coletados na literatura e fazer estudos de casos envolvendo as técnicas de análise e otimização aplicáveis para o desenvolvimento de próteses e órteses. Em outras palavras, é objetivo do projeto tentar reproduzir as metodologias pesquisadas nas análises estruturais de próteses.</p>'),
