(116, 'pt_BR', 'abstract', '<p>A presente pesquisa tem como objetivo estudar o impacto do isolamento pela pandemia covid-19 em aspectos neuropsiquiátricos em crianças matriculadas no 1º ano do ensino fundamental e que retornaram à escola após o isolamento.</p>\r\n<p>O estudo será realizado em duas escolas municipais da Estância Turística de Ribeirão Pires, repetindo-se estudo anterior, realizado em 2012 na dissertação de mestrado de Fábia Cecília da Silva Amann no Programa de Pós-Graduação em Neurociência e Cognição. A seleção dos participantes será realizada de acordo com a pontuação obtida no Teste de Maturidade Mental Colúmbia.&nbsp; Em seguida, serão realizadas avaliações complementares e, após analisar os resultados, será feita a comparação com os resultados obtidos em estudo anterior (AMANN S.C.F., 2012), investigando se há evidências de alterações neuropsiquiátricas a partir do desempenho das crianças nos testes, após o isolamento social causado pela pandemia covid-19.</p>'),
(116, 'pt_BR', 'areaSubarea', 'Neurociencia; Cognição; Psicologia'),
