(117, '', 'categoryIds', '[]'),
(117, 'pt_BR', 'abstract', '<p>A utilização de turbinas eólicas para a obtenção de energia elétrica tem crescido, é atualmente uma das principais fontes renováveis mais utilizadas do planeta. Porém os custos de implantação seguem altos, além da necessidade de uma extensa área para o funcionamento do parque eólico ao utilizar turbinas eólicas horizontais. Enquanto as turbinas eólicas verticais necessitam de menor espaço para utilização, e possuem menor custo de fabricação. Assim surge a possibilidade de ampliação do uso da energia eólica através das turbinas verticais, em pequena e média escala, até mesmo em meio às cidades. Os objetivos do presente projeto de pesquisa são primeiramente e fazer uma revisão bibliográfica detalhada dos principais métodos de análise do projeto estrutural de turbinas eólicas verticais e, na sequência, a partir dos modelos selecionados nesta revisão da literatura, fazer estudos de casos envolvendo os métodos considerados, determinando as técnicas, ferramentas, critérios e condições de contorno de tais modelos. Dessa forma talvez aumentar as possibilidades de produção, com a utilização de diferentes materiais e métodos.</p>'),
(117, 'pt_BR', 'areaSubarea', 'Engenharia de Estruturas'),
