(118, 'pt_BR', 'abstract', '<p align=\"justify\"><span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\">Neste projeto de iniciação científica, o estudante, sob a supervisão do orientador, trabalhará no desenvolvimento de um código em que implementará o algoritmo de Monte Carlo para modelar a evolução temporal do preço de ativos financeiros – mais especificamente, ações – e a partir daí precificar as opções desses ativos recorrendo ao modelo de Black-Scholes-Merton. A finalidade do trabalho é, primeiro, simular a performance de operações que combinem duas ou mais opções, mais especificamente, das operações conhecidas como <em>vertical spreads</em>, ou operações de trava. Nesse tipo de operação, duas opções do mesmo tipo (calls ou puts) e com o mesmo vencimento são negociadas simultaneamente, uma das pontas sendo vendida e a outra comprada. Num segundo momento, os resultados das simulações, particularmente a probabilidade de lucro como função de parâmetros como a volatilidade do ativo subjacente, serão utilizados para treinar um modelo de Aprendizado de Máquina.</span></span></p>'),
