(120, 'pt_BR', 'abstract', '<p>Neste estudo será realizado a caracterização química de extratos das solanáceas (<em>Solanum jussiaei)</em> e caracterizações físico-químicas de <em>Solanum crinitum</em>, frutas ricas em alcaloides que veem demostrando importantes atividades biológicas em estudos de obesidade e contra doenças como artrites, arterocleroses, doenças cardíacas e câncer. Esse estudo é continuidade de um projeto que apontou duas famílias de alcaloides presentes em frutas do mesmo gênero, a fruta-do-lobo e o juá-açu, onde procura-se otimizar o processo de extração, assim como a caracterização química dessa nova fruta nas buscas de diferentes análogos. Finalmente com os extratos caracterizados pretende-se avaliar a atividade antioxidante dos mesmos.</p>'),
