(122, 'pt_BR', 'abstract', '<p>Este projeto propõe-se a realizar um estudo crítico e diacrônico da carta de Galileu Galilei (1564-1642) a Dom Benedetto Castelli (1578-1643), datada de 1613, e do texto “Considerações sobre a opinião copernicana”, escrito provavelmente em 1615. Embora haja um consenso sedimentado acerca da importância desses materiais para a compreensão sobre a relação entre ciência e fé por Galileu – especialmente da carta a Castelli –, não há, ainda, na literatura especializada produzida no Brasil, uma análise detalhada do conteúdo desses textos, especialmente no que tange à fundamentação teórica e conceitual da argumentação do filósofo natural italiano. Dessa maneira, a partir deste estudo, pretendemos compreender, como Galileu costurou sua defesa à filosofia natural e sua independência em relação ao conhecimento religioso. Levando em consideração as recentes descobertas sobre a carta de Galileu a Castelli, o projeto possui grande relevância historiográfica, além de possibilitar um aprofundamento do candidato na pesquisa em história da ciência.</p>'),
(122, 'pt_BR', 'areaSubarea', 'História da Ciência, História da Física'),
