(123, 'pt_BR', 'abstract', '<p>A família Orchidaceae é uma das famílias botânicas mais diversas, tanto em número de espécies, distribuição geográfica, como em caracteres citogenéticos. Os caracteres como o número cromossômico e o tamanho de genoma podem estar relacionados com aspectos ecológicos das espécies como o hábito. Uma vez que tais análises macroecológicas,integrando dados citogenéticos e ecológicos, dependem obrigatoriamente de um <em>background </em>evolutivo que só pode ser oferecido por hipóteses filogenéticas robustas, este projeto visa utilizar o levantamento de dados citogenéticos e a filogenia obtida de tribos da subfamília Epidendroideae [projetos PDPD (2020-2021) e PIBIC (2021-2022)] para analisar as associações entre número cromossômico, tamanho de genoma e hábito nessas espécies empregando sempre a correção filogenética. Adicionalmente, este projeto visa disponibilizar os dados obtidos criando um banco de dados virtual.</p>'),
(123, 'pt_BR', 'areaSubarea', 'Biodiversidade & Ciências Biológicas / Genética'),
