(124, '', 'categoryIds', '[]'),
(124, 'pt_BR', 'abstract', '<p>Neste projeto o estudante deverá aprender a utilizar geradores de eventos para simular reações em aceleradores de partículas, em particular no colisor LHC do CERN. Reações bem conhecidas, como a produção do bóson <em>Z<sup>0</sup></em> e de jatos hadrônicos, deverão ser simuladas e comparadas entre as diversas etapas da simulação. Através da realização deste projeto deverá ser adquirida habilidade na utilização dos geradores Madgraph, Pythia e Delphes, bem como na ferramenta a ser utilizada para a análise dos dados gerados, o ROOT.</p>'),
