(125, '', 'categoryIds', '[]'),
(125, 'pt_BR', 'abstract', '<p>Este projeto tem como recorte temático as reflexões morais do filósofo Paul-Henri Thiry d\'Holbach, eternizado pela história da filosofia como o Barão d’Holbach (1723-1789), mais precisamente a sua crítica aos valores e às normas de comportamento e convivência vigentes na sua Europa do século XVIII e a relação do seu materialismo ateu com as ideias de virtude e felicidade, tendo como base duas de suas obras fundamentais, o Sistema da natureza, de 1770, e A moral universal, de 1776.</p>'),
