(126, 'pt_BR', 'abstract', '<p>A demanda por otimizações em projetos de engenharia é cada vez maior, assim sendo uma<br>prática cada vez mais presente no cotidiano de engenheiros. Um poderoso conceito, comumente<br>chamada de otimização estrutural, é amplamente utilizada para a criação e fabricação de estruturas<br>cada vez mais eficientes estruturalmente, assim como o uso de materiais compósitos. Tendo em<br>vista estes fatores, os objetivos do presente projeto de pesquisa são, primeiramente, realizar uma<br>revisão bibliográfica detalhada acerca de materiais compósitos e, posteriormente, a partir do<br>conteúdo absorvido nessa revisão da literatura, realizar estudos de casos práticos envolvendo as<br>técnicas de análise, simulação e otimização de estruturas aeroespaciais em materiais compósitos.</p>'),
