(131, 'pt_BR', 'abstract', '<p>Existem várias semelhanças entre a dinâmica dos buracos negros e a termodinâmica. Um importante paralelismo é o que ocorre entre a área do horizonte de eventos de um buraco negro com a entropia: ambas quantidades aumentam de forma irreversı́vel. Entretanto, existem outras analogias que podem ser demonstradas e associadas a relações termodinâmicas. Conforme sugerido por Bekenstein [1], tal analogia é possı́vel devido às semelhanças de comportamento entre as variáveis termodinâmicas (energia, entropia, volume, temperatura, pressão, ...) e as variáveis dinâmicas do buraco negro (massa, área, momento angular, gravidade superficial, ...). Além disso, foi mostrado por Hawking [2, 3] que um buraco negro emite radiação com uma temperatura caracterı́stica, proporcional à gravidade superficial do horizonte de eventos, como se fosse um corpo negro. Como consequência disso, foi demonstrado que a relação entre área do buraco negro e a sua entropia é mais do que uma analogia. Estas quantidades são de fato proporcionais e o modelo desenvolvido inicialmente como uma analogia torna-se um modelo teórico fisicamente bem fundamentado, constituindo a termodinâmica dos buracos negros. Assim, pode-se usar a já conhecida teoria termodinâmica para investigar um novo sistema, um buraco negro. Para estudar a termodinâmica dos buracos negros é necessário ter o conhecimento de vários conceitos e o domı́nio de algumas técnicas empregadas na termodinâmica clássica. Por isso, o projeto prevê uma revisão<br>dos principais tópicos da termodinâmica para, em seguida, fazer-se uma análise da dinâmica dos buracos negros conhecidos, iniciando com o buraco negro de Schwarzschild, mais simples, até analisar a famı́lia completa de buracos negros de Kerr-Newman [4]. Esta etapa será feita verificando as relações termodinâmicas relevantes, bem como interpretando o significado fı́sico das funções mais importantes, sem entrar nos detalhes que dependem de métodos avançados de análise dentro da teoria da relatividade geral. Por último, propõe-se analisar uma nova solução de buraco negro, num espaço-tempo assintoticamente anti-de Sitter, derivando as relações termodinâmicas para o mesmo, analisando suas propriedades em comparação com o buraco negro de Kerr-Newman.</p>'),
