(135, 'pt_BR', 'abstract', '<p style=\"font-weight: 400;\">Uma questão importante ao se tratar dos estudos de grupos de estrelas jovens é a mistura de possíveis membros do aglomerado com componentes do fundo da galáxia, bem como o estudo de parâmetros de massa e idade para os membros. Em trabalhos anteriores (Gregorio-Hetem 2015, 2019) foram desenvolvidos algoritmos que utilizaram de técnicas de inteligência artificial (como os algoritmos genéticos) para atribuir para cada uma das estrelas estudada uma probabilidade de pertinência ao grupo, ou possíveis subgrupos, utilizando como critério os parâmetros de velocidade e posição das fontes. Em posse dos valores de pertinência é possível medir o parâmetro fractal <em>Q</em> (Cartwright &amp; Whitworth 2004) e investigar sua relação com as propriedades de agrupamento e evolução dos membros, bem como realizar o estudo das massas e idades das estrelas através da construção do diagrama cor-magnitude (DCM) para os aglomerados. Anteriormente, pesquisas já publicadas (Gregorio-Hetem 2019, Yamanaki &amp; Hetem 2020) derivaram os parâmetros de massa e idade das estrelas através do método de ajuste (<em>fitting</em>) no DCM proposto por Bonatto (2019), que se baseia na sobreposição e comparação do diagrama de cor-magnitude (plotado para os membros) e os modelos teóricos evolutivos e isócronas providenciados pelo modelo PARSEC, por Bressan et al (2012) e Marigo et al (2017). Neste projeto, pretende-se realizar uma análise de um conjunto de aglomerados, que passaram por análises semelhantes em Gregorio-Hetem (2019), com o propósito de investigar propriedades de agrupamento e evolução dinâmica de seus membros estelares. Além do parâmetro Q&nbsp;medido para os grupos, e suas respectivas correlações com a dimensão fractal, pretende-se otimizar o processo de ajuste dos dados aos modelos evolutivos PARSEC através do método de interpolação de <em>splines</em> cúbicas para derivação de valores mais precisos de massa e idade para os membros no DCM. As propriedades acima discutidas podem levar a conclusões sobre as condições iniciais de formação dos aglomerados, evolução inicial e evolução dinâmica galáctica, bem como idade e massa () para os aglomerados, além da segregação de massa dinâmica .</p>'),
