(136, 'pt_BR', 'abstract', '<p style=\"font-weight: 400;\">Este projeto pretende desenvolver estudos baseados na bibliografia especializada e em modelos computacionais para criar um simulador um foguete estagiado, com o objetivo de desenvolver uma ferramenta didática. Um foguete a estágios é um veículo que utiliza duas ou mais etapas, cada uma das quais contém seus próprios motores e propulsores. O resultado efetivo equivale dois ou mais foguetes que, tomados em conjunto, são muitas vezes chamados de veículo de lançamento. Foguetes de dois foguetes estágios são muito comuns, mas já foram utilizados veículos lançadores de até cinco estágios. O descarte dos estágios inferiores (já exauridos) reduz a massa do foguete, o que possibilita às etapas restantes acelerar mais facilmente o foguete à sua velocidade final e altitude. Este trabalho reúne os eixos do projeto pedagógico da UFABC, buscando importantes aspectos da formação de um engenheiro aeroespacial: criatividade e inovação, orientação de aplicação, prática do trabalho em equipe, sistêmico e colaborativo e a imersão na diversidade acadêmica e cultural.</p>'),
