(138, 'pt_BR', 'abstract', '<p>O consumo de energia elétrica no Brasil, de acordo com a Empresa de Pesquisa Energética (EPE), estatal vinculada ao Ministério de Minas e Energia, apresentou um crescimento considerável nos últimos anos, principalmente em função do progresso<br>econômico e tecnológico. Em contrapartida surgem as fontes de energias renováveis, como a solar, eólica e hidrelétrica, que promovem a sustentabilidade e possuem potencial para atender a demanda energética. Compreender e modelar a conversão de energia eólica (energia cinética dos ventos) em energia elétrica é de extrema importância para prever e avaliar a potência que pode ser gerada num parque eólico. Há modelos matemáticos, implementados em recursos computacionais, para o estudo desta conversão, entre eles o FAST, gratuito, disponibilizado pelo NREL.<br>O presente estudo visa avaliar o uso de modelos para estudar a dinâmica eletromecânica desta conversão de energia, agregando conhecimento acerca da história da geração eólica, sua expansão, tecnologias e obstáculos, tipos de aerogeradores e suas propriedades, conversão e qualidade de energia e desafios da integração da mesma na rede elétrica. Fundado nisso será feita, por meio de revisão bibliográfica e estudo do FAST, uma análise desses transitórios por meio da simulação de aerogeradores.&nbsp;</p>'),
