(139, 'pt_BR', 'abstract', '<p>O uso de paraquedas se tornou essencial para a recuperação de veículos espaciais e<br>envio de suprimentos para regiões de difícil acesso, porém seu desenvolvimento envolvendo<br>testes empíricos é custoso e demorado, visto que variam desde a ancoragem do paraquedas<br>a veículos civis até a utilização de foguetes de sondagem. Buscando contornar essa<br>limitação, pesquisadores e empresas buscam métodos computacionais, como por exemplo,<br>a análise por elementos finitos ou outras abordagens mais simplificadas como modelos de<br>massa-mola. O presente projeto realizará em primeira instância a revisão bibliográfica dos<br>fundamentos do desenvolvimento de paraquedas, métodos utilizados para sua simulação<br>computacional e aplicações preliminares baseadas em estudos de casos com os métodos<br>selecionados.</p>'),
