(140, 'pt_BR', 'abstract', '<p>Neste projeto o estudante deverá utilizar geradores de eventos para simular a produção de Matéria Escura em reações envolvendo aceleradores de partículas, em particular no colisor LHC do CERN. Estas reações deverão ser simuladas utilizando-se geradores e simuladores de eventos MadGraph, Pythia e Delphes, sendo posteriormente analisadas utilizando-se ROOT.</p>'),
