(141, 'pt_BR', 'abstract', '<p><span style=\"font-weight: 400;\">A família Orchidaceae é uma das famílias botânicas mais diversas, tanto em caracteres citogenéticos, morfológicos, como ecológicos. Orchidaceae é a maior entre as famílias de angiospermas, compondo um importante componente da flora do Neotrópico, além de ser reconhecida por apresentar altos níveis de complexidade nos mecanismos de reprodução e morfologia vegetativa e floral, sendo a última muito importante para definição taxonômica dos clados. Dentre os clados que passaram por diversos realinhamentos taxonômicos está a tribo Vandeae (subfamília Epidendroideae), clado composto por cerca de 2.000 espécies distribuídas em três subtribos, estas recentemente circunscritas. Após as buscas de literatura para a tribo e dos seus dados citogenéticos (números cromossômicos e tamanho do genoma) que compôs um banco de dados e permitiu a construção de uma filogenia, o presente projeto visa reunir as informações obtidas e relacioná-las com o hábito de cada espécie com o uso de análises macroevolutivas e macroecológicas. Responder as possíveis correlações entre as variáveis citogenéticas e as de hábito ecológico fazendo regressões logísticas do passado evolutivo destas Angiospermas. &nbsp; </span></p>'),
(141, 'pt_BR', 'areaSubarea', 'Ciências Biológicas - Genética vegetal / Biodiversidade'),
