(147, 'pt_BR', 'abstract', '<div class=\"page\" title=\"Page 1\">\r\n<div class=\"layoutArea\">\r\n<div class=\"column\">\r\n<p>Quadratizations of pseudo-Boolean functions have been established in recent years as a very successful tool in the solution of very large binary optimization problems. Despite some good efforts and some nice results published about the structure and complexity of quadratizations, many of their theoretical aspects remain poorly understood. This is even more so regarding the class of Submodular pseudo-Boolean functions, where fewer results are known. Due to the vast importance of submodular functions in discrete optimization, we propose the beginning of a systematic investigation of submodular quadratizations of submodular functions and their extensions.</p>\r\n</div>\r\n</div>\r\n</div>'),
(147, 'pt_BR', 'areaSubarea', 'Ciência da Computação; Otimização; Teoria da Computação'),
