(148, '', 'categoryIds', '[]'),
(148, 'pt_BR', 'abstract', '<div class=\"page\" title=\"Page 2\">\r\n<div class=\"section\">\r\n<div class=\"layoutArea\">\r\n<div class=\"column\">\r\n<p>Os materiais de divulgação das universidades são importantes meios de comunicação e diálogo entre instituição e sociedade. Tais produções visam aproximar jovens estudantes do ensino superior, buscando apresentar o perfil da instituição tanto do ponto de vista dos cursos de graduação, quanto das pesquisas desenvolvidas. Esses materiais buscam, assim, engajar grupos historicamente excluídos de diferentes culturas e contextos políticos. Nesse sentido, o presente trabalho pretende utilizar a metodologia comparada para analisar duas instituições que procuram incorporar tais premissas em seus materiais: Hasselt University (Bélgica) e Universidade Federal do ABC (Brasil). Pretende-se com esse trabalho compreender como o discurso apresentado nesses documentos contemplam e promovem a inclusão de diferentes culturas em seus materiais, assim como, as diferentes abordagens associadas aos contextos sociais dessas instituições.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>'),
