(149, 'pt_BR', 'abstract', '<p>A criptografia é a ciência que estuda as possı́veis transformações de uma mensagem para que, quando transmitida por um canal inseguro, só possa ser interpretada pelo destinatário. A crip tografia, que existe desde que existem segredos, não é mais para uso exclusivo de governantes ou militares. Hoje a criptografia faz parte do nosso dia a dia. Foi o uso de computadores e o nascimento<br>das primeiras redes que impulsionaram a extraordinária expansão dos métodos criptográficos nos últimos 40 anos. Toda vez que fazemos compras online ou utilizamos nosso certificado digital para realizar um procedimento administrativo, estamos usando métodos criptográficos. Nosso dinheiro ou a confidencialidade de nossos dados pessoais dependem de que todos os processos envolvidos sejam suficientemente seguros. O objetivo do projeto é fazer uma aproximação aos principais algoritmos<br>criptográficos utilizados atualmente, com foco nos algoritmos assimétricos, mais especificamente o RSA, suas fraquezas e as curvas elı́pticas.<br>O projeto constará de três etapas: uma primeira etapa de estudo introdutório sobre criptografia<br>geral, uma segunda etapa sobre o estudo de criptografia assimétrica e uma última etapa com foco<br>especial no RSA, suas fraquezas, algoritmos de fatoração e curvas elı́pticas como alternativa ao RSA.<br>Também revisaremos brevemente o conceito de assinatura digital e alguns algoritmos de assinatura<br>digital baseados em criptografia assimétrica.</p>'),
