(150, 'pt_BR', 'abstract', '<p>O ácido kójico (AK) é um metabólito secundário produzido por fungos e bactérias, que ao realizarem a fermentação aeróbica, utilizam os carboidratos como substrato, sendo aplicado em várias áreas, como alimentícia, industrial, agrícola, de cosméticos e da saúde. O AK apresenta propriedades biológicas conhecidas como a capacidade de inibição da produção da tirosinase e, consequentemente, de melanina, auxiliando no tratamento de hiperpigmentações.<strong> Além disso, outro mecanismo molecular de ação desse bioativo envolve a inibição de vias intracelulares associadas à progressão da inflamação, </strong>tornando-o uma molécula promissora para aplicações no tratamento de dermatoses inflamatórias, considerando investigações anteriores que discutiram sua utilização no tratamento de inflamações intestinais. Vale ressaltar ainda, a possibilidade de integração do eixo intestino-pele, envolvido em muitas patologias inflamatórias, o que ressalta futuras investigações nesse campo. Nesse sentido, a abordagem tecnológica desta proposta refere-se ao desenvolvimento de diferentes formulações de hidrogéis a partir de componentes obtidos por rotas biotecnológicas, desde o bioativo, AK, produzido por fungos, às matrizes formadoras de géis, como polímeros e proteínas. Especificamente, em relação às matrizes-gel produzidas, essa proposta visa a obtenção de sistemas coloidais capazes de reter grandes quantidades de água e incorporar moléculas hidrofílicas como o AK, além de apresentarem propriedades bioadesivas e mecânicas adequadas à aplicação tópica. Outros fatores a serem ressaltados envolvem as propriedades farmacológicas inerentes aos componentes da matriz-gel, como cicatrizantes e antiinflamatórios, o que destaca a possibilidade de ações sinérgicas entre os componentes da formulação final.&nbsp;</p>'),
