(151, '', 'categoryIds', '[]'),
(151, 'pt_BR', 'abstract', '<p>A utilização de drogas lícitas e ilícitas, como o álcool e a cocaína, durante a gestação humana pode induzir efeitos nocivos no desenvolvimento embrionário e fetal e pode repercutir permanentemente sobre os indivíduos afetados, sendo por este motivo essas substâncias definidas como teratogênicas. Isso ocorre porque essas substâncias conseguem atravessar a barreira placentária, causando alterações congênitas que variam de acordo com o estágio de desenvolvimento no momento da exposição, dose e tempo de exposição associados ao genótipo do embrião. O período mais sensível à indução de defeitos congênitos é o embrionário, na qual cada um dos três folhetos dá origem a seus próprios tecidos e sistemas orgânicos, podendo cada sistema ter um ou mais estágios de suscetibilidade. Esta é também a fase onde o embrião ganha forma, ou seja, ocorre a modelagem do corpo até que se possa distinguir as características da espécie, no caso, um ser humano. Na fase fetal, a susceptibilidade à teratogênese diminui, mas pode ocorrer a perturbação funcional do feto e, eventualmente, causar a morte do embrião. O consumo de drogas durante a gestação e seus efeitos adversos é um problema de saúde pública e a informação a respeito não é acessível à população leiga. Dito isso, este trabalho objetiva, realizar uma revisão narrativa sobre os efeitos teratogênicos de drogas lícitas e ilícitas em humanos através de um levantamento bibliográfico feito após análise dos textos e ponderação científica, selecionando a ideia principal de cada trabalho pesquisado além de tornar acessível a informação ao público geral.</p>'),
