(152, 'pt_BR', 'abstract', '<p>A nanotecnologia é a ciência que estuda materiais em escala nanométricas (10<sup>-9</sup>m) e tem tido grande atenção sobretudo após o isolamento e caracterização de diversas nanoestruturas como grafeno, fulereno e nanotubos. Em particular o grafeno é um grande alvo de estudos nas últimas duas décadas devido as suas incríveis propriedades mecânicas, térmicas e eletrônicas. Em razão dessa grande atenção, novas nanoestruturas têm sido propostas com base na adição de elementos diferentes do carbono, por meio da funcionalização destas estruturas. A partir destes novos materiais e da funcionalização se torna possível a obtenção de nanoestruturas com novas propriedades ajustadas mediante as funções desejadas. Neste projeto estudaremos a dinâmica de hidrogenação utilizando dinâmica molecular atomística completamente reativa do Octagrafeno e sua influência mecânica sobre tensão pós-adsorção de hidrogênio utilizando a Dinâmica Molecular reativa totalmente atomística.</p>'),
