(153, 'pt_BR', 'abstract', '<p>O pensamento desenvolvimentista de Celso Furtado (1920-2004) destaca-se<br>pela originalidade do método que utilizou. Dentre suas maiores contribuições,<br>está a percepção de que o subdesenvolvimento econômico é um fenômeno<br>autônomo, e não uma etapa para o desenvolvimento. Fatores como<br>dependência tecnológica e padrões de consumo miméticos são marcas do<br>subdesenvolvimento, não havendo superação dessa condição sem que haja<br>uma ação intencional e politicamente direcionada. A teoria do<br>subdesenvolvimento de Furtado também tem como eixo a noção de<br>“dependência cultural”, entendida pioneiramente pelo autor como uma das<br>limitações à tomada de consciência que levaria à mudança social efetiva de<br>rompimento com o subdesenvolvimento. Essa perspectiva sobre o lugar da<br>cultura tem como importante marco os textos de Criatividade e Dependência na<br>Civilização Industrial (1978) e foi amadurecida pelo autor ao longo de obras<br>posteriores. Por outro lado, é possível pensar que a noção de dependência<br>cultural sempre fez parte do pensamento do autor, sendo importante para<br>compreender seus textos das décadas de 50, 60 e 70. Nesse sentido, o<br>presente projeto propõe a análise atenta de cinco obras do autor escritas nesse<br>período, estabelecendo como objetivo verificar se havia nelas os elementos<br>sobre cultura que adiante se tornariam centrais para o autor.</p>'),
