(154, 'pt_BR', 'abstract', '<p>Os eventos de inundação, enchentes e alagamentos estão cada vez mais presentes no cotidiano dos habitantes da Região Metropolitana de São Paulo (RMSP) e ações antrópicas de expansão urbana com ocupação das várzeas dos rios, sem o planejamento necessário contribuem para um aumento dessas situações. Considerando este cenário, percebe-se que existe a necessidade de um mapeamento e gerenciamento das cotas dos corpos hídricos, que interagem com a área urbana, para monitoramento que sirva para a elaboração de sistemas de alertas e planos de contingência eficientes, com a finalidade de melhorar a qualidade de vida dos habitantes dessa região. Este projeto tem como objetivo geral a determinação de cotas de referência para situações hidrológicas anômalas, como inundações e enchentes, e as chuvas deflagradoras, para a sub-bacia do Guarará localizada no município de Santo André. Serão analisados os dados de nível de cota da sub-bacia para o período de 2011 a 2021 e elaborado a sua curva de permanência para determinação de cenários de referência de atenção, alerta e emergência (inundação). Após a primeira análise, serão validados os dados obtidos com os registros de ocorrência na Defesa Civil de Santo André, e posteriormente será realizada uma etapa de relação entre os dados de precipitação extrema e o evento de inundação.</p>'),
