(157, 'pt_BR', 'abstract', '<p><span style=\"font-weight: 400;\">Esse projeto observa a necessidade da atenção da comunidade acadêmica à saúde mental de seus discentes, visto como muitos apresentam complicações com a saúde mental. Hoje, grande parte dos estudos relacionados ao tema são dos chamados países desenvolvidos e tem seu foco principal em estudantes universitários, grupo já associado com melhores condições financeiras. Há a necessidade de estudos mais amplos de diferentes países com seus respectivos cenários socioeconômicos, fator destacado quando observamos problemas de saúde mental mais evidentes nas poucas pesquisas de países em desenviolvimento quando comparadas aos estudos de países desenvolvidos. Diante disso, o objetivo principal do projeto é fazer um levantamento da saúde mental de estudantes de diferentes graus de escolaridade do Brasil, criando assim um estudo com potencial de agregar às pesquisas existentes e possibilitar uma melhor compreensão sobre o tema no cenário de um país latino-americano em desenvolvimento.</span></p>'),
