(158, 'pt_BR', 'abstract', '<p>O sangue representa cerca de 7% do peso corporal de um indivíduo, sendo constituído de plasma e células especializadas em suspensão, com função essencial de transporte de substâncias. A viscosidade do sangue depende basicamente de quatro fatores: influência do hematócrito, influência da temperatura, diâmetro do vaso e axialização das hemácias. Os valores encontrados para a viscosidade sanguínea tendem a aparecer com diferenças significativas, de acordo com o sexo, avançar da idade, uso de substâncias, hidratação, temperatura ambiente. Pelo fato do sangue ser um fluido não newtoniano, não podemos expressar sua viscosidade em termos absolutos sem que sejam levadas em conta as condições em que a mensuração é feita. A prática médica carece ainda de um método simples para a verificação desta medida, como um marcador inicial para prevenção de problemas vasculares e mesmo cognitivo, para tanto se faz necessário determinar valores de referência, bem como, a descrever de forma detalhada a metodologia empregada para aquisição desta medida. Estudos anteriores destacaram a importância desta medida, considerando o efeito da idade, o uso de substâncias, bem como sua relação com Fluxo Sanguíneo Regional Cerebral.&nbsp; O uso do viscosímetro rotacional com sistema cone/plate modelo DV-III Ultra permite utilizar o sangue total, apresentando como vantagem o controle da temperatura na cuba de medição onde o material é inserido. Além deste controle, é necessário padronizar os procedimentos e condições do processo de medição, para que os valores encontrados em pacientes possam ser comparados de forma efetiva a valores de referência (a ser determinado a partir desta técnica). Portanto, este trabalho representa um primeiro passo para que as utilizações dos valores de viscosidade sanguínea para a prática clínica.</p>'),
