(159, 'pt_BR', 'abstract', '<p>O xadrez é um esporte, que exige alta demanda cognitiva, que força os seus jogadores a<br>terem uma ativação de diversas regiões do cérebro. Estudos anteriores, como o de (Bilalić et<br>al.), mostraram uma relação entre a experiência dos jogadores de xadrez e a percepção do<br>tabuleiro e do jogo. Os jogadores possuíam uma visão do tabuleiro de acordo com a função<br>das peças e posição dentro do jogo, algo responsável pelos melhores resultados nas tarefas<br>de percepção relacionadas ao xadrez em comparação com jogadores novatos. O estudo foi<br>investigado por FMRI, o qual permite verificar características morfofisiológicas e ativação de<br>regiões do cérebro, com o empecilho da dos experimentados terem que ficar parados para<br>evitar possíveis interferências. Dito isto, o presente estudo tem o objetivo de replicar o<br>experimento de Renning et. al em 2013, com o uso de fNirs, cujo possui funcionalidades<br>semelhantes e mais flexibilidade para o movimento, permitindo que os jogadores tenham<br>uma experiência mais próxima da realidade</p>'),
