(160, 'pt_BR', 'abstract', '<p>As pulseiras inteligentes são dispositivos vestíveis frequentemente usadas para monitorar a atividade física e o estado de saúde das pessoas. Também podem ser usadas para monitoramento de problemas relacionados à saúde. Nesse contexto, o presente projeto tem como objetivo desenvolver um método extração de parâmetros em pulseiras inteligentes</p>'),
