(161, 'pt_BR', 'abstract', '<p>A <em>Curcuma longa </em>é um arbusto perene endêmico da Índia e os rizomas são amplamente utilizados em práticas culinárias e medicina tradicional. O rizoma é desidratado e moído, gerando um pó de coloração dourada. As atividades terapêuticas conhecidas da cúrcuma têm sido atribuídas aos compostos polifenólicos, os curcuminoides. O curcuminoide mais abundante no rizoma é a curcumina e a estrutura desta molécula, juntamente com as propriedades biológicas já conhecidas, tem despertado o interesse em realizar a prospecção de novas moléculas análogas para então realizar diferentes estudos de investigação biológica. A metodologia clássica para a reação de condensação que possibilita obter os análogos da curcumina de interesse deste projeto (curcuminoides monocetônicos) é a reação de condensação de Claisen-Schmidt. A proposta deste trabalho visa dar continuidade ao desenvolvimento de uma nova metodologia para a reação empregando pentacloreto de nióbio (NbCl<sub>5</sub>) como catalisador sólido ácido, possibilitando uma série de vantagens da catálise heterogênea. A aplicação de reagentes de nióbio na pesquisa em síntese orgânica é de alta viabilidade, pois no Brasil encontra-se a maior jazida de nióbio do mundo. Em trabalhos prévios do grupo de pesquisa, foi possível realizar a extração e caracterização da curcumina, além de realizar a síntese de três curcuminoides de interesse. No presente trabalho, serão preparados diferentes curcuminoides e, em alguns casos, em quantidades adequadas para estudos <em>in vivo</em>. Além dos ensaios biológicos contra a doença parasitária esquistossomose, estudos de aplicação em sistemas de liberação de fármacos foram propostos em colaboração com outros pesquisadores.</p>'),
