(163, 'pt_BR', 'abstract', '<p><span style=\"font-weight: 400;\">O fenômeno da corrosão eletroquímica, com suas diversas formas, causa grande preocupação em inúmeras áreas da engenharia. A corrosão por frestas é uma forma de corrosão localizada, geralmente associada a uma solução estagnada em micro regiões, que ocorre com grande frequência em dispositivos metálicos implantáveis. O aço inoxidável austenítico AISI 316L é uma liga metálica frequentemente aplicada como biomaterial, principalmente como placas de fixação e parafusos. A presente proposta visa estudar o mecanismo de corrosão por frestas no aço AISI 316L, em solução salina de 0,9% NaCl, por meio de ensaios de corrosão por frestas associados a polarização potenciodinâmica.</span></p>'),
