(164, 'pt_BR', 'abstract', '<p>Doenças cardiovasculares representam a principal causa de morte em pacientes com doença renal aguda e crônica. Desta forma, a relação entre disfunção cardíaca e renal tem sido bem estudada por mais de um século, onde essa interação órgão-órgão leva à definição bem conhecida de síndrome cardiorrenal (SCR). Diversos estudos se empenharam em caracterizar a fisiopatologia da SCR do tipo 3, ou síndrome renocárdica aguda, na qual a lesão renal aguda (LRA) leva à disfunção cardíaca aguda. Consequentemente, é sabido que a síndrome cardiorrenal gera quadros inflamatórios sistêmicos e que vesículas extracelulares podem estar envolvidas na comunicação patológica entre os rins e o coração. Portanto, as EVs presentes no plasma podem ter papéis significativos em doenças renais, bem como biomarcadores da própria SCR, os fatores de risco para o desenvolvimento de complicações, bem como os fatores de reparo ou proteção que difundem sinais de estresse prejudiciais e, finalmente, seus fatores terapêuticos, sendo parte do problema e parte da solução. Sabendo-se, assim, que estudos detalhados sobre o conteúdo das EVs na SRC são escassos, o uso de ferramentas de precisão para detecção de novos biomarcadores, bem como o desenvolvimento de novas tecnologias capazes de identificá-los em tempo real com o menor custo possível, se faz necessário. Desta forma, estudos recentes também mostraram que a quantificação de proteínas baseada em espectroscopia de IR pode ser adaptada com sucesso à prática experimental para analisar EVs. Assim, o presente estudo visa realizar, através do modelo de isquemia e reperfusão renal (I/R), unilateral, por 60 minutos, seguido de 8 dias de reperfusão renal em camundongos C57BL/6 machos, o isolamento e caracterização das vesículas presentes nos soros dos animais isquemiados e não isquemiados utilizando Espectroscopia de Infravermelho com Transformada de Fourier (FTIR), bem como as análises dos espectros por Análise dos Componentes Principais (PCA) e Análise de Cluster (CLA).</p>'),
