(165, '', 'categoryIds', '[]'),
(165, 'pt_BR', 'abstract', '<div class=\"page\" title=\"Page 2\">\r\n<div class=\"layoutArea\">\r\n<div class=\"column\">\r\n<p>Um dos principais pilares da Cosmologia Moderna é o Princípio Cosmológico, que afirma que em escalas de comprimento suficientemente grandes, a matéria no universo é distribuída de maneira homogˆenea e isotrópica. Este conceito aparenta carregar um “idealismo” que pode não necessariamente estar presente no universo. De fato, recentes observações [R.G. Clowes et al., Monthly Notices of the Royal Astronomical Society <strong>429</strong>, 2910 (2013); N.J. Secrest et al., The Astrophysical Journal Letters <strong>908</strong>, L51 (2021)] apontam para a possibilidade de violação do Princípio Cosmológico, ou seja, para a existˆencia de estruturas tão grandes no universo, que infringem o princípio de distribuiç˜ão homogˆenea e isotrópica de matéria em escalas cosmológicas. Isto, aliado a possíveis futuras observações, mostra uma possibilidade de quebra de paradigma para a cosmologia das próximas décadas. Teríamos de abandonar o Princípio Cosmológico? Quais as consequˆencias de seu não abandono em vista destas recentes observações? Como seriam as novas equações que regem a dinˆamica do universo se abandonássemos o Princípio Cosmológico? O abandono do Princípio Cosmológico tem implicaç˜oes para a aceleração da expansão do universo? Estas e outras perguntas serão visitadas neste Projeto de Iniciação Científica a partir da hipótese do espaço-tempo I de Bianchi, que descreve anisotropias no uni- verso. Para esta métrica, serão construídas as equações do tipo-Friedmann e as soluções dessas equações serão confrontadas com observações.</p>\r\n</div>\r\n</div>\r\n</div>'),
