(166, '', 'categoryIds', '[]'),
(166, 'pt_BR', 'abstract', '<p>O conhecimento das estruturas eletrônicas e moleculares dos compostos, estados neutros e iônicos, assim como os parâmetros físico-químicos, é altamente importante para a busca pelo entendimento das propriedades químicas e físicas, reatividade, e estabilidade dos materiais diversos, e, portanto, permite desvendar as suas possíveis aplicações relevantes. &nbsp;</p>\r\n<p>Tais informações sobre a estrutura da matéria e suas propriedades podem ser obtidas de forma altamente acurada tanto pelo emprego de métodos computacionais baseados em teorias mecânico-quânticas avançadas, quanto por meio do uso de radiação eletromagnética (fótons) em diferentes faixas de comprimentos de onda, em conjunto com técnicas experimentais modernas em espectroscopia fotoeletrônica e espectrometria.</p>\r\n<p>Dentre um universo de sistemas moleculares de interesse no nosso grupo de pesquisa, destacam-se aquele relacionado com moléculas de interesse biológico. Neste contexto, o presente projeto propõe a investigação teórica de um sistema molecular pertencente a este grupo, por exemplo, a molécula de 2-Imidazolidinona (C<sub>3</sub>H<sub>6</sub>N<sub>2</sub>O). Esta molécula compõe do grupo de compostos de cadeia heterocíclica nitrogenada, e muito importantes em processos químicos e principalmente biológicos, assim como por exemplo, as bases nitrogenadas de DNA e RNA. A molécula 2-imidazolidinona possui aplicações em herbicidas, inseticidas, inibidores de corrosão, e ainda é utilizada como intermediário na produção de antibióticos, dentre outras. &nbsp;</p>\r\n<p>O estudo sobre o comportamento dos compostos quando estes são expostos à radiação eletromagnética ionizante, fornecem dados relevantes sobre a dinâmica de como os estados quânticos e estruturas moleculares dos compostos se comportam mediante absorção de fótons (principalmente nas regiões espectrais desde o ultravioleta de vácuo até os raios-x), assim como possibilitam desvendar os complexos mecanismos de formação e quebra de ligações químicas, termoquímica, e prover informações adicionais sobre estabilidade e reatividade de tais sistemas. A exploração destes temas compõe a base fundamental deste projeto.</p>'),
