(167, '', 'categoryIds', '[]'),
(167, 'pt_BR', 'abstract', '<p>O gênero <em>Gustavia</em> L. é o segundo mais numeroso da família Lecythidaceae, com cerca de 40 espécies distribuídas pelas regiões de Mata Atlântica e Amazônica. A espécie nativa brasileira <em>Gustavia augusta</em> L., popularmente conhecida como jeniparana, destaca-se pela elevada frequência de indivíduos ocorrentes na Mata Atlântica, sendo bastante utilizada no paisagismo urbano. A polpa de seus frutos é comestível, sendo muito apreciada e consumida nos países amazônicos. Estudos têm apresentado potencial medicinal para seus extratos, tais como efeitos antioxidantes, anti-inflamatórios e úteis no tratamento da leishmaniose. Apesar de sua importância ornamental e farmacológica poucos estudos abordando aspectos citogenéticos foram apresentados até hoje para espécies de <em>Gustavia</em>, trazendo a literatura apenas o número cromossômico quatroestas espécies, com considerável variação inter e intraespecífica de números cromossômicos. Não há qualquer referência a seus cariótipos e a dados citomoleculares. Para suprir esta lacuna de informações este projeto pretende analisar as características morfométricas dos cromossomos em divisão mitótica de <em>G. augusta</em>, bem como acompanhar o comportamento cromossômico durante o processo meiótico nos microsporócitos, visando analisar sua regularidade e aferir a viabilidade polínica da espécie. A metodologia a ser empregada envolverá técnicas de citologia clássica para a análise cariomorfológica, incluindo bandamento diferencial com os fluorocromos CMA e DAPI, e da microsporogênese. A partir destes dados buscaremos também identificar possíveis tendências filogenéticas, como o número cromossômico básico para o gênero <em>Gustavia</em>, além de fornecer informações para futuros programas de melhoramento e manejo da espécie <em>G. augusta</em>.</p>'),
