(168, 'pt_BR', 'abstract', '<p><span style=\"font-weight: 400;\">O presente projeto de pesquisa visa compreender como pode ser feita a integração entre o ensino para a conservação da biodiversidade e os espaços não formais, sendo neste caso o zoológico. Para atingir tal objetivo será feita uma análise no Projeto Selva Viva, localizado na cidade de Taubaté, São Paulo. O espaço é um zoológico que visa, não só a exposição de animais, mas também atividades de educação ambiental com os visitantes e o contato direto com os animais silvestres, estes apreendidos por órgãos competentes como a polícia ambiental. Nesse contexto, a pesquisa, com viés qualitativo, será pautada na análise do espaço do zoológico e nas abordagens feitas para a educação e conservação da biodiversidade, através da mediação das visitas do público. Para isso, serão feitas entrevistas com grupos selecionados de visitantes, acompanhamento da visita e análise por meio do registro fotográfico do percurso expositivo do Projeto Selva Viva.&nbsp; Dessa forma, será possível identificar através da análise dos dados coletados como as ações do Projeto Selva Viva impactam os visitantes quanto à educação para a conservação da biodiversidade.</span></p>'),
