(169, '', 'categoryIds', '[]'),
(169, 'pt_BR', 'abstract', '<p>A privação de acesso à moradia adequada por significativa parcela da população brasileira e mundial assume um papel central no debate sobre cidadania, sustentabilidade, desigualdade e pobreza. O dimensionamento e a caracterização do problema é imprescindível para que políticas de garantia do direito à moradia e à cidade sejam elaboradas e colocadas em prática. Entretanto, a multidimensionalidade das necessidades habitacionais, associada às limitações dos dados existentes, impõe inúmeros desafios para a mensuração do problema de forma atualizada e detalhada no território. O presente projeto busca avançar no desenvolvimento de uma metodologia de representação multidimensional em escala detalhada (intra-municipal) das necessidades habitacionais dentro e fora de assentamentos precários. Para tanto, serão explorados dados alternativos ao Censo Demográfico, sobretudo a integração entre dados do Cadastro Único para Programas Sociais do Governo Federal (CadÚnico) e levantamentos locais de assentamentos precários, para que as diferentes dimensões da precariedade habitacional possam ser abordadas. Dentre as dimensões, serão representadas as desigualdades de acesso dos moradores ao restante da cidade, o que também demandará o cômputo de indicadores de acessibilidade.</p>'),
