(171, 'pt_BR', 'abstract', '<p>A estimulação medular (EM) é uma técnica neurocirúrgica que recentemente vem sendo utilizada como alternativa para o tratamento de alterações posturais e de marcha na doença de Parkinson (DP), que apresentam pouca resposta aos tratamentos mais convencionais. Há evidências de que a EM altera o comportamento cortical para um padrão mais próximo da normalidade e melhora a locomoção. Esse projeto tem por objetivo realizar uma revisão sistemática dos efeitos motores da estimulação medular na doença de Parkinson. A revisão sistemática já foi registrada na PROSPERO (CRD42021261069). Os bancos de dados pesquisados incluirão PubMed, Embase e Cochrane entre 2001 e dezembro de 2022. Os artigos devem abordar intervenção baseada em EM em pacientes com DP em pelo menos um grupo. EM pode ser aplicado em qualquer nível da coluna vertebral. Esperamos que nossos resultados sintetizem os efeitos da EM nos sintomas motores da DP.</p>'),
