(172, 'pt_BR', 'abstract', '<p>O padrão CubeSat impulsionou o uso de nanossatélites como plataformas de ensino e de demonstração tecnológica, entre outras missões. Essa padronização permitiu a popularização do acesso ao espaço pela redução do tempo e custo de desenvolvimento, levando a um aumento no número de missões lançadas. Com um software adequado de simulação da atitude, o desenvolvimento de algoritmos de determinação de atitude pode ser facilitado. O objetivo deste trabalho é desenvolver um modelo de simulação de órbita e atitude, modelando a dinâmica orbital e de atitude, o ambiente (campo magnético, posição do Sol e albedo) e sensores, com os respectivos modelos de erros.</p>'),
