(173, '', 'categoryIds', '[]'),
(173, 'pt_BR', 'abstract', '<p>Em sistemas de controle de atitude de CubeSats, a atuação magnética é geralmente escolhida para controle de atitude, pois possuem pouca massa e baixo consumo de energia. Técnicas de controle lineares podem ser diretamente aplicadas para a manutenção da atitude em torno de um valor nominal. Porém, para manobras de grandes ângulos, a aplicação destas técnicas podem não ser viável. Assim, o objetivo deste trabalho é analisar o comportamento de técnicas de controle que permitem manobras de atitude de grandes ângulos para aplicação em CubeSats.</p>'),
