(174, 'pt_BR', 'abstract', '<p style=\"margin: 0cm; text-align: justify; line-height: 150%;\"><span style=\"font-size: 11.0pt; line-height: 150%; font-family: \'Arial\',sans-serif; color: black;\">A engenharia biomédica é uma área multidisciplinar em que se objetiva a aplicação dos conhecimentos da engenharia nas áreas da saúde. Para isso, um dos enfoques é a criação de dispositivos biomédicos para fins diagnósticos, de monitorização e ou terapêuticos. Os biomateriais são um instrumento para a construção destes dispositivos, e a avaliação da performance deles, assim como seus efeitos em um sistema biológico, é um passo importante visando sua aplicação futura. Para tal avaliação, o preparo de amostras é uma etapa fundamental. Este trabalho pretende mostrar diversas formas de preparo de amostras visando a avaliação de biomateriais e de sua interação com células, por meio de diferentes técnicas de bioimageamento, assim como relatar seus resultados. Para isso, serão utilizadas variadas metodologias de ensaios de interação de células com biomateriais para o bioimageamento. Através dos diversificados resultados, ficará evidente a necessidade da importância de estudar essas interações, assim como a relevância da compreensão das relações células-biomateriais. Neste sentido, será possível avaliar quais formas de preparo de amostras e quais metodologias de processamento serão mais compatíveis e eficientes de acordo com a aplicação prática desejada. Para a análise dessas amostras serão utilizados os equipamentos de bioimageamento disponíveis na Central Experimental Multiusuário da Universidade Federal do ABC (CEM-UFABC), através de variadas técnicas, tais como microscopia, tomografia, fluorescência, espectroscopia, entre outros. Os resultados deste trabalho irão contribuir para o entendimento do funcionamento dos equipamentos disponíveis pela CEM-UFABC, assim como para um melhor entendimento sobre métodos de preparação de amostras e sobre variadas técnicas de análises de amostras. Por consequência, levará a uma melhor compreensão das capacidades regenerativas dos biomateriais e suas aplicações tecnológicas na engenharia biomédica, aperfeiçoando, assim, suas funções e utilizações práticas.</span></p>'),
