(176, 'pt_BR', 'abstract', '<p>Na última década, diversos avanços impulsionaram a indústria aeroespacial, desde os pequenos CubeSats até os mais poderosos sistemas de propulsão e transporte. Telescópios mais potentes foram desenvolvidos, que acoplam tecnologias de última geração para uma melhor observação do universo e de sua composição, como o telescópio espacial James Webb, lançado em dezembro de 2021. Mais além, avanços nas simulações e modelagens computadorizadas tornaram possível a aplicação de novas trajetórias de missões para veículos espaciais (V/Es) baseadas em conceitos mais complexos, como as Superestradas Interplanetárias.</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; As Superestradas Interplanetárias são o conjunto de soluções para o Problema dos Três Corpos Restrito. Essas soluções descrevem trajetos que permeiam todo o nosso Sistema Solar, aproveitando-se da existência dos Pontos de Lagrange – pontos de equilíbrio gravitacional entre corpos celestes capazes de comportarem uma órbita – para criar uma rede de transporte interplanetário, com baixíssimo custo de combustível e energia, na qual um V/E poderia seguir de forma natural, o que resultaria também em poucas correções durante o trajeto. Este conceito está sendo cada vez mais aplicado nos desenvolvimentos de diversas missões atuais, sendo em trajetórias de CubeSats e até mesmo em órbitas de futuras estações espaciais. [1]</p>\r\n<p>O foco desse projeto é entender e estudar as trajetórias geradas pelos Pontos de Lagrange no Problema dos Três Corpos e aplicá-las no cálculo, modelagem e simulação de trajetórias no sistema Terra-Lua. O estudo fará uso do software “open source” da Agência Aeroespacial Estadunidense (NASA), o ‘General Missions Analysis Tool’ (GMAT).</p>\r\n<p>Este projeto terá como base, principalmente, os artigos científicos elaborados por Martin Wen-Yu Lo e será uma continuação da pesquisa anterior sobre o mesmo tema (PDPD 2021-2022), de maneira a aprofundar e aplicar os conceitos ali apresentados.</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp; As informações necessárias para o desenvolvimento deste trabalho serão encontradas em literaturas e artigos científicos, bem como materiais acadêmicos de revistas científicas, palestras, apresentações e conferências de pesquisadores em geral, do Jet Propulsion Laboratory (JPL/NASA), em particular [1].</p>\r\n<p>Serão feitas algumas modelagens no software GMAT à fim de compreender a aplicação prática dos conceitos que serão abordados.</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp; Os resultados desta pesquisa serão apresentados em dois relatórios, um parcial e outro final, reunindo todo o conhecimento adquirido no processo.</p>\r\n<p>Espera-se que o conhecimento adquirido e apresentado nos relatórios, ainda bem incipientes no Brasil, possam ser difundidos e estudados mais amplamente no país, para análise de sua aplicação em missões espaciais futuras.</p>\r\n<p>&nbsp;</p>\r\n<p>Referência: [1] LO, Martin W. <strong>The Interplanetary Superhighway for the Development of the Moon &amp; the Earth\'s Neighborhood</strong>. In: THE AMERICAN ASTRONAUTICAL SOCIETY SPACE FLIGHT MECHANICS CONFERENCE, 2019, Portland. Anais. Portland: National Aeronautics and Space Administration, 2019. p. 1-52.</p>'),
