(177, 'pt_BR', 'abstract', '<p><span class=\"TextRun SCXW130090254 BCX0\" lang=\"PT-BR\" xml:lang=\"PT-BR\" data-contrast=\"auto\"><span class=\"NormalTextRun SCXW130090254 BCX0\">As áreas urbanas podem apresentar em sua paisagem diferentes tipos de cobertura verde</span><span class=\"NormalTextRun SCXW130090254 BCX0\">, que oferecem variados benefícios de acordo com suas características. A distribuição da vegetação e usufruto de seus benefícios, entretanto, não são feitos de forma igualitárias nas cidades, sendo o mapeamento desses verdes urbanos fundamental para o planejamento urbano, coerente com a realidade de cada cidade. Para tanto, o presente projeto de iniciação científica tem por objetivo realizar a identificação e classificação dos padrões de distribuição espacial do verde urbano dentro e nas proximidades das áreas consideradas urbanas pelo IBGE no município de Santarém, localizado na região oeste do Pará, a partir de técnicas de sensoriamento remoto. Serão utilizadas&nbsp; imagens de alta resolução espacial&nbsp; do sensor WPM do satélite CBERS-4A para identificar e mapear o verde urbano, por técnicas de </span><span class=\"NormalTextRun SpellingErrorV2Themed SCXW130090254 BCX0\">limiarização</span><span class=\"NormalTextRun SCXW130090254 BCX0\"> de histograma de imagens. Também serão extraídas métricas de paisagem a partir de uma grade celular que integra os verdes urbanos identificados, e caracterização dos padrões de distribuição dos verdes urbanos.</span></span><span class=\"EOP SCXW130090254 BCX0\" data-ccp-props=\"{&quot;201341983&quot;:0,&quot;335551550&quot;:6,&quot;335551620&quot;:6,&quot;335559739&quot;:160,&quot;335559740&quot;:360}\">&nbsp;</span></p>'),
