(178, 'pt_BR', 'abstract', '<p>O processo de fabricação com consciência ambiental, <em>Environmentally Conscious Manufacturing Process</em> (ECMP) tem se tornado ao longo dos anos mais do que uma obrigação, mas um compromisso para com o meio ambiente e para com a própria sociedade, imposta principalmente por regulamentações governamentais e pela perspectiva dos próprios clientes sobre questões ambientais. O ECMP envolve a integração do pensamento ambiental no desenvolvimento de novos produtos. Hoje a tecnologia CAD/CAE/CAM vem para auxiliar este processo e pode ser encontrada nas áreas: (a) automobilística, nas linhas de produção automatizadas; (b) odontológica, como ferramenta de análise para ortodontia e cirurgia, além da confecção de próteses e aparelhos ortodônticos; (c) construção civil, auxiliando na construção de maquetes e no processo de projeto integrado; entre outras. Propor ferramentas para selecionar um processo de fabricação com consciência ambiental simples para apoiar novos eco-designers inexperientes, facilitando a implementação, apoiando os engenheiros durante o processo de design de produtos verdes é a proposta deste projeto. Como principal objetivo, &nbsp;analisaremos o processo CAD/CAE/CAM para a prática sustentável em indústrias brasileiras de pequeno porte, comprovando eficiência, redução custos, aumento de produtividade e baixo impacto ambiental. Uma vez comprovada sua eficiência, será possível expandir o projeto para indústrias de médio e grande porte. Este trabalho conta com a interdisciplinaridade entre as engenharias mecânica, elétrica, produção, dentre outras.</p>'),
