(179, 'pt_BR', 'abstract', '<p>A fibrilação atrial (FA) é um tipo de arritmia cardíaca que consiste na contração incompleta/ineficiente do músculo, resultando numa alteração do escoamento sanguíneo pelo coração, podendo levar à formação de trombos, principalmente na região do apêndice do átrio esquerdo (AAE). O presente trabalho busca estudar este processo de trombogênese por meio da implementação de um modelo numérico baseado em Dinâmica de Fluidos Computacional (CFD), integrando ao modelo aspectos hemodinâmicos, bioquímicos e atividade eletromecânica do átrio esquerdo (AE) em condições de FA. Para isso, a metodologia será dividida em três frentes: modelagem hemodinâmica, onde serão analisados os aspectos físicos do escoamento sanguíneo no AE; modelagem bioquímica, onde serão adicionadas equações de transporte para os componentes celulares/bioquímicos relevantes à trombogênese; acoplamento da atividade eletromecânica da FA ao escoamento do sangue no AE humano pela prescrição do campo de atividade elétrica na parede atrial. Com o modelo integrado (hemodinâmica, bioquímica e atividade eletromecânica) definido, serão feitas simulações em diferentes cenários de relevância clínica e o potencial de trombogênese será avaliada por indicadores hemodinâmicos e marcadores bioquímicos definidos no projeto.</p>'),
