(180, 'pt_BR', 'abstract', '<p>A Teoria da Relatividade trouxe-nos uma das grandes revoluções da física no começo do século XX. Como hipótese, ela assume que as leis físicas são independentes do observador e que a velocidade da luz é universalmente constante. A principal consequência dessa teoria é a necessidade da reinterpretação de conceitos como: espaço, tempo, energia, momento, forças e a velocidade da luz como um limite. Muitas previsões da Relatividade Geral diferem significativamente daquelas da física clássica, notadamente as sobre a passagem do tempo, a geometria do espaço, o movimento dos corpos em queda livre e a propagação da luz, fornecendo uma descrição unificada da gravidade como uma propriedade geométrica do espaço-tempo.<br>Todavia, a descrição da teoria tem importantes implicações na astrofísica. Pressupõe-se os efeitos no espaço-tempo provocados por buracos negros- regiões do espaço onde o espaço-tempo é distorcido para que nada, nem mesmo a luz possa escapar- como um estado final para estrelas massivas. Ademais, este projeto visa a realização de um estudo teórico dos efeitos gravitacionais no espaço-tempo na presença de altas massas via Teoria da Relatividade, expandindo o conhecimento para as implicações das propriedades de buracos negros.</p>'),
