(181, 'pt_BR', 'abstract', '<p>Estudantes público-alvo da educação especial (PAEE) são definidos como aqueles com deficiência, transtorno do espectro autista (TEA) e altas habilidades ou superdotação pela legislação brasileira. Nesse contexto, objetivamos a sistematização de materiais acessíveis da área de Matemática para o público supracitado, por meio de uma plataforma/site, onde serão ancorados referências e informativos de materiais para cada um dos públicos anteriormente elencados. Para alcançar tal objetivo, nos valeremos da pesquisa de cunho exploratório, de natureza qualitativa, com revisão sistemática. Assim, pretendemos: a) contribuir com a sistematização de materiais acessíveis na área da matemática; b) fomentar pesquisas na UFABC no tocante à Educação Inclusiva; c) Instigar a formação pluri e interdisciplinar nas licenciaturas e, por fim, d) estimular pesquisas em outras áreas do conhecimento pouco exploradas (Educação Especial).</p>'),
