(183, 'pt_BR', 'abstract', '<p>Devido aos prejuízos que acarreta à população, a segregação tem se constituído objeto de interesse de vários campos das ciências sociais. No entanto, a maioria dos estudos sobre o tema adota a perspectiva residencial para a análise do fenômeno, fato esse que vem sendo questionado, uma vez que as experiências dos indivíduos não se limitam apenas ao seu local de residência. Esse trabalho explora uma nova metodologia para representar o fenômeno, desenvolvida por Lisboa (2022), que considera uma perspectiva individual para analisar a segregação resultante de atividades realizadas em diferentes momentos (dia e noite). Partindo de informações sobre os níveis de exposição de indivíduos a distintos grupos sociais na Região Metropolitana de São Paulo, nos períodos diurno e noturno, o trabalho tem como objetivo desenvolver tipologias de segregação individual, analisá-las e compará-las a atributos socioeconômicos individuais (tais como idade, sexo, escolaridade e tipo de ocupação) e de localização residencial (por exemplo, se é próxima a infraestruturas de transporte). Busca-se, assim, investigar se tais atributos têm relação com a circulação por espaços da metrópole que implicam em maior ou menor segregação dos indivíduos ao longo do dia.</p>'),
