(184, 'pt_BR', 'abstract', '<p>O citomegalovírus humano (HCMV) é um tipo de herpesvírus, que, em indivíduos saudáveis é assintomático ou apresenta sintomas leves, no entanto, em indivíduos imunossuprimidos pode causar doenças graves e até, risco de vida. O HCMV possui a capacidade de estabelecer infecção persistente e latente no hospedeiro ao longo da vida, pois desenvolveu estratégias para evitar a eliminação imunológica e permanecer no hospedeiro. O vírus adquiriu a capacidade de sequestrar e explorar a proteína IL-10, codificada pelo gene viral UL111A, que produz diversos transcritos por <em>splicing alternativo</em>. As proteínas IL-10 virais, produzidas por estes transcritos, possuem propriedades anti-inflamatórias e imunossupressoras, possibilitando a diminuição da resposta imunológica do hospedeiro e a evasão viral. Esse projeto tem como objetivo investigar a presença de variabilidade no gene do HCMV UL111A e correlação com a doença, e com a expressão e níveis relativos dos transcritos de IL-10 em amostras de indivíduos saudáveis e imunossuprimidos positivos para HCMV, incluindo receptores de transplante. A amplificação das amostras de DNA de pacientes será feita por nested PCR. Posteriormente, o DNA será purificado e enviado para sequenciamento e análise das sequências gênicas.</p>'),
