(185, 'pt_BR', 'abstract', '<p>A solda TIG é realizada por meio de um arco elétrico criado entre um eletrodo sólido de tungstênio não consumível e o material a ser soldado, protegidos do ar atmosférico por um gás inerte (normalmente argônio ou hélio). Enquanto isso, a solda a laser funciona por meio da fusão do metal que ocorre pela absorção da luz do feixe que é direcionado à região a se soldar, gerando menor calor, sendo possível obter um melhor acabamento. O objetivo deste projeto é analisar dados já existentes e propor um comparativo entre os dois métodos de soldagem para o aço 304, analisando sua composição química e microestrutura, utilizando técnicas como a difração de raios-X e tratamentos térmicos.</p>'),
