(186, 'pt_BR', 'abstract', '<p><span dir=\"ltr\" role=\"presentation\">Este projeto tem por objetivo a simulação da interação de partículas carregadas com alta energia, originadas em colisões</span><br role=\"presentation\"><span dir=\"ltr\" role=\"presentation\">de eventos em aceleradoes, usando a ferramenta de simulação</span> <span dir=\"ltr\" role=\"presentation\">GEANT4</span><span dir=\"ltr\" role=\"presentation\">. Essas simulações terão o objetivo primeiro de</span><br role=\"presentation\"><span dir=\"ltr\" role=\"presentation\">fornecer as ionizações ocorridas como resultado das interações das partículas de interesse com o material do detector.</span><br role=\"presentation\"><span dir=\"ltr\" role=\"presentation\">Essas simulações estão inseridas no contexto do</span> <span dir=\"ltr\" role=\"presentation\">upgrade</span> <span dir=\"ltr\" role=\"presentation\">do experimento ALICE como um sistema adicional a um</span><br role=\"presentation\"><span dir=\"ltr\" role=\"presentation\">novo detector, o FoCal.</span></p>'),
