(187, 'pt_BR', 'abstract', '<p>Este projeto propõe a concepção e desenvolvimento de uma ferramenta para a geração<br>de datasets visuais a partir do uso intensivo de técnicas de computação gráfica. A ferramenta<br>a ser desenvolvida deverá ser capaz de gerar imagens e informações semânticas<br>associadas a estas imagens. Como resultado, este conjunto de dados poderá ser utilizados<br>em projetos correlatos para treinamento de modelos de inteligência artificial, entre eles<br>modelos de redes neurais artificiais, redes de convolução, redes generativas artificiais, entre<br>outras. O projeto deve capacitar o aluno no desenvolvimento de software e introduzir<br>propriedades consideradas essências em datasets sintéticos para inteligência artificial. O<br>software desenvolvido fará uso de recursos disponíveis e de acesso livre, tal como geometrias<br>3D, texturas, softwares de modelagens 3D e motores gráficos 3D a fim de sintetizar<br>cenas 3D, que serão posteriormente convertidas em bases de imagens e dados descritivos.<br>Ao fim do projeto o software será documentado e disponibilizado para uso em futuras<br>pesquisas.</p>'),
