(188, 'pt_BR', 'abstract', '<p>Há duas problemáticas de grande relevância associadas ao fósforo (P) atualmente: a<br>eutrofização de ambientes aquáticos devido ao lançamento de efluentes ricos em P;<br>bem como à escassez do P para fins agrícolas, devido à crescente exploração de suas<br>fontes naturais. Assim, é evidente a urgência de tecnologias que permitam a remoção<br>e recuperação do P, retirando seu excesso dos efluentes ao mesmo tempo que<br>aumentam sua disponibilidade para uso humano, em um contexto de economia<br>circular, para sanar as problemáticas envolvendo esse recurso. Dentre as técnicas de<br>captura de P de efluentes sanitários, a mais eficiente é a adsorção. Em estudos<br>recentes, substratos à base de cascas de ovos permitiram a remoção de 90% do P de<br>efluentes via adsorção em ensaios em batelada. Isso demonstra o potencial desse<br>substrato como uma alternativa de baixo custo e eficiente para o tratamento terciário<br>de efluentes. Apesar dos bons resultados, não há trabalhos que proponham o<br>desenvolvimento de um filtro com tal substrato para implementação em estações de<br>tratamento de esgotos (ETEs). Assim, o presente projeto pretende desenvolver um<br>protótipo de filtro tendo como recheio substrato à base de cascas de ovos com vistas à<br>remoção e ao reaproveitamento de P de efluente sanitário. Além disso, será avaliada a<br>ecotoxicidade desse adsorvente após os ensaios e seu potencial como fertilizante<br>agrícola. Inicialmente, serão conduzidos ensaios em batelada para determinar as<br>melhores condições de adsorção de P pelo substrato, variando o pH da solução e a<br>granulometria do material filtrante, e comparar o potencial de cascas de ovo<br>calcinadas e não calcinadas como adsorventes, além de ensaios de coluna com o filtro<br>desenvolvido com o material estudado para avaliar sua possível viabilidade para o<br>tratamento terciário de efluentes. A ecotoxicicidade do substrato será avaliada por<br>teste avoidance com minhocas e seu potencial como fertilizante será testado por meio<br>de sua incorporação no plantio de rabanetes, para se estudar a recuperação e<br>reciclagem do P. Os ensaios serão conduzidos em triplicata e será realizado tratamento<br>estatístico dos dados.</p>'),
