(189, '', 'categoryIds', '[]'),
(189, 'pt_BR', 'abstract', '<p>A engenharia de software tem evoluído bastante nas últimas décadas primeiramente com a melhora e aperfeiçoamento dos seus processos produtivos e de verificação e validação, e mais recentemente com forte introdução da automação nas diversas etapas dos seus processos.</p>\r\n<p>Este projeto tem como propósito estudar os diversos tipos de processos envolvidos no desenvolvimento de software, desde nos métodos tradicionais como o modelo baseados em ciclo de vida do software até os baseados em produção ágil. Estes processos serão então mapeados em modelos de processos padronizados mais genéricos utilizados na área administrativa, como o BPMN (Business Process Modeling Notation, mantido pelo Object Management Group – OMG responsável pelo padrão UML). O BPMN é uma notação gráfica (diagramas) amplamente utilizada em engenharia de software para modelar processos de negócio para facilitar o gerenciamento, execução e monitoramento de processos. Como resultado, o uso do BPMN no contexto do Desenvolvimento de Software pode melhorar a qualidade e a eficiência da produção de software.</p>\r\n<p>O objetivo do projeto é identificar e avaliar as principais ferramentas de software de modelagem de processos utilizadas na engenharia de software, estabelecendo o nível de integração entre a gestão do processo e o nível de automação do processo de produção e de avaliação do software em si, além da capacidade analítica (ferramentas analíticas) e a capacidade de geração de metadados dos processos envolvidos que possibilitem a avaliação da qualidade e eficiência da produção de software.</p>'),
