(190, 'pt_BR', 'abstract', '<p>Osciladores harmônicos, tanto amortecidos quanto forçados, são descritos por equações diferenciais ordinárias lineares que podem ser resolvidas analiticamente, mostrando sempre comportamento regular. No entanto, sabe-se que são apenas uma aproximação para modelos mais realistas (mesmo unidimensionais). Neste projeto pretendemos analisar o comportamento de osciladores não-lineares na presença de forças externas periódicas no tempo, estudando o comportamento qualitativo das órbitas no espaço de fase e a emergência de caos nesses sistemas, por meio da técnica das seções de Poincaré (mapas estroboscópicos).</p>'),
