(191, 'pt_BR', 'abstract', '<p align=\"justify\"><span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\">Os hidrogéis são compósitos ativos com usos variados e com forte caráter interdisciplinar que vêm, nos últimos anos, cada vez mais se associando a manufatura aditiva como um material inteligente devido sua alta responsividade a determinados meios. A chamada impressão 4D busca incorporar esse comportamento inteligente dentro de uma estrutura, onde o próprio material se transforma em um mecanismo complexo com fonte de energia passiva. O objetivo do presente trabalho é, além de realizar uma revisão abrangente na literatura, modelar e simular o comportamento de hidrogéis sensíveis a temperatura e ao pH, sendo capaz de projetar sua correta distribuição para alcançar a forma ou atuação desejada.</span></span></p>'),
