(192, 'pt_BR', 'abstract', '<p>Este é um projeto de iniciação científica em Teoria dos Grafos.<br><br>Uma <em>coloração aditiva</em> de um grafo G = (V, E) é uma função f: V → N_k<br>tal que, para toda aresta uv ∈ E, temos que S(u) ≠ S(v), onde<br>S(u) = Σ_{ x ∈ N_G(u)} f(x), sendo k um inteiro positivo<br>e N_k = {1, 2, ..., k}. O <em>número da sorte</em> de um grafo G, denotado por η(G), é definido <br>como o menor valor de k tal que f seja uma coloração aditiva.<br>Em 2008, Chartrand, Okamoto, Zhang (<em>The sigma chromatic number of a graph</em>, Graphs Combin. <strong>26</strong> (2010),<br>no. 6, 755-773) introduziram uma outra métrica para a coloração aditiva.<br>O <em>número cromático sigma</em> de um grafo G, denotado por σ(G), é definido <br>como o menor valor de |Ima(f)| tal que f seja uma coloração aditiva, onde Ima(f)<br>é o conjunto imagem de f. <br><br>Este projeto de iniciação científica objetiva dar continuidade aos estudos<br>de uma iniciação cientifica anterior sobre colorações aditivas<br>propondo encontrar limitantes de σ para determinadas famílias<br>de grafos e melhorar o limitante atual de η para grafos<br>planares livres de triângulo.</p>'),
(192, 'pt_BR', 'areaSubarea', 'Matemática; Matemática Discreta; Combinatória'),
