(193, 'pt_BR', 'abstract', '<p>A pesquisa tem como objetivo analisar as origens do Peronismo através do marco do 17 de Outubro de 1945 e compreender como esse fenômeno se relaciona profundamente com a história política argentina.</p>\r\n<p>O Peronismo é um fenômeno singular em nosso continente, e possivelmente no mundo. Sua ascensão ocorre no imediato pós-guerra, mas suas raízes são muito anteriores. O Peronismo segue tão presente na Argentina a ponto de não haver como se discutir a política local atual sem mencioná-lo. Aliás, não somente mencionado, mas, na verdade, entender que a política argentina atual ainda se configura entre Peronismo e Antiperonismo. Com isso, percebe-se que o Peronismo se adaptou ao longo das décadas de acordo com as necessidades argentinas em relação a questões nacionais e internacionais. Há aspectos profundos que mantém viva a figura de Perón e que se relaciona com o povo argentino. Um Perón mítico e construído historicamente com os parâmetros de cada tempo.</p>\r\n<p>Assim, serão pesquisadas questões da formação do Estado e a configuração da sociedade argentina do século XX. A data de origem do Peronismo é cercada por diversos mitos, sendo importante ressaltar principalmente que foi o marco da participação popular na política argentina. Há pontos essenciais para entender como a figura de Perón representou parcela expressiva da sociedade naquele 17 de outubro de 1945 e que marca a identidade nacional até hoje.</p>'),
