(194, 'pt_BR', 'abstract', '<p>Escoamento ao redor de aerofólio fino com pequeno ângulo de ataque em relação a uma corrente uniforme e confinada em um canal é abordado utilizando-se relação integral envolvendo as condições de contorno e o método das expansões em termos de auto-funções. Assume-se fluido incompressível e irrotacional, de modo que o campo de velocidades pode ser escrito como o gradiente de uma função potencial que satisfaz a equação de Laplace no domínio do escoamento. Este domínio é subdividido em sub-regiões, e em parte das sub-regiões a solução do problema de contorno específico pode ser escrita em termos de auto-funções da equação de Laplace. Utilizando-se relação integral envolvendo as condições e contorno e fronteiras entre sub-regiões, obtém-se conjunto de equações algébricas cuja solução são os coeficientes de cada auto-função presente nas expansões em subdomínios específicos. O potencial de velocidades é subdividido em uma parcela que representa o problema de espessura e em uma parcela circulatória, no intuito de satisfazer a condição de Kutta-Joukowskii no bordo de fuga do aerofólio e determinar a circulação<br>do escoamento. A força de sustentação é determinada via teorema de Kutta-Joukowskii e o momento aerodinâmico é avaliado via integração do momento do campo de pressão ao redor da placa plana em relação a um polo conveniente. A performance do método proposto é avaliada comparando-se resultados para os coeficientes de sustentação e de momento aerodinâmico em função da distância da placa plana à parede e em função da distância entre paredes com resultados proveniente de métodos presentes na literatura.</p>'),
