(195, 'pt_BR', 'abstract', '<p>O presente projeto de IC (Iniciação Científica) tem como escopo o desenvolvimento de competências na área de circuitos de RF e micro-ondas, por meio do estudo e projeto de redes de casamento de impedância adaptativa para retificadores de RF.</p>\r\n<p>Devido a impedância do diodo <em>Schottky</em> variar com a temperatura, será alvo dessa IC o estudo e desenvolvimento de uma rede de casamento adaptativa para dois modelos de retificadores de RF (série e paralelo) de maneira que os componentes da rede de casamento possam ser chaveados, mantendo assim, a máxima transferência de potência na maior faixa possível de temperatura de operação.</p>\r\n<p>O projeto e implementação da rede de casamento adaptativa será realizado com o auxílio dos softwares ADS (<em>Advanced Design System</em>) e/ou QUCS (<em>Quite Universal Circuit Simulator</em>). Posteriormente, tais redes de casamento serão implementadas junto aos protótipos dos retificadores para testes em bancada de maneira a validar a proposta inicial.</p>'),
(195, 'pt_BR', 'areaSubarea', 'Engenharia Elétrica; Teoria Eletromagnética, Micro-ondas, Propagação de Ondas, Antenas '),
