(196, 'pt_BR', 'abstract', '<p>Apesar do avanço das tecnologias e das pesquisas em Inteligência Artificial na Educação os resultados ainda estão distantes da sala de aula, especialmente em países em desenvolvimento como o Brasil.&nbsp; O desconhecimento de ferramentas de autoria de conteúdos personalizáveis e a dificuldade de uso pelos educadores é um dos obstáculos para que a personalização da aprendizagem ainda seja incipiente.&nbsp; Um exemplo de ferramenta de autoria é o CTAT - <em>Cognitive Tutor Authoring Tool</em> que, segundo os criadores, tem como objetivo reduzir significativamente a quantidade de tempo necessária para criar um tutor e minimizar a necessidade de conhecimentos em programação de inteligência artificial. O software CTAT é gratuito para fins de pesquisa.&nbsp; Esse trabalho tem por objetivo geral explorar a ferramenta de autoria CTAT para a construção de materiais instrucionais personalizados. Os seguintes objetivos específicos foram estabelecidos: (a) Realizar uma revisão de literatura a fim de identificar experiências da elaboração de materiais instrucionais com o CTAT; (b) Elaborar materiais instrucionais personalizáveis para uma disciplina (a ser definida); (c)&nbsp; Elaborar um tutorial para uso do CTAT, em linguagem acessível a educadores sem formação em programação;&nbsp; (d) Experimentar os materiais produzidos a partir da simulação de diferentes perfis de estudantes e analisar a eficiência da personalização.</p>'),
