(197, 'pt_BR', 'abstract', '<p>O ensino investigativo é uma das abordagens que permite explorar a realidade por meio de análise e avaliação de problemas. Visto a necessidade de propor problemas investigatórios pautados nos interesses do repertório cultural dos discentes (em especial músicas, séries e filmes), de modo a engajar e motivar o ensino de ciências e matemática, foi observado um grande entusiasmo pelas produções do Universo Cinematográfico da Marvel. Assim, este trabalho se propõe a levantar possibilidades sobre como abordar e propor problemas investigativos ficcionais sem o perigo de cair em pseudociências e erros conceituais. Para tal, serão utilizadas as metodologias de estudo de caso e análise de conteúdo e os dados serão coletados por meio de entrevistas com discentes e docentes do Ensino Fundamental e Ensino Médio.</p>'),
