(199, 'pt_BR', 'abstract', '<p>A Manufatura Aditiva (MA) consiste na adição de material para gerar alguma peça, diferente da manufatura<br>tradicional (Subtrativa) em que é realizada a retirada, como no processo de usinagem. Um exemplo de MA é o<br>processo utilizado em impressoras 3D, em que o material é depositado sobre uma bandeja em camadas, formando<br>o objeto desejado. O processo é iniciado a partir de um modelo em CAD (Computer-Aided Design) que possui<br>uma grande flexibilidade para desenhos de peças, ou seja, dessa forma é possível adquirir formatos complexos<br>que antes não era possível. Um passo além desse processo é a impressão 4D, em que é aplicada uma nova<br>dimensão: o tempo. Isto é, o objeto pode mudar de formato em ciclos. Esse tipo de material se chama Smart<br>Materials (SM) e sua utilização se mostra promissora. Esse tipo especial de material, a partir de um estímulo,<br>pode mudar de cor, dimensão etc., ou seja, é possível utilizá-lo como mecanismo, por exemplo em válvulas, asas<br>de aviões, aletas de foguetes etc. A predição do formato desejado com base na geometria inicial será o foco desse<br>estudo.</p>'),
(199, 'pt_BR', 'areaSubarea', 'Engenharia de Estruturas'),
