(200, 'pt_BR', 'abstract', '<p>Das reações bioquímicas ao desenvolvimento global, a complexidade surgiu como uma característica excepcional do nosso mundo.<br>Buscar estudar sistemas complexos e novas abordagens são fundamentais para avançar nossa compreensão e capacidades.<br>Essas abordagens incluem o reconhecimento da importância dos padrões de comportamento; o espaço de possibilidades; e processos adaptativos que selecionam comportamentos eficazes para um mundo complexo.<br>Dentro deste campo, temos a teoria da percolação é uma seção da teoria da probabilidade, que tem múltiplas aplicações em ciências naturais e de engenharia.<br>Aqui nesta proposta visamos uma introdução à teoria de sistemas complexos.<br>Exploraremos o conceito de percolação e algumas de suas inúmeras aplicações.<br>De especial interesse vamos abordar temas como transição de fase em sistema de percolação, vizinhança, clusters, entre outros temas como descrevemos ao longo da proposta.<br>Espera-se que a aluna possa compreender sistemas complexos e reconhecê-los em processos do dia-a-dia.<br>O contato com a programação e simulações apresentará uma técnica de abordagem cientifica que a aluna levará consigo.<br>Além disso, os resultados e desempenho da aluna serão apresentados no Simpósio de Iniciação Cientifica da UFABC em 2023.</p>'),
(200, 'pt_BR', 'areaSubarea', 'física; matematica aplicada'),
