(201, 'pt_BR', 'abstract', '<p class=\"western\" align=\"justify\"><span style=\"font-family: Arial, serif;\">O Aprendendo a Ler e a Escrever em Pequenos Passos (ALEPP) tem sido utilizado com sucesso em estudantes com histórico de fracasso escolar, nivelando as turmas e fazendo com que os alunos que apresentam defasagem no processo de alfabetização possam voltar a acompanhar as aulas com seus colegas que não apresentam esta defasagem. Apesar de ser uma importante ferramenta de apoio ao professor na tarefa de alfabetizar, ainda são necessários dados empíricos sobre sua efetividade. O presente projeto de pesquisa tem por objetivo realizar avaliação neuropsicológica da linguagem antes e depois do treino do protocolo informatizado para o ensino de habilidades de leitura, a fim de avaliar sua efetividade. Os achados deste estudo contribuirão para o desenvolvimento de tecnologias úteis para o enfrentamento de questões relativas à educação básica (como déficits de alfabetização) e educação especial inclusiva (como a intervenção ao Transtorno do Espectro Autista - TEA) e ensino de forma geral.</span></p>'),
