(203, 'pt_BR', 'abstract', '<p>Este projeto de pesquisa tem por objetivo investigar o uso de material suporte no tratamento de lixiviado de aterro, utilizando biorreatores com membranas (MBR) integrado com célula combustível microbiana (CCM), na limpeza mecânica das membranas e no desenvolvimento de biofilme como estratégias para melhorar a remoção de micropoluentes orgânicos, reduzir a formação de depósito (fouling) e mitigar a inibição da nitrificação. Para isto, serão utilizados dois MBRs em paralelo, alimentados com lixiviado do aterro sanitário de Santo André/SP, um deles será a unidade controle, e o outro será o sistema integrado com a CCM, com dois compartimentos e com diferentes condições e tipo de biomassa. Serão caracterizados os processos de conversão e remoção de poluentes convencionais e emergentes. A formação de depósito nas membranas será avaliada em função das resistências a filtração. O projeto faz parte de um projeto maior, aprovado este ano pela chamada Universal CNPq/MCTI/FNDCT 18/2021. O grupo de pesquisa já investigou o tratamento de LA utilizando MBR acoplado com CCM e, este projeto, será uma continuação dos avanços científicos obtidos, em que será avaliado a influência do material suporte na eficiência do processo. O aluno deste projeto já desenvolveu um projeto de IC/PDPD bem sucedido. Espera-se com este projeto contribuir com a formação profissional do aluno de graduação e responder as perguntas científicas referentes ao uso de material granular na limpeza mecânica de membranas no processo híbrido MBR e CCM, possibilitando o prosseguimento desta pesquisa.</p>'),
