(204, 'pt_BR', 'abstract', '<p>Este projeto almeja o desenvolvimento de um novo compósito com propriedade capacitiva derivado do vidro bioativo 58S produzido pelo método sol-gel, com a finalidade de regenerar o tecido ósseo. O projeto é previsto de ser realizado em três etapas: 1) Revisão literária sobre o vidro bioativo 58S e sobre o material capacitivo a ser incorporado na matriz vítrea, o estudo teórico da capacitância como a propriedade alvo do projeto, e sobre os efeitos esperados no processo de regenerativo do tecido ósseo gerados pelos materiais citados; 2) Desenvolvimento do compósito; 3) Caracterização estrutural, morfológica e elétrica do compósito formado.</p>'),
