(205, 'pt_BR', 'abstract', '<p>Para Thomas Kuhn (1922-1996), importante físico e filósofo da ciência norte americano, a atividade científica ocorre num esquema paradigma-anomalia-revolução. Kuhn compreende que a ciência normal é o modo como funciona a atividade científica no dia a dia, e descreve seu caráter relativamente dogmático e conservador. Contudo, o trabalho do estadunidense descreve principalmente as ciências exatas. Assim, nosso propósito é estabelecer uma possível ponte entre a concepção kuhniana do processo de produção de conhecimento científico e a atividade realizada pelos pesquisadores nas áreas das humanidades como descritas por Wilhelm Dilthey (1833-1911) e Michel Foucault (1926-1984), visando a compreensão dos limites do esquema delineado pelo físico para descrever estas áreas. Importante também será a reflexão sobre a natureza do conhecimento produzido pelas ciências humanas a partir do ferramental teórico apresentado pelo autor, tanto quanto sua relevância para a opinião pública atual.</p>'),
(205, 'pt_BR', 'areaSubarea', 'Filosofia, Filosofia das Ciências'),
