(206, 'pt_BR', 'abstract', '<p>O embargo estadunidense ao petróleo proveniente da Rússia, invasora da Ucrânia na Guerra que se desenrola no Leste Europeu desde fevereiro de 2022, levou à aproximação dos Estados Unidos da América com a República Bolivariana da Venezuela. A possibilidade de atender a demanda estadunidense&nbsp; tem levado o governo venezuelano a estudar projetos de intensificação da exploração do recurso energético, inclusive em territórios indígenas biodiversos. Historicamente, esta atividade produtiva causou inúmeros impactos sociais e ambientais nos territórios indígenas do países, em particular na regiao do delta do rio Orinoco. Partindo do pano de fundo teórico e metodológico interdisciplinar, com base nas Epistemologias do Sul e na literatura existente sobre os impactos socioambientais da exploração do petróleo na região, esta pesquisa visa analisar os possíveis desdobramentos &nbsp;da Guerra na Ucrânia no modo de vida dos habitantes seculares das margens do rio Orinoco: os Warao, também conhecidos como o “povo da canoa”.</p>'),
