(207, 'pt_BR', 'abstract', '<p>Este projeto tem por objetivo repensar a periferia paulistana como um espaço dedicado ao “outro”, onde a reprodução do epistemicídio é uma regra adotada para controlar os corpos anteriormente expulsos e marginalizados, incorporados à lógica ocidental. Para isso, a pesquisa irá pensar a partir do contexto de uma escola pública da periferia paulistana, em específico, a periferia da Fazenda da Juta, buscando entender como o ensino de história pode reproduzir esse epistemicídio, refletindo, principalmente, em como a história do bairro é retratada na escola escolhida. Como forma de compreender esses processos, algumas questões devem ser postas, sendo elas: quais são os problemas que o epistemicídio gera para a sociedade periférica? É possível pensar em uma educação libertadora e emancipadora com essa modalidade de ensino? De que forma as epistemologias do Sul podem nos ajudar a repensar novas práticas escolares e sociais no território periférico? A pesquisa possui abordagem qualitativa, com análise de referencial bibliográfico e metodologia de coleta de dados a partir de entrevistas com estudantes de uma escola pública de ensino fundamental, utilizando-se de grupo focal como forma de condução dos encontros. Além disso, é previsto uma produção de material dos próprios estudantes em relação ao próprio bairro em que vivem a partir de oficinas planejadas e executadas pelo pesquisador. Espera-se ao final da pesquisa, compreender o epistemicídio como um silenciamento dos jovens periféricos, entendidos como “outro” na lógica da modernidade e, a partir disso, refletir sobre uma educação libertadora através da produção autoral dos participantes sobre a história do seu bairro, evidenciando o diálogo e a compreensão entre os conhecimentos global e local como uma prática para a busca pela emancipação educacional do sul global.</p>'),
