(208, 'pt_BR', 'abstract', '<div class=\"page\" title=\"Page 1\">\r\n<div class=\"layoutArea\">\r\n<div class=\"column\">\r\n<p>As Áreas Marinhas Protegidas (sigla “MPAs” em Inglês) são áreas oceânicas que possuem alguma restrição de uso e, idealmente, monitoramentos ecológicos periódicos e planos de manejo, visando a conservação da biodiversidade e preservação dos ecossistemas contra à exploração antrópica, que causa desequilíbrio e diversas perdas à vida marinha e prejuízos aos processos e serviços ecossistêmicos, como deterioração de hábitas, reduções de abundância de organismos, alteração de composição nas comunidades, impactos nos ciclos de vida e colapso da pesca, além de poluição. Hoje, cerca de 25% das águas e costa brasileiras estão dentro deste regime de proteção, porém, com a necessidade de alcançar no mínimo 30%, porcentagem acordada na Cúpula da Terra no Rio de Janeiro, realizada em 1992, para que a proteção seja considerada “eficaz”, juntamente com fiscalização e uso adequados. Apesar da porcentagem de MPAs no Brasil ser próxima do acordado, elas nem sempre cumprem com o papel empregado a elas, podendo apresentar falhas na administração, nas metodologias de monitoramentos e avaliação, no nível de proteção que foram designadas etc. Portanto, é importante que as MPAs sejam adequadamente monitoradas, fiscalizadas e manejadas, em uma abordagem integrada incluindo gestores, pesquisadores e seus diferentes tipos de usuários. Este trabalho visa então realizar uma revisão bibliográfica para produzir uma síntese da situação atual e real das MPAs do Brasil, identificando problemas e lacunas diante de sua heterogeneidade de contextos, tamanhos, recursos, dados disponíveis e categorias.</p>\r\n</div>\r\n</div>\r\n</div>'),
