(209, 'pt_BR', 'abstract', '<p>O Espectro do Autismo (EA, ou Autism spectrum disorders com a sigla ASD em inglês) é um transtorno do neurodesenvolvimento e relaciona-se com déficits persistentes na comunicação social e na interação social em múltiplos contextos e padrões restritos e repetitivos de comportamento, interesses ou atividades, com subdivisões relacionadas ao prejuízo na linguagem funcional e à deficiência intelectual, segundo CID-11. Partindo de uma visão pautada na neurodiversidade, compreende-se o Espectro Autista como uma diferença neurológica dos indivíduos dentro do espectro, do qual não há cura por não se tratar de uma doença e deve ser respeitada como diversidade. A partir dessa visão, o presente projeto pretende construir um Planejamento Educacional Individualizado (PEI) para 6 estudantes do espectro autista público-alvo da educação especial matriculados na educação superior, além de garantir condições para a sua respectiva implementação, a partir do envolvimento dos educadores e do acompanhamento do desempenho acadêmico dos estudantes durante o período de dois quadrimestres ou dois semestres. Será utilizada uma abordagem de sujeito único com delineamento ABABA, com 8 fases de execução. Pretende-se avaliar, ainda, como o diagnóstico teve impacto na vida dos participantes, quais questões podem ter colaborado para um processo de diagnóstico tardio e como questões de gênero podem se relacionar com esta problemática através de comparações inter-sujeitos.</p>'),
