(211, 'pt_BR', 'abstract', '<p>A dor crônica é uma doença extremamente prevalente na população, estimando-se que cerca de 30% da população global padeça por ela. Além disso, é muito estudada atualmente com os avanços da medicina, principalmente em pesquisas neurológicas que conseguiram observar que há alterações funcionais, vistas do eletroencefalograma, no cérebro de paciente de dor crônica. O tratamento dessa doença ainda é muito discutido, uma vez que a farmacologia gera efeitos adversos e não é 100% comprovada. Alguns estudos mostram que a estimulação cerebral em pacientes com dor crônica pode ser efetiva pela melhora do quadro clínico, porém ainda não se sabe os mecanismos neurológicos que estão presentes nessa mudança positiva do quadro. Está sendo pesquisado então, tratamentos que deem menos efeitos adversos e que possam ser equivalentemente efetivos, começou-se a pesquisar sobre o uso do tACS na dor crônica. tACS é uma estimulação neurológica não invasiva que mostrou efeitos positivos no tratamento de diversas patologias, psiquiátricas e neurológicas, sendo uma técnica de estimulação cerebral que consegue modular as oscilações cerebrais e, dado que os pacientes com dor têm alterações no processamento cerebral em repouso e afetivo, pode ser plausível que a tACS consegue provocar mudanças relevantes. O objetivo deste projeto é observar o mecanismo neurofisiológico da neuromodulação do tdcs na redução da dor em pacientes com dor crônica. O projeto se baseia na observação da funcionalidade do cérebro antes e depois da estimulação, via EEG, para se observar a possível neuromodulação. O projeto possuirá dois grupos, um com pacientes saudáveis e outro com pacientes com dor crônica. No grupo de pacientes com dor crônica, o EEG será medido antes e após uma sessão de tACS. No grupo de pessoas saudáveis, apenas será realizada uma sessão de EEG para coletar dados em repouso e de processamento emocional. A sessão de tACS ativa será efetuada com estimulação anódica em CP3 e catódica na região supra orbital direita, com uma intensidade de 0.4 mA e uma frequência de 10 Hz durante vinte minutos com o paciente em repouso. Na sessão de tACS sham será simulada uma sessão de tACS. As medidas da dor, assim como as mudanças nos parâmetros do EEG bem em repouso ou bem em resposta a estímulos afetivos serão considerados os desfechos principais desta pesquisa. Espera-se que sejam observadas diferenças significativas no grupo de pacientes com dor crônica após a tACS ativa (em comparação com a sessão antes da tACS) e que a tACS produza valores semelhantes aos do grupo de pessoas saudáveis nos desfechos principais.</p>'),
