(212, 'pt_BR', 'abstract', '<p>As habilidades de leitura e escrita são fundamentais para o desenvolvimento escolar e cultural das pessoas dentro da sociedade. No entanto, pessoas com deficiências podem apresentar dificuldade na aquisição destas habilidades. Uma forma de estudar os mecanismos envolvidos na aprendizagem de leitura e escrita em crianças é por meio das medições neurofisiológicas durante a realização de tarefas acadêmicas de ensino. Este projeto tem como objetivo avaliar a aprendizagem de leitura e escrita de crianças com autismo e/ou DI em um programa de ensino denominado como ALEPP. O procedimento será aplicado com seis crianças com diagnóstico de autismo e/ou deficiência intelectual e será realizado em fases experimentais com o uso da Espectroscopia funcional em infravermelho próximo (fNIRS) em tarefas de avaliação do ensino de palavras e tarefas de generalização do ensino. Espera-se que o estudo produza dados nas fases experimentais sobre a atividade neurofisiológica durante o processo de aprendizagem.</p>'),
