(213, '', 'categoryIds', '[]'),
(213, 'pt_BR', 'abstract', '<p><span class=\"TextRun SCXW252387320 BCX0\" lang=\"PT-BR\" xml:lang=\"PT-BR\" data-contrast=\"auto\"><span class=\"NormalTextRun SCXW252387320 BCX0\">A diversidade urbana amazônica se distingue das demais regiões do país por fatores como&nbsp; sua localização,&nbsp; condições geográficas e climáticas,&nbsp; por sua história de colonização e ciclos econômicos próprios. A&nbsp; região&nbsp; carece de bases cartográficas atualizadas que subsidiem o&nbsp; planejamento territorial otimizado e congruente com as especificidades locais. A partir de dados de bases de </span><span class=\"NormalTextRun SCXW252387320 BCX0\">sensoriamento remoto gratuitas, o presente projeto de iniciação cientifica objetiva elaborar </span><span class=\"NormalTextRun SCXW252387320 BCX0\">uma série temporal que exprima a expansão urbana Amazônica dentro de suas categorizações de urbanização próprias, que diferem das utilizadas para urbanização de outros estados. Para tanto, será realizado um levantamento documental bibliográfico das literaturas sobre a urbanização amazônica, o esclarecimento acima do conceito de área construída e do uso de sensoriamento remoto para a extração da área construída. Posteriormente serão avaliadas as imagens de satélites da série LANDSAT, especialmente os satélites Landsat-8 e Landsat-9, para a extração de área construída no município de Santarém que é a área de estudo do presente projeto.</span></span><span class=\"EOP SCXW252387320 BCX0\" data-ccp-props=\"{&quot;201341983&quot;:0,&quot;335551550&quot;:6,&quot;335551620&quot;:6,&quot;335559739&quot;:160,&quot;335559740&quot;:360}\">&nbsp;</span></p>'),
(213, 'pt_BR', 'areaSubarea', 'PLANEJAMENTO URBANO E REGIONAL / DEMOGRAFIA - MÉTODOS E TÉCNICAS DO PLANEJAMENTO URBANO E REGIONAL'),
