(216, 'pt_BR', 'abstract', '<p>O câncer de mama triplo-negativo (TNBC) apresenta alta agressividade com rápida evolução clínica e baixas taxas de sobrevivência, além disso, é definido pela elevada heterogeneidade celular e molecular, dificultando a descoberta de terapias alvo efetivas. O carcinoma renal de células claras (ccRCC) é o mais comum entre os subtipos de cânceres renais, apresentando alto índice metastático, além de representar 2% dentre todos os canceres no mundo. A anidrase carbônica IX (CAIX) é uma metaloenzima associada a membrana com a função de regular o pH em condições de hipoxia promovendo a invasão das células tumorais em microambientes hipóxicos, essa enzima encontra-se superexpressa em TNBCs e ccRCC. O ligante de morte celular programada-1 (PD-L1) também é superexpresso em diversos tipos de tumores, sendo que o PD-L1 é capaz de interagir com o receptor de morte celular programada-1 (PD-1) que está localizado em linfócitos L (LT) favorecendo a exaustão dos LT e tornando-os incapazes de coibir a progressão tumoral. Este projeto tem como objetivo analisar uma possível reversão da exaustão promovida potencialmente pelos LT CAR (<em>chimeric antigen receptor T cells</em>) anti-CAIX liberadores de anticorpos anti-PD-L1<em> in vitro </em>em co-cultura com linhagens de TNBCs e ccRCC.</p>'),
