(218, '', 'categoryIds', '[]'),
(218, 'pt_BR', 'abstract', '<p>A maioria das metodologias de avaliações de risco de desastre foi desenvolvida por profissionais de ciências naturais e o Quadro de Sendai da ONU reconhece a necessidade de incluir nesses métodos as complexas conexões intercalares dos processos físicos com a vulnerabilidade social, especialmente em países em desenvolvimento. Este projeto tem como objetivo analisar a experiência de inclusão de informações de vulnerabilidade social em protocolos de campo dos Planos Municipais de Redução de Riscos (PMRR) de São Bernardo do Campo e Franco da Rocha (2020-2021). Pretende-se estruturar uma base de dados georreferenciados com os dados dos protocolos de campo sobre os setores de risco, e em seguida, analisar a relação entre vulnerabilidade e risco por meio do método de florestas aleatórias ordinais. Por fim, pretende-se tecer reflexões qualitativas sobre as limitações e potencialidades da inclusão dos aspectos de vulnerabilidade nos estudos de caso analisados.</p>'),
(218, 'pt_BR', 'areaSubarea', 'Geociências; Geografia urbana; Aspectos Sociais do Planejamento Urbano e Regional; Aspectos Físico-Ambientais do Planejamento Urbano e Regional'),
