(219, 'pt_BR', 'abstract', '<p>A busca pelo conforto climático no ambiente, influenciando bem-estar humano e produtividade, pode se dar pela climatização artificial de ambientes fechados, mas gera impactos ambientais e uma artificialização da experiência de vida humana. Neste projeto, busca-se pensar sobre quais seriam os lugares do mundo com melhor conforto climático natural, ao ar livre. Será realizada uma pesquisa de abrangência global para avaliar como as pessoas se sentem confortáveis em relação à umidade relativa do ar, à temperatura percebida e à radiação solar onde vivem. A partir dos resultados, serão criados indicadores de conforto climático. Esses indicadores serão utilizados para mapear o conforto climático em escala global. Os resultados são discutidos frente à distribuição espacial da população atual e os cenários passados, atuais e futuros de dinâmicas demográficas e climáticas.</p>'),
