(220, '', 'categoryIds', '[]'),
(220, 'pt_BR', 'abstract', '<p>O debate sobre o acesso à água de maneira digna e de qualidade pode ser encontrado tanto nos materiais acadêmicos de pesquisa quanto em propostas de políticas públicas e reivindicações sociais. Essa discussão emerge em uma realidade de desigualdade social que se concretiza também em áreas de moradias precárias, principalmente, nas periferias brasileiras. Nestes locais, o risco de as pessoas sofrerem com a insegurança hídrica e sofrerem como os impactos diretos e indiretos no seu cotidiano é ainda maior do que em outras áreas. A intermitência do abastecimento de água, o valor das tarifas cobradas pelo serviço de abastecimento e a inexistência de infraestrutura são alguns dos obstáculos para se atingir a segurança hídrica. Essa pesquisa tem por objetivo identificar os níveis de insegurança hídrica presentes na comunidade Wilma Flor - Cidade Tiradentes, no município de São Paulo, por meio da coleta de dados por questionários aplicados no formato presencial. Os dados coletados serão sistematizados, analisados estatisticamente e apresentados no formato de infográficos e figuras. A identificação dos níveis de insegurança hídrica obtida neste projeto contextualizará uma pesquisa de mestrado em andamento que se propõe a aprofundar o entendimento das relações de gênero nas estratégias de garantia da segurança hídrica na comunidade estudada. Por fim, este projeto de pesquisa contribuirá para o desenvolvimento de futuras pesquisas assim como no embasamento da discussão de futuras políticas públicas, no contexto do direito à água e moradia em áreas de habitação precária presentes em municípios como o de São Paulo.&nbsp;</p>'),
(220, 'pt_BR', 'areaSubarea', 'Planejamento Urbano e Regional; Planejamento Territorial; Ecologia Política'),
