(221, 'pt_BR', 'abstract', '<p>Em março de 2020, a Organização Mundial da Saúde (OMS) definiu o surto da Covid-19 como pandemia. Dentre as várias frentes de pesquisa para o controle dessa crise sanitária, existem aquelas que utilizam imagens médicas para a triagem, diagnóstico e prognóstico da patologia. Um número considerável e crescente de bancos de dados de radiografias e tomografias de tórax, somado à carência de radiologistas e o aumento da complexidade das imagens médicas, gerou um cenário desafiador para o combate à doença. O presente projeto tem como objetivo analisar a eficiência das ferramentas de aprendizado de máquina profundo no contexto de achados pulmonares relacionados à Covid-19. Utilizaremos redes convolucionais consagradas na literatura, bancos públicos de imagens médicas e métricas de performance para explorar o potencial e compreender as aplicações e limitações dessa ferramenta computacional no suporte ao diagnóstico médico da Covid-19.</p>'),
