(222, '', 'categoryIds', '[]'),
(222, 'pt_BR', 'abstract', '<p>O Mar Negro tem sido palco de uma importante geopolítica russa no século XXI, remontando, portanto, ao início da formação da <em>Rússia Moderna</em> e a sua definição como <em>império europeu</em> no século XVIII. Nesse período, a Rússia expandiu seu territóriono &nbsp;entorno do Mar Negro, regiões do Báltico e do Cáucaso. Tal expansão estratégica - nomeada como “porta para a Europa” - teve como intento intensificar suas interações aos vizinhos ocidentais. A expansão começou pela conquista de São Petersbugo, no Golfo da Finlândia, e depois no Baltico (Lituânia, Estônia, Letônia), por Pedro I, e, posteriormente, a consolidação de poder da Rússia no Báltico e no Cáucaso pela Catarina II. Como podemos observar que a Rússia como conhecemos hoje, em seus aspectos culturais e territoriais, sofreu e sofre grande influência do território do Mar Negro, visto que, a sua formação como nação moderna e seu auge político está intimamente ligado a esse espaço. É necessário, portanto, analisar a geopolítica russa no século XXI no Mar Negro para então compreendermos qual será os próximos movimentos da Rússia em relação as nações que compõe atualmente esse espaço.</p>'),
(222, 'pt_BR', 'areaSubarea', 'Relações Internacionais; Geopolítica '),
