(223, 'pt_BR', 'abstract', '<p>O balão dirigível Bartholomeu de Gusmão - 1892 - de Augusto Severo foi o primeiro aeróstato do mundo a resolver o problema de tangagem em balões. O balão tinha várias inovações dentre as quais uma tornava sua estrutura semi-rígida, de modo a corrigir o problema de tangagem. A solução incorporava uma estrutura interna ao envelope do balão: constava de uma viga principal e elementos de treliça, possibilitando a fixação de propulsores no eixo longitudinal principal do balão, equilibrando esforços e evitando assim a tangagem. Na pesquisa um desenho em computador do balão será construído utilizando desenhos de época. A partir&nbsp; desse desenho e com a especificação de perfis e materiais, um modelo da estrutura será desenvolvido, visando a analisar a resposta do balão em condições de enchimento do envelope, ascenção e movimento lateral. Como bambu foi utilizado na construção do aeróstato na França, e uma falha estrutural num dia de tempestade o destruiu, diferentes materiais serão testados com vistas a verificar se utilizando a mesma figura de mérito, a falha poderia ser evitada.&nbsp; Nos relatórios serão apresentados os resultados. Uma revisão da importância histórica e legado do balão também serão incorporados.</p>'),
(223, 'pt_BR', 'areaSubarea', 'Engenharia Aeroespacial; Estruturas'),
