(224, 'pt_BR', 'abstract', '<p>Neste projeto pretendemos estudar o comportamento de um passeio aleatório com ramificação em um grafo finito. Em particular, queremos mostrar que quando o total de partículas é um processo de nascimento e morte supercrítico, então com probabilidade tão alta quanto se queira, dado um total de partículas inicial de partículas suficientemente grande, o processo eventualmente ocupará todos os sítios e jamais desocupará nenhum sítio do grafo.</p>'),
