(225, 'pt_BR', 'abstract', '<p>O surgimento da física quântica no século passado, nos levou a uma revolução tecnológica com o desenvolvimento de dispositivos eletrônicos e, consequentemente, suas aplicações em comunicação, computação, entre outras áreas. Contudo, apesar da mecânica quântica ser fundamental nos desdobramentos tecnológicos atuais, estes ainda são sistemas essencialmente clássicos, no sentido que características intrinsecamente quânticas (tais como superposição e emaranhamento) não se manifestam nas aplicações. <br><br>Nas últimas décadas, com o advento de abordagens da Teoria da Informação na descrição de sistemas quânticos, estamos desenvolvendo o inicio de uma nova geração de dispositivos tecnológicos, onde buscamos utilizar as propriedades intrinsecamente quânticas dos sistemas físicos em prol de vantagens em desempenho e eficiência. Esta abordagem tem sido considerada a segunda revolução quântica e, muitas vezes, denominada de <em>Tecnologias Quânticas 2.0</em>. De fato, as aplicações vão além da tecnologia de informação, abrangendo áreas como comunicação, metrologia, medicina, entre outras. No contexto da metrologia quântica, buscamos utilizar as propriedades quânticas de sensores e também de processos de medida para alcançar os limites últimos em precisão e sensibilidade. <br><br>Neste projeto, nosso intuito é estudar sistemas de medidas interferométricos que utilizam estados quânticos da luz, tanto do ponto de vista teórico quanto experimental. Estaremos avaliando diversas configurações distintas na busca de mapear adequadamente suas vantagens e limitações. Nesta contextualização estaremos trabalhando com ferramental teórico como a informação de Fisher e outras medidas para construir figuras de mérito para diferentes configurações interferométricas. A estudante terá a oportunidade de aprender de forma abrangente desde teoria de informação até óptica quântica, que permitirão que ela obtenha uma boa compreensão destas áreas e desenvolva habilidades práticas ao lidar com os sistemas que serão estudados. Além disso, ela participará do desenvolvimento dos trabalhos em nosso grupo como parte de um projeto maior que envolve protocolos quânticos aplicados a metrologia.</p>'),
