(226, 'pt_BR', 'abstract', '<p>Este projeto de iniciação científica prevê o desenvolvimento de uma metodologia de síntese do etomidato, um fármaco utilizado para induzir anestesia geral no processo de intubação orotraqueal (ou endotraqueal). Este procedimento hospitalar ficou em evidência durante a segunda onda da COVID-19 no país, principalmente por causa da falta de medicamentos (kit intubação) necessários para o procedimento, incluindo o próprio etomidato.</p>\r\n<p>Nosso grupo de pesquisa já obteve o etomidato quiral em duas etapas, porém com baixo rendimento. Assim, uma nova proposta está sendo apresentada. Esta nova proposta consiste em funcionalizar o feniletanol para um derivado halogenado afim de tornar mais susceptível à substituição nucleofílica.</p>'),
