(227, 'pt_BR', 'abstract', '<p>Em um mecanismo flexível o movimento é dado pela flexibilidade da estrutura ao invés da presença de juntas e pinos. Essa característica faz com que esses mecanismos tenham grande aplicação em dispositivos de mecânica de precisão e sistemas microeletromecânicos (MEMS). Várias técnicas são usadas no projeto de mecanismos flexíveis, sendo que entre elas a otimização topológica (OT) tem se mostrado a mais genérica e sistemática. O objetivo desse trabalho de iniciação científica é implementar um software (“solver”) para o projeto de mecanismos flexíveis, usando o método de otimização topológica. O algoritmo do OT combina um método de otimização com o método dos elementos finitos (MEF), para distribuir material no interior de um domínio de projeto de maneira a atender uma função objetivo especificada, satisfazendo dadas restrições impostas ao problema de otimização. O software para otimização e projeto de mecanismos flexíveis será desenvolvido utilizando a linguagem Python.</p>'),
