(229, 'pt_BR', 'abstract', '<p>Ao se comprimir um material pelo seu comprimento, o esperado é que sua largura aumente, porém, nem todos os materiais funcionam assim, ou seja possuem o coeficiente de Poisson positivo. Os chamados materiais auxéticos possuem o Coeficiente de Poisson negativo diminuindo sua largura ao se comprimir o comprimento. Tal efeito provém da característica estrutural dos materiais, também sendo construído a partir de uma microestrutura projetada. Materiais auxéticos são raros de serem encontrados na natureza, sua manufatura se faz necessária e por conta desse fato começaram a ganhar destaque na comunidade científica a algumas décadas por serem promissores em diversas áreas, como na área biomédica ou de equipamentos de proteção. Em princípio, o presente projeto de Iniciação Científica tem por objetivo explorar a simulação computacional, fabricação e caracterização de estruturas que possuem efeito auxético. A estrutura projetada, com auxílio de um software de CAD, será fabricada por técnica de manufatura aditiva (impressão 3D), na qual um objeto é construído camada por camada (adição de material). A estrutura fabricada será caracterizada através de ensaios experimentais para verificar o seu desempenho.</p>'),
