(230, 'pt_BR', 'abstract', '<p>A mandíbula é um importante elemento estrutural da face, que integra o sistema estomatognático. Sua importância funcional vai desde servir como alavanca para o movimento mastigatório até absorver e dissipar as forças da mastigação. Uma prótese de Articulação Temporo-Mandibular (ATM) deve ser capaz de simular essas propriedades da mandíbula. A Otimização Topológica consiste num método computacional poderoso de otimização estrutural que permite projetar a topologia ótima de uma dada estrutura. Na área biomédica, o método de Otimização Topológica (MOT) pode auxiliar no estudo e na confecção de próteses, órteses e outras estruturas relacionadas. O principal objetivo deste projeto de iniciação científica é aplicar o MOT na projeção de uma prótese de ATM. Para isso, será utilizado um software comercial de Otimização Topológica para projeto de estruturas com máxima rigidez sujeitas a restrição de peso.</p>'),
