(231, 'pt_BR', 'abstract', '<p>As espécies <em>Schinus molle</em> L. e <em>Schinus terebinthifolia </em>Raddi pertencem à família Anacardiaceae Lindl., são nativas da América do Sul e popularmente conhecidas em razão de seu uso agronômico e paisagístico. Ademais, estas espécies são valorizadas pela qualidade de seu lenho, pelo uso de seus frutos na culinária, pelo uso industrial de suas resinas e por seus potenciais medicinais. Entretanto, informações citogenéticas para este gênero são escassas e restritas a contagens de cromossomos. Este projeto propõe caracterizar o perfil citogenético, através de técnicas de citogenética clássica e bandamento com fluorocromos CMA/DAPI, e reprodutivo, com a análise do processo de microsporogênese e de viabilidade polínica, de ambas as espécies, juntamente com uma revisão sistemática de informações cariotípicas da família e do gênero, comparando-as e analisando-as com as mais recentes revisões de sua filogenia.</p>'),
