(232, 'pt_BR', 'abstract', '<p>O crescente aumento das pesquisas, estudos e projetos em conservação da biodiversidade tem se dado pelos diversos fatores antrópicos e naturais que vêm ocorrendo ao longo do tempo em nosso planeta. Como forma de definir estratégias e ações conservacionistas utilizam-se as Listas Vermelhas, as quais seguem critérios da <em>International Union for Conservation of Nature</em> (IUCN). No âmbito da avifauna brasileira, podemos destacar sua importância no contexto mundial, onde 165 espécies do país estão na lista de ameaçadas de extinção, número que representa 12% de todas as aves em risco no planeta. A pesquisa e compreensão da avifauna no Estado de São Paulo, o qual abrange os domínios fitogeográficos do Cerrado e da Mata Atlântica, dois <em>hotspots</em> mundiais, se mostra um importante fator para a compreensão das causas que acarretam a (quase) extinção de tantas espécies. Portanto, o presente trabalho visa analisar a relação entre as variáveis ambientais e a distribuição da riqueza de espécies de aves endêmicas e ameaçadas no Estado de São Paulo e que estão incluídas na Lista Vermelha das Espécies de Aves (IUCN).</p>'),
