(233, 'pt_BR', 'abstract', '<p><span style=\"font-weight: 400;\">Um jogo sério do tipo quiz, geralmente, objetiva o ensino e a avaliação de forma dinâmica e atrativa para o aprendiz. Para viabilizar a elaboração de quizzes que possam contribuir com o processo de ensino-aprendizagem, o professor precisa ter acesso a um ambiente favorável em que possa especificar o conteúdo das questões, inserir feedbacks motivadores e possa acompanhar o desempenho dos estudantes. Este projeto visa avaliar a condição de acessibilidade do serviço web existente, nomeado “plataforma Quizle”, com base em diretrizes de acessibilidade web, e propor melhorias em sua interface de modo que ela se torne mais acessível a professores com ou sem deficiência. Espera-se gerar um protótipo de uma nova interface e avaliá-lo com o público-alvo.</span></p>'),
