(234, 'pt_BR', 'abstract', '<p>O Brasil é um dos maiores produtores de alimentos do mundo e uma das consequências é<br>a geração de milhões de toneladas de resíduos que, atualmente, são em sua maioria<br>descartados, queimados em caldeira ou utilizados na produção de ração animal. Entretanto,<br>estes resíduos são potenciais fontes de compostos de interesse comercial e poderiam ser<br>transformados em produtos de maior valor agregado. Estima-se que o país produziu 7<br>milhões de toneladas de banana no ano de 2021 e que a cada tonelada de fruta produzida<br>são geradas cerca de 4 toneladas de resíduos como pseudocaule, folhas, casca e<br>inflorescências. A literatura já reportou a presença de compostos bioativos de interesse<br>comercial como lupenone, pentacosano, fitoesteróis, compostos fenólicos e outros na<br>inflorescência da bananeira. Além disso, a fração lignocelulósica da biomassa pode ser<br>utilizada para a produção de açúcares fermentáveis, que podem ser precursores de<br>bicombustíveis de segunda geração. No contexto da economia circular, apresenta-se a<br>possibilidade de uma biorrefinaria utilizando resíduos agroindustriais de bananeira como<br>matérias-primas. Destarte, o presente projeto pretende realizar a caracterização<br>físico-química da inflorescência da bananeira, Musa acuminata \'Dwarf Cavendish\',<br>variedade abundante no país, visto que a informação é importante para dar prosseguimento<br>aos estudos da biorrefinaria.</p>'),
