(235, 'pt_BR', 'abstract', '<p>Em um contexto de contínuo agravamento das mudanças climáticas, impactos podem ser observados por toda a biosfera. Os insetos sociais, como os cupins Neotropicais, têm importante papel em processos de ciclagem de nutrientes e decomposição de substratos vegetais, sendo sua manutenção dependente de temperaturas ideais. Logo, através de bioensaios, esta proposta visa avaliar a tolerância térmica e o consumo de alimento a partir da variabilidade climática de uma espécie cupim neotropical.</p>'),
