(236, '', 'categoryIds', '[]'),
(236, 'pt_BR', 'abstract', '<p><strong>Introdução: </strong>A hipóxia é definida como uma diminuição da concentração de O2 tecidual e a isquemia com uma diminuição do fluxo sanguíneo para o tecido que, por sua vez, impede a distribuição adequada de O2, glicose e outros nutrientes. Os insultos hipóxico-isquêmicos se referem a uma reduzida circulação e oxigenação sanguínea no cérebro e podem ser ocasionados por parto prematuro ou por injúrias que ocorrem durante o nascimento como, por exemplo, a asfixia. <strong>Objetivo:</strong> O presente estudo tem o objetivo de avaliar o efeito neuroprotetor da proteína Neuroglobina (Ngb) em cérebros de ratos <em>Wistar</em> submetidos ao modelo de anóxia neonatal, que mimetiza o insulto hipóxico-isquêmico em humanos. <strong>Métodos:</strong> Os ratos neonatos com 1 a 2 dias de vida pós-natal (PN1-2), serão submetidos ao modelo descrito por Takada e colaboradores (Takada <em>et al.,</em> 2011) onde serão colocados em uma câmara de policarbonato, a qual será saturada completamente com nitrogênio 100% a um fluxo de 11,5 L/minuto, durante 25 minutos e aquecidos a 37ºC. O grupo controle será exposto às mesmas condições experimentais sem, contudo, haver troca do ar dentro da câmara, ou seja, permanecerá ao ar ambiente. Os encéfalos dos filhotes machos serão dissecados com PN7 e encaminhados para o estudo imuno-histoquímico e de Western Blotting para análise da proteína Ngb. Todos os dados obtidos neste estudo resultarão em contribuições científicas relevantes para a compreensão dos reais efeitos da anóxia sobre o desenvolvimento cerebral dos filhotes, dentro de um projeto maior desenvolvido no mesmo grupo de pesquisa.</p>'),
