(237, 'pt_BR', 'abstract', '<p>A fibrilação atrial (FA) é a arritmia cardíaca supraventricular mais comum no mundo. FA é caracterizada pela atividade elétrica rápida e anormal nos átrios, causando alterações na função mecânica dos átrios. Estas características refletem diretamente nos padrões hemodinâmicos, levando a menor volume ejetado dos átrios para os ventrículos, menores velocidades do sangue e maior tempo de residência do sangue nas câmaras atriais. Além disso, o apêndice do átrio esquerdo (AAE), região sacular resultante do desenvolvimento embrionário, é caracterizado por ser uma região de grande recirculação do sangue, e na ausência da contração muscular organizada, resulta na estagnação do sangue. Modelos numéricos integrando diferentes físicas, especificamente na área cardiovascular, a atividade eletrofisiológica, a biomecânica e a hemodinâmica, representam ferramentas interessantes para investigar condições patológicas em diferentes cenários à níveis específicos do paciente. No contexto da FA, as condições pró-trombóticas estão diretamente relacionados aos padrões de escoamento, que por sua vez são diretamente afetados pela biomecânica do átrio, envolvendo fases de expansão, contração e oscilação mecânica devido a atividade fibrilatória. Desta forma, este projeto objetiva o desenvolvimento de um algoritmo capaz de realizar a prescrição da variação de volume do átrio esquerdo em função do ciclo cardíaco e em condições de FA com base no mapeamento das coordenadas das geometrias e determinação do deslocamento em função das fases do ciclo cardíaco e/ou FA. As coordenadas determinadas pelo algoritmo serão utilizadas como condições de contorno em simulações por Dinâmica dos Fluidos Computacional (CFD), isto é, pela prescrição de um perfil 2D ou 3D transiente no <em>setup</em> CFD, para investigação dos padrões hemodinâmicos em condições saudáveis e de FA e quantificação de indicadores hemodinâmicos de formação de trombos.</p>'),
