(238, 'pt_BR', 'abstract', '<p>O uso de implantes tem crescido vertiginosamente nos últimos anos, impulsionado pelo envelhecimento das populações em países desenvolvidos e pelo desejo dos pacientes de manter um bom nível de atividade e qualidade de vida. Consequentemente, a demanda por biomateriais implantáveis ​​de alto desempenho que possam enfrentar desafios únicos em cardiologia, terapia vascular, ortopedia, trauma, coluna, odontologia e tratamento de feridas também vem aumentando constantemente. A literatura apresenta inúmeros exemplos de aplicações de biomateriais metálicos, poliméricos, cerâmicos, bem como materiais compósitos. Em se tratando de substituição permanente ou temporária de tecido sujeito à solicitação mecânica, os metais são os biomateriais mais comumente utilizados. No que diz respeito às situações em que o dispositivo implantável deve ser temporário, biomateriais reabsorvíveis vêm sendo desenvolvidos, dentre os quais destacam-se os polímeros biorreabsorvíveis. Porém, quando existe a necessidade de resistência à esforços mecânicos, os materiais poliméricos deixam a desejar e, assim, nas últimas décadas, esforços significativos têm se voltado para o desenvolvimento de metais implantáveis, que sejam biodegradáveis, particularmente para usos na área ortopédica e cardiovascular. Este projeto visa realizar um estudo sobre os metais absorvíveis, avaliando as vantagens e desvantagens para uso na prática clínica, particularmente nas áreas ortopédica, com dispositivos temporários para fixação óssea, e cardiovascular, com <em>stents</em> vasculares. Como objetivos específicos, o estudo visa levantar informações sobre as principais ligas metálicas biodegradáveis que vêm sendo estudadas para uso como biomateriais, conhecer o mecanismo de biodegradação e reabsorção em meio fisiológico e avaliar as vantagens e desvantagens de uso de metais biodegradáveis na prática clínica como dispositivos temporários para fixação óssea e como <em>stents</em> vasculares.</p>'),
