(239, 'pt_BR', 'abstract', '<p><span style=\"font-weight: 400;\">Tendo em vista o grande número de pessoas acometidas com onicomicose, popularmente conhecida como micose de unha, o presente projeto tem como objetivo pesquisar parâmetros de formulação para um filme fino multicamadas que venha substituir os tratamentos de escolha, no caso esmaltes e cremes antifúngicos. É sabido que a taxa de adesão ao tratamento tópico é muito baixa, devido ao longo período de tratamento e à frequência diária de aplicação das formulações medicamentosas, necessária em casos de infecção únguea. O uso de um filme de fácil aplicação e durabilidade prolongada (2-5 dias), favorece a continuidade do tratamento e aumentaria sensivelmente&nbsp; a taxa de cura da doença. A proposta inicial é utilizar polímeros biocompatíveis , de fontes naturais e biodegradáveis (sericina, ácido hialurônico e colágeno), de modo a minimizar o impacto ambiental da formulação cosmecêutica.</span></p>\r\n<p><span style=\"font-weight: 400;\">Outro desafio do projeto é desenvolver uma metodologia para a produção dos filmes finos, empregando a técnica de </span><em><span style=\"font-weight: 400;\">blade coating,</span></em><span style=\"font-weight: 400;\"> criando assim filmes homogêneos e com validação em termos de reprodutibilidade; algo difícil de se obter usando as técnicas de </span><em><span style=\"font-weight: 400;\">silk screen e spinning coating.</span></em></p>'),
