(240, 'pt_BR', 'abstract', '<p><span style=\"font-weight: 400;\">Este projeto apresenta uma proposta de pesquisa a ser desenvolvida como projeto de Iniciação Científica e submetida ao edital do Programa de Iniciação Científica da UFABC. Pretende-se refletir sobre a relevância dos serviços de limpeza urbana como elementos de ampliação da compreensão do elo espaço-população-ambiente e seus componentes sociais, econômicos, demográficos e territoriais. Para tanto serão trabalhados dados sobre as características da varrição de rua e coleta de lixo em duas zonas do município de São Paulo, a saber a Zona Oeste, mais consolidada em termos de serviços e equipamentos públicos e também com um padrão econômico mais elevado, e também a Zona Leste, menos consolidada em termos de serviços e equipamentos públicos e com um padrão econômico mais baixo.</span></p>'),
