(242, 'pt_BR', 'abstract', '<p><strong>Introdução: </strong>Componentes do sistema calicreína-cinina estão presentes no cérebro normal em baixas concentrações, a qual pode aumentar dramaticamente durantes insultos cerebral tais como isquemia/reperfusão. Mediadores inflamatórios específicos produzidos no local da lesão podem regular a resposta vascular desta área. <strong>&nbsp;</strong>Um destes mediadores é a bradicinina, que aumenta a permeabilidade da barreira hematoencefálica para pequenas moléculas por ação no receptor B2 e no receptor B1, levando a efeitos pró-inflamatórios.<strong> Objetivo:</strong> O presente estudo tem o objetivo de verificar as alterações cerebrais nos níveis de expressão das proteínas B<sub>1</sub> e B<sub>2</sub> e de seus respectivos receptores em ratos <em>Wistar</em> submetidos à anóxia neonatal. <strong>Métodos:</strong> Os ratos neonatos com 1 a 2 dias de vida pós-natal (PN1-2), serão submetidos ao modelo descrito por Takada e colaboradores (Takada <em>et al.,</em> 2011) onde serão colocados em uma câmara de policarbonato, a qual será saturada completamente com nitrogênio 100% a um fluxo de 11,5 L/minuto, durante 25 minutos e aquecidos a 37ºC. O grupo controle será exposto às mesmas condições experimentais sem, contudo, haver troca do ar dentro da câmara, ou seja, permanecerá ao ar ambiente. Os encéfalos dos filhotes machos serão dissecados com PN7 e encaminhados para o estudo de imuno-histoquímica, imunofluorescência e RT-PCR para análise das proteínas B1 e B2 e seus receptores. Todos os dados obtidos neste estudo resultarão em contribuições científicas relevantes para a compreensão dos reais efeitos da anóxia sobre o desenvolvimento cerebral dos filhotes.</p>'),
