(243, 'pt_BR', 'abstract', '<p>Os poloxâmeros (PL) são compostos não-iônicos que possuem um vasto grupo de copolímeros surfactantes, que são formados por óxido de propileno (PO) e óxido de etileno (EO), de composição geral:&nbsp; EOx-POy-EOx. Esses materiais podem ser utilizados em diversas aplicações biomédicas, tais como bioengenharia tecidual, tratamento oncológico, bioimpressão 3D e liberação de fármacos, sendo essa última o objetivo deste projeto. Os poloxâmeros escolhidos são o P407 (de fórmula HO[CH<sub>2</sub>-CH<sub>2</sub>O]x [CH(CH<sub>3</sub>)-CH<sub>2</sub>O]y[CH<sub>2</sub>-CH<sub>2</sub>O]xOH), e o P403 (constituído por óxido de polietileno (PEO), de fórmula (-CH<sub>2</sub>CH<sub>2</sub>O-)n, e por óxido de propileno (C<sub>3</sub>H<sub>6</sub>O)).</p>\r\n<p>Esses materiais apresentam propriedades anfifílicas importantes para a incorporação de biomateriais para regeneração óssea, sendo realizada pelo controle sobre o processo de dissolução desses copolímeros. Os vidros bioativos são biomateriais de terceira geração que também são utilizados em diversas aplicações biomédicas. Esse biomaterial possui diferentes composições químicas de acordo com cada aplicação, no caso, para este projeto, o vidro selecionado é o 58S (58SiO2 - 33CaO - 9P2O5), sintetizado pelo método sol-gel. Será também utilizado o vidro contendo o elemento hólmio, utilizado na braquiterapia. Os objetivos deste projeto são compreender a estrutura e dinâmica dos sistemas obtidos, avaliando o efeito da incorporação do vidro bioativo aos poloxâmeros a partir da análise das taxas de dissolução do material.</p>'),
