(244, 'pt_BR', 'abstract', '<p>A pesquisa refere-se a uma investigação sobre o desenrolar da<br>Primavera Árabe na Síria, na qual desencadeou uma guerra civil que dura há<br>mais de 10 anos; como se dá a manutenção do atual presidente Bashar alAssad no poder e a possibilidade do país ser aceito de volta na Liga Árabe,<br>analisando as exigências e consequências políticas expondo os lados opostos<br>da contenda, as narrativas de uma eventual força de influência externa no<br>desenrolar da guerra-civil e decifrar quais são as tendências para o retorno da<br>Síria a Liga Árabe, segundo o posicionamento dos líderes dos Estados<br>membros e quais seriam os condicionantes impostos a esse retorno.</p>'),
