(245, 'pt_BR', 'abstract', '<p>Ao longo das últimas décadas, o Método de Otimização de Topologia (MOT), que<br>combina o Método dos Elementos Finitos (MEF) com um algoritmo de otimização para<br>encontrar a distribuição ótima de material no interior do domínio de projeto da estrutura,<br>tornou-se um dos métodos mais populares na indústria e na academia como ferramenta de<br>projeto mecânico para projetos conceituais. Apesar de sua maturidade, apenas recentemente<br>pesquisadores propuseram a adoção de formulações não convencionais do MEF para lidar, por<br>exemplo, com a presença de restrições de tensão e problemas como padrão de tabuleiro de<br>xadrez (ou “checkerboard pattern” em inglês) na Otimização de Topologia (OT). Assim, o<br>presente projeto vai explorar uma formulação alternativa para a OT, no sentido de avaliar<br>problemas planos com restrição de tensão e padrão de tabuleiro de xadrez. A formulação não<br>convencional do MEF adotada nesta pesquisa e aplicada no MOT será a Formulação<br>Híbrido-Mista de Tensão (FHMT). Na FHMT as tensões, os deslocamentos no domínio e o<br>campo de deslocamento no contorno estático são as variáveis principais e aproximadas<br>simultaneamente. Por fim, para avaliação da aplicabilidade da FHMT no MOT serão<br>desenvolvidos experimentos numéricos em MatLab®.</p>'),
