(247, 'pt_BR', 'abstract', '<p>A pesquisa pretende analisar estratégias de investimento para pequenos investidores e poupadores diversificarem suas aplicações financeiras utilizando o mercado acionário. A metodologia proposta para o desenvolvimento da pesquisa procurará apoiar-se na Teoria Econômica Comportamental e nas estratégias usuais de mercado. Serão analisados os preços históricos de ativos listados no Índice BOVESPA como base para a análise das estratégias. A pesquisa apoia-se na hipótese de que há espaço para o pequeno investidos operar em regiões de preço abaixo e acima do \"normal\", levando em consideração comportamentos dos agentes econômicos previstos pela Economia Comportamental.</p>'),
