(248, 'pt_BR', 'abstract', '<p>Em um mundo que está cada vez mais conectado, os dados dos indivíduos continuam majoritariamente sob sistemas de registros centralizados em diferentes organizações, sejam públicas ou privadas. Observando especificamente a área da saúde, além do significativo compartilhamento de dados sensíveis (e.g., diagnósticos, exames, etc.) entre inúmeras unidades de saúde (e.g., clínicas, hospitais, postos de saúde, etc.), os pacientes em si têm pouco ou nenhum controle sobre estes dados. Neste contexto, o presente projeto tem o intuito de analisar arquiteturas baseadas em tecnologias de registros distribuídos (do inglês, <em>Distributed Ledger Technologies</em> - DLT) na implementação de sistemas de informação de saúde, considerando os requisitos de eficiência, segurança e escalabilidade. Na primeira parte deste projeto, será realizada uma revisão bibliográfica quanto às possibilidades de DLTs (e.g, Blockchain, DAG e Holochain). Na segunda parte, será feita a proposta de uma nova arquitetura baseada em DLT, bem como realizados testes de avaliação e validação, considerando métodos baseados em medições, modelagem analítica e/ou simulação. Concomitantemente, serão ainda produzidos artigos para publicação em periódicos científicos.</p>'),
(248, 'pt_BR', 'areaSubarea', 'Engenharia da Informação; Ciência da Computação; Sistemas de Informação'),
