(249, 'pt_BR', 'abstract', '<p>O avanço na área da saúde contribui cada vez mais para uma maior expectativa de vida frente aos inúmeros tratamentos conhecidos e aperfeiçoados que são respaldados pela constante evolução na tecnologia. A engenharia biomédica, por sua vez, é responsável por criar ou aperfeiçoar a tecnologia que será aplicada na área da saúde e, entre seus campos de atuação, encontra-se a engenharia de tecidos, a qual atua principalmente no estudo de substitutos biológicos. A pele, que é o maior órgão do corpo humano e está em constante contato com o meio externo, apresenta inúmeros desafios que podem e devem ser assistidos pela engenharia de tecidos como no uso de membranas bioativas. Os fitoterápicos, por outro lado, apresentam diversas substâncias químicas com potencias medicinais eficientes e comprovados, como o caso da espécie <em>Himatathus drasticus</em>. Tendo em vista esse cenário, o objetivo dessa pesquisa é o preparo e a caracterização de membrana bioativa de gelatina e <em>Himatanthus drasticus</em>, visando o desenvolvimento de curativos para regeneração da pele</p>'),
