(250, 'pt_BR', 'abstract', '<p>Nos últimos anos, a indústria de cosméticos vem crescendo e se aprimorando em seus ativos e composições químicas. As embalagens desses produtos devem acompanhar seu desenvolvimento visto que são responsáveis por auxiliar na duração do produto levando em consideração a validade, proteção e a permanência das propriedades dos ativos ali presentes. Tendo em vista os fatores elencados, foi investigada a possibilidade do desenvolvimento de uma embalagem para cosméticos buscando fazer mudanças em sua estrutura para alcançar uma melhor performance utilizando a biomimética como principal aliada, onde o objeto da natureza utilizado como inspiração é a vagem do amendoim. Além disso, também serão estudados os materiais a serem utilizados na confecção do protótipo. A depender dos resultados alcançados, pode-se julgar a possibilidade da diminuição de conservantes nos produtos em decorrência de uma embalagem que exerça melhor essa função. Será utilizado o software Fusion 360 para o desenvolvimento da peça com design generativo obtendo, assim, uma embalagem com a quantidade mínima de material possível para seu desempenho.</p>'),
