(251, 'pt_BR', 'abstract', '<p>Segundo a Organização Mundial da Saúde (OMS), cerca de 2,2 bilhões de pessoas no mundo são cegas ou apresentam baixa visão. Muitos são os motivos que levam à perda considerável de visão, podendo ser um problema inato ou adquirido ao longo da vida, como por exemplo glaucoma, diabetes, atrofia do nervo óptico, dentre outros. O sistema de escrita e leitura tátil Braille demonstra extrema importância para esses grupos de pessoas, uma vez que tais condições dificultam ou exime a total possibilidade de entendimento e comunicação por vias convencionais da escrita. Ao longo dos anos foram desenvolvidas tecnologias que buscam minimizar esses impactos, como por exemplo os Displays Brailles Atualizáveis que podem ser conectados a computadores para leitura de informações. Tais displays funcionam com células brailes automáticas, e podem conter de 6 a 80 células dependendo do modelo. Apesar de ser uma boa solução, infelizmente esses displays ainda possuem um custo muito elevado. O desafio é desenvolver um atuador compacto e de baixo consumo de energia, que seja capaz de produzir um movimento vertical para impulsionar ou retrair o pino que será usado para o estímulo tátil. Sendo assim, buscando uma possível nova abordagem para esse tema, a pesquisa do uso de músculos artificiais de hidrogel se torna interessante, uma vez que sua movimentação pode ser utilizada para criar um novo mecanismo para displays braille, sendo estes mais leves, mais baratos e com baixo consumo de energia. Utilizando as propriedades de responsividade de hidrogéis, o projeto buscará desenvolver um protótipo de músculo artificial (atuador) para aplicação em célula braille automática.</p>'),
