(253, 'pt_BR', 'abstract', '<p>Os Acordos de Abraão foram assinados em 15 de setembro de 2020 e em tese serão responsáveis por selar a paz além da normalização diplomática entre Israel, Emirados Árabes Unidos (EAU) e o Bahrein – Estado-vassalo saudita –, que logo foram seguidos por Kosovo, Sudão e Marrocos. O tratado levou a uma completa e nova relação diplomática principalmente entre Emirados Árabes e Israel – o que nunca houve desde a criação do Estado de Israel, em 1948. O acordo que sela a paz entre as nações foi o primeiro que Israel conseguiu realizar com um país árabe da região desde 1994 – quando Israel e Jordânia assinaram um tratado de paz – além de serem os primeiros países do Golfo Pérsico a estreitarem laços com o Estado judeu. Em teoria, os Acordos de Abraão diminuiriam as tensões árabe-israelenses e dariam maior segurança para a região, bem como impulsionariam a uma verdadeira e significativa mudança nas relações militares e econômicas ali presentes, com a intensa troca de tecnologias e culturas entre ambos os países, com vislumbre a uma enorme prosperidade da região com oportunidades ilimitadas de trocas científicas e econômicas.<br>O acordo foi uma grande demonstração de que os Estados Unidos ainda têm forte influência na região, além de ser de extrema valia para o Estado de Israel, que vem buscando há décadas, o apoio de importantes atores do Oriente Médio para buscar maior protagonismo na região.<br>Os Acordos de Abraão possibilitaram mais de 30 acordos assinados entre Israel, EAU e Bahrein, nas mais variadas áreas, desde saúde a agricultura até turismo e comunicações. Na visão de especialistas israelenses, o acordo fora um marco de esperança para o futuro de todo o Oriente Médio. O acordo firmado em 2020, com forte intermediação dos EUA, foi importante para que Israel e EAU se comprometessem no desenvolvimento econômico e intelectual de ambos e da região. Um exemplo disso foi<br>que a World Expo Dubai1, que aconteceu em outubro de 2021, teve participação, a convite de Dubai, de Israel que levara todo um pavilhão de inovações tecnológicas nacionais ao seu mais novo aliado da região. A ideia é que os acordos possam desbloquear o grande potencial que a região detém. O último destes acordos foi o tratado de Livre Comércio entre Israel e Emirados Árabes, o primeiro acordo deste tipo assinado por Israel com um país árabe, o que representa forte alteração geopolítica na região.</p>'),
