(254, 'pt_BR', 'abstract', '<p>O projeto analisa as justificativas oficiais usadas pela OTAN para intervir na<br>Guerra Civil da Líbia, buscando as bases conceituais que serviram de base para<br>criar uma legitimidade de ação para a operação. O projeto foca no conceito de<br>Responsability to Protect e na usa aplicação durante o confronto, observando<br>seu papel em discursos oficiais de autoridades de membros da operação, além<br>de traçar suas origens como formulação teórica. O projeto também busca<br>analisar a postura da mídia de países participantes da operação e como essas<br>ajudam a construir a narrativa oficial em suas reportagens</p>'),
