(255, 'pt_BR', 'abstract', '<p>O ensino superior, particularmente nas universidades públicas, teve seu acesso concentrado para as classes mais altas da sociedade brasileira até o momento de fortalecimento dos programas de inclusão social a partir dos anos 2000. Essa inclusão tem gerado reações como mudanças no padrão de internacionalização de cursos e carreiras que, por sua vez, têm produzido novas clivagens no ensino superior. O objetivo geral desta pesquisa é analisar, por meio de comparação entre os cursos de relações internacionais da Universidade Federal do ABC e da Fundação Getúlio Vargas, as diferenças no perfil dos seus docentes e dos seus respectivos projetos pedagógicos, com a finalidade de analisar não somente o perfil estrutural das pessoas que lecionam nesses cursos, mas também o perfil pedagógico dos dois cursos. Para isso, a pesquisa se organiza em três etapas, sendo a primeira a construção de um banco de dados dos docentes dos cursos de relações internacionais da UFABC e da FGV para análise do perfil. A segunda etapa se consistirá numa leitura comparativa dos projetos político-pedagógicos de ambos os cursos, com a finalidade de identificar os temas prioritários e as estratégias pedagógicas. E a terceira etapa será de envio de formulário ou a realização de entrevistas com docentes dos dois cursos numa tentativa de complementar e aprofundar os entendimentos a respeito das diferenças. Este projeto será realizado no âmbito do Núcleo de Estudos de Gênero da UFABC e do Grupo de Pesquisa Neoliberalismo, Democracia e Mudança Estrutural do Espaço Intelectual Brasileiro.</p>'),
