(256, 'pt_BR', 'abstract', '<p>O arroz é um dos alimentos mais comuns e mais consumidos pela <br>população mundial. É um alimento que normalmente é mais acessível e está <br>inserido no cotidiano da maioria das culturas. Entretanto, ele é pobre em um <br>elemento antioxidante, o qual grande parte da população mundial possui <br>deficiência, o selênio (em média 68,4 ng g-1<br>). Algumas alternativas foram <br>encontradas com o intuito de aumentar a ingestão de Se, como, por exemplo, o <br>consumo de suplementos alimentares, alimentos enriquecidos em Se e <br>suplementação de animais para o consumo humano. A nanotecnologia é uma <br>ciência inovadora que vêm crescendo cada vez mais em áreas como medicina, <br>agricultura e meio ambiente. A aplicação de nanopartículas de Se em arroz <br>durante seu cultivo pode demostrar efeitos benéficos, porém é necessário <br>estudar a bioacessibilidade de Se nesses grãos de arroz, ou seja, a quantidade <br>máxima do elemento que seria absorvida pelo corpo humano, pois, apesar de <br>ser benéfico, o Se pode ser prejudicial se consumido em grandes quantidades. <br>Por isso, esse projeto tem o intuito de apresentar um método de aplicação de <br>nanopartículas de Se em plantas de arroz, visando o aumento da quantidade do <br>elemento disponível no grão. Serão usados métodos que simulam as fases da <br>digestão humana (digestão gástrica e intestinal) e, ao fim do projeto, será <br>determinada a quantidade de Se e de outros elementos químicos como Fe, Co, <br>Cd, As, Pb, Mn, Mg e Cu, que serão de fato absorvidos pelo corpo humano, ou <br>seja, a bioacessibilidade de Se e dos outros elementos presentes no alimento.</p>'),
