(257, 'pt_BR', 'abstract', '<p>Pretendemos nesse projeto fazer a modelagem do surgimento de câmaras de eco e de polarização em redes sociais. A principal metodologia será a simulação em computador de modelos baseados em agentes para propagação de opiniões, em que os agentes estão distribuídos em uma rede livre de escala. Mais precisamente, pretendemos estender alguns resultados recentes da literatura que foram obtidos para o modelo do votante, tentando entender como esses resultados se modificariam para outros tipos de modelo. Para tanto serão estudados principalmente o modelo do votante, o modelo Sznajd e as suas variantes e as redes que iremos usar para a interação entre os agentes vão ser principalmente as redes de Barabási-Albert e de Watts-Strogatz. O objetivo principal é que o aluno obtenha experiência com a modelagem e simulação de modelos baseados em agentes (principalmente na parte de programação e análise de dados), assim como com a metodologia científica em geral.</p>'),
