(258, 'pt_BR', 'abstract', '<p>Completa 44 anos em 2022 a Constituição Federal de 1988, importante marco na política brasileira e sobretudo, na história da democracia do país. A luta pelos direitos políticos femininos, desde a instauração do voto obrigatório, apenas para funcionárias públicas do Estado em 1934, passa por diversos estágios até que se pudesse ter os mesmos direitos políticos que os homens, apenas 26 anos depois. Observa-se, contudo, que a presença masculina no corpo legislativo é esmagadora se comparado à feminina, por quê? Mediante os recortes educacionais feitos nas etapas de conquista do voto, qual a relação do perfil educacional feminino com sua participação na vida pública? A proposta deste projeto é a partir da execução de uma pesquisa exploratória no município de Diadema, durante os anos de 1989 a 2021, com base nos dados sobre educação e política, obtidos pelo IBGE e pela Câmara Municipal da cidade, traçar o perfil educacional das vereadoras eleitas e a partir dessa análise, elucidar como a política está aberta para mulheres, independente do seu grau de escolaridade. Este projeto será realizado no âmbito do Núcleo de Estudos de Gênero da UFABC e do Grupo de Pesquisa Neoliberalismo, Democracia e Mudança Estrutural do Espaço Intelectual Brasileiro.</p>'),
