(259, 'pt_BR', 'abstract', '<p>O arroz é um alimento muito produzido e consumido em todo mundo, mas é um <br>alimento carente em selênio (em média 68,4 ng g-1<br>), um micronutriente essencial <br>para a saúde humana. O Se possui funções antioxidantes, além de prevenir e <br>auxiliar no tratamento de diversas doenças. O uso de suplementos alimentares <br>e o consumo de alimentos ricos em selênio têm sido algumas alternativas para <br>aumentar a ingestão de selênio pela população. A nanotecnologia tem <br>possibilitado o avanço nas áreas da medicina e meio ambiente nos últimos anos. <br>O intuito desse projeto é a aplicação de nanopartículas de selênio na cultura do <br>arroz para biofortificação dessa cultura, e avaliação dos impactos da <br>biofortificação com nanopartículas de selênio na especiação química desse <br>elemento nos grãos de arroz. Para isso, as amostras cultivadas depois de serem <br>preparadas serão analisadas por ICP-MS para totais e HPLC-ICP-MS para a <br>especiação.</p>'),
