(260, 'pt_BR', 'abstract', '<p style=\"margin: 0cm; margin-bottom: .0001pt; text-align: justify; line-height: 150%;\"><span style=\"font-family: \'Arial\',\'sans-serif\';\">Vidros bioativos incorporados com nanopartículas magnéticas podem ser aplicados no tratamento de câncer por hipertermia magnética, uma terapia baseada na geração de calor. <span style=\"background: white;\">Nanocompósitos </span>baseados em vidros bioativos do sistema 58SiO<sub>2</sub>-33-CaO-9P<sub>2</sub>O<sub>5</sub> com incorporações de ferritas de cobalto (Co<sub>X</sub>Fe<sub>3-X</sub>O<sub>4</sub>) foram sintetizados pelo <span style=\"background: white;\">método sol-gel em projeto anterior, visando alinhar as propriedades regenerativas da matriz vítrea com a capacidade das nanopartículas de aquecer a região onde estão depostas. Neste projeto, os nanocompósitos desenvolvidos serão dispersos em polímero termorreversível a base de Poloxamer 407, um hidrogel com propriedades adequadas como sistemas injetáveis. Os materiais serão caracterizados por calorimetria de varredura diferencial (DSC), reologia e determinação da taxa de absorção específica (SAR).</span></span></p>'),
