(261, '', 'categoryIds', '[]'),
(261, 'pt_BR', 'abstract', '<p>A nanotecnologia vem, durante os últimos anos, se revelando uma abordagem extremamente útil em diversas áreas do conhecimento, possuindo numerosas aplicações que beneficiam o avanço científico e tecnológico. Dentro desse contexto, são notáveis seus usos para fins biomédicos, e este projeto foca nas ações antibacterianas apresentadas por materiais nanoestruturados, utilizando como base as nanopartículas de óxido de zinco (ZnO NPs). Estudos recentes têm revelado a capacidade antimicrobiana das ZnO NPs contra bactérias Gram-positivas, possuindo a capacidade de penetrar a membrana bacteriana e desorganizá-la. Além da ação antibacteriana, tais estudos indicam que as ZnO NPs não prejudicam as células humanas, possuindo, portanto, baixa citotoxicidade e sendo vistas como promissoras para a criação de medicamentos e técnicas eficientes no combate a diversas doenças humanas. Assim, este projeto objetiva o estudo dessas nanopartículas, abrangendo para isso sua síntese, caracterização estrutural por diversas técnicas, ensaios de citotoxicidade e avaliação de sua ação antibacteriana.</p>'),
