(262, 'pt_BR', 'abstract', '<p><span style=\"font-weight: 400;\">A dor neuropática é um tipo de dor crônica gerada por lesões de estruturas nervosas, estando associada a sensações como formigamento, pontadas, choques, queimação, entre outras. Essa espécie de dor motivou o desenvolvimento e validação de vários instrumentos de rastreio da dor neuropática. Uma destas ferramentas é o </span><em><span style=\"font-weight: 400;\">Douleur Neuropathique</span></em><span style=\"font-weight: 400;\"> 4 (DN4), questionário contendo quatro conjuntos de questões capazes de distinguir entre dor neuropática e dor nociceptiva. Na Esclerose Lateral Amiotrófica (ELA) os afetados sofrem a perda progressiva de capacidades funcionais como a movimentação de membros, comprometendo a fala, mastigação e respiração, podendo levar à morte por insuficiência respiratória. Ainda sem cura, trata-se de uma doença ocasionada pela degeneração dos neurônios motores primários no cérebro e dos neurônios motores secundários na medula espinal. Pelo caráter eminentemente motor da doença, pouco se sabe sobre a existência de dor neuropática nesta população. Com o intuito de identificar a presença de dor neuropática em pacientes com ELA, neste trabalho pretende-se aplicar o questionário DN4 e comparar o seu resultado com do diagnóstico médico de presença ou não deste tipo de dor.</span></p>'),
