(263, '', 'categoryIds', '[]'),
(263, 'pt_BR', 'abstract', '<p>O processo de classificação de estágios do sono é demorado e intensivo e requer especialistas para analisar horas de sinais de EEG. Além disso, está sujeito a erros subjetivos de cada especialista. O uso de rede neurais profundas vem sendo demonstrado resultados promissores, com diversas arquiteturas sendo utilizadas como redes Convolutivas, Long-Short Term Memories (LSTMs) e, mais recentemente, Transformers. Porém, adultos de diferentes idades podem ter diferentes perfis de sono, incluindo duração dos estágios e características do sinal.</p>\r\n<p>Neste trabalho, utilizaremos Transformers para a classificação de sono. Utilizaremos aprendizado auto-supervisionado para permitir que o Transformer aprenda a extrair características relevantes do sinal e gere uma representação que possa ser posteriormente utilizada por um classificador. Utilizaremos esta representação como entrada para um classificador, que pode ser ajustado para diferentes perfis de sujeitos. Iniciaremos o projeto com o uso de um eletrodo e, posteriormente, utilizaremos múltiplos eletrodos. Utilizaremos bases abertas de dados de competições de BCI para realizar o treinamento e avaliação das redes.</p>'),
