(264, 'pt_BR', 'abstract', '<p>Apicotermitinae é uma subfamília de Termitidae, e são cupins bastante abundantes nos solos neotropicais. Mesmo assim, esse é o grupo de cupins menos conhecido taxonomicamente, principalmente devido a sua falta da casta dos soldados, tradicionalmente mais utilizada na identificação desses insetos. O objetivo deste projeto é estudar a taxonomia dos Apicotermitinae encontrados em duas campanhas do monitoramento de fauna realizado como requisito para implementação da Usina Hidrelétrica de Jirau, em Rondônia. Os táxons serão identificados através do estudo da morfologia interna e externa e de estudos morfométricos, a partir disso possíveis novos táxons serão ilustrados e descritos. &nbsp;&nbsp;</p>'),
