(265, '', 'categoryIds', '[]'),
(265, 'pt_BR', 'abstract', '<p><span style=\"font-weight: 400;\">Este projeto de Iniciação Científica (IC) se insere no contexto de pré-processamento de sinais de eletroencefalografia (EEG), visando a sua utilização em interfaces cérebro-computador baseados em imagética motora (alterações nos sinais cerebrais que ocorrem quando uma pessoa imagina estar fazendo um movimento). A atividade cerebral pode ser captada de forma não invasiva através de eletrodos colocados no escalpo. A partir do processamento desses dados captados é possível identificar padrões associados a uma intenção do usuário, e assim comandar sistemas físicos e/ou computacionais, caracterizando assim a BCI. As possibilidades de aplicação de BCIs são diversas, com maior foco em reabilitação e melhora da qualidade de vida de pessoas com deficiências severas, mas a técnica também possui promissora aplicação na área de entretenimento, como em jogos em realidade virtual. Porém, os potenciais medidos no escalpo são de baixíssima intensidade e facilmente distorcidos por sinais não oriundos da atividade cerebral, como o piscar de olhos e seu movimento de sacada, movimento dos músculos da face, do escalpo e também o batimento cardíaco. Esses sinais indesejados são chamados artefatos, e precisam primeiramente ser removidos do sinal bruto de EEG para que seja possível aplicar os algoritmos de classificação e assim realizar, efetivamente, a interação cérebro-máquina. É justamente nesta etapa que este projeto visa focar, já que essa fase de pré-processamento exige diversos conhecimentos específicos sobre as diversas técnicas disponíveis no que diz respeito a seus efeitos, melhores aplicações e funcionamento.</span></p>'),
