(266, 'pt_BR', 'abstract', '<p><span style=\"font-weight: 400;\">No ciclo 2021-2022, estudamos o problema de separação de fontes em misturas não-lineares, particularmente o modelo Post-Nonlinear. Começamos retomando o que foi feito em [1] e observando que o algoritmo proposto apresenta alguns problemas de convergência. Sendo assim, optamos por alterar a forma de tratar o estágio não linear da mistura, aplicando dois algoritmos bio-inspirados: algoritmos genéticos e algoritmo de otimização por enxame de partículas. A partir daí, neste ano, pretendemos analisar mais a fundo principalmente o segundo algoritmo, analisando o desempenho de topologias diferentes e incluindo também as redes neurais por base radial na análise. </span></p>'),
