(267, 'pt_BR', 'abstract', '<p>Al´em das trˆes grandes classes de materiais, classificados de acordo com a sua estrutura eletrˆonica: condutores, semicondutores e isolantes, h´a alguns outros tipos que se destacam pelas suas propriedades peculiares. Uma dessas classes ´e a de isolantes topol´ogicos (TI’s). Sua descoberta foi tema do Prˆemio Nobel de f´ısica em 2016, justificado pelo ex´otico comportamento de sua superf´ıcie e sua rela¸c˜ao com o interior (bulk) do material. Esses sistemas apresentam propriedades isolantes em seu bulk e condutoras na superf´ıcie. Isso ocorre pelo forte acoplamento spin-´orbita (SOC) dos ´atomos que os comp˜oem, for¸cando com que apare¸ca<br>estados de superf´ıcie condutores por n˜ao se tratar de um isolante trivial. Essa e outras diversas propriedades dos TI’s os colocam na fronteira dos estudos em mat´eria condensada pelas diversas possibilidades de aplica¸c˜oes em um futuro pr´oximo, como na spintrˆonica e na computa¸c˜ao quˆantica. Dessa forma, o presente projeto prop˜oe o estudo do Bi2Te3, um isolante topol´ogico, via m´etodos de primeiros princ´ıpios, mais precisamente via teoria do funcional da densidade (DFT). O interesse est´a no estudo das aplica¸c˜oes do SOC nas equa¸c˜oes da DFT com o intuito de se modelar os estados de superf´ıcie desse material, os quais aparecem na forma de cones de Dirac.</p>'),
