(268, 'pt_BR', 'abstract', '<p>Raios c´osmicos s˜ao part´ıculas subatˆomicas altamente energ´eticas e eletricamente carregadas que s˜ao defletidas nos campos magn´eticos, presentes nos meios gal´actico e extragal´actico, no decorrer de suas propagações. Como as estruturas e os valores dos campos magn´eticos nesses meios s˜ao limitadamente conhecidos, torna-se dif´ıcil a reconstruç˜ao das fontes astrof´ısicas que deram origem aos eventos de raios c´osmicos detectados na Terra. Formula-se, assim, um dos grandes problemas da astrof´ısica da atualidade, ainda n˜ao totalmente resolvido, para o qual s˜ao necess´arios estudos detalhados, seja dos processos f´ısicos ocorridos no transporte de raios c´osmicos nos ambientes gal´actico e extragal´actico, seja das propriedades f´ısicas dos campos magn´eticos destes meios.<br>Neste projeto de iniciaç˜ao cient´ıfica, lançaremos m˜ao de diferentes modelos para os campos magn´eticos gal´acticos e, de posse de simulaç˜oes computacionais da propagaç˜ao de part´ıculas carregadas em campos magn´eticos, produziremos os efeitos das&nbsp; chamadas “lentes magn´eticas”, com uso da t´ecnica de retropropagaç˜ao. Finalmente, compararemos nossos resultados com os<br>obtidos na literatura.</p>'),
