(269, 'pt_BR', 'abstract', '<p>O presente projeto visa compreender a vivência de mulheres e LGBTQIA+ encarceradas ante um número recorde de presos no Brasil. Perpassando a elevação do contingente feminino nos presídios e a contínua carência de dados oficiais quanto à presença de LGBTs no sistema penitenciário, existe o interesse em aprofundar o conhecimento de como a estrutura prisional é moldada para atender a um tipo específico — o qual chamarei “preso padrão”: o homem cisgênero/heterossexual. Decorre daí violências sofridas por indivíduos desviantes de tal padrão, que vivenciarão um ambiente que não está preparado para lhes receber e, consequentemente, terão de enfrentar situações que estão para além da privação de liberdade, que vão da ausência de itens de higiene básica no período menstrual a colocação de mulheres trans e travestis em presídios masculinos.</p>'),
