(271, '', 'categoryIds', '[]'),
(271, 'pt_BR', 'abstract', '<p>As condições em que vivem homens e mulheres não são meramente estabelecidas pelo determinismo biológico ou inatas à existência humana, são, na verdade, demarcadas pelas relações sociais engendradas pelo sistema sexo-gênero. Partindo dessa premissa, o projeto propõe-se a discutir configurações contemporâneas da Divisão Sexual do Trabalho (DST), com ênfase no trabalho do cuidado. Além disso, pretende refletir sobre como marcadores sociais da diferença, como raça e classe, atravessam a DST, o que nos permitirá delinear os impactos concretos e subjetivos que essa divisão opera sobre a vida das mulheres. A metodologia proposta se baseia em pesquisa bibliográfica referente à temática da divisão sexual do trabalho, teoria da reprodução social e trabalho de cuidado (care), associada ao levantamento e tratamento de dados censitários e quantitativos, produzidos primariamente por institutos de pesquisa como IBGE e IPEA, organizações da sociedade civil como a OXFAM.</p>'),
