(272, 'pt_BR', 'abstract', '<p>O objetivo deste trabalho é efetuar uma revisão de literatura e dados disponibilizados pela<br>prefeitura de São Paulo com foco nas ações implementadas durante o período de pandemia da<br>COVID-19 e as principais adversidades enfrentadas pelo sistema de gestão dos resíduos sólidos<br>urbanos na cidade de São Paulo, principalmente referente ao manejo dos resíduos<br>provenientes do sistema de saúde, identificando, também, as consequências no pós pandemia.<br>Utilizando plataformas de busca (Periódicos da Capes e Scopus) serão levantados trabalhos<br>científicos que relatam as medidas e suas consequências para a saúde pública e para o meio<br>ambiente. A partir da avaliação das diligências adotadas durante esse período, será efetuada<br>uma avaliação sobre os planos e projetos executados, assim como providências para cenários<br>futuros.</p>'),
