(273, '', 'categoryIds', '[]'),
(273, 'pt_BR', 'abstract', '<p><span style=\"font-weight: 400;\">O combate à inflação tem sido objetivo de políticas econômicas no Brasil desde a crise do início da década de 60, que agravou os problemas estruturais brasileiros enquanto o país entrava em um regime autoritário que vigorou por 21 anos. Durante os 5 mandatos militares, o Brasil deu passos importantes na estruturação do seu sistema econômico e estrutura produtiva, como a estatização do setor energético, a consolidação de empresas estatais em setores estratégicos, um maior planejamento da economia, a criação do Banco Central do Brasil e do Conselho Monetário Nacional, além de introduzir a correção monetária, criar a dívida pública com lançamento de títulos indexados, e realizar algumas reformas, como a administrativa, a financeira e a tributária. Obviamente, o ambiente de supressão de liberdades individuais e o imenso arrocho salarial obstaculizaram que essas medidas pudessem impactar de forma mais profunda a melhoria das condições econômicas e sociais no país.&nbsp;</span></p>\r\n<p><span style=\"font-weight: 400;\">Assim, em decorrência de choques externos e uma crise financeira entre o final da década de 70 e início da 80, as condições de financiamento para o Brasil e outros países da América Latina mudaram drasticamente, levando à um aumento descontrolado da dívida pública, uma aceleração inflacionária e, no caso brasileiro, à diversos planos econômicos que visavam corrigir os déficits da balança comercial e a inflação.&nbsp;</span></p>\r\n<p><span style=\"font-weight: 400;\">Paralelamente, os Estados Unidos, especialmente em razão do esgotamento do Regime de Bretton Woods e objetivando manter a hegemonia do dólar frente ao crescimento de países com maior planejamento de sua economia (Japão e Alemanha, especialmente), realizou um aumento da taxa de juros, o que movimentou altos fluxos de capital de curto e médio prazos para sua economia. Em decorrência desta reorganização econômica, ocorreu desregulamentação do mercado de trabalho e do mercado financeiro, focalizando a redução do poder público no planejamento e execução de políticas econômicas, este fenômeno foi chamado de financeirização e espalhou-se pelo mundo nas décadas seguintes (Harvey, 2008), com repercussões importantes no Brasil (Antunes, 2005).</span></p>\r\n<p><span style=\"font-weight: 400;\">No Brasil, este fenômeno tomou corpo na década de 90 (Antunes, 2005; Batista, 1994), com o Plano Real por meio do pacote de privatizações, as reformas no sistema de seguridade social, a reforma trabalhista e a elevação exponencial da taxa de juros. É nesta década que o receituário ortodoxo, a interpretação neo-liberal, passam a dominar o debate político e econômico, deslocando a discussão do eixo da Economia Política (desenvolvimento, industrialização, economia nacional etc) para o da Política Econômica, reduzida ao recém instaurado tripé macroeconômico.&nbsp;</span></p>\r\n<p><span style=\"font-weight: 400;\">Neste sentido, o objetivo desta pesquisa é </span><span style=\"font-weight: 400;\">compreender as transformações econômicas no Brasil que resultaram do processo de financeirização no final do século XIX e entender </span><span style=\"font-weight: 400;\">as modificações da composição e segmentos do sistema financeiro nacional após meados da década de 90 sob a luz do Plano Real.</span></p>'),
