(274, '', 'categoryIds', '[]'),
(274, 'pt_BR', 'abstract', '<p>O projeto de iniciação científica consiste na fabricação e caracterização de dispositivos termoelétricos baseados em polímeros condutores, no caso, o poli(3,4-etileno-dioxitiofeno) poliestireno sulfonado (PEDOT:PSS), o qual será dopado com diferentes materiais, visando a alteração da condutividade elétrica e concomitantemente aumento do coeficiente Seebeck e da Figura de Mérito que são de suma importância para a possibilidade de aplicação tecnológica destes dispositivos. Com relação à caracterização elétrica, faremos medidas quatro pontas e com relação as propriedades termoelétricas construiremos dispositivos em estrutura vertical</p>'),
(274, 'pt_BR', 'areaSubarea', 'Física da Matéria Condensada; Eletrônica Orgânica; Dispositivos Optoeletrônicos'),
