(275, 'pt_BR', 'abstract', '<p>A linguagem neutra surge enquanto reivindicação da utilização de pronomes neutros em uma luta por direitos e visibilidade de pessoas trans não-binárias, ou seja, pessoas que não se enquadram no binário de gênero masculino e feminino. Dita reivindicação é contestada por projetos proibitivos de sua utilização, estratégia característica de cenários políticos de conservadorismo, os quais a partir da última década tem mobilizado uma ofensiva antigênero ao redor do mundo. Neste trabalho, pretendemos oferecer uma reflexão filosófica sobre os incômodos e resistências que a linguagem neutra gera através de uma análise crítica da teoria do discurso de Judith Butler – particularmente no seu estudo dos discursos de ódio – em conversação com pesquisas e estudos de dados sobre políticas antigênero, em especial os disponibilizados pelo Observatório de Sexualidade e Política (Sexuality Policy Watch). Este projeto será desenvolvido vinculado ao Núcleo de Estudos de Gênero Esperança Garcia.</p>'),
