(276, 'pt_BR', 'abstract', '<p>Este estudo busca explicar a dependência tecnológica dentro de acordos comerciais a partir da Teoria&nbsp; Marxista da Dependência (TMD). Nosso objeto de investigação é o USMCA (<em>United States–Mexico–Canada Agreement</em>). Teremos como foco as relações comerciais entre Estados Unidos, Canadá e México. Dados que esses três Estados possuem graus divergentes de desenvolvimento, pretendemos demonstrar as vantagens e desvantagens comerciais a partir dos fluxos de exportações e importações relacionadas ao setor automotivo. A&nbsp; escolha desse setor se deu em função da grande importância econômica e tecnológica para os participantes do USMCA na produção global de automóveis. Partirmos de uma pesquisa explorátoria, bibliográfica, qualitativa e quantitativa que se apoia em dados secundários fornecidos por organizações internacionais. Temos como objetivo responder como se dá a dependência tecnológica entre&nbsp; México,&nbsp; Canadá e Estados Unidos com relação ao setor automotivo. A partir disso apresentamos como hipótese que as assimetrias acerca do desenvolvimento entre os membros geram&nbsp; impactos diferentes em&nbsp; relação aos acordos comerciais firmados após adesão ao USMCA. Para tal investigação, este estudo vai avaliar em particular os balanços comerciais e os fluxos de pagamentos de propriedades intelectuais e a dependência&nbsp; tecnológica.</p>'),
(276, 'pt_BR', 'areaSubarea', 'Economia pol´ítica internacional'),
