(277, 'pt_BR', 'abstract', '<p>A pergunta que norteia essa pesquisa é sobre o lugar da ficção científica na teoria feminista queer. Para isso, farei uma comparação entre o uso que faz Donna Haraway da ficção científica no seu ensaio Manifesto ciborgue (1985/2009) e o uso que faz&nbsp; Jack Halberstam das animações na sua obra <em>Arte queer do fracasso</em> (2011/2020). Duas obras focadas nas ficções como potenciais fontes de saber para se imaginar novos mundos, separadas por quase 3 décadas, o Manifesto Ciborgue de Haraway e <em>A Arte Queer do Fracasso</em> de Halberstam, esmiúçam a fertilidade oriunda, respectivamente, dos livros de ficção e das animações infantis para se imaginar novos modos de produzir existência. Este projeto será desenvolvido vinculado ao Núcleo de Estudos de Gênero Esperança Garcia.</p>'),
