(278, 'pt_BR', 'abstract', '<p>No presente projeto, a aluna será apresentada, por meio de ferramentas químico-computacionais e dados, às áreas de química e física quântica, usando como temática o estudo de pirróis presentes em micro-organismos marinhos. Estes compostos podem ser usados como agentes pigmentantes em indústrias têxteis de forma sustentável, além de promoverem vantagens biológicas com seu uso, como atividades anti-cancerígenas. Nesse sentido, neste projeto, serão determinadas propriedades importantes para o entendimento do espectro de absorção e das propriedades de interação com diferentes substratos.</p>'),
