(280, 'pt_BR', 'abstract', '<p>Ao longo das últimas cinco décadas o Modelo Padrão tem tido enorme êxito em descrever uma enorme quantidade de dados&nbsp; experimentais. No entanto, diversas questões permanecem em aberto, como a massa dos neutrinos, a natureza da matéria&nbsp; escura, a inclusão da força gravitacional, entre outras perguntas de grande importância. Em muitas extensões do Modelo Padrão um setor fracamente acoplado (setor escuro) é introduzido, resultando em partículas que podem ser produzidas no LHC e que decaem dentro do detector. Em um projeto anterior foi desenvolvida uma aproximação analítica para o comprimento de&nbsp; decaimento médio de tais partículas no LHC. Tal informação é de grande importância para estudos fenomenológicos.<br>Neste projeto propomos aplicar esta expressão analítica para modelos da nova física. Como resultado esperamos mostrar como a expressão obtida pode ser de grande utilidade para novos estudos na área de fenomenologia além do Modelo Padrão.</p>'),
(280, 'pt_BR', 'areaSubarea', 'Física; Física de Partículas e Campos'),
