(282, 'pt_BR', 'abstract', '<p>A Engenharia de Tecidos visa aplicar fundamentos da ciência e engenharia dos materiais, biologia e biomedicina, de modo a promover a reconstrução ou regeneração de tecidos e órgãos vivos. Ela se fundamenta no uso de células de interesse, oriundas ou não do próprio paciente, para a expansão em cultura e o uso de biomateriais que formam estruturas tridimensionais para o cultivo celular, os chamados arcabouços. Dentro deste contexto, a escolha e produção de arcabouços é um dos primeiros e mais importantes passos do processo. Este, deve possuir características similares, ou pelo menos, mais próximas possíveis às matrizes extracelulares dos tecidos alvos nativos. Assim, para a produção de suportes mais eficientes dentro desse aspecto, é necessário considerar os biomateriais mais adequados ao respectivo objetivo. Entre eles, a gelatina, proteína proveniente da desnaturação do colágeno, é um dos biomateriais naturais que se mostram mais promissores para o uso na engenharia de tecidos. Entretanto, ela apresenta desvantagens a serem consideradas, como a pouca resistência à tração e a rigidez estrutural. Nesse sentido, a reticulação por glutaraldeído é utilizada. Esse agente reticulante induz a formação de interações entre as cadeias de moléculas da gelatina, visando a melhoria dessas propriedades mecânicas. No entanto, em concentrações elevadas, o glutaraldeído pode apresentar citotoxicidade, comprometendo o uso do material. Portanto, o objetivo desse projeto será avaliar se os níveis de reticulação em filmes de gelatina afetam o padrão de adesão e espalhamento de células Vero, visando a procedimentos de engenharia de tecidos.</p>'),
