(283, 'pt_BR', 'abstract', '<p><span style=\"font-weight: 400;\">Na pesquisa aqui proposta, pretendemos analisar a obra </span><em><span style=\"font-weight: 400;\">O Estrangeiro</span></em><span style=\"font-weight: 400;\">, de Albert Camus, onde a filosofia </span><span style=\"font-weight: 400;\">absurdista </span><span style=\"font-weight: 400;\">do livro </span><em><span style=\"font-weight: 400;\">O Mito de Sísifo</span></em><span style=\"font-weight: 400;\"> é aplicada, a partir da teoria </span><span style=\"font-weight: 400;\">ontológica </span><span style=\"font-weight: 400;\">de Martin Heidegger. Nosso objetivo é entender, por meio de um intercâmbio entre esses conceitos filosóficos, como a filosofia de ambos pode resultar em um olhar mais abrangente sobre a obra literária de Camus.&nbsp;</span></p>'),
