(285, 'pt_BR', 'abstract', '<p>Este projeto de pesquisa tem por objetivo principal investigar o papel das mulheres no processo de ocupação do bairro Jardim Valeri, no município de Registro-SP. Se trata de uma área de ocupação localizada próxima à margem direita do rio Ribeira de Iguape, onde os seus habitantes sofrem as consequências das cheias no rio Ribeira e em seus afluentes nos períodos de chuvas intensas. Realizaremos entrevistas com as moradoras e com os moradores mais antigos para levantar informações sobre quando e como ocorreu a ocupação do bairro, buscando identificar a participação das mulheres neste processo.</p>'),
