(286, 'pt_BR', 'abstract', '<p>Essa pesquisa busca compreender o atual cenário dos programas destinados à formação de professores indígenas no estado de São Paulo, em especial no município de São Paulo, analisando os principais desafios para a formação docente diferenciada. Para isso, analisaremos o Referencial Curricular Nacional para as Escolas Indígenas (RCNEI) e o Referencial para Formação dos Professores Indígenas, propostos pelo Ministério da Educação e Cultura (MEC), e suas implicações na trajetória da formação dos docentes indígenas. Para a elaboração do presente projeto foi realizada pesquisa bibliográfica preliminar relacionada ao percurso histórico da consolidação da docência escolar indígena no Brasil e aos cursos de formação docente realizados em São Paulo.</p>'),
