(287, 'pt_BR', 'abstract', '<p>Nós humanos usamos a percepção de durações de centenas de milissegundos a<br>segundos para processamentos sensoriais, planejamento motor e funções cognitivas. Apesar<br>de estudos identificarem correlatos neurais dessa capacidade de estimar durações, ainda há<br>lacunas no entendimento de como o processamento de estímulos temporais ocorre em nosso<br>sistema nervoso central. Por exemplo, em tarefas de categorização de durações entre curto e<br>longo, alguns estudos com eletroencefalografia captaram padrões que parecem se relacionar<br>às durações, mas mais especificamente, a aspectos decisionais. Nestes experimentos, são<br>comumente apresentados um estímulo de referência e um de comparação, na modalidade<br>visual ou auditiva, de forma contínua, ou seja, uma duração com um início e um fim. Os<br>sinais eletrofisiológicos correlatos são observados após esses estímulos de comparação,<br>porém parecem estar presentes apenas para durações de categoria “curta”, e ausentes na<br>categoria “longa”. Para poder investigar melhor esse correlato eletrofisiológico, é necessário<br>um novo tipo de desenho experimental que permita avaliar o sinal neural ao longo do<br>intervalo temporal. Portanto, nosso objetivo no presente projeto é desenvolver e testar um<br>desenho experimental em que o estímulo de comparação seja multi estímulos, ou seja, a<br>duração final é composta da soma de diversas durações menores.</p>'),
(287, 'pt_BR', 'areaSubarea', 'neurociência cognitiva'),
