(288, '', 'categoryIds', '[]'),
(288, 'pt_BR', 'abstract', '<p>A reprodução ou julgamento de estímulos na tentativa atual são enviesados em direção<br>à tentativa anterior em tarefas mnemônicas. Este viés é conhecido como dependência serial,<br>contudo, os mecanismos responsáveis por possibilitar essa influência entre tentativas não são<br>completamente conhecidos. Tarefas de interceptação, em que participantes realizam uma<br>coincidência temporal entre sua resposta e o choque de um alvo em movimento com uma<br>barreira, também exibem o fenômeno da dependência serial, porém guardam diferenças<br>importantes em relação a tarefas mnemônicas. Essas diferenças são a inexistência de um<br>período de retenção, a emissão de resposta enquanto o estímulo alvo ainda está na tela, e a<br>ausência de uma instrução explícita de memorização da velocidade do alvo. Desta forma, os<br>mecanismos de armazenamento de informação podem ou não ser compartilhados entre essas<br>tarefas, com uma lacuna na literatura no estudo da última. No presente projeto, propomos<br>explorar o mecanismo de memória de curto prazo envolvido na dependência serial verificada<br>durante a integração visuomotora em uma tarefa de interceptação. Para cumprir este objetivo,<br>realizaremos uma coleta de dados comportamentais com registro concomitante de<br>Eletroencefalografia (EEG) utilizando a apresentação de um estímulo sensorial inespecífico<br>de alta energia, um ping, no tempo entre tentativas. O potencial evocado pelo ping será<br>utilizado como substrato para classificação da velocidade do alvo na tentativa anterior, e<br>estudo da evolução temporal deste sinal. A decodificação, ou ausência de decodificação deste<br>sinal permitirá inferir os mecanismos e dinâmica de armazenamento da informação.</p>'),
