(289, '', 'categoryIds', '[]'),
(289, 'pt_BR', 'abstract', '<p>Dando importância ao contexto da formulação e promulgação da Base Nacional Comum Curricular, documento que pauta os currículos nacionais, obrigatoriamente, desde o final de 2019, observa-se um cenário de exclusão dos professores da rede básica de ensino dentro dos processos de discussão e decisões. Levando em conta essa ausência de participação da comunidade escolar, a viabilidade da BNCC fica em cheque, pois existe uma enorme dificuldade em uma proposta curricular funcionar sem analisar a subjetividade dos profissionais envolvidos. Além disso, a proposta busca heterogeneizar os currículos tendo uma Base Comum entre os estados, ignorando também a multiculturalidade do nosso extenso país. Portanto, o presente projeto visa investigar as concepções de 8 a 12 professores da rede básica de ensino do Estado de São Paulo, com tempos de ensino e modelo de instituição (público e privada) diferentes, sobre os impactos da BNCC em sua atividade docente e também no ideal de escola, tendo em vista a introdução da lógica empresarial nos currículos que representa o aparecimento de uma pedagogia da exclusão. A partir dessa investigação através de entrevistas semi-estruturadas, será efetuada uma análise qualitativa, por meio da análise textual-discursiva proposta por Moraes e Galiazzi (2006), o que possibilitará a incorporação dos discursos dos entrevistados dentro de nossas análises. Portanto, através do processo de entrevistas e de análise, pretendemos dar voz para que os professores tenham um espaço para realmente falar sobre a BNCC e assim entendermos como este nicho foi inserido nesta realidade e consequentemente como seu trabalho foi impactado pela política educacional.</p>'),
