(290, 'pt_BR', 'abstract', '<p align=\"justify\"><span style=\"font-family: Liberation Sans, sans-serif;\"><span style=\"font-size: medium;\">A percepção de tempo envolve uma série de habilidades diferentes, como julgamento de ritmos, discriminação temporal, tempo de reação e padrões temporais. Uma das maiores dificuldades, no momento, é a falta de uma taxonomia clara das relações entre estas diferentes habilidades. Para identificar as relações entre estas habilidades e criar uma taxonomia temporal, serão analisados dados já coletados de uma série de tarefas temporais. Estas análises serão realizadas para cada tarefa individualmente e para investigar possíveis relações entre elas, a fim de estabelecer uma taxonomia das habilidades que relacionam-se ao processamento temporal. </span></span></p>'),
