(292, 'pt_BR', 'abstract', '<p>Trata-se de uma pesquisa acerca das relações entre currículo de Geografia e as narrativas na existência - e resistência - das populações tradicionais do estado de São Paulo. Analisaremos o Currículo Paulista de Geografia, em vigor a partir de 2021, visando identificar em que medida os aspectos relacionados à história, ao modo de vida, às formas de manejo dos recursos naturais, às formas de produzir conhecimento e as lutas dos povos e comunidades tradicionais que vivem no estado de São Paulo estão sendo contemplados ao longo da escolaridade. Buscaremos analisar se a maneira de evidenciá-los contribui (ou não) para a valorização destes povos no contexto escolar à luz das referências teóricas sobre currículo escolar, exclusão e invisibilização de grupos étnico-raciais, identidade cultural e justiça social.</p>'),
