(293, 'pt_BR', 'abstract', '<p>A lesão medular é um dano causado na medula espinhal, sendo a lesão dividida em primária e secundária. A primária é o trauma que causa a lesão, já a secundária é a cascata de eventos moleculares que ocorrem em resposta à primária. Esses eventos estão relacionados a processos epigenéticos, como a regulação da expressão gênica coordenada por modificações na cromatina. O estudo desses processos nos permite desenvolver soluções clínicas para a recuperação da lesão. A trimetilação das histonas H3K27 é realizada pelo potenciador de Zeste homólogo 2 (EZH2) e está relacionada ao silenciamento transcricional e à interrupção da expressão gênica. Já a demetilase lisina específica 6B (KDM6B) desmetila a H3K27 e é importante na resposta celular a estresses ambientais. Assim, o objetivo deste estudo é verificar os níveis de H3K27, EZH2 e KDM6B durante a lesão medular usando técnicas de imunofluorescência (IF) e western blotting (WB). Além disso, será feita a análise da densidade de pixel pelo software ImageJ (National Institute of Mental Health, Bethesda, Maryland, USA) e a análise estatística por meio de uma regressão linear entre os níveis de EZH2 e KDM6B.</p>'),
