(293, 'pt_BR', 'title', 'Análise dos níveis de H3K27me3 e balanço da maquinaria de metilação através das unidades catalíticas EZH2 e KDM6B após lesão medular por contusão em ratos'),
(294, '', 'categoryIds', '[]'),
(294, 'pt_BR', 'abstract', '<p><span style=\"font-weight: 400;\">Tomando como ponto de partida questionamentos elaborados pelos chamados feminismo neomaterialista e feminismo pós-humano a respeito da teorização do corpo, buscamos elaborar uma cartografia de métodos e genealogias feministas capazes de auxiliar nossa reflexão sobre a predicação contemporânea de crise ecológica e emergência climática. Nossa exploração possui como horizonte norteador as dificuldades éticas em jogo nas relações entre humanos e extra-humanos, tal como delineadas por diversas autoras feministas. Para tal, mobilizamos conceitos que operam no limite entre sujeito e alteridade tais como gestacionalidade, planetareidade e intervalo, todos eles produzidos no contexto de feminismos comprometidos com a construção de novas práticas, narrativas e linguagens que tornem a diferença vivível, possibilitando novas figurações do que seria habitar ecologicamente a Terra junto a agências e forças extra-humanas.</span></p>\r\n<p>&nbsp;</p>'),
(294, 'pt_BR', 'areaSubarea', 'Filosofia política; ética.'),
