(295, 'pt_BR', 'abstract', '<p>O presente projeto delineia uma pesquisa cujo objetivo central é o estudo sobre gendered innovation, dando foco para sua realização no Brasil no século XXI. Nesse sentido, pretende-se investigar a literatura existente no Brasil e no mundo nos últimos 20 anos, buscando pesquisar qual a contribuição da economia, em especial das chamada economia de gênero, economia da inovação e economia estruturalista, para a questão da desigualdade de gênero intrínseca à sociedade.</p>'),
