(297, 'pt_BR', 'abstract', '<p>A retina é um tecido do sistema nervoso central (SNC), localizado na parte interna do olho. A retina é formada por camadas celulares, que se conectam através de sinapses. Entre as células que formam a retina estão as células da glia, que podem<br>ser divididas em micro- e macróglias, que são os astrócitos, as células de Müller e os oligodendrócitos. As células gliais são muito importantes para o bom funcionamento da retina. Isso porque as células de Müller possuem diversas funções como a manutenção da estabilidade do meio extracelular, enquanto as microglias são importantes por sua capacidade regenerativa e proteção tecidual. Além disso, ambas as células participam da neuroinflamação ao liberarem citocinas e fatores inflamatórios. Ainda, os íons cálcio (Ca2+), regulados pelo receptor IP3R1, possuem diversas funções relacionadas direta ou indiretamente com o funcionamento de células neurais. O íon Ca2+ influencia processos desde a proliferação à morte celular. Com isso, o objetivo desse projeto é analisar o papel de IP3R1 na neuroinflamação da retina e como ela atua na ativação microglial. Para isso, iremos realizar culturas puras de células microgliais e de Müller com camundongos da linhagem C57/BL6. Após a coleta das células puras, será feita a aplicação do fármaco 2-APB (1uM) para observar a ação do IP3R1 nessas células, que serão analisadas por<br>imunofluorescência com marcadores de neuroinflamação. Com isso, esperamos observar uma regulação da ativação microglial (de um estado mais pró-inflamatório para um estado mais anti-inflamatório), e da gliose reativa das células de Müller, quando tratadas com o 2-APB.</p>'),
