(298, 'pt_BR', 'abstract', '<p>As políticas de ciência, tecnologia e inovação (CT &amp; I) desempenham um papel crucial no progresso econômico, sendo a inovação no âmago deste, dando ênfase na interação das instituições, processos interativos e criação do conhecimento em diversos setores da economia, conforme o Manual de Oslo (2006). Deste modo, segundo Labrunie, L. M. et al (2020), a partir de suas polí ticas de CT&amp;I, o Japão passou por profundas transformações que criaram um sistema de inovação internacionalizado, com parcerias entre indústria, pesquisa e governo, que o tornaram uma grande potência tecnológica.. Foi possível adentrar em paradigmas produt ivos mundiais, fortalecendo a competição internacional com outras potências econômicas através do estabelecimento de uma alta qualidade de pesquisa durante as últimas duas décadas. Hoje em dia, as políticas de CT&amp;I estão adotando novos focos, voltandose às questões da sustentabilidade e de prevenção de riscos à pandemia e outras questões de seguridade nacional, como evidente no 6º Plano de Ciência, Inovação e Tecnologia do país (20212025) (JAPÃO, 2021). Fazse relevante, portanto, entender como esse foco se transformou ao longo dos anos 2000, tendo em vista os Objetivos de Desenvolvimento Sustentável, comparativamente ao desempenho do país. Assim, este projeto de pesquisa tem por objetivo o estudo das políticas de CT&amp;I voltadas ao desenvolvimento e da evo lução da Agenda 2030 (ONU, 2022).</p>'),
