(299, 'pt_BR', 'abstract', '<p>O objetivo fundamental deste projeto é dar continuidade a uma pesquisa já iniciada e que buscava compreender o conceito de reconhecimento na <em>Fenomenologia do Espírito </em>e o contexto no qual se dá seu desenvolvimento na seção “A verdade da certeza de si mesmo” na mesma obra. A partir dos estudos foi feita uma leitura detida do texto hegeliano e de seus comentadores. Com efeito percebeu-se um <em>debate</em> interpretativo acerca da noção de indivíduo que se deriva da Dialética do Senhor e do Escravo. Assim, este projeto de pesquisa pretende dar continuidade à problemáticas evidenciadas a partir da pesquisa anterior segundo um direcionamento mais preciso para a formação social do indivíduo no interior da <em>Fenomenologia do Espírito.</em></p>\r\n<p>A respeito desse momento chave da <em>Fenomenologia</em>, os estudiosos destacam nessas passagens da seção “A verdade da certeza de si mesmo” o processo de formação ontológica de um ser social, ou seja, um indivíduo que só pode existir enquanto reconhecido perante outros; e também como a relação de reconhecimento implica concomitantemente a formação de uma concepção-de-si enquanto indivíduo. Assim, a presente pesquisa busca apreender, através de um estudo exegético da obra hegeliana e de seus comentadores, em que medida Hegel pensa a formação do indivíduo a partir desse processo de mediação pela coletividade. Além disso, busca-se entender os debates nos quais Hegel se insere ao realocar a formação do indivíduo para um contexto que tem em seu cerne a relação com a alteridade.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>'),
