(300, 'pt_BR', 'abstract', '<p><span style=\"font-weight: 400;\">A pandemia da COVID-19 vem causando consequências inimagináveis não apenas de ordem epidemiológica e de saúde pública, mas também tem trazido impactos sociais, econômicos e políticos para toda a população brasileira. No entanto, pode-se observar que grupos mais vulneráveis, como a população feminina, negra e de baixa renda, ficam ainda mais expostas tanto à contaminação pelo vírus quanto ao desemprego, à reduções salariais, entre outros problemas. Tendo em vista as relações de trabalho, o histórico de desigualdasde no país e a intersecção das relações de raça e gênero, propõe-se uma análise das condições de trabalho de empregadas domésticas no Brasil no contexto&nbsp; pandêmico do Coronavírus. A partir de uma pesquisa exploratória qualitativa junto a órgãos representantes dessa classe de trabalhadores(as) em São Paulo e na região do Grande ABC, serão analisadas as vivências de trabalhadoras negras nessa condição, a fim de se discutir as especificidades que têm marcado o contexto destacado.</span></p>'),
