(301, 'pt_BR', 'abstract', '<p>A senciência é a capacidade de ter experiências subjetivas, ou seja, de sentir o mundo através de valências positivas ou negativas. Durante muito tempo essa capacidade foi atribuida apenas a mamíferos, e contemporaneamente vem sendo estendida a alguns invertebrados, trazendo consigo questionamentos ainda em abertos acerca de suas raízes evolutivas. Diante disso, o objetivo geral deste trabalho é investigar a senciência animal diante de duas abordagens integrativas: realização de uma revisão aprofundada a respeito do estado da literatura da senciência, com ênfase em aspectos comparativos e em especial relacionados à classe Cephalopoda (Bilateria, Mollusca) e compilação de atributos morfológicos e moleculares possivelmente relacionados a senciência entre os invertebrados. Nossos resultados poderão pavimentar uma compreensão comparativa acerca do tema, bem como atualizará o status de nosso conhecimento acerca das características da senciência entre os invertebrados e mais especificamente, Cephalopoda.</p>'),
