(302, 'pt_BR', 'abstract', '<p>Muito se fala sobre estratégias de ensino que atendam a diversidade espacial e cultural das escolas, alunos e professores, e uma delas é a construção de feiras de ciências. Alguns autores apontam a sua importância para trabalhar a contextualização e problematização de conteúdos de forma interdisciplinar e como pode ser um aliado para o enriquecimento curricular. Esse projeto quer buscar em dois contextos de escolas públicas a construção dessas feiras para que seja possível fazer um estudo de caso, análise de narrativas e entrevistas com os sujeitos protagonistas dos trabalhos bem como a amostra de documentos dos projetos elaborados utilizando-se uma abordagem qualitativa e uma análise de diferentes perspectivas, permitindo a reflexão do pesquisador sobre o desenvolvimento da produção do conhecimento.</p>'),
