(303, 'pt_BR', 'abstract', '<p>O presente projeto tem como finalidade introduzir à estudante modelos clássicos que lidam com a questão das inomogeneidades em modelos cosmológicos, em especial a relação entre a dinâmica local dos estados gravitacionais ligados em oposição à dinâmica global dominada pela expansão cosmológica. Dentre as várias abordagens constantes na literatura, daremos especial atenção aos modelos do tipo queijo suíço, para o qual será necessário o estudo do formalismo das junções Darmois-Israel. Uma revisão da literatura tratando de outras abordagens será feita, como os modelos do tipo Lemaître-Tolman-Bondi e o estudo de órbitas em soluções de McVittie. Finalmente visamos simular numericamente um modelo do tipo \"top hat\" em que se faz uma junção de solução interior homogênea a uma solução de Friedmann-Lemaître-Robertson-Walker no exterior, apresentando densidades de matéria diferentes de cada lado. Com isto, esperamos preparar a estudante para a pesquisa em temas contemporâneos na Relatividade Geral através das técnicas assimiladas na conclusão deste projeto.</p>'),
