(304, 'pt_BR', 'abstract', '<p>Diante do problema crônico de desempenho na leitura de grande parcela do alunado do Ensino Médio (EM) brasileiro, e ainda, a crença de que os que chegam à universidade devem ter superado tal dificuldade, foi proposta medir a habilidade de leitura dos estudantes recém-chegados à luz do construto da Qualidade Lexical a partir da aplicação da tarefa de leitura de palavras e pseudopalavras, além do questionário QHL cuja prática de leitura deve ser evidenciada na qualidade lexical dos calouros. O trabalho prevê ainda medir a habilidade de leitura dos estudantes no último ano da graduação, com o mesmo procedimento usado com os ingressantes, com a finalidade de investigar se a leitura demandada durante a graduação acaba por melhorar a habilidade de leitura individual, como também, se os indicadores universitários de desempenho escolar refletem esse suposto progresso.</p>'),
