(305, 'pt_BR', 'abstract', '<p>O presente projeto visa introduzir ao aluno métodos numéricos de resolução de equações diferenciais, incluindo as noções de erros numéricos, ordem de convergência e execução de testes, visando adicionar à sua formação uma visão crítica dos modelos matemáticos concretos ao mesmo tempo que lhe apresenta técnicas úteis para seu futuro acadêmico. Usaremos como motivação soluções de problemas Newtonianos, culminando com o movimento orbital de um objeto gravitando uma massa central.</p>'),
