(306, '', 'categoryIds', '[]'),
(306, 'pt_BR', 'abstract', '<p>Problemas de classificação constituem uma parte importante do campo de processamento digital de sinais. A capacidade de desenvolver sistemas que reconheçam padrões em sinais e sejam capazes de os identificar tem sido aproveitada em inúmeras situações, como por exemplo: reconhecimento biométrico, reconhecimento de voz e faces e até mesmo escrita. Diversos tipos de abordagens podem ser adotadas para solucionar esses problemas, combinando diferentes tipos de algoritmos de aprendizado de máquina (ML, <em>Machine Learning</em>). Entre eles, uma abordagem muito utilizada é através do aprendizado profundo (DL, \\<em>Deep Learning</em>), que tem como objetivo estruturar os algoritmos de forma mais complexa e robusta utilizando redes neurais artificiais . Entretanto, essa complexidade pode resultar em um elevado custo computacional na execução dos algoritmos, também ocasionando <em>overfitting</em> em alguns casos. Sendo assim, o presente trabalho tem como objetivo realizar a classificação de instrumentos musicais utilizando redes neurais convolucionais (CNN, <em>Convolutional Neural Networks</em>), explorando uma estrutura modificada, denominada SincNet, que utiliza filtros <em>sinc</em> na primeira camada da CNN, como forma de reduzir o número de parâmetros e complexidade da rede - realizando a avaliação de comparação de desempenho deste método em relação à modelos de CNNs tradicionais.</p>'),
(306, 'pt_BR', 'areaSubarea', 'Engenharia Elétrica, Processamento de Sinais'),
