(307, 'pt_BR', 'abstract', '<p>O presente trabalho tratará da confiabilidade estrutural que tem por objetivo analisar a probabilidade de falha de um determinado elemento estrutural ou de um sistema estrutural. Para tal, será utilizado o Processo de Monte Carlo que consiste na geração de um grande número de valores randômicos para cada variável aleatória. Neste processo, para cada projeto gerado aleatoriamente, a função de performance é avaliada e caso seu valor seja positivo, o elemento (ou sistema) não falha e caso negativo, o elemento falha. O objetivo geral será a aplicação do método para avaliar a confiabilidade de uma estrutura treliçada tridimensional, utilizada na confecção da fuselagem e do tail boom da aeronave “Sorg”, de 2020, desenvolvida pela equipe Harpia Aerodesign, com a finalidade de participar da competição SAE BRASIL Aerodesign. A ideia central do trabalho é implementar um código no <em>software</em> MatLab<sup>®</sup> capaz de verificar, tanto no âmbito de cada barra da treliça, quanto no âmbito do sistema estrutural como um todo, a sua probabilidade de falha utilizando o Processo de Monte Carlo. Além disso, para uma maior fidelidade, os resultados da análise estrutural serão também comparados com aqueles dados pelo programa Ansys<sup>®</sup>, para a validação do código a ser escrito.</p>'),
