(308, 'pt_BR', 'abstract', '<p>O objetivo do presente estudo é avaliar a contribuição do design para o campo da Neurociência Educacional por meio da avalição de desempenho no trabalho com material didático com e sem cuidados estéticos. O desempenho das crianças do ensino fundamental será avaliado por meio de rastreo ocular durante a execução de uma prova tradicional (sem cuidádos estétios) e uma prova elaborada com os conceitos de design e estética. Serão comparadas as provas para a pontuação na prova, duração de fixação e número de alternâncias entre as Áreas de Intereses (AOI).</p>'),
