(309, 'pt_BR', 'abstract', '<p>A otimização topológica é um processo que tem como objetivo reduzir o volume de material em peças que desempenham uma função específica. O processo de otimização será realizado através do programa Autodesk Inventor, que aplica o Método dos Elementos Finitos (MEF) e métodos de otimização para determinar o leiaute ideal das peças. Após o processo de otimização, as peças relativas aos projetos ótimos serão produzidas com a ajuda de impressoras 3D para se analisar fisicamente o projeto final. O número de projetos de pesquisa na área de otimização topológica tem crescido consideravelmente, como pode ser visto em trabalhos publicados em congressos de engenharia e em revistas científicas. Este crescimento se deve ao fato de ser muito importante para o mercado de manufatura que se tenha peças com alta eficiência e mínimo custo possível. Como a otimização reduz o volume e consequentemente a massa da estrutura, eliminar partes de peças de forma que sua eficiência não seja prejudicada, é uma área que reduz os custos de produção das peças e aumenta a competitividade do projeto, diminuindo o consumo matéria prima e consequentemente o custo final do produto.</p>'),
