(310, '', 'categoryIds', '[]'),
(310, 'pt_BR', 'abstract', '<p>Indivíduos que sofrem de atrofia muscular severa, enfrentam diversos obstáculos em vários ambientes por causa de suas limitações. Motivando a busca por modelos numéricos que auxiliam no entendimento do problema. Dentre essas técnicas, o estudo da atrofia muscular usando medições da bioimpedância em modelos numéricos, vem tendo grande destaque na literatura. Dessa forma, este projeto procura pesquisar, estudar e aplicar esses modelos, para prever como seriam as leituras de bioimpedância muscular em indivíduos com tais condições. O modelo Cole-impedância, um dos mais aplicados, é um modelo de medição de bioimpedância muito utilizado para medir a impedância de diversos tecidos, de diferentes partes do corpo humano, incluindo o tecido muscular esquelético. A ideia, é relacionar a bioimpedância com uma característica do tecido muscular esquelético, como geometria, exercício e quantidade de fibras. No entanto, o grande desafio de aplicar o modelo de Cole-impedância está em entender como a impedância do tecido muscular esquelético muda de acordo com a geometria da região estudada, e que os músculos mudam a sua geometria quando contraem ou relaxam. Os modelos serão baseados em dados obtidos por diversos artigos que relacionam bioimpedância a diferentes características do tecido muscular esquelético. O projeto será desenvolvido na linguagem python e os dados serão obtidos da literatura.</p>'),
