(311, '', 'categoryIds', '[]'),
(311, 'pt_BR', 'abstract', '<div class=\"page\" title=\"Page 3\">\r\n<div class=\"section\">\r\n<div class=\"layoutArea\">\r\n<div class=\"column\">\r\n<p>Neste projeto de pesquisa de iniciação científica faremos um exercício de análise de relações que existem, ou podem vir a existir, entre ciência e letras de canções populares. Essa análise será feita a partir da noção de “estranhamento”, noção essa que pode ter diferentes interpretações, ora se aproximando mais da ideia do desconhecido, ora daquilo que nos é familiar. Assumindo essa noção como fio condutor, buscaremos despertar olhares diversos para aquilo que, muitas vezes, já está naturalizado.</p>\r\n<p>O estranhamento da música no campo científico e da ciência nas manifestações artísticas, permite, por exemplo, que novos olhares para a ciência sejam instigados, pois o que era familiar a ponto de já estar invisível, ganha novos contextos que acabam por inspirar novos espaços de reflexão e de aprendizagem. Nesse sentido, a música e a ciência, que são muitas vezes entendidas como campos distintos e disjuntos, podem ser complementares uma da outra.</p>\r\n<p>Como resultado de nosso ensaio investigativo, ao desenvolvermos um pequeno inventário de “textos-para-cantar”, articulando relações entre o mundo artístico e o científico, acreditamos poder participar e contribuir para manter o tema — ciência, seus modos de fazer e suas relações com a cultura e a sociedade relações — na pauta de uma educação científica que visa, sobretudo, a educação como \"leitura crítica do mundo ao lado da leitura crítica da palavra” (FREIRE, 2015, p. 184)</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>'),
