(311, 'pt_BR', 'RAAluno', '11202130570  INSERT INTO `publication_settings` (`publication_id`, `locale`, `setting_name`, `setting_value`) VALUES
(319, 'pt_BR', 'abstract', '<p>A experiência e apreciação estética são influenciadas por fatores intrínsecos ao objeto estético observado, ao observador, e por fatores externos, como o local onde o objeto é observado ou outro objeto estético associado, como a música. Apesar de sabermos que a música pode influenciar o comportamento, pouco se sabe sobre a sua influência na observação e interpretação de obras visuais, em particular pinturas contemporâneas abstratas. Essa pesquisa tem como objetivo replicar e ampliar um estudo anteriormente feito pela UFABC, em um museu de arte contemporânea, verificando assim se os resultados se mantêm com uma maior amostra de participantes e em um ambiente online. Para isso, os participantes serão divididos aleatoriamente em grupos. Cada grupo observará as mesmas obras de arte, porém ouvindo trechos musicais que comunicam diferentes categorias de emoção (música feliz, triste, tensa, tranquila ou silêncio). Em seguida, suas perspectivas em relação a experiência estética das<br>obras visuais e das músicas serão coletadas por meio de questionários e comparadas. A hipótese testada é a de que as emoções das músicas de fundo possar influenciar a interpretação e experiência estética das obras visuais. Esse projeto faz parte de um projeto maior sobre Neuroestética.</p>'),
