(320, '', 'categoryIds', '[]'),
(320, 'pt_BR', 'abstract', '<p>A associação entre música e movimento é observada desde a tenra idade. Por outro lado, trabalhos científicos realizados sobretudo em países ocidentais desenvolvidos descrevem que uma sincronização sensório-motora precisa e flexível só pode ser observada a partir dos 10 anos de idade. Não está claro, entretanto, se a incapacidade de sincronização precisa antes dessa idade seria um reflexo da imaturidade do sistema motor ou o fato de conexões funcionais entre áreas do sistema motor e auditivo ainda não terem se estabelecido. Não está claro, tampouco, se crianças de diferentes contextos culturais também apresentam o mesmo padrão de desenvolvimento no que se refere à sincronização sensório-motora. Evidências empíricas de que essa habilidade pode ser influenciada por fatores socioculturais levantam a hipótese de que fatores ainda não considerados nos estudos disponíveis na literatura (incluindo a adequação da tarefa e dos estímulos apresentados em relação à faixa etária pesquisada, bem como contexto cultural, entre outras características demográficas, geográficas e sociais) podem influenciar o desenvolvimento da habilidade de sincronização sensório-motora. O presente estudo tem como foco realizar uma revisão integrativa de literatura com o objetivo de identificar, selecionar e avaliar a qualidade de evidências científicas de diferentes fontes sobre o desenvolvimento de habilidades de sincronização sensório-motora no contexto musical em crianças de 0 a 10 anos de idade.&nbsp; Esse projeto de pesquisa é parte de um projeto multicêntrico que envolverá pesquisadores de países como Canadá, Estados Unidos e África do Sul. Espera-se, com este projeto, conseguir ultrapassar barreiras culturais, sociais, e de língua, para mapear de forma ampla e transcultural o estado do conhecimento acerca do desenvolvimento motor infantil no que se refere à habilidade de sincronização sensório-motora em contexto musical. O resultado deste projeto poderá ter aplicações práticas e implicações para pesquisas em diversas áreas do conhecimento, como a cognição musical, a educação musical, a musicoterapia, a dança, a educação física e a educação infantil de forma geral.</p>'),
