(321, 'pt_BR', 'abstract', '<div class=\"page\" title=\"Page 1\">\r\n<div class=\"layoutArea\">\r\n<div class=\"column\">\r\n<p>Este Projeto de Pesquisa tem por objetivo introduzir a estudante nas técnicas e conceitos fundamentais da Física de Altas Energias, tanto no aspecto teórico como no experimental. Através de um programa de estudos bem estruturado, visamos complementar a formação acadêmica do estudante, fornecendo um conhecimento básico da pesquisa atual na área e possibilitando sua futura participação no experimento CMS do LHC. Neste projeto será abordada as diferentes formas de procura por matéria escura no CMS, com especial atenção para o entendimento de possíveis backgrounds para os processos. Concomitante com o estudo de matéria escura, a estudante deverá se familiarizar com algumas ferramentas de análise em física de partículas. Para um primeiro contato será simulada a produção do boson Z no LHC decaindo em jatos, que é uma importante fonte de background para os processos no CMS. Desta forma a estudante irá se familiarizar com aspectos importantes da análise de dados no experimento.</p>\r\n</div>\r\n</div>\r\n</div>'),
