(322, '', 'categoryIds', '[]'),
(322, 'pt_BR', 'abstract', '<p>A vida das pessoas que porventura não tem algum membro, seja esse inferior ou superior, é muito dificultada e essas pessoas têm sempre que estar buscando meios de se adaptar para que possam viver a vida da melhor maneira possível. As próteses são uma alternativa muito bem-vinda que podem mudar a vida das pessoas de maneira muito rápida, dando possibilidade de realizar novas ações que antes seriam impossíveis e gerando uma melhora muito grande na autoestima. Hoje a tecnologia é capaz de rastrear atividade muscular para que apenas com contrações musculares a prótese seja capaz de realizar alguma ação, e facilitar muito a vida da pessoa que a utiliza. Dito isso, deveriam ser acessíveis a todos que as necessitam independente dos custos, contudo sabemos que essa não é a realidade em que vivemos e, portanto, torna-se extremamente necessário o trabalho feito pelos grupos citados anteriormente como a E-Nable e o Atomic Lab, dando acesso à próteses muito funcionais e baratas àqueles que não conseguem pagar por uma com as mais novas tecnologias. Assim, o objetivo desse trabalho é contribuir com a comunidade fazendo melhorias no modelo disponibilizado pelo grupo E-Nable, a Phoenix Hand V3, por meio de testes feitos em softwares gratuitos e por meio de testes práticos após feita a impressão na impressora 3D. Após o final do experimento, o projeto será postado na comunidade da E-Nable para que fique disponível para o público.</p>'),
(322, 'pt_BR', 'areaSubarea', 'Engenharia Biomédica; Biomecânica; Modelagem Numérica'),
