(323, 'pt_BR', 'abstract', '<p>É papel do ensino de Geografia, na escola, contribuir para a formação de sujeitos que se reconheçam em seus lugares e tenham consciência das potencialidades de suas ações como cidadãos. No entanto, quando olhamos para a realidade do ensino, confrontamo-nos com um contexto em que vozes são silenciadas e realidades são invisibilizadas. À vista disso, pretendemos com esta pesquisa de iniciação científica investigar se o lugar vivido pelos alunos é considerado conteúdo relevante na elaboração de propostas didáticas de Geografia e como ele é abordado ao longo dos Anos Finais do Ensino Fundamental e do Ensino Médio nas escolas públicas do município de São Bernardo do Campo.</p>'),
