(324, 'pt_BR', 'abstract', '<p><span style=\"font-weight: 400;\">A espécie </span><em><span style=\"font-weight: 400;\">Scybalium fungiforme</span></em><span style=\"font-weight: 400;\"> é conhecida popularmente no Brasil como “cogumelo-de-caboclo”, nome este que faz referência à&nbsp; morfologia de sua inflorescência, a qual parece um fungo da cor vinho emergindo do solo. Esta espécie é uma holoparasita de raiz, como o restante das espécies da família Balanophoraceae. O hábito das espécies vegetais parece ter associação com caracteres citogenéticos, em especial com o tamanho de genoma, o qual pode variar graças a mudanças no número de cromossomos (como causado pela poliploidia) ou graças à expansão de sequências repetitivas. A espécie cogumelo-de-caboclo apresenta um dos maiores tamanho de genoma entre as Angiospermas, porém o desconhecimento do seu número cromossômico impede a identificação do mecanismo responsável pelo aumento no tamanho do genoma. Visando mitigar esse </span><em><span style=\"font-weight: 400;\">gap</span></em><span style=\"font-weight: 400;\">, o presente projeto visa determinar o número cromossômico de</span><em><span style=\"font-weight: 400;\"> S. fungiforme </span></em><span style=\"font-weight: 400;\">e, a partir da comparação com os números cromossômicos das espécies próximas, determinar se houve ou não ocorrência de poliploidia nesta espécie.&nbsp;</span></p>'),
