(325, 'pt_BR', 'abstract', '<p class=\"p1\">Este Projeto de Pesquisa tem por objetivo introduzir a estudante nas técnicas e conceitos fundamentais da Física de Altas Energias, tanto no aspecto teórico como no experimental. Através de um programa de estudos bem estruturado, visamos complementar a formação acadêmica da estudante, fornecendo um conhecimento básico da pesquisa atual na área e possibilitando sua futura participação no experimento CMS do LHC. A estudante deverá<span class=\"Apple-converted-space\">&nbsp; </span>estudar modelos de matéria escura que vêm sendo explorados por nosso grupo no CMS. Em particular estamos estudando modelos com a presença de partículas com um tempo de vida suficiente para deixar um traço no detetor e, posteriormente, decair nas partículas de matéria escura que não deixam sinal algum nos detectores. Este tipo de processo leva a sinais com traços que desaparecem. Cabe ressaltar que a estudante já vem estudando<span class=\"Apple-converted-space\"> a simulação de </span>modelos de matéria escura e irá se aprofundar em alguns aspectos desta simulação.</p>'),
