(326, 'pt_BR', 'abstract', '<p>Grandes avanços científicos e tecnológicos tem sido obtidos a partir de um maior entendimento da Mecânica Quântica. Em especial, a inclusão do ponto de vista da Teoria da Informação na maneira de compreender os fenômenos quânticos possibilitou que se delineasse a área da informação quântica: um estado quântico que descreve um sistema físico possui toda a informação que se pode obter sobre tal sistema. Por meio da manipulação destes estados é possível realizar processamento, armazenamento e transmissão da informação de maneira mais eficiente do que a obtida por meios clássicos (que não se aproveitam das propriedades quânticas do sistema, tais como superposição e emaranhamento de estados). De fato, o desenvolvimento de manipulações precisas das propriedades dos estados quânticos tem permitido avanços para além da computação, com aplicações em metrologia, agricultura, medicina, entre tantas outras áreas. <br><br>Neste projeto de pesquisa de iniciação científica propomos um estudo sobre caracterização de estados quânticos da luz produzidos pela interação com meios atômicos em célula de vapor. Em especial, estamos interessados nas medidas da polarização destes estados por meio dos operadores de Stokes. O estudante estará diretamente envolvido na etapa de aquisição de dados do aparato experimental para a produção destes estados e auxiliará no desenvolvimento da interface computacional (via programação em <em>Labview</em>) para a analise dos dados obtidos. Devemos frisar que o aluno terá atividades tanto teóricas nos estudos sobre o processo de medida em quântica, caracterização de estados e tomografia quântica, quanto na parte experimental a partir montagem do sistema de medida e aquisição de dados em si.</p>\r\n<p>Este projeto faz parte das metas do grupo no uso de estados comprimidos de polarização da luz para aplicações em esquemas de metrologia quântica de alta precisão e comunicação quântica. Além disso, buscamos estudar a possibilidade de obter estados emaranhados nestas variáveis de polarização; o emaranhamento é um fator chave para a maior eficiência de um grande número dos algoritmos quânticos propostos até agora. Portanto, a produção e manipulação destes estados permite o uso deste sistema físico para aplicações na demonstração de dispositivos para processamento de informação quântica e, consequentemente, seu uso na demonstração de protocolos quânticos.</p>'),
