(327, 'pt_BR', 'abstract', '<p>Os arcabouços ou <em>scaffolds </em>são ferramentas de extrema importância para a Engenharia de Tecidos e as tecnologias de medicina regenerativa. Podendo ser biomateriais de origem natural (biológica) ou sintética, os <em>scaffolds </em>contribuem com o suporte para as células, além de estimular respostas de migração, proliferação e diferenciação celular, visando a formação de um novo tecido a ser implantado no paciente. A escolha de biomateriais biológicos muito se justifica pelas vantagens de boa biocompatibilidade, baixa toxicidade e, muitas vezes, biomimetismo. Deste modo, a partir de levantamento bibliográfico na área de Engenharia de Tecidos e materiais implantaveis, este projeto tem como objetivo a elaboração de um biomaterial a base do bagaço de uva (<em>Vitis vinifera</em>) por meio de eletrofiação. O interesse sobre esse bio-resíduo está relacionado com as concentrações relativamente altas de compostos fenólicos em seus componentes, apresentando atividades antioxidante, anti-inflamatória e vasodilatadora. Este projeto estima uma revisão bibliográfica sobre a utilização de bagaço de uva na Engenharia de Tecidos, na elaboração de um biomaterial, sua caracterização morfológica, com testes de degradação <em>in vitro</em> e ângulo de contato, além de avaliações de citotoxicidade direta e proliferação celular relacionados ao biomaterial, visando futuramente a sua aplicação em regeneração tecidual de pele.</p>'),
