(328, 'pt_BR', 'abstract', '<p>O projeto de pesquisa tem como mote principal compreender e analisar a realidade de estudantes de universidades públicas que possuem o interesse pela vida acadêmica, procurando verificar como se processa a vivência deste grupo na universidade, as motivações e os interesses que os levam a colocar no horizonte a área de pesquisa e ensino, além das dificuldades existentes para que tal objetivo ocorra com sucesso. De modo a atingir este fim, será feita uma análise do perfil dos estudantes de baixa renda que desejam seguir carreira no ensino superior, suas motivações e limitações nessa escolha e seu trajeto de vida até a decisão. Tal análise será conduzida considerando o atual financiamento e incentivo à pesquisa no Brasil, que vem decaindo nos últimos anos, procurando visualizar os desafios e impactos no objeto de investigação que pretendemos construir.</p>'),
