(329, 'pt_BR', 'abstract', '<p>A descelularização consiste em um processo químico para a remoção de<br>células e é solução promissora à engenharia de tecidos e aos transplantes de<br>órgãos. O objetivo deste experimento é promover a descelularização de<br>hortaliças como a de brócolis (Brassica oleracea L.), a partir da construção de<br>um sistema de irrigação por gotejamento. Utilizando-se soluções dos<br>detergentes Dodecil Sulfato de Sódio (SDS) e Triton X-100, busca-se atingir a<br>descelularização e com o biomaterial obtido realizar um cultivo celular para<br>analisar a possível aplicação do biomaterial em regeneração tecidual de pele.<br><br></p>'),
