(330, 'pt_BR', 'abstract', '<p><span class=\"fontstyle0\">O uso de ferramentas de CFD (</span><span class=\"fontstyle2\">Computational Fluid Dynamics </span><span class=\"fontstyle0\">- Dinˆamica de Fluidos Computacional) na resolu¸c˜ao do campo de escoamento em cˆamaras de combust˜ao de motores foguetes a propelente h´ıbrido se desenvolveu bastante nos ´ultimos anos. Contudo, modelos abrangentes, que descrevem a complexa intera¸c˜ao entre os m´ultiplos fenˆomenos relevantes na queima destes motores, ainda s˜ao limitados e simula¸c˜oes num´ericas s˜ao frequentemente consideradas apenas como uma ferramenta qualitativa na determina¸c˜ao do campo termo-fluido-dinˆamico do foguete. A presente proposta de trabalho consiste na realiza¸c˜ao de um estudo te´orico da taxa de regress˜ao de propelentes s´olidos em motores foguete h´ıbridos, relacionando-a com os principais parˆametros caracter´ısticos do escoamento. Destaca-se que o objetivo do trabalho ´e o teste de uma ferramenta comercial de CFD para a simula¸c˜ao do processo de regress˜ao, esta que resolve numericamente as equa¸c˜oes de conserva¸c˜ao de massa, de energia e de quantidade de movimento. Espera-se desenvolver um modelo que consiga simular o processo de regress˜ao em geometrias simples de cˆamaras de combust˜ao de motores a propelente h´ıbrido e aplic´a-lo adicionando o efeito da combust˜ao e da troca de calor por radia¸c˜ao, sendo que, uma vez validado para a geometria selecionada e condi¸c˜oes de contorno adotadas ´e poss´ıvel utilizar como base para geometrias mais complexas e com adi¸c˜ao de outros fatores, como corre¸c˜oes de erros gerados por aproxima¸c˜oes. <br></span></p>'),
