(331, 'pt_BR', 'abstract', '<div id=\"magicparlabel-2576\" class=\"abstract\">\r\n<div class=\"abstract_item\">A Relatividade Restrita (RR) amadureceu no começo do século XX, incorporando na descrição da natureza uma nova interpretação do espaço e do tempo e trazendo como uma nova simetria fundamental da física a <em>simetria de Lorentz</em>, que engloba além das já conhecidas rotações tridimensionais, as chamadas <em>transformações de Lorentz</em>, que podem ser entendidas como rotações generalizadas que misturam tempo e espaço. A Teoria Eletromagnética (TE) de Maxwell foi a primeira teoria que se reconheceu como compatível com a simetria de Lorentz: na verdade, foi justamente a aparente incompatibilidade entre a TE e a mecânica clássica que motivou os célebres trabalhos de Einstein, que popularizaram a relatividade. Podemos dizer, assim, que a relatividade é o que é para que a TE seja relativística. Contudo, nas últimas décadas, motivadas pela expectativa de nova física na escala de Planck, tem ocorrido um sistemático estudo de teorias que admitem pequenas violações da simetria de Lorentz (VL). Naturalmente, a TE é um dos focos desses estudos, sendo uma teoria muito bem conhecida do ponto de vista teórico, e que conta com experimentos bastante sensíveis, que podem mesmo alcançar o grau de sensibilidade necessária para perceber eventuais efeitos de VL oriundos da escala de Planck. Este projeto dedica-se a expor alguns dos possíveis efeitos que surgem na TE devido a presença de VL.</div>\r\n</div>'),
