(332, 'pt_BR', 'abstract', '<p>Nos últimos anos, estudos de ferramentas de inteligência artificial para auxílio ao diagnóstico médico têm reportado valores de acurácia comparáveis aos de profissionais médicos. No entanto, vários outros desafios existem para a adoção de tais ferramentas na prática clínica. Muitos dos avanços recentes devem-se a modelos opacos de redes neurais, em que a mecânica de decisão não pode ser observada. Isso contribui para diminuir a confiança sobre os diagnósticos apontados. No presente trabalho, nós&nbsp; propomos uma investigação de modelos de redes neurais interpretáveis para auxílio ao diagnóstico, isto é, modelos em que um ser humano tenha a possibilidade de compreender o processo de decisão do algoritmo. O uso de métodos interpretáveis tem como potenciais vantagens o aumento da confiança por parte de profissionais médicos, uma maior transparência do processo de diagnóstico e a possibilidade de investigar quais são as características das imagens que influenciam a saída do algoritmo de auxílio ao diagnóstico.</p>'),
