(333, '', 'categoryIds', '[]'),
(333, 'pt_BR', 'abstract', '<p>As experiências estéticas envolvem interações entre processos sensoriais, cognitivos e emocionais, e são influenciadas por diversos fatores externos ao objeto estético, como contexto, preferências individuais do observador e a presença de música de fundo. A música pode modular percepções e julgamentos, podendo influenciar a apreciação estética de estímulos visuais. Além disso, julgamentos estéticos da música de fundo também podem interferir na apreciação do estímulo visual. Reações emocionais à música ocorrem centenas de milissegundos após o início do estímulo, sendo possível monitorá-las através de medidas de dilatação pupilar. A variação do diâmetro pupilar está associada a estímulos julgados como mais interessantes. O presente projeto de pesquisa irá examinar, por meio de pupilometria, correlatos neurofisiológicos de processos cognitivos envolvidos em experiências estéticas induzidas por músicas e obras visuais apresentadas de forma isolada e simultânea. O resultado esperado é que julgamentos estéticos após a apresentação dos diferentes estímulos serão correlacionados ao grau de dilatação pupilar. Ademais, uma análise exploratória indicará se as respostas pupilares&nbsp; para diferentes objetos estéticos nos domínios visual e auditivo são&nbsp; distintas quando estes são apresentados de forma isolada ou simultânea. Por fim, avaliaremos possíveis&nbsp; correlações entre a dilatação da pupila e medidas subjetivas de experiência estética. Este projeto faz parte de um projeto maior, interdisciplinar, na área de Neuroestética, desenvolvido por um grupo de pesquisadores na UFABC.</p>'),
