(334, 'pt_BR', 'abstract', '<p>O Brasil é um dos maiores usuários de adubos químicos e defensivos agrícolas no mundo. Tais práticas agrícolas colaboram para a degradação dos ambientes naturais, reduzindo sobremaneira a biota associada aos cultivos. As técnicas agroecológicas são um contraponto às práticas agrícolas convencionais, buscando integrar a biota local aos modos de cultivo, potencializando o equilíbrio ecológico que torna dispensável o uso de adubação química e de agrotóxicos. Nesse contexto, conhecer e compreender a dinâmica da biodiversidade do solo é essencial para assegurar a saúde dos cultivos. Assim, o presente estudo pretende realizar um diagnóstico da saúde ambiental dos cultivos agroecológicos no município de Santo Andre, SP, com base na composição da fauna edáfica presente nestes cultivos. Este projeto é parte integrante de um projeto maior que estudará também cultivos em outros municípios da região e que tem por objetivo final estruturar estratégias que permitam auxiliar os produtores agroecológicos no processo de enriquecimento da biodiversidade do solo em seus cultivos, buscando o equilíbrio ecológico e consequentemente a saúde ambiental desses cultivos.</p>'),
