(336, 'pt_BR', 'abstract', '<p><span style=\"font-weight: 400;\">O presente projeto tem como objetivo o desenvolimento da tradução de um texto de Angela Davis (1944-) o qual foi proferido por ocasião de sua entrada na UCLA no curso “Temas filosóficos recorrentes na literatura negra”. O texto seria publicado anos mais tarde e faria parte de um conjunto de materiais em defesa de Angela Davis, presa no período. Por tradução, compreendemos que esta se dá em processo e, portanto, compreende aqui o exercício da tradução dialogada. A tradução também serve como exercício de escrita, procurando elencar e definir temas que auxiliem a leitura bem como estejam apoiados na pesquisa. A tradução culmina no campo das materialidades, do diverso no espaço político. Acompanha aqui a construção de um “Dicionário Angela Davis”, em diálogo constante com a organização de seus textos tendo em vista não apenas a definição do conceito, mas também uma possibilidade de traduzir em verbete o diálogo com o orientador, de modo a traduzir o pensamento de Angela Davis pela experiência também de nossa pesquisa. </span></p>'),
