(337, '', 'categoryIds', '[]'),
(337, 'pt_BR', 'abstract', '<p><span style=\"font-weight: 400;\">O presente projeto visa uma análise da </span><em><span style=\"font-weight: 400;\">Autobiografia </span></em><span style=\"font-weight: 400;\">de Angela Davis. Trata-se de uma peça filosófico-literária pela qual Angela desenvolve seus conceitos e seus pensamentos em desdobramento com suas ações políticas. Não se trata de mera propaganda das ideologias defendidas pela autora, mas de um exercício filosófico no qual a experiência subjetiva passa a valer como fonte de questões e de construção de conceitos. Nossa pesquisa, assim, acompanhará o lastro filosófico da Autobiografia de Angela Davis. Com isso, montaremos um “dicionário Angela Davis”, compreendendo em seus verbetes não apenas a apresentação dos conceitos mobilizados pela autora, mas também o campo de debates que se desenvolveu na leitura orientada do </span><em><span style=\"font-weight: 400;\">Dicionário</span></em><span style=\"font-weight: 400;\">. Os verbetes desse dicionário serão construídos em diálogo com o orientador da pesquisa e será esse o primeiro nível de diálogo neste projeto. Seguiremos com a exploração desse dicionário, considerando o público estudantil do ensino médio. O conteúdo do debate será gravado e será a base para a revisão dos conceitos elencados pelas conversas com a orientação. Consideramos assim a possibilidade de envolver nossa pesquisa em uma comunidade, a partir do debate em instituições escolares como a nossa. </span></p>'),
