(338, 'pt_BR', 'abstract', '<p>O hipocampo (HPC) é uma estrutura muito estudada devido a sua função na obtenção de novas memórias e navegação espacial. Diversos neurônios estão em atividade durante estes processos, gerando oscilações específicas. O engajamento em atividades específicas, por exemplo, memória de trabalho, pode envolver outras estruturas como o córtex pré-frontal (<em>prefrontal cortex</em>, PFC). A comunicação dessas duas regiões permite a coordenação adequada para a realização de determinada tarefa, observadas, por exemplo, por meio da coerência entre as oscilações dessas regiões. Alterações nesta comunicação pode levar à um déficit cognitivo, como observado em algumas doenças como a esquizofrenia. O enriquecimento ambiental é um ambiente dinâmico e iterativo que proporciona desafios físicos e mentais que pode ser utilizado como uma ótima estratégia terapêutica, uma vez que um ambiente enriquecido traz diversos benefícios cognitivos, como melhora em tarefas de memória, tomada de decisão, entre outros, e observa-se também alterações a nível celular, como aumento do comprimento e densidade dendrítica, e número de botões sinápticos. A proposta deste projeto é avaliar a comunicação entre essas duas regiões, córtex pré-frontal e hipocampo, em animais submetidos ao enriquecimento ambiental e comparar com animais que cresceram em ambiente padrão por meio de registros eletrofisiológicos realizados simultaneamente no HPC e PFC. Com isso, pretendemos contribuir para um melhor entendimento da importância de um ambiente dinâmico que possam servir potencialmente como propostas terapêuticas em doenças neurodegenerativas e do desenvolvimento.</p>'),
