(339, 'pt_BR', 'abstract', '<p>Em alguns cenários adversos, a capacidade regenerativa intrínseca da pele é interrompida, acometendo a regeneração deste tecido.&nbsp; A interrupção eventual do processo de cicatrização da pele pode tornar o tecido lesionado uma ferida crônica, gerando cicatrizes anormais e dismorfia na aparência da pele, além de manter o paciente vulnerável à infecções por um período prolongado. As patologias que influenciam a origem de uma ferida crônica impactam, diretamente, a fase inflamatória do processo cicatrizante da pele, especialmente no amadurecimento do coágulo de fibrina, responsável pela secreção dos fatores de crescimento importantes para a estimulação da produção de colágeno natural. Alguns dos fatores mais importantes são: fator de crescimento transformador beta, TGF-ꞵ, fator de crescimento epidérmico, EGF, fator de crescimento derivado de plaquetas, PDGF, e o fator de crescimento fibroblástico, FGF. Esses fatores podem ser encontrados em concentrações significativas em alguns alimentos, como o leite bovino. Devido ao comprometimento da produção natural do polímero, há uma busca contínua por biomateriais que auxiliem no processo regenerativo e na qualidade de vida dos pacientes acometidos. Sendo assim, este projeto visa estudar a proliferação celular da combinação do biopolímero de gelatina, Hemospon®, à base de colágeno hidrolisado, comumente utilizado na medicina, e leite bovino pasteurizado, a partir do preparo e da caracterização do biomaterial, além de realizar ensaio de degradação, caracterização por FTIR, análise de morfologia e migração celular, a fim de avaliar o potencial cicatrizante dessa membrana.</p>'),
