(340, '', 'categoryIds', '[]'),
(340, 'pt_BR', 'abstract', '<p>A retina pode ser acometida por diversas patologias neurodegenerativas, e uma das mais recorrentes é a retinose pigmentar, uma doença com diversas mutações gênicas que pode afetar a funcionalidade dos fotorreceptores, envolvendo a perda<br>progressiva de bastonetes, que geralmente é seguida pela morte de cones. Os mecanismos associados com a perda celular primária de bastonetes e secundária de cones ainda não são totalmente compreendidos. Neste contexto, a necroptose,<br>um sistema de morte celular necrótica programada, controlada pela atividade quinase de RIPK1 e RIPK3, e relacionada a caspase-8, tem sido amplamente associada com a perda de fotorreceptores na retinose pigmentar. Tendo em vista que a inibição da necroptose pode se tornar uma opção para o tratamento de doenças neurodegenerativas, ela pode ser um alvo terapêutico promissor na prevenção e no retardo da degeneração dos fotorreceptores. O projeto aqui apresentado tem por intenção realizar uma análise dos mecanismos de morte celular por necroptose na patologia retinose pigmentar, utilizando modelos animais<br>de camundongo com mutação na fosfodiesterase 6-beta e, portanto, portadores da retinose pigmentar. Além disso, pretendemos acompanhar o desenvolvimento de metodologias moleculares e celulares, visando propor, ao final da iniciação científica,<br>possíveis intervenções para o tratamento desta retinopatia.&nbsp;</p>');
