(341, 'pt_BR', 'abstract', '<h2>A presente proposta está vinculada a outros dois projetos atualmente em vigência com financiamento do Cnpq: o projeto “<em>Mercados ilícitos, redes criminais: dinâmicas e configurações locais, perspectiva histórica e abordagem comparativa de três áreas críticas da região da fronteira brasileira”, </em>projeto de Produtividade em Pesquisa iniciado em 2021 e o projeto “<em>Redes criminais, tráfico de drogas e suas dinâmicas na fronteira brasileira: descrição e análise comparativa de duas regiões fronteiriças –&nbsp; a tríplice fronteira Brasil/Paraguai/Argentina e as cidades-gêmeas Ponta Porã(MS)/Pedro Juan Caballero(PY)”</em> com financiamento no âmbito do Edital Universal/2018. Além disso, trata-se de uma continuidade do projeto iniciado no âmbito do Edital do PDPD 04/2021, intitulado<em> “</em>Mercados ilícitos e redes criminais”. Situado no campo de intersecção entre esses vários projetos, essa proposta busca aprofundar a análise da trajetória de alguns atores&nbsp; do Primeiro Comando da Capital (PCC), através de particularidades da sua inserção nas atividades criminais e nas relações estabelecidas com outros atores dentro e fora do espaço prisional. Desta forma, pretende-se construir um arcabouço analítico com informações localizadas em fontes abertas e, a partir do cruzamento dos dados coletados, compreender as redes que se conformam a partir do pertencimento ao PCC e o efeito que produzem nos diversos territórios perpassados por essas redes ou nos quais seus atores estão ancorados. E, desta forma, consideramos que podemos contribuir com uma análise da história do PCC que tem como foco a trajetória de seus principais integrantes e as redes por eles costuradas ao longo do tempo.</h2>\r\n<p>&nbsp;</p>'),
