(341, 'pt_BR', 'title', 'Mercados ilícitos e redes criminais: uma análise da história do PCC e da trajetória de seus integrantes'),
(342, '', 'categoryIds', '[]'),
(342, 'pt_BR', 'abstract', '<p>O estabelecimento de um forte poderio por parte de facções criminosas como o Primeiro Comando da Capital (PCC) e Comando Vermelho (CV) serviu como uma importante influência para o surgimento de grupos criminais em todo território brasileiro. Na maioria dos casos, essas novas organizações começam como aliadas de uma facção maior, entretanto, como há rivalidades entre estas, muitos conflitos por disputas de poder acabam surgindo e, por consequência, colocando em risco a segurança da população local devido ao aumento de ações violentas (DIAS; MANSO; 2018).</p>\r\n<p>Segundo o Atlas da Violência publicado pelo Instituto de Pesquisa Econômica Aplicada (Ipea), em 2017, a guerra pelo controle do tráfico internacional de drogas nas rotas que passam pelas regiões Norte e Nordeste dispararam os índices de violência nestes territórios. Com a situação apaziguada, os anos de 2018 e 2019 apresentaram reduções consecutivas nas taxas de criminalidade. Contudo, a partir de 2020, o cenário se transformou novamente e, atualmente, o nordeste brasileiro apresenta um dos piores índices de homicídios no país.</p>\r\n<p>Considerando a centralidade desses grupos nas dinâmicas criminais e no fenômeno da violência no Brasil, a atuação dentro e fora das prisões e os diversos efeitos que podem produzir nos territórios onde atua, na última década se construiu um sólido campo de estudos acadêmicos sobre esse tema. Desta maneira, a pesquisa proposta busca analisar as produções encontradas a partir de um banco de dados pré-definido, onde consta uma diversidade de trabalhos produzidos e que exploram tópicos que poderão favorecer a compreensão de aspectos desses fenômenos nas distintas regiões do Brasil e, desta forma, aprofundar a compreensão das dinâmicas criminais e da violência relacionada à atuação das facções prisionais. Considerando o volume de material do qual dispomos e a importância que a facções parecem ter adquirido para compreender o fenômeno da violência nesta Região, propomos focar nossa análise na produção acadêmica da região Nordeste, buscando caracterizá-la, inclusive as diferenças, similaridades e nuances entre os diversos estados que a compõem, a partir da literatura encontrada.&nbsp;</p>'),
