(343, 'pt_BR', 'abstract', '<div><span lang=\"PT-BR\">Atualmente, em diversos países se está realizando a liberação do mercado elétrico para os consumidores de baixa tensão. No Brasil, tal liberação está sendo considerada nos planos decenais de expansão de energia, aproveitando o uso de recursos energéticos distribuídos como: sistemas fotovoltaicos, veículos elétricos e equipamentos de armazenamento de energia. Para criar um mercado competitivo que possa trazer benefícios aos consumidores e às empresas concessionárias de energia elétrica, a agregação de consumidores é considerada como parte das novas estruturas de mercado varejista. Com o objetivo de contribuir com os estudos de análise da implementação de um mercado varejista no Brasil, neste projeto de pesquisa propõe-se desenvolver uma metodologia que realize a otimização dos recursos energéticos distribuídos dentro de grupos agregados de consumidores de baixa tensão. Tal otimização tem por objetivo diminuir a potência líquida requerida pela rede elétrica, considerando tarifas horárias que possam trazer benefícios econômicos aos consumidores e permitam adiar investimentos nos planos de obras de reforço para melhoria da qualidade do fornecimento por parte das empresas distribuidoras. Dessa forma, os resultados podem auxiliar aos agentes envolvidos na implementação de um mercado varejista no Brasil.</span></div>'),
