(344, 'pt_BR', 'abstract', '<p>A abordagem sobre a percepção de grupos criminosos dentro e fora dos presídios é objeto de estudo de longa data por muitos pesquisadores. Nesse viés, o que se pôde observar a respeito das escolhas políticas tomadas, principalmente na questão do encarceramento em massa, é a constante reprodução de um sistema que escancara a desigualdade do país em todas as suas esferas. É, justamente, no contexto de crise do sistema prisional e incapacidade do Estado de gerir suas administrações penitenciárias que surgem as facções, grupos organizados, dispostos a resistir e reagir frente às inúmeras violências institucionais provocadas pela má gestão dos presídios. Pensando nisso, proponho dar continuidade ao trabalho&nbsp; vinculado a um projeto do edital anterior, que envolve a compreensão das dinâmicas prisionais, situadas na intersecção de dois campos: o campo de estudo das prisões e o campo de estudo sobre redes criminais, analisando, explorando e revisitando material publicado na imprensa na última década a respeito dessas facções, extraindo desse material até aqui produzido suas respectivas localizações&nbsp; de modo a construir um repositório cartográfico desses grupos.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>'),
