(345, 'pt_BR', 'abstract', '<p>A anóxia neonatal é uma das principais causas de morte em neonatos. A anóxia<br>neonatal é caracterizada pela falta de oxigênio antes, durante ou após o nascimento do<br>bebê. A prematuridade é um fator de risco para a ocorrência desse evento, uma vez que<br>o neonato apresenta imaturidade do aparelho respiratório. Com os avanços<br>tecnológicos nas últimas décadas, grupos de pesquisa têm estudado como adversidades<br>ocasionadas no período de neurodesenvolvimento afetam as funções cerebrais.<br>Adicionalmente, foi descoberto que a privação de oxigênio desencadeia cascatas<br>bioquímicas que levam a morte celular em diversas estruturas do encéfalo, como o<br>hipocampo e córtex. Nos casos em que os neonatos sobrevivem, esses indivíduos<br>acabam por desenvolver déficits cognitivos e motores, além de que alguns casos de<br>Transtorno do Espectro Autista (TEA) e Transtorno de Déficit de Atenção com<br>Hiperatividade (TDAH) parecem estar associados ao evento de privação de oxigênio.<br>Infelizmente, ainda não está totalmente elucidado como a falta de oxigenação no<br>período de neurodesenvolvimento interfere na função cerebral. Curiosamente, estudos<br>mostram que inflamações gestacionais com consequente ativação imune materna<br>(AIM) podem modular negativamente o sistema imunológico fetal. Assim, sugere-se que<br>a combinação desses dois insultos – AIM e privação de oxigênio – podem prejudicar o<br>desenvolvimento cerebral da prole. Atualmente, o único tratamento destinado a bebês<br>que sofrem a privação de oxigênio é a hipotermia, todavia, o mesmo é realizado apenas<br>nascidos a termo. Sendo assim, o objetivo desse projeto é avaliar os efeitos da injeção<br>de TAK242 sobre o desenvolvimento somático e sensório-motor em animais que foram<br>expostos ao modelo de “double hit” – AIM e a anóxia neonatal -, visando explorar uma<br>nova alternativa terapêutica que possa ser aplicada em uma idade correlata a<br>prematuridade.</p>'),
