(346, 'pt_BR', 'abstract', '<div><span lang=\"PT-BR\">As microrredes agregam recursos energéticos distribuídos, a fim de um melhor aproveitamento das fontes intermitentes para suprir as demandas locais e fornecer serviços às concessionárias de energia elétrica. No entanto, para realizar tal aproveitamento e fornecimento de serviços, torna-se necessário uma previsão da geração intermitente para o gerenciamento energético local das microrredes. Nos últimos anos, a geração de energia solar fotovoltaica tem crescido nas zonas urbanas do Brasil. Tal geração, em consumidores conectados nas redes de média tensão, pode formar microrredes que têm a possibilidade de oferecer serviços para a operação do dia seguinte das redes elétricas de distribuição. Com o intuito de melhorar a previsão de geração para os estudos de gerenciamento energético de microrredes com sistemas fotovoltaicos, nesta pesquisa se desenvolverá um método de previsão de curva de irradiância solar para a operação do próximo dia. Para mostrar as vantagens do método proposto, a proposta será aplicada utilizando dados da usina solar instalada na Universidade Federal do ABC (UFABC), campus Santo André, e dos dados meteorológicos coletados nas estações meteorológicas do Serviço Municipal de Saneamento Ambiental de Santo André (SEMASA). Os resultados deste projeto podem ajudar nos estudos de gerenciamento de microrredes com sistemas fotovoltaicos e na sua implementação nas áreas de concessão das empresas distribuidoras de energia elétrica.</span></div>'),
