(347, 'pt_BR', 'abstract', '<p>Os avanços do capitalismo possibilitaram uma maior integração social e econômica dos países no mundo. Com foco em expansão e de conquista de novos mercados as atividades ilícitas também se aproveitaram desse momento para diversificar os negócios e ir atras de novos parceiros comerciais.</p>\r\n<p>As regiões de fronteira chamam a atenção do crime organizado internacional pelo seu potencial expansionista e das oportunidades mais atraentes de negócios ilícitos, ainda mais no Brasil que faz fronteira com diversos países, em especial a região Norte fazendo fronteira com os principais produtores de cocaína.</p>\r\n<p>Como a pesquisa anterior ao qual esta é entendida como uma continuidade, o foco recairá na cidade de Tabatinga-AM, uma cidade transfronteiriça que faz fronteira com Santa Rosa no Peru e Leticia na Colômbia, na qual objetivaremos fazer uma análise do material coletado anteriormente de maneira qualitativa para assim podermos fazer um diagnostico sobre as atividades ilícitas na região, os atores envolvidos e a presença de facções criminosas pela cidade.</p>'),
