(348, 'pt_BR', 'abstract', '<p>Salvador Allende foi Presidente do Chile entre 1970 e 1973, era filiado ao Partido Socialista (PS) e fazia parte de uma coalizão das esquerdas do país - Unidade Popular, portanto foi um governo com propostas e ações progressistas. No contexto latino-americano, na época, os países da região eram, em sua maioria, conservadores ou alinhados aos princípios liberais e tentavam construir um plano de desenvolvimento a partir dessas perspectivas. O cenário externo era marcado pela consolidação do poder dos Estados Unidos nas relações internacionais e a disseminação dos seus ideais imperialistas e antissocialistas. Em contraposição, Allende e seu governo tinham como definidor da sua política externa a defesa dos objetivos e princípios terceiro-mundistas e da integração latino-americana. Principalmente a integração latino-americana era vista como uma ferramenta para a emancipação político-econômica e o real desenvolvimento dos países da América Latina, lutando contra a dominação imperialista da estrutura internacional.&nbsp;Nesse sentido, a presente proposta pretende investigar a política exterior do governo Allende, entre 1970 e 1973, voltada para a integração latino-americana. O estudo irá analisar o contexto internacional no qual Allende governou o Chile, o projeto e as ações da política externa chilena em relação à América Latina e, principalmente, à integração latino-americana. O objetivo é, a partir de uma metodologia de análise de conteúdo, entender qual é a concepção da Unidade Popular sobre a integração latino-americana, as ações que conseguiram ser implementadas e seu legado para a integração regional.</p>'),
