(349, 'pt_BR', 'abstract', '<div><span lang=\"PT-BR\">Antes da década de 2010, os ônibus urbanos da região do ABC contavam com sistemas de propulsão altamente poluentes. A fim de melhorar as condições do ar nas cidades do ABC, tais sistemas estão sendo substituídos por sistemas que utilizam recursos energéticos menos poluentes. Dentre as possíveis modificações, os ônibus elétricos movidos por baterias acompanhadas de células à combustível são uma solução interessante no que tange ao aproveitamento energético, tendo uma maior autonomia para longos trajetos e com tempos menores para o abastecimento do combustível. Assim, a célula combustível é considerada como uma excelente alternativa para utilização nos ônibus urbanos. Neste projeto de IC se desenvolverá um algoritmo de otimização para auxiliar na hibridização dos ônibus elétricos, analisando os principais indicadores de viabilidade económica, mantendo o ciclo de vida útil das baterias e das células de combustível atendendo as necessidades de operação para cada tipo de ônibus urbano. Tal algoritmo será desenvolvido utilizando linguagem Python, por ser uma linguagem que pode ser integrada na maioria dos softwares utilizados na indústria automotiva.</span></div>'),
