(350, 'pt_BR', 'abstract', '<p>Fibrilação atrial (FA) é a arritmia cardíaca mais comum a nível mundial sendo a principal causa de isquemias cerebrais, infarto do miocárdio e tromboembolia venosa. FA é caracterizada pela atividade elétrica rápida e anormal nos átrios, resultando em padrões alterados de contrações dos átrios e em casos persistentes causam o aumento da rigidez da parede do átrio esquerdo (AE), levando a formação de zonas de estagnação do sangue e potencial formação de trombos. A trombogênese ocorre especialmente no apêndice do átrio esquerdo (AAE), uma pequena bolsa anatômica residual do desenvolvimento embrionário do AE. Em pacientes saudáveis o AAE apresenta grande contratilidade, prevenindo a formação de trombos, em contraste aos pacientes com FA com contratilidade reduzida. Cerca de 70-99% dos trombos em pacientes com FA não valvar são formados no AAE. Avanços nas técnicas de imagens médicas como são promissoras na caracterização hemodinâmica em casos de FA, no entanto, ainda é incerto se estas possuem resolução suficiente para capturar os mecanismos de trombogênese em condições relacionadas à baixa velocidade do sangue. Neste cenário, a CFD aparece como uma interessante ferramenta complementar para estudos hemodinâmicos. Esta é uma técnica numérica robusta que fornece grande detalhamento espacial-temporal no domínio avaliado, sendo uma ferramenta versátil para avaliação hemodinâmica em diferentes cenários. O sangue é composto por solução de plasma e elementos formados (células vermelhas, brancas e plaquetas). Do ponto de vista reológico, o sangue total (suspensão homogênea de plasma com elementos formados) se comporta como fluido Não-Newtoniano pseudoplástico. A viscosidade aparente do sangue total aumenta consideravelmente quando sob condição de baixas taxas de cisalhamento. Isto é atribuído a formação de <em>rouleaux </em>(aglomerados de células sanguíneas vermelhas). Estudos hemodinâmicos consideram normalmente o sangue total. Poucos trabalhos focaram na modelagem multifásica do escoamento do sangue (plasma + células) devido ao maior custo computacional. Modelos CFD multifásicos podem ser usados para a resolução acurada na variação local da distribuição de células vermelhas dentro dos vasos e câmaras cardíacas, permitindo avaliar as consequências hemodinâmicas em regiões de acúmulos das células vermelhas. Para uma predição acurada, é necessário estudar as interações complexas entre as células vermelhas e o plasma sanguíneo, sendo fundamental o entendimento das contribuições de diferentes forças interfásicas para uma modelagem mais acurada, principalmente nas regiões próximas a paredes ou de estagnação do sangue. Por fim, vale destacar que pelo conhecimento dos proponentes, não existem trabalhos publicados sobre a hemodinâmica do átrio esquerdo humano utilizando modelos multifásicos.</p>'),
