(351, '', 'categoryIds', '[]'),
(351, 'pt_BR', 'abstract', '<p><strong>Introdução. </strong>A estimulação magnética transcraniana (EMT) é capaz de promover ativação fásica de grupos neuronais no córtex cerebral e consequentemente de vias motoras descendentes. Esta ativação gerando sinais conhecidos como potenciais evocados motores (PEM) e que comumente são registrados por eletromiografia de superfície (sEMG). Entretanto, esta técnica de registro não é eficiente para a obtenção de potenciais evocados em certos músculos devido às características anatômicas deles e há interesse em investigar outras técnicas de avaliação. Uma das alternativas que se mostrou promissora é a técnica de ultrassom muscular (mUS) no monitoramento de músculos como a língua e o diafragma. Entretanto, a padronização desta técnica é raramente descrita na literatura científica. <strong>Justificativa. </strong>A técnica de EMT-US pode ser útil na avaliação e diagnóstico de uma série de doenças em que o acometimento principal se dá em músculos profundos, de difícil monitoramento com EMG. <strong>Objetivo.</strong> Avaliar e padronizar a técnica de obtenção de PEM derivados de EMT-US em indivíduos saudáveis. <strong>Métodos. </strong>Será realizada uma estimulação magnética transcraniana em 10 participantes saudáveis e o registro de PEM e ainda ultrassonografia na língua e no diafragma com o músculo abdutor curto do polegar como controle.</p>'),
