(353, 'pt_BR', 'abstract', '<p>A corrosão metálica é um fenômeno espontâneo e frequente. Sua ocorrência é muitas vezes prejudicial ao emprego de um material devido à perda das qualidades para o qual foi designado. Para solucionar este problema alguns trabalhos da literatura propõem o recobrimento do material utilizando um grupo de camadas protetoras interessantes chamadas smart coatings, as quais fornecem uma solução viável para lidar com os desafios da corrosão em uma ampla gama de aplicações devido as suas propriedades promissoras de se regenerar após ter sofrido algum dano, o que é conhecido como auto-reparação (<em>self-healing</em>). Entre estes recobrimentos estão aqueles contendo cério. A propriedade de inibição a corrosão do Cério (Ce) tem sido discutida na literatura, entretanto pouco se conhece dos mecanismos envolvidos em tal processo. Diante disto, o presente trabalho visa realizar uma revisão bibliográfica sobre camadas protetoras smart coatings contendo Ce, fazer um levantamento das propostas de mecanismos envolvidos, analisar estas propostas e extrair conclusões relevantes que auxilie na futura deposição de filmes contendo Cério sobre o aço carbono utilizando a técnica de plasmas de baixa temperatura.</p>'),
