(354, 'pt_BR', 'abstract', '<p>O arroz (<em>Orzya sativa L</em>.) é uma monocotiledónea de grande importância comercial, já que é um dos cereais mais consumidos mundialmente. Logo, há um grande interesse em estudar mecanismos de absorção de elementos tóxicos e quais impactos esses elementos trazem para o desenvolvimento vegetal. Um desses elementos é o arsênio (As), um semimetal que é bioacumulado, que pode ser encontrado naturalmente no meio ambiente e que vem sendo usado em produtos de atividade industrial, poluindo o ambiente. O arsênio é mais comumente encontrado no ambiente nas formas inorgânicas As(III) e As(V) que, por sua vez, possuem um alto nível de toxicidade tanto para plantas quanto para aqueles que a consomem. Estudos anteriores mostraram que o arsênio pode afetar a arquitetura da raiz de plantas mas que a arquitetura das raízes também pode modular a absorção de arsênio. Além disso, outros estudos realizados com arroz mostram que a predileção por As varia de acordo com a cultivar, ou seja, com seu genótipo. No entanto, não se sabe ao certo se características morfológicas, como semelhança na arquitetura da raiz, ajudam a explicar por que algumas cultivares apresentam maior ou menor predileção por As. Com isso, o projeto tem o intuito de identificar se há estruturas morfológicas do sistema radicular em comum presentes em cultivares de <em>Orzya sativa L.</em> que possuem baixa e alta predileção por As (V). Para isso, as cultivares brasileiras comerciais de arroz EMBR1, 2 e 3 (baixa predileção) e EMBR 28,29 e 30 (alta predileção) serão germinadas na presença e na ausência de As (V) e a morfologia geral da raiz será analisada. Os dados como comprimento das raízes, número e comprimento de raízes adventícias e pelos radiculares entre outras características, serão coletados e comparados entre as cultivares e entre os grupos com maior ou menor predileção por As(V) na presença e ausência do contaminante, o que vai possibilitar uma análise dos efeitos do As (V) nas raízes de plantas desses grupos<em>.</em>&nbsp;</p>'),
