(355, '', 'categoryIds', '[]'),
(355, 'pt_BR', 'abstract', '<p>As novas dimensões científicas para a preservação ambiental colocaram em pauta uma nova classe de contaminantes classificados como Poluentes de Interesse Emergente (PIEs) que trouxeram questões de como alguns produtos utilizados no cotidiano possuem uma capacidade contaminadora quando em contato com o meio ambiente. Dentre esses contaminantes destacam-se os antibióticos utilizados no campo medicinal e veterinário. Devido ao aumento do consumo de antibiótico, ocorre, por consequência, o aumento na eliminação desses compostos pelo organismo, na qual após isso dirige-se a três possíveis locais: primeiro em redes de esgotos e Estações de Tratamento de Esgoto (ETEs), seguido pelo despejo em ambientes aquáticos e, por fim, Estações de Tratamento de Água (ETAs). Sendo assim a proposta de pesquisa descrita no presente projeto tem como base o estudo das dinâmicas que os antibióticos realizam em ambientes aquáticos, a partir da criação de sistemas experimentais controlados. Desse modo, este projeto de Iniciação Científica tem como objetivo a avaliação da fitotoxicicidade dos antibióticos quinolonas empregando como bioindicador a germinação de sementes de<em> Sinapis alba</em> (mostarda-branca). A pesquisa baseia-se no ramo da ecotoxicologia, ciência responsável pelo estudo do nível de toxicidade que os contaminantes apresentam para certos organismos, sendo a fitotoxicologia o âmbito responsável pelas análises em plantas. Ensaios fitotoxicológicos utilizando sementes de <em>S. alba</em> tornaram-se relevantes cientificamente por fornecerem classificações quanto ao nível de toxicidade com rápida execução, baixo custo, independência de aparelhos sofisticados e com facilidade de obtenção de sementes em comércio local.</p>'),
