(356, 'pt_BR', 'abstract', '<p><span style=\"font-weight: 400;\">Trata-se de um Projeto de Iniciação Científica (IC) vinculado ao tema de gênero associado com pensadores e pensadoras decoloniais. O objetivo deste projeto de pesquisa é aprofundar estudos sobre a organização de movimentos de mulheres indígenas no Brasil, bem como mapear e destacar a existência de tais grupos e de representantes importantes para esse movimento. Cada vez mais, grupos de mulheres indígenas de diferentes etnias têm reivindicado espaços de atuação dentro de seus próprios grupos e da sociedade brasileira, de uma forma geral, lutam para combater o machismo presente dentro de suas próprias Aldeias e também contra um racismo exercido pelo Estado através de intervenções nas sociedades tradicionais. </span><span style=\"font-weight: 400;\">Este projeto será desenvolvido vinculado ao Núcleo de Estudos de Gênero Esperança Garcia.</span></p>'),
