(357, '', 'categoryIds', '[]'),
(357, 'pt_BR', 'abstract', '<p>O processo de urbanização brasileiro foi marcado pela concentração de renda, poder e terra, que, aliados a dinâmicas de coronelismo e arbitrariedade na aplicação de leis, levou não somente a desigualdade social, mas, também, a grande segregação territorial. Frente a necessidade de moradia, indivíduos são expostos a riscos socioambientais ao se assentar em áreas inadequadas para habitação. Neste sentido, é de grande importância o mapeamento do risco, seu diagnóstico para que, então, seja possível seu tratamento. Assim sendo, o seguinte projeto se presta a sistematizar e analisar diferentes tipos de mapeamentos de riscos, a fim de apoiar a pesquisa de doutorado intitulada “Mapeamentos de riscos socioambientais na construção de (in)justiças territoriais: histórico, aplicações e consequências” e, também, a própria formulação de planejamentos e&nbsp; prevenção de desastres.&nbsp;</p>'),
