(358, '', 'categoryIds', '[]'),
(358, 'pt_BR', 'abstract', '<p>A microalga verde <em>Chlamydomonas reinhardtii</em> se tornou um modelo muito utilizado para se compreender a fisiologia básica de plantas e biotecnologia de algas. Além do interesse em novas cepas da espécie para posteriores estudos de transformação genética e cultivo para obtenção de biomassa com conteúdo de alto valor agregado, este projeto também é parte de um projeto maior de colaboração internacional para isolamento de <em>C. reinhardtii</em> ao redor do planeta, e sequenciamento para descoberta da biodiversidade e de novos genes e suas funções. Desta forma, o objetivo deste projeto é isolar a microalga <em>C. reinhardtii</em> de solo e água doce, e comparar o crescimento das cepas em condições controladas em escala laboratorial. Primeiramente será realizada coleta, em seguida, em laboratório, através de técnicas básicas de microbiologia será realizado o isolamento de cepas utilizando meio de cultivo apropriado, com posterior amplificação de genes específicos para confirmação, seguido da última etapa de cultivo das cepas isoladas para comparação. Os resultados serão divulgados no evento de iniciação científica da Universidade, através de pôster, que conterá imagens coletadas, e dados numéricos de contagens e acompanhamento de cultivos.</p>'),
