(359, '', 'categoryIds', '[]'),
(359, 'pt_BR', 'abstract', '<p>Milhões de toneladas de resíduos agroindustriais são descartados anualmente apesar de ainda<br>poderem conter compostos de grande interesse econômico para diversos setores industriais.<br>Em um país líder em cultivo de banana, os resíduos gerados de grande proporção são em sua<br>maioria descartados. Diversas tecnologias estão sendo estudadas para dar melhor destino aos<br>resíduos, passando-os por diversos processos ambientalmente corretos em uma biorrefinaria,<br>por exemplo. Possíveis produtos finais são açúcares fermentáveis, óleos essenciais, corantes e<br>outros bioprodutos. A fim de reaproveitar essa biomassa, em principal a inflorescência da<br>bananeira, que contém diversos compostos bioativos, como compostos fenólicos e<br>antocianinas, com atividades antioxidante e antimicrobiana, o presente projeto busca, ao<br>submetê-la ao processo de arraste a vapor direto, obter óleos essenciais como produtos. O<br>estudo será feito em um laboratório nas dependências da Universidade Federal do ABC,<br>vinculado a um grupo de pesquisa maior que já atua na área.</p>'),
(359, 'pt_BR', 'areaSubarea', 'Engenharias II; Engenharia química'),
