(360, 'pt_BR', 'abstract', '<p>Este projeto tem o objetivo de delinear o conceito de gênero como estabelecido na literatura, com enfoque especial em Butler e Beauvoir, para que, a partir disso, possamos compreender melhor o papel do gênero nos debates atuais acerca dos direitos e reivindicações de pessoas trans, agrupando relatos de jovens trans e suas jornadas pelo Sistema Único de Saúde (SUS) na busca do cuidado com a própria saúde, de maneira a demarcar o espaço e a importância da compreensão do conceito de gênero na sua trajetória.</p>'),
