(361, '', 'categoryIds', '[]'),
(361, 'pt_BR', 'abstract', '<p>O contexto dos governos progressistas sul-americano nos primeiros 15 anos do século XXI esteve marcado pelo surgimento de propostas inovadoras para a integração regional ,o novo regionalismo sul-americano “pós-liberal”. Diferentemente dos arranjos realizados no contexto neoliberal anterior, com foco na integração econômica, o regionalismo “pós-liberal” previa, também, maior justiça social e integração cultural e política. Apesar dos avanços das iniciativas, no entanto, elas não avançaram tanto no que diz respeito à necessidade de uma integração que respeite os territórios e os modos de existência dos povos indígenas. Esta pesquisa analisará as propostas para uma integração regional orientada pelo projeto político-civilizatório intercultural do Vivir bien surgidas, em especial, na Bolívia, durante o governo de Evo Morales Ayma. Pretende-se investigar em que medida o Vivir BIen pode ser um horizonte para o alcance de uma integração sul-americana (política, econômica e cultural) que &nbsp;aponte para ações mais ecológicas e afinadas com as demandas dos povos indígenas da região.</p>'),
(361, 'pt_BR', 'areaSubarea', 'Interdisciplinar, Relações Internacionais'),
