(362, 'pt_BR', 'abstract', '<p><span style=\"font-weight: 400;\">O uso crescente do EMG de alta densidade possibilitou o uso desse tipo de sinal para a classificação de movimento. No entanto, os métodos utilizados para isso requerem uma&nbsp; quantidade de dados muito maior do que o praticável para dados de origem biomédica. Uma das opções para contornar essa limitação é a utilização de métodos de data augmentation, para gerar dados artificiais a partir dos dados reais para serem utilizados na fase de treinamento das redes neurais. Esse trabalho irá estudar diferentes métodos de Data augmentation para a classificação do movimento. Por fim, os códigos computacionais e resultados serão disponibilizados ao público na plataforma Github.</span></p>'),
