(363, '', 'categoryIds', '[]'),
(363, 'pt_BR', 'abstract', '<p>Considerando o crescente papel internacional da China, de um lado, e a crise de legitimidade que abate instituições financeiras multilaterais tradicionais, de outro, este trabalho tem o intuito de explorar o papel da China como agente financeiro. Para países em desenvolvimento, em especial na Ásia, África e América Latina, seja em busca de desenvolvimento econômico, reconstrução em um período pós-guerra ou outros fatores, a China constituiu-se em uma alternativa para financiamento externo. Estamos interessados em compreender se os objetivos buscados pelos países nos financiamentos e empréstimos chineses foram ou não alcançados. Para tanto, como metodologia adotamos revisão bibliográfica e levantamento de dados primários.</p>'),
