(364, 'pt_BR', 'abstract', '<p><span style=\"font-weight: 400;\">O presente projeto de Iniciação Científica propõe realizar um levantamento bibliográfico acerca dos projetos de extensão e iniciativas voltados para meninas em idade escolar, que visam desconstruir estereótipos de gênero e incentivar o ingresso dessas jovens nas mais diversas áreas da ciência, atrelado a literaturas que contemplem a importância das mulheres na ciência ao longo da história, além de suas contribuições para a construção do conhecimento científico e grandes descobertas da ciência. Também será investigado o alcance desses projetos e o impacto dos estereótipos de gênero nas ciências com um estudo de caso aplicado para alunas da Educação Básica, a fim de compreender quais aspectos influenciam ou não a participação dessas jovens em projetos desse caráter e, posteriormente, em uma carreira de pesquisa científica, ou de atuação em alguma das áreas que contempla as ciências naturais e exatas e suas tecnologias. Este projeto será desenvolvido vinculado ao Núcleo de Estudos de Gênero Esperança Garcia.</span></p>'),
