(365, 'pt_BR', 'abstract', '<p>Neste projeto de iniciação científica iremos construir modelos efetivos representativos das propriedades estruturais da liga semicondutora Cu<sub>2x</sub>Hg<sub>2-x</sub>GeTe<sub>4</sub>, um material com boas propriedades termoelétricas recentemente descoberto [Levy-Wendt, Phys. Rev. M. 5, 015402 (2021)]. Estes modelos serão construidos usando resultados de cálculos de primeiros princípios, que permitirão que encontremos os parâmetros do modelo que mais o aproximam do material real. Na posse destas descrições efetivas do material, iremos depois estudar a dependência na temperatura das propriedades estruturais desta liga semicondutora, para isso recorrendo a simulações de Monte Carlo. Numa primeira fase o discente de iniciação científica irá construir modelos efetivos para diferentes concentrações de cobre (i.e. diferentes valores de $x$ na fórmula química anterior). Na segunda parte do projeto o discente escreverá um código de Monte Carlo clássico e com ele estudará as propriedades térmicas dos modelos obtidos na primeira parte. Os resultados obtidos neste projeto deverão resultar numa publicação em revista científica internacional.</p>'),
