(366, 'pt_BR', 'abstract', '<p>Este projeto de iniciação científica aborda tarefas matemáticas cognitivamente desafiadoras com tecnologias digitais para o ensino. Para tanto, aborda três etapas: &nbsp;(1) <strong>revisão de Literatura e de documentos curriculares</strong>, envolvendo fichamentos de artigos que tratam das tecnologias digitais em Educação Matemática e estudo das unidades temáticas da Base Nacional Comum Curricular (BNCC); (2) <strong>elaboração de tarefas matemáticas cognitivamente desafiadoras com tecnologias digitais</strong>: serão produzidas tarefas para o ensino com o uso de softwares de geometria dinâmica e objetos de aprendizagem; e (3) <strong>discussão das tarefas&nbsp; em um grupo colaborativo com professores</strong>: as tarefas serão socializadas, debatidas, reformuladas e validadas por professores que ensinam matemática. Espera-se que os resultados possam produzir análises teóricas e metodológicas, com contribuições para a pesquisa em Educação Matemática, bem como gerar impactos nas práticas dos professores, colaboradores do projeto.</p>'),
