(367, 'pt_BR', 'abstract', '<div class=\"page\" title=\"Page 1\">\r\n<div class=\"layoutArea\">\r\n<div class=\"column\">\r\n<p>Hodiernamente, há um grande problema com as altas taxas de gases do efeito estufa lançados na atmosfera. E isso se deve, em partes, ao fato que a matriz elétrica de transporte mundial tem como base combustíveis fósseis, grandes contribuintes para o aquecimento considerável do mundo, além de causar problemas de saúde aos moradores das grandes metrópoles. Portanto, convém buscar novas formas de fornecer energia para veículos automotivos a fim de mitigar esse problema. Entre as diversas maneiras de fornecer energia ao veículo, se destaca as células a combustível, que possuem eficiência energética semelhante às baterias de lítio e possuem potencial para se tornarem mais leves. Entre os modelos mais famosos de células a combustível temos as PEMs e as DEFCs. Os modelos DEFCs são mais interessantes para estudo já que não dependem de armazenamento de gás, o que pode simplificar o projeto. Todavia tais células a combustível possuem um grande gargalo tecnológico e nesse ponto necessita-se de estudos. Tendo isso em vista, esse projeto busca reduzir esse gargalo realizando síntese e caracterização de novos materiais condutores para placas bipolares, baseados em polímero-nanotubos de carbono/grafeno. Dessa forma, avançaremos em busca de solucionar o problema do século, o aquecimento global.</p>\r\n</div>\r\n</div>\r\n</div>'),
(367, 'pt_BR', 'areaSubarea', 'Materiais compósitos; placas bipolares; materiais para energia'),
