(368, 'pt_BR', 'abstract', '<p>A determinação principal do estudo em questão é a análise da relação entre Demanda Bioquímica de Oxigênio (DBO<sub>5</sub>) ao longo do curso hídrico do Rio Tamanduateí, que nasce no munícipio de Mauá e percorre as cidades de Santo André e São Caetano do Sul, até desaguar no Rio Tietê na cidade São Paulo, região da Vila Mariana. Para isso, serão selecionados 8 pontos fixos de coleta e análise de sua água. As amostras coletadas passarão pelo processo de cálculo de sua Demanda Bioquímica de Oxigênio por cinco dias. E por fim, serão relacionados os resultados obtidos em laboratório com os dados de densidade populacional das cidades em que o Rio Tamanduateí percorre, nascendo em uma cidade menos povoada para mais povoada, indicando de que maneira a ocupação humana altera a qualidade das águas.</p>'),
