(369, '', 'categoryIds', '[]'),
(369, 'pt_BR', 'abstract', '<p>O estudante publico alvo da educação especial tem o seu direito legislado ao acesso e permanência no sistema educacional brasileiro, contudo,&nbsp; apesar do indiscutível aumento no número de matrículas de PcD em todos os níveis da educação, estudos apontam que existem questões na qualidade do ensino oferecido ao público-alvo da educação especial. Atualmente a técnica de rastreio ocular&nbsp; vem sendo utilizada em&nbsp; diversas áreas, inclusive na educação, podendo auxiliar na avaliação dos&nbsp; mecanismos envolvidos na aprendizagem examinando a efetividade&nbsp;&nbsp; dos recursos pedagógicos e práticas utilizadas na Educação Especial. Nesse contexto, com base na metodologia de Revisão Sistemática de Literatura, esse&nbsp; estudo tem como objetivo investigar fatores positivos e desafios na avaliação da aprendizagem, por meio da técnica de&nbsp; rastreio ocular, na Educação Especial.</p>'),
