(370, 'pt_BR', 'abstract', '<p>A investigação proposta tem como objetivo compreender a influência dos divulgadores científicos e dos meios de comunicação digitais e seu papel na circulação de informações científicas sobre a Covid-19 entre o público jovem de um bairro periférico da cidade de São Paulo. Para tanto, a pesquisa utilizará uma abordagem qualitativa de carater descritivo e exploratório. Os dados serão coletados junto aos alunos da “Escola Técnica Estadual (ETEC) de Sapopemba”, localizada no bairro Fazenda da Juta, Distrito de Sapobemba, município de São Paulo – SP, com a utilização de questionários eletrônicos com questões fechadas e abertas sobre o tema investigado. A análise das respostas obtidas será conduzida com a utilização da Análise Textual Discussiva. O projeto de investigação tem resultados esperados a identificação de quais divulgadores científicos exerceram maior influência sobre o público no contexto da Pandemia; determinar quais foram os aspectos determinantes de tais atores para que as suas informações sobre a Covid - 19 fossem consideradas confiáveis pelo público; identificar os principais canais utilizados para obtenção de informações sobre a Pandemia; e elencar quais os principais critérios utilizados pelo público para a escolha destes canais.</p>'),
