(371, 'pt_BR', 'abstract', '<p>Segundo uma pesquisa realizada em 2019 pela Base de informações geográficas e Estatísticas sobre os Indígenas e Quilombolas do IBGE (Instituto Brasileiro de Geografia e Estatística) estima-se que há atualmente no Brasil cerca de 16 milhões de afrodescendentes vivendo em comunidades quilombolas, as quais ultrapassam o número de 5 mil comunidades divididas em 1.672 municípios do país, dessas, apenas 404 são oficialmente reconhecidas. Os indivíduos que vivem nesses territórios são constantemente ameaçados por fazendeiros, latifundiários, mineradores e até mesmo pelo poder público, com quem disputam a posse de suas terras ancestrais. Esses territórios são a base de sustentação dessas comunidades que reproduzem com muitas dificuldades suas práticas agrícolas e suas manifestações culturais (danças, cantos, culinária, religião, estética e modo de viver). É no território que se desenvolve a identidade dessas comunidades, seus saberes, seus fazeres e tradições. Desse modo, o que se objetiva aqui é traçar um panorama do modo de vidas das comunidades quilombolas já reconhecidas pelo poder público no município de Januária, Estado de Minas Gerais. Particularmente, se dará ênfase no processo histórico de formação e reconhecimento dessas comunidades e um mapeamento preliminar de como políticas públicas voltadas a estas comunidades têm se efetivado na dimensão da gestão e reconhecimento territorial, da saúde, da educação e combate ao preconceito regional.</p>'),
