(372, 'pt_BR', 'abstract', '<div class=\"page\" title=\"Page 1\">\r\n<div class=\"layoutArea\">\r\n<div class=\"column\">\r\n<p>Os materiais utilizados atualmente na fabricação de implantes e dispositivos médicos ainda enfrentam diversos questionamentos quanto ao seu desempenho mecânico e biocompatibilidade em longo prazo, abrindo caminhos para inovação nesta área. Ligas de titânio do tipo-β metaestáveis constituem uma classe de materiais capazes de apresentar uma combinação de propriedades distintas, advindas tanto das características intrínsecas da microestrutura em condições fora do equilíbrio, como também dos vários mecanismos de deformação plástica possíveis em função da metaestabilidade da matriz. Neste sentido, objetivando domínio e nacionalização da ciência e tecnologia envolvidas na pesquisa e desenvolvimento de ligas metálicas para utilização biomédica, o presente projeto de I.C. se enquadra dentro de um projeto de pesquisa que estudará o processamento e caracterização de uma liga de titânio tipo-β metaestáveis, Ti-Nb-Ta-Zr, com composição isenta de elementos tóxicos e não alergênicos para aplicações como biomateriais visando três objetivos específicos: 1) exploração tecnológica e adequação das propriedades mecânicas para as funções pretendidas, viabilizada pela estrutura metaestável e variação das rotas de processamento; 2) entendimento do comportamento ao desgaste em ambiente bio- simulado, de forma a minimizar problemas recorrentes de afrouxamento de implantes artificiais; 3) avaliação da resposta biológica por meio de estudos in vitro em meios de culturas de células osteoblásticas, responsáveis pela formação, crescimento e regeneração óssea. Ao final, espera-se que a liga investigada atenda mais plenamente os requisitos de biocompatibilidade e biofuncionalidade, de forma a melhorar o sucesso dos procedimentos cirúrgicos e estender o uso de biomateriais a um número cada vez maior de indivíduos.</p>\r\n</div>\r\n</div>\r\n</div>'),
