(374, 'pt_BR', 'abstract', '<p>O projeto pretende contribuir para o conhecimento da atuação das facções criminais dentro e fora das prisões da região Sudeste. Tendo como ponto de partida material bibliográfico acadêmico sobre esse tema, coletado em projetos anteriores e de âmbito nacional, será feito um recorte dos trabalhos referentes à Região Sudeste. Os textos selecionados serão lidos e fichados e, assim, pretende-se esboçar uma análise da dinâmica criminal das facções nesta região.</p>'),
