(375, 'pt_BR', 'abstract', '<p>Primários da radiação cósmica colidem com núcleos de átomos da alta atmosfera, produzindo gerações sucessivas de partículas que se multiplicam numa cascata conhecida como chuveiro atmosférico extenso (CAE). No caminho do chuveiro até a superfície da Terra, as partículas ultrarrelativísticas da componente eletromagnética (elétrons e pósitrons), ao viajarem com velocidade superior à da luz no meio (v &gt; c/n, onde n é o índice de refração), emitem radiação do tipo Cherenkov. Esta radiação, que é luz com comprimentos de onda típicos na região entre o azul e o ultravioleta, é usada como sinal para a observação de CAEs em telescópios de imageamento Cherenkov atmosférico (IACTs, na sigla em inglês) na astronomia de raios gama.</p>\r\n<p>Uma nova geração de IACTs no mundo será iniciada com o Cherenkov Telescope Array (CTA), que será composto por mais de 100 telescópios instalados em ambos os hemisférios, com um arranjo nas Ilhas Canárias e outro no norte do Chile. Os telescópios do CTA proverão uma ampla cobertura no espectro energético, desde 20 GeV até 100 TeV, ampliando a cobertura do céu em <br>resolução angular e sensibilidade de energia em cerca de uma ordem de grandeza às dos atuais IACTs.</p>\r\n<p>Neste projeto de iniciação científica (IC), faremos uma revisão da física da radiação Cherenkov e, posteriormente, estudaremos com uma detalhada simulação computacional a formação do sinal Cherenkov nos telescópios do CTA.</p>'),
