(376, 'pt_BR', 'abstract', '<p>Submodular functions are an important class of objective and constraint functions in discrete optimization problems, with many deep and beautiful results and lots of applications. Recently, the problem of optimizing the difference or the ratio of submodular functions has received some attention in the literature for encompassing a variety of machine learning models. We propose a continuation of that systematic investigation by focusing on some structurally-restricted subclasses of submodular functions, their algorithmic aspects, and their tantalizing consequences in machine learning applications.</p>'),
