(377, 'pt_BR', 'abstract', '<p><span style=\"font-weight: 400;\">O mundo em um contexto pós-pandêmico</span><span style=\"font-weight: 400;\"> se desenvolve a partir das intensas mutações experienciadas com o isolamento social e com as novas necessidades sociais resultadas do uso intensivo de tecnologias. Nesta iniciação científica, estudaremos a intersecção entre educação, gênero e tecnologia. Buscaremos compreender como os jovens vivenciam as suas experiência afetivas em mediação com os aparatos tecnológico. O recorte da pandemia nos interessa por conta da virtualização em massa das formas de sociabilidade, o que aprofunda manifestações que já vinham se desenvolvendo anteriormente. Para realizar esta pesquisa, iremos percorrer três movimentos de estudo: primeiro, entender a relação entre real e virtual e as tecnologias como formadoras de subjetividades; segundo, a partir do conceito de \"tecnologia de gênero\", vamos conhecer pesquisas empíricas sobre o uso dos aplicativos de relacionamento e como estes exigem (in)tensas negociações afetivas; terceiro, vamos estudar dois importante materiais sobre a relação de jovens e tecnologia. Com isso queremos testar algumas hipóteses sobre como as tecnologias de sociabilidade de tornaram, elas também, \"pandêmicas\", no sentido de afetar profundamente os modo de vida contemporâneos. Este projeto será desenvolvido vinculado ao Núcleo de Estudos de Gênero Esperança Garcia.&nbsp;</span></p>'),
