(378, 'pt_BR', 'abstract', '<p>Os plásticos possuem um longo tempo de vida e o aumento no consumo deste material, bem como o seu descarte irregular, vem gerando um grave impacto ao meio ambiente. Por isso, entender o comportamento deste material no ambiente e os impactos que a sua degradação gera para o ecossistema é muito importante para o desenvolvimento de tecnologias mais sustentáveis. Os plásticos descartados no meio ambiente podem ser fragmentados pelo efeito de luz solar, mecanicamente ou por ação de micro-organismos, diminuindo o tamanho desses materiais para partículas com diâmetro &lt; 5 mm e gerando os denominados microplásticos (MPs). Este trabalho tem como objetivo avaliar a degradação de polietileno tereftalato (PET) oriundo de águas naturais e alimentos visando à identificação e quantificação desse polímero. O preparo de amostras para isolamento de MPs será avaliado visando à identificação de PET através de compostos de degradação gerados via decomposição por processos oxidativos avançados. Serão realizadas otimizações através dos métodos univariado ou multivariado, visando máxima sensibilidade, precisão e frequência analítica, bem como mínimo consumo de reagentes e geração de resíduos.</p>'),
(378, 'pt_BR', 'areaSubarea', 'Química/Química Analítica'),
