(379, 'pt_BR', 'abstract', '<p>A <em>Heteropterys tomentosa </em>ou <em>Heteropterys aphrodisiaca </em>(Malpighiaceae) é uma espécie nativa com ocorrência principalmente no cerrado e conhecida pelos nomes populares de “nó-de-cachorro” ou “Cordão-de-São-Francisco”. As raízes da planta são popularmente utilizadas em forma de garrafadas como tônico, afrodisíaco, para melhora da memória, entre outros usos. O comércio do material botânico de nó-de-cachorro em grandes centros urbanos ocorre principalmente em casas de ervas, lojas de produtos naturais e bancas de raizeiros, sendo encontrada principalmente na forma de pó pulverizado. Neste projeto será feita a comparação do perfil fitoquímico e farmacológico de amostras de nó-de-cachorro obtidas de diversos locais (casas de ervas na região do ABC) com uma amostra autenticada. A presença de contaminantes e possíveis adulterantes nas amostras também será avaliada. Para a avaliação farmacológica, será realizada a extação hidroalcoólica das amostras e os extratos serão submetidos à avaliação da atividade antioxidante pelo teste de sequestro do radical livre DPPH e o efeito sobre as enzimas monoamino oxidase e acetilcolinesterase.</p>'),
