(380, 'pt_BR', 'abstract', '<p><span style=\"font-weight: 400;\">A vigente pesquisa tem como objetivo estudar e analisar como o funcionamento da sociedade do desempenho e do capitalismo tardio têm impactado a vida psíquica humana, assim como a saúde mental dos indivíduos. Buscamos uma abordagem interdisciplinar, integrando discussões das ciências biológicas, das neurociências e da teoria crítica contemporânea. Pretende-se compreender a correlação entre as formas sociais, especialmente num contexto capitalismo neoliberal, e as expressões neurológicas da psique humana, evidenciando de que forma isso afeta o ser humano em nível corporal fisiológico. Buscando responder estes questionamentos, este estudo busca instigar a interdisciplinaridade entre filosofia e ciências naturais como finalidade de auxiliar na discussão de tópicos modernos no âmbito da saúde mental e a ética do aprendizado.</span></p>'),
