(381, 'pt_BR', 'abstract', '<p><span dir=\"ltr\" role=\"presentation\">No problema do Caixeiro Viajante temos um conjunto de cidades juntamente com</span><br role=\"presentation\"><span dir=\"ltr\" role=\"presentation\">os custos de viajar de uma cidade para outra e queremos encontrar uma rota de custo</span><br role=\"presentation\"><span dir=\"ltr\" role=\"presentation\">mínimo que passa por todas elas exatamente uma vez. Esse é um problema clássico e</span><br role=\"presentation\"><span dir=\"ltr\" role=\"presentation\">central em otimização combinatória, com diversas aplicações práticas e, infelizmente,</span><br role=\"presentation\"><span dir=\"ltr\" role=\"presentation\">NP</span><span dir=\"ltr\" role=\"presentation\">-difícil. Este projeto tem por objetivo a introdução do candidato à pesquisa científica</span><br role=\"presentation\"><span dir=\"ltr\" role=\"presentation\">por meio do estudo de diferentes algoritmos para o problema mencionado, com foco em</span><br role=\"presentation\"><span dir=\"ltr\" role=\"presentation\">algoritmos de aproximação.</span> <span dir=\"ltr\" role=\"presentation\">Cada algoritmo envolve técnicas e conceitos diferentes,</span><br role=\"presentation\"><span dir=\"ltr\" role=\"presentation\">possibilitando assim ao aluno complementar sua formação em Ciência da Computação.</span></p>'),
