(382, 'pt_BR', 'abstract', '<p><span style=\"font-weight: 400;\">O feminismo negro é um campo teórico, político e metodológico central ao pensamento social brasileiro nos dias de hoje. A luta das mulheres negras é parte constitutiva de nossa história, e os anos 1970 são um marco importante nessa trajetória de luta. Nesse momento, algumas importantes referências do pensamento negro feminista contemporâneo emergem, como por exemplo o Nzinga Informativo e deixam registros que nos permitem compreender melhor suas contribuições e apostas políticas. Nessa pesquisa, propõe-se um estudo dos jornais Nzinga Informativo, uma publicação central na articulação do feminismo negro no período de 1985 a 1989, e busca-se compreender conceitos e estratégias que foram referências para a teorização do feminismo negro braileiro através dos escritos produzidos nesse jornal. A pesquisa contemplará as contribuições políticas e acadêmicas do informativo às mulheres negras e ao movimento feminista. Esse projeto será realizado no âmbito do Núcleo de Estudos de Gênero da UFABC, do qual faz parte a orientadora do projeto.</span></p>'),
