(383, 'pt_BR', 'abstract', '<p>O Pantanal é considerado uma área úmida de proteção ambiental (sítio RAMSAR) e abriga uma considerável parcela da biodiversidade brasileira. Tocas de tatus (Xenarthra, Cingulata) foram mapeadas na região transpantaneira de Poconé, Mato Grosso, em uma área delimitada da Fazenda Passo da Ema no período de 11 a 21 de setembro de 2019, época de seca. Foram coletados dados de 243 tocas em uma fazenda de 44 hectares, então subdividida em três diferentes regiões: campos de murundus, formação savânica e beira de estrada. Os dados então coletados sobre a posição, visibilidade e atividade das tocas serão aqui analisados estatisticamente. O estudo da distribuição das tocas de tatus pode ajudar no entendimento do comportamento destes animais, e apresentar-se, portanto, como uma importante ferramenta para a conservação da paisagem pantaneira e sua biodiversidade.</p>'),
