(384, 'pt_BR', 'abstract', '<p>Testes experimentais realizados em parceria entre a agencia espacial brasileira (AEB) e o centro espacial<br>alem˜ao (DLR), sobre o funcionamento da bomba centrifuga de combust´ıvel presente no motor foguete<br>L75, mostraram a ocorrˆencia do fenˆomeno de cavita¸c˜ao no indutor desta bomba. Posteriores trabalhos<br>simulacionais tamb´em observaram o mesmo fenˆomeno, utilizando uma abordagem num´ericas de estado<br>permanente com m´etodos de m´ultiplos referenciais inerciais (MRF). Entretanto, uma investiga¸c˜ao maior<br>deste fenˆomeno deve ser realizada a fim de investigar melhor os motivos pela ocorrˆencia de cavita¸c˜ao no<br>componente indutor. Deste modo, o presente estudo tem como objetivo investigar o fenˆomeno de cavita¸c˜ao<br>presente no componente indutor, via uma abordagem num´erica transiente, multif´asica e tridimensional com<br>o auxilio de c´odigo aberto OpenFOAM. O resultados ser˜ao validados com dados experimentais e poss´ıveis<br>predi¸c˜oes de parˆametros de projeto que implicam na cavita¸c˜ao podem ser levantados.</p>'),
