(385, 'pt_BR', 'abstract', '<p>Este documento contém o projeto de Iniciação Científica intitulado: “Migração e Analfabetismo em Heliópolis: desafios e persistências no Bairro Educador”, que busca&nbsp; investigar e compreender a construção do Heliópolis como espaço das migrações internas em São Paulo, a transformação deste território em “Bairro Educador” e a relação desses processos com a persistência do analfabetismo entre adultos na comunidade. Para tanto, busca-se construir aporte teórico orientado por teorias da migração interna (Singer, 1973, Baeninger, 2005) e pelo conceito de Bairro Educador (Dimenstein, 2009). Para observar a consolidação desses dois processos e sua relação com o desafio da persistência do analfabetismo em adultos, será acessado aporte metodológico combinando registros conservados pela comunidade e entrevistas em profundidade com migrantes e educadores dedicados ao enfrentamento do analfabetismo em Heliópolis.&nbsp;</p>'),
