(386, 'pt_BR', 'abstract', '<p>O desenvolvimento tecnológico está diretamente relacionado à conjuntura política no<br>qual está imerso, embora as noções mais usuais tendam a insistir na tecnologia como uma<br>caixa preta, alheia a seu entorno. Questionando esta realidade, a Tecnologia Social surge como<br>crítica ao processo hegemônico de desenvolvimento tecnológico e centra suas análises e<br>atuações nas ações populares de construção sociotécnica. Neste contexto, a presente pesquisa<br>objetiva analisar os processos de construção de tecnologias por movimentos sociais na cidade<br>de Mauá. A fim de refletir sobre as contradições e conflitos entre o desenvolvimento<br>tecnológico hegemônico e aquele protagonizado pela população em seus processos auto<br>organização. Para isso será utilizado o método da pesquisa ação junto a movimentos sociais já<br>organizados no município, para que seja possível contribuir com a organização destes assim<br>como a construção de conhecimento.</p>'),
(386, 'pt_BR', 'areaSubarea', 'interdisciplinar; Engenharia Popular'),
(386, 'pt_BR', 'bolsistaProdutividade', 'nao');
