(387, 'pt_BR', 'abstract', '<p>O sistema imunológico dos seres humanos é altamente especializado e bem desenvolvido. Tal mecanismo confere proteção contra agentes patogênicos intracelulares e extracelulares, oferecendo dois tipos diferentes de recursos especializados para reconhecimento e proteção contra essas duas categorias de agentes infecciosos. Em geral, as respostas imunes podem ser divididas em duas fases: a primeira em que ocorre o reconhecimento do antígeno e a segunda na qual é feita a erradicação desse antígeno. Dentro dessas categorias, destacaremos nesse trabalho o papel que um tipo celular, denominado células dendríticas, possui no processo de mediação dentro do mecanismo de respostas imunes. Durante um processo infeccioso, por exemplo, essas células apresentam a função primária de apresentação desse agente infectante para outro grupo celular, localizado em pontos específicos do corpo dos vertebrados, o qual vai ser responsável por levar adiante parte da cadeia de acontecimentos químicos e físicos até o fim do processo e a eliminação desse fator danoso. Fatores externos, químicos por exemplo, também podem mediar esse processo, como drogas ou fármacos. Nesse contexto, vamos estudar também as ações, mecanismos e meios que um fitoquímico específico chamado Sulforafano, proveniente de uma família vegetal de grande disponibilidade e já conhecido, em parte, pelas suas ações na modulação das respostas imunes, pode contribuir para maior e melhor entendimento da modulação das respostas imunes, filiado a um novo mecanismo de hidrogéis termossensíveis para melhor distribuição do Sulforafano nas células dendríticas<span class=\"Apple-converted-space\">&nbsp;</span></p>'),
(387, 'pt_BR', 'areaSubarea', 'inflamação, imunologia celular, fitoquímico'),
