(388, '', 'categoryIds', '[]'),
(388, 'pt_BR', 'abstract', '<p>O crescimento exponencial do bilinguismo, apoiado no contexto de globalização, somado a possíveis implicações cognitivas e correlatas neurais, tornou o estudo do bilinguismo um tema cada vez mais relevante em estudos psicolinguísticos, neurolinguísticos e em neurociência da linguagem, por isso, torna-se necessário o estudo detalhado desse fenômeno. Porém, tal tema apresenta implicações, como a necessidade de atestar o grau de proficiência do indivíduo estudado, além de suas implicações cognitivas. O presente estudo dá continuidade ao projeto “Adaptação de teste de nomeação multilíngue (MINT) para língua portuguesa no contexto do bilinguismo português-inglês” que teve como objetivo adaptar o teste de vocabulário MINT para falantes nativos de português brasileiro, a fim de que possa ser usado em estudos sobre bilinguismo e multilinguismo. O teste foi adaptado para aplicação de falantes de Português-Inglês e aplicado preliminarmente em bilíngues. Neste projeto, daremos continuidade à aplicação em bilíngues e investigaremos o acesso lexical nessa população em comparação a monolingues. Os participantes (30 bilíngues adultos) realizarão o MINT e testes de fluência verbal nas duas línguas. Um grupo de monolíngues (n=30, língua materna português) será usado como controle. Os participantes bilingues e monolingues realizarão o teste de simon para investigar as funções executivas. Os bilíngues responderão a um questionário de experiência linguística e de proficiência. Serão avaliadas diferenças entre monolingues e bilingues nos testes de vocabulário e como estas diferenças se relacionam com as medidas de proficiência, experiência linguística e funções executivas. Espera-se replicar em nosso meio,&nbsp; os achados de diferenças no acesso lexical entre monolingues e bilingues ( bilíngues seriam um pouco mais lentos que monolíngues e sujeitos a interferências interlinguísticas. Por outro lado, espera-se que bilingues mais proficientes e com melhores funções executivas tenham menor interferência entre as línguas. As funções executivas serão avaliadas pelo teste de Simon (versão computadorizada).</p>'),
(388, 'pt_BR', 'areaSubarea', 'Neurociência, Linguagem'),
