(388, 'pt_BR', 'title', 'Efeitos do Bilinguismo sobre o Acesso Lexical na Língua 1 em Bilíngues Português- Inglês: uma investigação da relação entre as habilidades de controle inibitório, experiência linguística e  proficiência na Língua 2'),
(389, '', 'categoryIds', '[]'),
(389, 'pt_BR', 'abstract', '<p>O estudo, modelagem e análise de redes é um ponto essencial da compreensão de como sistemas complexos funcionam, o qual acaba por englobar temáticas desde a física estatística até a neurobiologia. As redes estão dispostas em todas os campos do saber e podendo ser aplicadas para compreender diferentes tipos de conexões e redes que existem, como por exemplo, no campo da biologia e bioquímica pode-se modelar e estudar como funcionam as redes metabólicas nos organismos vivos, comunicação entre os neurônios no sistema nervoso e demais outras características essenciais para a compreensão do funcionamento dos seres vivos; para a tecnologia podemos compreender os caminhos que a internet navega, conecta-se e gera informações que são transacionadas pelo meio; e etc.<br>Desta forma, o presente projeto visa entender o papel das sinapses elétricas e dos tipos de conectividades em redes neuronais . A partir de modelagem teórica e análises de dados experimentais, pretende-se explorar essa temática. Os dados experimentais virão, principalmente, de multi-eletrode array (MEA) e medidas eletrocorticográficas, além disso, a maneira a qual é buscada analisar esses dados e modelar essa conexões para o estudo advém principalmente do uso do software Gephi [4], construindo graficamente os grafos, e no estudo aprofundado de modelos teóricos de redes e suas composições para a melhor e maior aproximação com os cenários realistas do funcionamento do sistema nervoso que ainda são pouco explorados na busca aprofundada da atuação das sinapses elétricas nas conectividades neuronais.</p>'),
(389, 'pt_BR', 'areaSubarea', 'Neurociência, Neurociência Computacional'),
(389, 'pt_BR', 'bolsistaProdutividade', 'nao'),
