(390, 'pt_BR', 'abstract', '<p>A aerodinâmica é uma área de desenvolvimento de um carro de Fórmula 1 imprescindível para um bom desempenho em corridas. A presença do <em>downforce</em> produzido pelo escoamento de ar em contato com a superfície do carro permite uma maior aderência dos pneus com a pista, melhorando a capacidade de aceleração, frenagem e contorno de curvas. Entretanto, tais efeitos benéficos sempre vem acompanhados de uma força de arrasto, que age no sentido contrário ao movimento e, portanto, limita a velocidade desses veículos. A asa traseira, em particular, é um dos dispositivos que mais contribuem para o surgimento dessas forças em monopostos. O objetivo deste projeto é analisar numericamente o impacto dos parâmetros geométricos da asa traseira multielementos de um carro de Fórmula 1 nas suas características aerodinâmicas.</p>'),
