(391, 'pt_BR', 'abstract', '<p>A comunicação requer que sinais sejam compartilhados entre os indivíduos emissor e receptor. Investigaremos a comunicação em grilos, em que os machos variam seus cantos em função da temperatura do ambiente, e de forma acoplada, as fêmeas também respondem para os cantos em função da temperatura. O objetivo do projeto é implementar essa nova linha de pesquisa e replicar os experimentos comportamentais clássicos de acoplamento de temperatura. O projeto consiste em desenvolver os equipamentos de coleta para (1) realizar os registros do canto dos machos em diferentes temperaturas ambientes e (2) registro de movimentos de resposta das fêmeas a cantos de diferentes temperaturas, estando as fêmeas também em diferentes temperaturas ambientes. Esses estudos permitirão viabilizar experimentos futuros de investigação das bases neurais da comunicação em grilos, com fins acadêmicos e didáticos.</p>'),
