(392, 'pt_BR', 'abstract', '<p>Toda sociedade possui em sua formação um conjunto específico e particular de práticas e rotinas sociais cuja legitimação se dá através de sua materialização em instituições comunitárias cujo valor ético é compartilhado entre todos. O sistema econômico capitalista enquanto instituição intrínseca ao modo organizacional da vida humana possui em sua constituição uma série de elementos condicionantes formulados através de acordos intersubjetivos, sobre os quais o racismo se apresenta como parte integradora. A partir da análise das obras de Silvio Almeida, <em>Racismo Estrutural</em> (2019), <em>Dennis de Oliveira, Racismo estrutural: uma perspectiva histórico-crítica</em> (2021), e Mário Theodoro, <em>A sociedade desigual: o racismo e a branquitude na formação do Brasil</em> (2022), se busa analisar as diferenças e semelhanças em tais abordagens sobre o racismo estrutural, entendendo-o como elemento&nbsp; central da reprodução social do&nbsp; capitalismo no Brasil.&nbsp;</p>'),
(392, 'pt_BR', 'areaSubarea', 'Sociologia - Relações Étnico-raciais '),
