(393, 'pt_BR', 'abstract', '<p>Em face às adversidades socioambientais no Brasil e no mundo, os negócios sociais e os ecossistemas nos quais estão inseridos – denominados como Ecossistemas de Inovação Social</p>\r\n<p>– configuram-se como importantes e viáveis alternativas de solução à desigualdade social. Dessa forma, o objetivo desta pesquisa é mapear os empreendimentos sociais na cidade de São Paulo, com destaque aos negócios sociais financeiros e as suas dinâmicas internas, bem como as organizações estruturantes dos ecossistemas aos quais estão integrados. Pretende-se conduzir a pesquisa realizando um levantamento de potenciais organizações que promovam a inclusão financeira. A lista de empreendimentos terá como base o mapeamento organizado pela Pipe.Social. Planeja-se enviar um formulário eletrônico com perguntas estruturadas de modo a investigar as características, forma de atuação e dimensão geográfica, entre outros aspectos, das instituições previamente mapeadas. Por meio de uma cartografia georreferenciada do Ecossistema de Inovação Social da capital paulista e de uma abordagem quantitativa dos dados coletados, a pesquisa espera oferecer uma investigação aprofundada dos empreendimentos sociais de serviços financeiros que atuam na região da cidade de São Paulo, bem como enfatizar a abrangência do impacto dessas instituições na esfera social.</p>\r\n<p>&nbsp;</p>'),
