(394, 'pt_BR', 'abstract', '<p>Sementes de <em>Moringa oleifera</em> apresentam capacidade coagulante decorrente da presença de proteínas catiônicas responsáveis pela desestabilização de partículas na etapa de coagulação, propiciando a formação de flocos passíveis de sedimentação. Estudos demonstram que o produto apresenta baixa estabilidade durante o armazenamento, perdendo a capacidade coagulante ao longo do tempo quando na forma aquosa. Uma alternativa seria produzir e armazenar o coagulante na forma sólida, o que eventualmente pode reduzir sua degradação. Assim, este trabalho tem como objetivo avaliar a influência do armazenamento no desempenho dos extratos de sementes de <em>Moringa oleifera</em> nas formas: pó in natura, extrato liofilizado obtido em meio aquoso e extrato liofilizado obtido em meio salino. Serão realizados ensaios de coagulação (G = 200 s<sup>-1</sup> por 30 segundos), floculação (G = 20 s<sup>-1</sup> por 15 minutos) e decantação (30 e 60 minutos) para avaliação da redução de turbidez ao longo de 6 meses de armazenamento, com realização de ensaios nos dias 1, 7, 14, 21, 30, 60, 90, 120, 150 e 180. Também será avaliado o residual de matéria orgânica na água tratada, as dimensões dos flocos formados por microscopia ótica e o potencial zeta para a água coagulada. Para os coagulantes será avaliada a concentração de proteínas e identificação da presença de poros.</p>'),
