(395, 'pt_BR', 'abstract', '<p>A ideia do presente projeto de pesquisa surgiu a partir dos resultados encontrados na Iniciação Cientifica desenvolvida pela estudante no edital de 2021, quando buscou averiguar a predominância dos modelos de comunicação pública da ciência em algumas fontes. A análise demonstrou que os materiais do Projeto Educador (Secretaria de Educação de São Bernardo do Campo, direcionadas para crianças dos anos iniciais do Ensino Fundamental) se encaixavam, predominantemente, no modelo de déficit, ainda que outros materiais pontuais apresentassem características do modelo dialógico. A fim de romper com a predominância do modelo de déficit, o presente projeto visa propor atividades pedagógicas voltadas para um dos locais discutidos em uma das revistas do Projeto: o Parque Natural Municipal Estoril. Serão feitas visitas ao Parque para uma observação, descrição e identificação das potencialidades do local. Serão observados aspectos como: capacidade de lotação para receber turmas grandes; infraestrutura para realização de atividades; acessibilidade etc. Serão propostas atividades didáticas a serem aplicadas com turmas escolares, partindo de uma perspectiva que considere os modelos dialógico e de participação dos visitantes. A proposta pedagógica incluindo o espaço não formal será elaborada a partir do esquema de Modelo Didático de Utilização dos Museus com fins Educativos.</p>'),
