(396, 'pt_BR', 'abstract', '<p>Os métodos de otimização computacional caracterizam-se, especialmente no escopo aeronáutico, por explorar o escopo do projeto de forma a aumentar a sua eficácia. Com esse objetivo, a parametrização geométrica de aerofólios se destaca na busca por eficiência durante a otimização de superfícies aerodinâmicas. Sob essa perspectiva, este projeto aborda o desenvolvimento de um código computacional que descreve aerofólios a partir de funções matemáticas, com a ideia principal de adequação destes em parâmetros matemáticos que influenciam diretamente no seu comportamento aerodinâmico, a fim de facilitar sua otimização.</p>'),
