(397, 'pt_BR', 'abstract', '<p>A mitigação e adaptação às mudanças climáticas é um esforço agregado global, previsto por diversas conferências e acordos internacionais para reduzir os impactos negativos que seus efeitos podem ter por todo o mundo. Em especial, países do Sul Global estão mais vulneráveis a esses riscos. Entretanto, a ação colaborativa em prol de ações para essa temática mostra-se difícil de se consolidar. Dentro da esfera nacional, há o desmantelamento da governança relacionada às mudanças climáticas. O presente trabalho se presta a realizar uma análise das políticas implementadas pela área ambiental do governo do Estado de São Paulo entre os anos de 2005 e 2018, incluindo a Secretaria de Estado do Meio Ambiente e o Fórum Paulista de Mudanças Climáticas Globais e de Biodiversidade.</p>'),
