(398, 'pt_BR', 'abstract', '<p><span style=\"font-weight: 400;\">Microbiota humana refere-se ao conjunto de microrganismos que habitam os diferentes órgãos e tecidos de nosso corpo e desempenham diversos papéis fundamentais para a homeostase. Por outro lado, a disbiose destas comunidades pode estar envolvida no desenvolvimento de doenças. A comunidade bacteriana tem sido extensivamente estudada, enquanto a diversidade fúngica permanece pouco explorada. Doenças crônicas de pele foram historicamente atribuídas a fungos do gênero </span><em><span style=\"font-weight: 400;\">Malassezia</span></em><span style=\"font-weight: 400;\"> com base em métodos dependentes de cultivo. Porém, estratégias de Biologia Molecular, em particular tecnologias de sequenciamento de segunda geração, mostram que esses organismos são abundantes também na pele saudável. Atualmente, o gênero inclui 18 espécies formalmente descritas, mas há evidências de organismos ainda não caracterizados com alta prevalência e abundância em amostras provenientes tanto de lesões cutâneas quanto de pele saudável. Dados metagenômicos são frequentemente analisados de maneira generalista, negligenciando sequências para as quais não há referência nas bases de dados, o que dificulta a detecção de possíveis novas espécies. Neste projeto, serão avaliadas a prevalência e abundância de sequências de organismos não caracterizados do gênero </span><em><span style=\"font-weight: 400;\">Malassezia </span></em><span style=\"font-weight: 400;\">em conjuntos de dados metagenômicos da microbiota fúngica cutânea, buscando correlações com diferentes estados de saúde e outras características dos voluntários. Primeiramente, será realizada uma revisão sistemática da literatura envolvendo análises metagenômicas da microbiota fúngica cutânea. Os dados de sequenciamento correspondentes aos trabalhos selecionados serão recuperados da base </span><em><span style=\"font-weight: 400;\">Sequence Read Archive</span></em><span style=\"font-weight: 400;\"> (SRA) do NCBI a fim de avaliar a presença, prevalência e abundância de sequências pertencentes a possíveis novas espécies do gênero </span><em><span style=\"font-weight: 400;\">Malassezia</span></em><span style=\"font-weight: 400;\">. Por fim, serão realizadas análises estatísticas com os metadados disponíveis. Elucidar a diversidade de fungos do gênero </span><em><span style=\"font-weight: 400;\">Malassezia </span></em><span style=\"font-weight: 400;\">poderá contribuir para uma melhor compreensão da diversidade microbiana da pele e seu possível envolvimento na etiologia de doenças.</span><span style=\"font-weight: 400;\"><br></span></p>'),
(398, 'pt_BR', 'areaSubarea', 'Ciências Biológicas; Microbiologia'),
