(399, 'pt_BR', 'abstract', '<p>Com o desenvolvimento tecnológico diversos softwares foram projetados para que <br>fosse possível propiciar optimizações dos trabalhos manuais. A criação de alguns desses <br>softwares proporcionou e promoveu soluções de problemas complexos que envolvem <br>elementos estruturais. Dentre essas soluções numéricas pode-se destacar o método de <br>elementos finitos, que pertence a classe de métodos numéricos utilizados para a <br>aplicação de soluções envolvendo equações diferenciais (EDO e EDP), a partir das <br>condições de projeto, permitindo solucionar diversos problemas reais de engenharia.<br>Este estudo trata-se de uma análise numérica, com o objetivo de avaliar <br>o comportamento estrutural de uma asa da aeronave executiva da Embraer Phenom <br>300E, aplicando o método dos elementos finitos para a investigação através de análise <br>linear estática e dinâmica dastensões, das regiões de falhas mecânicas e dos modos de vibração.<br>Pretende-se também no presente projeto, realizar um estudo e dimensionamento da <br>asa, a fim de identificar as características do perfil de aerofólio. Após os estudos <br>geométricos, as análises serão implementadas utilizando tanto softwares de<br>Computer Aided Engineering (CAE), quanto de MEF, como o FEMAP, ambos são versões de estudante e gratuita. Serão estudadas conjuntamente as forças que atuam na estrutura da asa, como: força de sustentação, força da gravidade e outras cargas concentradas que impactam a estrutura.</p>'),
(399, 'pt_BR', 'areaSubarea', 'Engenharia Estrutural; Métodos computacionais; Análise numérica; '),
