(400, '', 'categoryIds', '[]'),
(400, 'pt_BR', 'abstract', '<p>As oscilações neurais são importantes para diversas habilidades cognitivas como processo de atenção e tomada de decisão, por exemplo. Entender essas oscilações é importante para a compreensão de informações que trafegam entre diferentes regiões cerebrais, e como comportamentos gerados por esse tráfego de informações estão relacionados com a atividade cerebral. A proposta mais recente é essas interações entre regiões diferentes do cérebro podem ser reconfigurados flexivelmente por momentos de sincronia ou coerência da atividade neural das diferentes áreas cerebrais . O objetivo deste projeto é relacionar essas interações e como se alteram (com neuropatologias, por exemplo) e demonstrar que elas podem ser estudadas e analisadas através de modelos e estudos computacionais, mais precisamente o aprendizado de máquina (Machine Learning), que é utilizado para realizar previsões de casos a partir de dados prévios disponibilizados .<br>Neste projeto, vamos analisar o experimento de tomada de decisão realizado com ratos no labirinto em Y, que é feito através do teste de aprendizagem após eletrodos serem implantamos nos cérebros destes animais. Os dados, provenientes dos registros eletrofisiológicos feitos simultaneamente aos testes, serão analisados separadamente pelos parâmetros necessários para que o<br>animal experimentado realize a tarefa e o fato de ele conseguir realizar a tarefa ou não.<br><br></p>'),
(400, 'pt_BR', 'areaSubarea', 'Neurociência, Neurociência Computacional'),
