(401, '', 'categoryIds', '[]'),
(401, 'pt_BR', 'abstract', '<p>O uso de coagulantes naturais no tratamento de águas e efluentes é uma alternativa considerada sustentável, com uso de fontes renováveis e que apresentam biodegradabilidade, gerando resíduos de mais fácil destinação final. A <em>Moringa oleifera</em> é uma destas alternativas, com sementes que apresentam propriedades coagulantes e adsorventes. Por se tratar de um produto orgânico, um dos aspectos desfavoráveis ao uso de tal produto é a sua baixa estabilidade durante o armazenamento e a possibilidade de residual de matéria orgânica na água tratada. Este trabalho tem como objetivo avaliar o desempenho do extrato de sementes de <em>Moringa oleifera</em> imobilizado em esferas de alginato de sódio no processo de clarificação de água, condição que podem aumentar a estabilidade do produto e reduzir o aporte de matéria orgânica para a água tratada. Utilizando esferas de alginato de sódio com extrato de <em>Moringa oleifer</em>a extraído em com água destilada e com solução salina, com e sem liofilização, serão realizados ensaios de coagulação (G = 200 s<sup>-1</sup> por 30 segundos), floculação (G = 20 s<sup>-1</sup> por 15 minutos) e decantação (30 e 60 minutos) para avaliação da redução de turbidez ao longo de 6 meses de armazenamento, com realização de ensaios nos dias 0, 1, 7, 14, 21, 30, 60, 90, 120, 150 e 180. O residual de matéria orgânica na água tratada, as dimensões dos flocos formados e o potencial zeta para a água coagulada também serão analisados. Para os coagulantes serão avaliadas a concentração de proteínas e as características morfológicas e de química elementar do material.</p>'),
(401, 'pt_BR', 'areaSubarea', 'saneamento básico; tratamento de água; tratamento de efluentes'),
