(402, '', 'categoryIds', '[]'),
(402, 'pt_BR', 'abstract', '<p><span style=\"font-weight: 400;\">O surgimento de plataformas digitais vem ocasionando a transformação na dinâmica das relações sociais e, neste mesmo sentido, das próprias relações de trabalho. O trabalho caracterizado pelo uso das Tecnologias de Informação e Comunicação (TICs) vem&nbsp; intensificando, cada vez mais, uma série de algoritmos que, em essência, rompem antigas formalidades e vínculos do trabalho, através de uma interface gráfica em tela, nas quais as relações de trabalho transformam-se em prestação de serviços. A partir desta nova forma de&nbsp; relação laboral, empresas que se identificam apenas como intermediadoras entre o prestador de serviço e o cliente final exploram a chamada Economia de Compartilhamento para que possam consolidar a sua empresa na sociedade através de falsas premissas de liberdade e autonomia do trabalho. </span><span style=\"font-weight: 400;\"><br></span> <span style=\"font-weight: 400;\">As empresas que apresentavam anteriormente uma forma física e concreta no mundo, agora se tornam apenas </span><em><span style=\"font-weight: 400;\">bytes</span></em><span style=\"font-weight: 400;\"> e sinais elétricos de um aparelho conectado ao mundo digital. O distanciamento do prestador de serviço se torna, de fato, cada vez maior com esta virtualização do mundo, onde não cabe a este senão a apenas a compreensão dos dados finais que lhe são oferecidos por complexas coletas de dados feitas por algoritmos ou a resposta automática de uma assistente virtual. A alienação do trabalho digital e a intangibilidade da empresa, portanto, marcam a nova onda de precarização do trabalho fornecida aos trabalhadores, somatizando-se ao processo de espoliação dos direitos trabalhistas, o qual tem se intensificado nos últimos anos, no Brasil e no mundo.</span></p>'),
(402, 'pt_BR', 'areaSubarea', 'Economia; Economia do Trabalho'),
