(403, 'pt_BR', 'abstract', '<p>As expressões faciais constituem uma grande faceta da comunicação não-verbal humana, e sua importância para a transmissão de informações incentivou pesquisas em reconhecimento de emoções, visando oferecer melhorias à qualidade de vida por meio do entendimento e processamento de dados relacionados à expressão humana. Nesse contexto, estudos recentes fazem amplo uso do Reconhecimento de Expressões Faciais (REF) para o levantamento de dados sobre a percepção humana de acordo com diferentes estímulos. Todavia, no contexto acadêmico, há pouca documentação acerca da aplicação do REF para o acompanhamento ao-vivo de expressões faciais, sobretudo de forma remota e centralizada. Assim, este projeto visa desenvolver e avaliar uma central para o acompanhamento remoto de expressões faciais e estados emotivos de pessoas em determinados espaços, tal como laboratórios, permitindo a análise de padrões de comportamento de grupos de indivíduos de forma centralizada e remota. Para isso, serão implementados modelos de REF em sistemas embarcados -- como Raspberry Pi -- para a detecção e transmissão de expressões faciais para um servidor WEB, compilando e hospedando os dados coletados em uma página WEB, a qual poderá ser acessada por meio de um navegador de internet, seja via um celular ou computador. Em paralelo, serão levantados dados a respeito da exequibilidade do processamento de imagens em sistemas embarcados, além de como diferentes formas de conexão e transmissão de dados impactam o sistema remoto. Desse modo, o desenvolvimento do sistema permitiria avaliar numericamente padrões de emoções de grupos de pessoas em dados ambientes, além de determinar limitações da execução de modelos de REF em sistemas embarcados.</p>'),
(403, 'pt_BR', 'areaSubarea', 'Engenharia de Informação'),
