(404, 'pt_BR', 'abstract', '<p>A apatridia é uma realidade vivida por mais de quatro milhões de pessoas no <br>mundo todo. Muitas vezes associada ao refúgio e às migrações forçadas, o problema <br>social possui causas que vão além dos referidos movimentos migratórios, bem como<br>impactos que vão além do imaginado. Por geralmente não possuírem nacionalidade e os <br>documentos de identidade necessários, os apátridas são vulneráveis à prisão ou <br>detenção, despejo forçado, expulsão e até mesmo tráfico humano (ACNUR, 2015). <br>A falta de um Estado que os reconheça como indivíduos pertencentes a uma <br>nacionalidade leva, consequentemente, a uma vida sem direitos. Apesar de serem <br>abraçados pelos Direitos Humanos em escala internacional, os apátridas enfrentam <br>problemas legais relacionados à falta de acesso à educação, à saúde, ao matrimônio e <br>vivem em constante medo de serem expulsos do país em que se encontram. <br>Dessa maneira, a nacionalidade que, para muitos, é concedida no nascimento, para <br>outros é negada e só é conquistada através da reivindicação e da luta, cenário em que se <br>encontram os apátridas. Nesse sentido, a nacionalidade é restrita às mãos do Estado, <br>sendo dada exclusivamente àqueles que este determinar. Portanto, este estudo tem por <br>objetivo estudar tanto os impactos da apatridia na vida das pessoas nesta condição na<br>atualidade, quanto ao entendimento do instituto nacionalidade como um direito humano.</p>'),
(404, 'pt_BR', 'areaSubarea', 'Relações Internacionais; Direitos Humanos'),
