(406, 'pt_BR', 'abstract', '<p>O presente projeto de iniciação científica tem por objetivo compreender a que nível o currículo do ensino básico para as escolas públicas do estado de São Paulo permite com que as juventudes de classes subalternas tenham espaço para expressar sua identidade cultural em sala de aula. Para tanto, a pesquisa irá adentrar o espaço cultural da Batalha da Matrix, em São Bernardo do Campo, e em escolas de educação básica da mesma cidade, buscando entender em que medida o currículo escolar trabalha próxima às realidades dos estudantes e permitem com que estes ocupem um lugar de protagonismo. Alicerçada à pesquisa-participante, bem como um apoio teórico acerca da temática apresentada, pretende-se, ao final da pesquisa, diagnosticar formas em que as práticas educativas da região funcionem como suporte nos processos de construção de identidades e projetos de vida dessas juventudes.</p>'),
