(407, 'pt_BR', 'abstract', '<p>A nanotecnologia ´e a ciˆencia que estuda materiais em escala nanom´etrica (10<sup>−9</sup>m) e tem tido grande aten¸c˜ao sobretudo ap´os o isolamento e caracteriza¸c˜ao de diversas nanoestruturas como grafeno, fulereno e nanotubos. Em particular o grafeno tem sido um grande alvo de estudos nas ´ultimas duas d´ecadas devido a suas incr´ıveis propriedades mecˆanicas, t´ermicas e eletrˆonicas. Devido a essa grande aten¸c˜ao, novas nanoestruturas tˆem sido propostas com base na adi¸c˜ao de elementos diferentes do carbono, por meio da funcionaliza¸c˜ao destas estruturas. A partir destes novos materiais e da funcionaliza¸c˜ao se torna poss´ıvel a obten¸c˜ao de nanoestruturas com novas propriedades ajustadas `as desejadas. Neste projeto estudaremos a capacidade de armazenamento de hidrogˆenio do TPDH-grafeno (Tetra-Penta-Deca-Hexagonal grafeno), decorado com metais e dopado com boro e nitrogˆenio, utilizando dinˆamica molecular atom´ıstica reativa e tamb´em a teoria do funcional da densidade (DFT).</p>'),
