(408, 'pt_BR', 'abstract', '<p>O presente projeto tem como objetivo destrinchar, compreender e relacionar perspectivas de um debate acerca da Lei nº 8.313 de 23 de dezembro de 1991, que instituiu o Programa Nacional De Apoio à Cultura (Pronac), a afamada Lei Rouanet, entre outras leis voltadas ao investimento em Cultura, como, por exemplo, a Lei Estadual de Incentivo à Cultura (LEIC), de Minas Gerais e outros exemplos que é possível encontrar. No âmbito desta pesquisa, pretende-se visualizar e explorar como as leis de investimento na cultura funcionam e até onde podem favorecer artistas e outros indivíduos envolvidos na realização de produções culturais, além de entender o seu funcionamento em si e o que ele pode vir a gerar para a sociedade como um todo. Ademais, com o auxílio do conceito de gastos tributários, será possível fazer uma abordagem ao investimento indireto que se pode ter na Cultura e às esferas de onde ele pode vir, sendo a principal, a corporativa. Dessa forma, em síntese, pretende-se discutir de forma ampla e exploratória, a forma como as leis de investimento cultural funcionam e investigar como são exercidas, levando em conta o fato de políticas culturais estarem ligadas de forma intrínseca à Educação, além de estarem atreladas às Políticas Públicas, previstas na Constituição Federal do Brasil desde 1988.</p>'),
