(409, 'pt_BR', 'abstract', '<p>&nbsp;&nbsp;A Esquizofrenia é um transtorno psiquiátrico com origem em fatores genéticos somados a fatores ambientais de estresse, como bullying ou assédio sexual, entre outros em fases cruciais do neurodesenvolvimento. Os sintomas se manifestam principalmente no fim da adolescência e início da vida adulta e são separados em três categorias principais: sintomas positivos, como delírio, alucinação e desordem de pensamento; sintomas negativos, como redução da expressão emocional e sociabilidade, anedonia; e sintomas cognitivos, como desordem de pensamento. Um dos modelos animais usados para a reprodução dos sintomas da esquizofrenia é o modelo MAM, que consiste na administração de uma injeção intraperitoneal no décimo sétimo dia de gestação e implica na interrupção temporária do neurodesenvolvimento fetal, como consequência, os filhotes na fase adulta apresentam hiperlocomoção, déficits em testes de interação social (IS) e em teste de PPI. Estudos recentes indicam uma associação entre vários aspectos da esquizofrenia com o sistema purinérgico. O presente estudo se propõe a investigação da ação dos antagonistas P2X, brilliant blue g (BBG) e suramina em modelos MAM de esquizofrenia e sua relação com a neuroinflamação causada por estresse oxidativo. Os principais objetivos deste projeto são: avaliar os efeitos agudo e crônico do BBG e da suramina nas respostas comportamentais de ratos do modelo MAM.</p>'),
