(410, 'pt_BR', 'abstract', '<p>A nanociência, desde sua idealização popularizada por Feynman em sua palestra denominada \"There’s Plenty of Room at the Bottom\" tem sido alvo de estudo da comunidade científica. Na palestra, o físico menciona que poderíamos manipular os materiais em nível atômico a ponto de podermos armazenar toda a informação da Enciclopédia Britânica na ponta de um alfinete. Tal linha de pensamento desencadeou o interesse na estrutura atômica dos materiais. Os resultados obtidos no seu desenvolvimento têm levado à criação e descoberta de materiais 0D(fulerenos, nanodiamantes, ou estruturas pequenas e quase pontuais), 1D (nanotubos, nanocones e outros), 2D (como o grafeno, ou qualquer estrutura de folha com espessura na escala de átomos) ou 3D (grafite, diamantes, entre outros). Entre os materiais mais estudados nesse campo de pesquisa, é possível destacar o nitreto de boro (NB) e o grafeno. Porém, um tópico não muito expandido nesse meio são os efeitos da adição de hidrogênio nessas nanoestruturas, e o efeito que essa hidrogenação tem em materiais híbridos. Este projeto propõe analisar os efeitos geométricos e eletrônicos da formação de ilhas de NB formadas em diferentes substratos durante a hidrogenação de folhas de grafeno.</p>'),
