(411, 'pt_BR', 'abstract', '<p>Com o mercado globalizado, a logística tornou- se uma vantagem competitiva de toda empresa que importa ou exporta produtos, porém os custos de transporte e outras despesas afetam significativamente o resultado dos negócios. A logística internacional é composta por muitos elos da cadeia de distribuição que impactam nos custos logísticos.</p>\r\n<p>Considerando esse cenário, o presente projeto tem como objetivo identificar os elos de uma cadeia logística internacional, mapear quais são os custos envolvidos no processo e analisar com um estudo de caso de um regime aduaneira especial de Drawback, que contempla os cenários tanto de importação e exportação, permitindo avaliar uma cadeia logística completa.</p>'),
