(412, 'pt_BR', 'abstract', '<p>A presente pesquisa tem o objetivo de compreender a trajetória dos principais movimentos sociais que atuam na luta pelo direito à moradia no Brasil e investigar a atuação da campanha Despejo Zero durante a pandemia de COVID-19 sob o recorte de gênero. Trata-se de um desdobramento e continuidade de um projeto de pesquisa de iniciação científica já em andamento, analisando disputas nos usos do território durante a pandemia. Propõe-se, aqui, aprofundar a pesquisa bibliográfica iniciada e realizar levantamento de dados sobre as vulnerabilidades e as estratégias de luta das mulheres no movimento de moradia durante a pandemia do Coronavírus.</p>'),
