(413, 'pt_BR', 'abstract', '<p>Sistemas de controle automático têm como objetivo modificar uma variável de um sistema de modo a controlar seu comportamento. Existem diversos tipos de controladores dependendo do comportamento desejado, e vários deles são abordados em disciplinas tradicionais nos cursos de engenharia. Com a disponibilidade de novos recursos computacionais, ambientes virtuais têm sido cada vez mais utilizados para o ensino das disciplinas na universidade, e o presente projeto se insere justamente neste contexto. Assim, o projeto tem como objetivo principal desenvolver experimentos virtuais no ambiente GAZEBO e ROS, para auxiliar no ensino da disciplina de Sistema de Controle.</p>'),
