(414, '', 'categoryIds', '[]'),
(414, 'pt_BR', 'abstract', '<p>A hipótese de neurodesenvolvimento deficiente na esquizofrenia tem levado à utilização de modelos animais baseados em intervenções na fase perinatal. Dentre eles, o MAM consiste na injeção do antimitótico acetato de metilazoximetanol (MAM) no décimo sétimo dia de gestação de ratas Wistar, cujos filhotes apresentam prejuízos comportamentais e neuroquímicos, na fase adulta, tais como, aumento da locomoção na arena, sensibilidade a psicoestimulantes, redução na interação social, déficit no teste pré-atencional de inibição pré-pulso (PPI) e redução de neurônios gabaérgicos que expressam parvalbumina. Várias destas evidências se assemelham a alterações observadas em pacientes com esquizofrenia. Estudos recentes apontam para um aumento de citocinas inflamatórias e redução do antioxidante endógeno glutationa (GSH) em pacientes esquizofrênicos, levantando a hipótese acerca do papel do estresse oxidativo e da inflamação na fisiopatologia deste transtorno. Nossos resultados recentes demonstraram que o tratamento agudo ou crônico com o precursor do GSH, N-Acetil-L-Cisteína (NAC), reverteu os déficits comportamentais do modelo MAM. Considerando a escassez de estudos comportamentais em fêmeas e as diferenças hormonais e neuroquímicas, o presente projeto tem como objetivo principal avaliar os efeitos comportamentais em fêmeas, do uso crônico de NAC em filhotes de ratas tratadas com MAM. Incialmente, as ratas receberão tratamento de MAM do 17º dia de gestação (ou salina, para os animais controle). Após o desmame, as fêmeas serão separadas dos machos e entre os dias 45-60 de vida receberão o primeiro dia de tratamento com NAC (ou salina), conforme a detecção da fase do ciclo estral (metade das fêmeas nas fases estro/proestro e a outra metade nas fases metaestro/ diestro). As ratas serão tratadas por 15 dias com NAC (tratamento crônico) ou salina e 24 após a última dose serão feitos os testes comportamentais de interação social, hiperlocomoção na arena e PPI. Durante todo o tratamento crônico será feito o lavado vaginal para verificar a fase do ciclo estral em que as ratas se encontram.</p>'),
