(415, '', 'categoryIds', '[]'),
(415, 'pt_BR', 'abstract', '<p>Em março de 2020, a população foi pega de surpresa com o início de uma pandemia que se espalhou rapidamente pelo mundo. A velocidade que o vírus se espalhava obrigou cientistas a seguirem este mesmo ritmo, por isso, em pouco tempo já tínhamos informações sobre o SARS-COV-2, como seu genoma e meios de transmissão. Entre as descobertas citadas, cientistas também comprovaram a presença deste vírus nas fezes de pacientes e, consequentemente, em amostras de esgoto. A partir de então, comprovada a relação entre a carga viral em amostras de esgoto e casos positivos de COVID-19, o monitoramento de esgoto se tornou uma ferramenta epidemiológica fundamental de alerta para o aumento do número de casos da doença, principalmente para casos assintomáticos que são mais difíceis de identificar. Essa ferramenta também mostrou-se essencial para países com capacidade limitada para testes clínicos, devido ao baixo custo de implementação e possibilidade de rápida intervenção e auxílio no planejamento de políticas de saúde pública. No entanto, muitas regiões possuem saneamento básico precário ou tratamento irregular de esgoto, ocorrendo, então, o despejo em águas superficiais. Os principais desafios para a implementação desta ferramenta são a falta de informações consolidadas e, também, de uma metodologia padronizada. Por estes motivos, esta pesquisa busca contribuir para o avanço de pesquisas futuras a respeito do monitoramento do SARS-COV-2 no ambiente, por meio da avaliação da concentração de amostras de águas dos mananciais, em regiões específicas da Unidade Hidrelétrica de Itaipu (UHI), onde será realizada e validada a técnica de concentração das amostras de água para detecção do coronavírus e, também, pelo agrupamento de informações em um quadro síntese para fácil consulta, a partir de artigos já publicados.&nbsp;&nbsp;&nbsp;&nbsp;</p>'),
