(416, '', 'categoryIds', '[]'),
(416, 'pt_BR', 'abstract', '<p>Este projeto tem por objetivo analisar os conceitos de <em>Kultur </em>e <em>civilisation </em>sob a perspectiva da formação do pensamento antimoderno na Alemanha nazista. A rejeição da arte moderna na Alemanha, principalmente do expressionismo, ganhou corpo através de campanhas públicas, tendo como principal marco a exposição de Arte Degenerada, realizada em 1937, em Munique, na Alemanha. Esta exposição uniu mais de 600 obras de arte modernas consideradas esteticamente aversivas e indesejadas pelo regime nazista. A manipulação da arte como instrumento de doutrinação ideológica foi extremamente presente no regime nazista. A arte moderna era propagandeada pelo regime como sinônimo da degeneração moral e corporal humana, já que, esteticamente, essas obras valorizavam os aspectos subjetivos da alma humana em detrimento da perfeição da forma, resultando em imagens distorcidas e impactantes. Já a arte com tendências românticas e classicistas refletia o ideal ariano, ao passo que, esteticamente, eram representados corpos viris, musculosos e atraentes, carregados de&nbsp; tom heroico. Em face disso, buscamos identificar uma possível relação justificativa dos valores identitários exclusivistas da autoimagem germânica, representada pelo conceito de <em>Kultur, </em>com a reação aversiva ao movimento artístico modernista durante o regime nazista.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>'),
(416, 'pt_BR', 'areaSubarea', 'Ciências Humanas, Filosofia, Estética e Filosofia da arte'),
