(417, 'pt_BR', 'abstract', '<p><span style=\"font-weight: 400;\">O presente projeto busca investigar a ocupação e reivindicação de territórios para prática de </span><em><span style=\"font-weight: 400;\">Slam Poetry</span></em><span style=\"font-weight: 400;\"> (campeonato de poesia falada) na Região Metropolitana de São Paulo, enxergando-a como uma ação de cidadania insurgente e de enraizamento da cultura popular periférica. Para isso, esta pesquisa pretende compreender o surgimento, a expansão e as transformações do </span><em><span style=\"font-weight: 400;\">hip-hop</span></em><span style=\"font-weight: 400;\"> enquanto movimento cultural neste território, investigando sua trajetória e ligação com os saraus periféricos, as batalhas de rima e mais recentemente o </span><em><span style=\"font-weight: 400;\">Slam Poetry</span></em><span style=\"font-weight: 400;\">.&nbsp; O projeto&nbsp; intenciona&nbsp; analisar a expansão dessas práticas culturais a partir das teorias sobre cidadania territorial e cidadania insurgente, bem como inventariar e cartografar os locais utilizados para essas atividades e as ações de ressignificação e reivindicação de espaços na Região Metropolitana de São Paulo.</span></p>'),
