(418, 'pt_BR', 'abstract', '<p>Sonho lúcido (SL) é um fenômeno de descrição consideravelmente nova na literatura científica. Nesta, tem uma de suas definições como o entendimento de que se está sonhando enquanto sonha. Contém características metacognitivas a exemplo do insight, autorreflexão e autoconsciência. Tais características também podem ser observadas em diferentes práticas de meditação. A partir de critérios como o uso de uma técnica definida, relaxamento lógico e estado autoinduzido, ou ainda uma prática contemplativa que visa alcançar um estado subjetivo único, ou a busca pela experiencia da natureza da consciência, pode-se encontrar conjuntos distintos de práticas. Além disso, diferentes tipos de meditação levam a emoções, estados psicológicos e cognitivos distintos, como também seus diferentes substratos neurais. Os dois fenômenos citados, além de características fenomenológicas, podem interagir com o uso da meditação como técnica de indução de sonho lúcido ou facilitando-o. Dessa maneira, relacionar vários tipos de meditação e SLs é interessante para que se possa observar possíveis convergências. Portanto, e considerando a importância do estudo dos dois fenômenos e a correlação que possivelmente possuem, os diferentes tipos de meditação devem ser estudados para ver quais traços fenomenológicos e, possivelmente fisiológicos estão correlacionados às diferentes práticas de meditação e como essas características podem se relacionar com o ato de se tornar lúcido nos sonhos<strong>.</strong> Neste trabalho, &nbsp;serão aplicados questionários relacionados a SLs e meditação bem como sobre características cognitivas e metacognitivas, de forma a observar de que maneira esses estados podem estar relacionados.</p>'),
