(419, 'pt_BR', 'abstract', '<p>Este trabalho visa discorrer sobre posições filosóficas da autora Conceição Evaristo no livro <em>Insubmissas lágrimas das mulheres</em> que se revela um retrato de solidariedade e afeição feminina, por tocar no que é essencial, no que move, no que aproxima e une mulheres e, em especial, mulheres negras. A contextualização destas qualidades torna atual as histórias e necessidades do meio social em relação à mulher. Será empreendida uma análise literária pontuando a interseccionalidade em seus textos. A princípio, demonstrando como o texto se relaciona com a vivência particular da mulher negra, suas particularidades gerais a fim de mostrar a atualidade da escrita literária e sua importância.</p>'),
