(420, 'pt_BR', 'abstract', '<p>A prematuridade extrema é caracterizada por nascimentos anteriores as 28 semanas de gestação e, quando sobrevivem, os neonatos são expostos a diversos cuidados em UTI neonatal que os expõem a agentes infecciosos. Devido a imaturidade do sistema imunológico e respiratório nesta idade, os prematuros extremos são uma população com alta incidência de infecções e asfixia neonatais que podem comprometer o neurodesenvolvimento do indivíduo. Quando conjugadas, estas intercorrências perinatais podem potencializar as lesões cerebrais e exacerbar os prejuízos motores, cognitivos e comportamentais causados pela asfixia neonatal de forma isolada. Entre as lesões agravadas, o comprometimento da maturação das células da linhagem dos oligodendrócitos e consequente prejuízos na mielinização estão entre os principais eventos do neurodesenvolvimento perturbados em indivíduos prematuros. Entretanto, as alterações moleculares que as propiciam são complexas e necessitam de maiores elucidações a fim de possibilitar futuras propostas terapêuticas. Com os recentes avanços metodológicos e moleculares, o desenvolvimento e refinamento da análise transcriptômica, RNAseq, demonstra ser uma ferramenta interessante para auxiliar na compreensão das alterações moleculares ocasionadas pela inflamação e asfixia neonatal aos oligodendrócitos. Entretanto, por se tratar de uma técnica laboriosa, as etapas iniciais que garantirão a qualidade da amostra em que o RNAseq será realizado devem ser bem estabelecidas. Logo, propusemos neste projeto a definição da metodologia de extração e purificação de RNA, molécula de instável e de difícil manipulação, inicialmente utilizando técnica convencional e econômica com fenol/clorofórmio. Após eficiente manipulação da molécula de RNA, a extração e purificação utilizando kit comercial dedicado as análises d RNAseq. Ambos os processamentos serão seguidos de etapas de controle de qualidade do procedimento. Deste modo, este projeto certamente corroborará com o desenvolvimento do aluno na manipulação de RNA e preparo das amostras de ratos submetidos a inflamação e asfixia neonatal que serão encaminhadas ao Centro de Estudos do Genoma Humano e Células-Tronco da Universidade de São Paulo para serem sequenciados e catalogados.</p>'),
