(421, 'pt_BR', 'abstract', '<p>Neste projeto, propomos um estudo introdutório de equações diferencias e sistemas dinâmicos com ênfase na Epidemiologia Matemática, tendo como foco o estudo de modelos epidemiológicos compartimentais clássicos e visando o entendimento da dinâmica de doenças infecciosas. Estudaremos conceitos relacionados a sistemas dinâmicos, modelos epidêmicos, como o SIS, SIR e etc., assim como, também buscaremos compreender o funcionamento dessas enfermidades, com o auxílio de ferramentas matemáticas. Tal estudo é de extrema importância, visto que através dessa compreensão é possível prever, planejar e saber quais serão as medidas que devem ser tomadas para o controle do aumento do número de casos e mortes pela doença, assim como, para sua prevenção.</p>'),
