(422, 'pt_BR', 'abstract', '<p><span style=\"font-weight: 400;\">O uso crescente do EMG de alta densidade possibilitou o uso desse tipo de sinal para diferentes fins. No entanto, muitas vezes é necessário que se utilize sinais simulados de EMG de alta densidade, para testar os métodos desenvolvidos. No momento, não existe um simulador de EMG de alta densidade disponível de forma livre. Esse trabalho tem por objetivo implementar um simulador de EMG de alta densidade. Por fim, os códigos computacionais e resultados serão disponibilizados ao público na plataforma Github.</span></p>'),
