(423, 'pt_BR', 'abstract', '<p class=\"p1\">A anóxia neonatal, que corresponde à falta de oxigênio ao nascimento, tem como principal&nbsp;sequela a lesão encefálica hipóxico-isquêmica, afeta de 0,1 a 0,3% das crianças nascidas a&nbsp;termo e aproximadamente 60% das crianças prematuras com baixo peso ao nascimento. Cerca&nbsp;de 20 a 50% dos neonatos que sofrem anóxia neonatal não sobrevivem e, daqueles que&nbsp;sobrevivem, 25% apresentam alguma sequela neurológica permanente como paralisia cerebral,&nbsp;déficits cognitivos, auditivos e visuais. A neuroinflamação, caracterizada pela resposta&nbsp;especializada exacerbada das células gliais, em especial da microglia, é considerada o principal&nbsp;fator que contribui para as lesões encefálicas após a anóxia. Não há tratamentos eficazes&nbsp;conhecidos que visam minimizar as sequelas provocadas pela anóxia neonatal. Neste sentido, a&nbsp;terapia de fotobiomodulação, por seu conhecido papel na modulação de processos&nbsp;inflamatórios, é excelente candidata a recurso terapêutico ou preventivo na lesão causada pela&nbsp;anóxia neonatal. O presente projeto visa, portanto, analisar os efeitos da terapia de&nbsp;fotobiomodulação em microglia submetidas à hipóxia. Desta forma, será possível aprofundar&nbsp;os conhecimentos acerca dos efeitos da terapia de fotobiomodulação na resposta inflamatória&nbsp;ocasionada pela anóxia neonatal.</p>'),
