(424, 'pt_BR', 'abstract', '<p>O desenvolvimento da óptica adaptativa (AO, na sigla em inglês) é impulsionado pela necessidade de uma maior eficiência na captação da luz do objeto científico em telescópios de astronomia, produzindo uma maior intensidade de luz sendo entregue num número menor de pixels dentro dos instrumentos detectores, minimizando assim os efeitos do ruído de fundo do céu e das distorções atmosféricas nas imagens dos objetos celestes. Todos os telescópios extremamente grandes (ELTs, na sigla em inglês) são limitados por estas distorções introduzidas pela atmosfera da Terra. Tais distorções são parcialmente compensadas pelo uso de AO, que consistem em sistemas optomecânicos que podem medir a frente de onda da luz incidente de objetos celestes e rapidamente aplicar uma correção óptica apropriada usando um elemento óptico ativo, tipicamente um espelho deformável.</p>\r\n<p>Neste projeto de iniciação científica (IC), propomos atividades experimentais no Laboratório de Óptica Adaptativa da UFABC, onde o estudante tomará contato com os instrumentos utilizados na aplicação da AO, tais como: um espelho deformável, um sensor de frente de onda, um modulador de luz espacial, etc.</p>'),
