(425, 'pt_BR', 'abstract', '<p>O Transtorno do Espectro do Autismo (TEA) é um transtorno do neurodesenvolvimento que apresenta diversos graus de gravidade. A incidência é estimada entre 0,3% e 1,8% de nascidos vivos, sendo cinco vezes mais comum entre meninos. O ambiente materno, particularmente a inflamação têm um papel importante na incidência de TEA. A privação de oxigênio ao nascimento, conhecida como anoxia neonatal é uma das principais causas de mortalidade e morbidade em crianças. Tanto a anoxia como a ativação imune materna (AIM) levam ao aumento da inflamação no sistema nervoso central se assemelhando ao que foi identificado em indivíduos com TEA. Devido a isso, a eficácia de possíveis agentes neuroprotetores tem sido testada. A progesterona (PROG) tem um forte potencial para o tratamento já que a sua utilização tem se mostrado benéfica em pesquisas relacionadas a privação de oxigênio na fase neonatal. Portanto, esse projeto tem como objetivo avaliar a ação neuroprotetores da PROG no modelo de inflamação perinatal por AIM combinada à anoxia neonatal. Será verificado se o tratamento será capaz de reduzir o grau de dano encefálico e os déficits sensório-motores.</p>'),
