(427, 'pt_BR', 'abstract', '<p><span class=\"fontstyle0\">Herbários são coleções biológicas que funcionam como ferramenta para o estudo da biodiversidade de espécies vegetais a partir da montagem, preservação e organização de exsicatas. Apesar da importância das algas para as cadeias tróficas, estudo dos ecossistemas e vida na Terra, este grupo é menos frequente em coleções vegetais, que são compostas principalmente por organismos da flora terrestre, tais como as angiospermas. O Herbário Sinningia da Universidade Federal do ABC é o mais jovem dos herbários paulistas, possuindo aproximadamente 2.500 amostras, mas ainda sem representantes de algas em seu acervo.<br>Desta forma, o referido projeto pretende iniciar a coleção de macroalgas do HUFABC através da coleta e identificação morfológica das espécies coletadas no litoral do estado de São Paulo, nos municípios de Ubatuba e São Sebastião. Espera-se contribuir para o conhecimento acerca da biodiversidade do grupo na costa paulista e auxiliar na consolidação do herbário Sinningia como uma importante ferramenta para estudos ficológicos, possibilitando o uso do espaço para atividades de ensino, pesquisa e extensão relacionadas às algas.</span></p>'),
(427, 'pt_BR', 'areaSubarea', 'Ciências Biológicas; Botânica'),
