(429, 'pt_BR', 'abstract', '<p><span style=\"font-weight: 400;\">Esse projeto tem como objetivo discutir obras e leituras de duas autoras negras, sendo elas Lélia Gonzalez e Sueli Carneiro. A partir delas compreenderemos as relações raciais e sociais no Brasil com o objetivo de verificar como tais autoras colaboram para pensar um feminismo negro como ferramenta de anti-opressão para o país. Como metodologia, o trabalho passa por duas etapas. A primeira é ler e interpretar obras sobre as duas autoras e sobre mulheres negras. A segunda parte conta com oficinas de leitura, escrita e trocas sobre o feminismo, feminismo negro e realidade brasileira a partir dos escritos dessas autoras, com jovens de 14 a 18 anos. Espera-se que ao final dessa pesquisa possa-se observar as contribuições dessas autoras negras brasileiras para pensar os problemas raciais do Brasil.</span></p>\r\n<p>&nbsp;</p>'),
