(430, 'pt_BR', 'abstract', '<p class=\"western\" align=\"JUSTIFY\"><span style=\"font-family: Arial, sans-serif;\"><span style=\"font-size: small;\">As cinzas provenientes da queima de biomassa residual são potenciais contaminantes ambientais, além de possíveis causadoras de doenças respiratórias. A fim de aproveitar suas vantagens econômicas e reduzir seu dano à natureza, esses resíduos podem ser reutilizados em diferentes aplicações, a depender de suas características. A composição das cinzas de bagaço de cana de açúcar (CBCA) possibilita sua aplicação como aditivo pozolânico, um componente necessário para produção de materiais cimentícios. A alta concentração de SiO</span></span><sub><span style=\"font-family: Arial, sans-serif;\"><span style=\"font-size: small;\">2</span></span></sub><span style=\"font-family: Arial, sans-serif;\"><span style=\"font-size: small;\">, em algumas espécimes de cinzas, viabiliza sua utilização como substitutas do quartzo em massas cerâmicas ou como fonte de sílica na manufatura de vidros. No entanto, a caracterização das cinzas se faz necessária, visto que há considerável variedade de composições. Além da temperatura e tempo de queima, outros fatores relacionados à procedência das biomassas influenciam as propriedades e características finais da cinza. As substâncias presentes nos resíduos serão identificadas através da técnica de difratometria de raios X (DRX), e suas quantidades relativas determinadas por fluorescência de raios X (FRX). A microscopia eletrônica de varredura (MEV) possibilitará o estudo de características morfológicas das cinzas. Para determinar se houve combustão completa ou incompleta, poderá ser empregue a espectroscopia no infravermelho por transformada de Fourier (FTIR) e as análises térmicas. Com as etapas de análise das cinzas de biomassas e a revisão bibliográfica, espera-se classificar as cinzas em função do seu potencial de aplicação na indústria.</span></span></p>'),
(430, 'pt_BR', 'areaSubarea', 'engenharia de materiais e metalúrgica; engenharia química; tecnologia química; extração e transformação de materiais; cerâmicos'),
