(432, 'pt_BR', 'abstract', '<p>Os herbários e bancos de DNA, possuem uma enorme importância científica, histórica e cultural, por meio destas ferramentas diversos estudos podem ser beneficiados. No mais, estas coleções além de possuírem também grande significado no tocante aos<br>estudos taxonômicos e evolutivos de espécies vegetais, apresentam conjuntamente um meio muito propício para o desenvolvimento biotecnológico relacionado a este táxon. Nosso país possui uma das maiores biodiversidades do mundo, onde estima-se que 19% das espécies vegetais existentes encontram-se aqui. Contudo, no Brasil, os herbários existentes enfrentam muitas dificuldades estruturais e muitos não dispõem de coleções de algas, haja vista que há uma grande diferenciação entre o número estimado de algas existentes e o número de espécies catalogadas. Os bancos de DNA também caminham em seus primeiros passos no país e, tampouco, apresentam coleções de DNAs abrangentes de algas. Considerando este contexto e a necessidade de ações que mudem este cenário para benefício da ciência no país, este projeto visa propor a criação de um Banco de DNA de macroalgas, vinculado ao Herbário Sinningia da Universidade Federal do ABC (HUFABC). O banco de DNA servirá como ponto de partida para estudos em genética da conservação, genômica comparativa, filogenia, evolução ou bioprospecção para uso biotecnológico.</p>'),
