(433, 'pt_BR', 'abstract', '<p>Como consequência do pensamento patriarcal, as esferas sociais, em termos gerais, aceitaram por um longo período histórico a noção de que a mulher deveria limitar-se a determinadas tarefas e funções tidas como femininas, e por muito tempo não houve relevantes mudanças sociais. Na arte não foi diferente. Como prova disso podemos pensar facilmente em grandes artistas homens como Michelangelo, Di Cavalcanti ou Van Gogh. Já quando se trata de grandes artistas mulheres os nomes não aparecem com tanta facilidade. A questão das mulheres na arte é complexa e revela discussões profundas sobre o assunto quando tratadas de modo sério. Nesse sentido, partindo da pergunta “por que não houve grandes artistas mulheres?”, Linda Nochlin procura criticar e problematizar as razões que definiram a história da arte, e fizeram com que mulheres não se destacassem como grandes artistas, o que ela faz problematizando primeiramente a própria questão e a própria noção de grande arte ou de gênio artístico. O esforço para entender a problemática envolvida nessa questão não é simples, já que envolve discussões fundamentadas em estruturas sociais construídas de modo desigual. No caso do presente projeto, o que se pretende é a construção de uma pesquisa que aborde as duas pontas da presença (ou ausência) das mulheres na arte, a da representatividade e a da representação feminina. &nbsp;</p>'),
