(434, 'pt_BR', 'abstract', '<p><span style=\"font-weight: 400;\">A pandemia da COVID-19 gerou um grande impacto na política local e na vida das pessoas. Estudos sobre crise e resiliência deixaram de lado o município e estudaram&nbsp; em grande medida, os grandes concentradores de orçamento, estados e federações. A educação e saúde foram impactadas e sofreram medidas restritivas como forma de contenção da doença. Este projeto busca coletar e consolidar dados que contenham as estruturas pré-COVID-19 de saúde e educação, além das medidas restritivas impostas pelos executivos municipais. A pesquisa gerará um banco de dados público e consolidado, junto de relatório descritivo e de comparações simples entre estrutura prévia e duração de medidas restritivas da área.</span></p>\r\n<p><br style=\"font-weight: 400;\"><br style=\"font-weight: 400;\"></p>'),
