(435, 'pt_BR', 'abstract', '<p><span class=\"fontstyle0\">Apesar da enorme biodiversidade existente no litoral brasileiro, esta é uma das regiões menos estudadas no mundo, onde muitas espécies ainda continuam sendo pouco conhecidas. </span><span class=\"fontstyle2\"><em>Hypnea brasiliensis</em> </span><span class=\"fontstyle0\">é um exemplo disso. Este táxon foi erroneamente identificado no litoral brasileiro por décadas e só recentemente teve seu </span><span class=\"fontstyle2\">status </span><span class=\"fontstyle0\">taxonômico elucidado, tendo sido descrito em 2016 como endêmico e amplamente distribuído ao longo de toda a costa brasileira. Estudos recentes avaliaram a taxonomia e<br>filogenia de </span><em><span class=\"fontstyle2\">H. brasiliensis</span></em><span class=\"fontstyle0\">; no entanto, os padrões de estrutura populacional, fluxo gênico, diversidade genética e história demográfica desta espécie ainda permanecem desconhecidos e carecem de investigação. Desta forma, este projeto propõe o estudo filogeográfico de populações de </span><em><span class=\"fontstyle2\">H. brasiliensis </span></em><span class=\"fontstyle0\">coletadas ao longo do litoral brasileiro, através de análises de dois marcadores moleculares: o mitocondrial COI-5P e o plastidial </span><em><span class=\"fontstyle2\">rbc</span></em><span class=\"fontstyle0\">L. Com o desenvolvimento do projeto espera-se elucidar a história evolutiva desta espécie, os processos que levaram à sua diversificação e distribuição atual no Brasil, além de averiguar a presença de estrutura genética populacional e possíveis barreiras ao fluxo gênico.</span></p>'),
