(436, 'pt_BR', 'abstract', '<p>O presente projeto de pesquisa busca estudar a vulnerabilidade das redes de transporte público na Região Metropolitana de São Paulo (RMSP) frente as mudanças climáticas, tema ainda menos abordado do que o dos efeitos dos transportes urbanos no grave quadro de emergência climática. Incidentes climáticos extremos cada vez mais recorrentes atrelados a insuficientes e precários sistemas e estruturas incitam em perturbações na operação dos sistemas de transportes e não raras vezes inundações e alagamentos afetam drasticamente os sistemas viários – ruas e trilhos, infraestruturas e equipamentos de transportes, interrompendo trajetos, isolando passageiros, imobilizando frotas, alagando terminais e estações. Assim, tais eventos climáticos extremos afetam diretamente a mobilidade urbana, agindo como fatores de pressão nas infraestruturas e sistemas de transporte e consequentemente afetando o cotidiano da população. Analisar a vulnerabilidade das redes de infraestruturas já marcadas por vulnerabilidades (Canil, 2021), e sistemas de transporte, ou o risco de serem afetados, abrange diversos aspectos, incluindo a susceptibilidade ao dano ou fragilidade dos sistemas e a dificuldade de adaptação frente aos eventos impactantes, o que terá como resultado o agravamento do padrão de mobilidade da população, como também a piora das condições ambientas em geral. Enquanto o risco é uma potencialidade - conjunção de dinâmicas positivas ou negativas, a vulnerabilidade é tangível e pode ser mensurada (Demoraes, 2016). &nbsp;Este autor identificou seis aspectos principais para avaliar a vulnerabilidade de redes de transporte público - vulnerabilidade intrínseca, dependência, exposição a perigos, alternativas capacidade de controle e preparação para crises – e a cada um deles associou diferentes indicadores que permitem caracterizar o grau de fragilidade dessas redes. Além de uma revisão bibliográfica sobre as implicações das mudanças climáticas nos sistemas de transportes e mobilidade urbana, pretende-se nesta pesquisa, estudar a metodologia desenvolvida por Demoraes e, considerando o contexto da metrópole de São Paulo, avaliar se é adequada a sua aplicação, desenvolvendo e sistematizando indicadores que caracterizem os aspectos principais da vulnerabilidade das redes de transporte público da metrópole paulista. Para tanto, vai se recorrer às bases de dados disponibilizadas pela Agência de Transporte do Estado de São Paulo (ARTESP), Empresa Metropolitana de Transporte Urbano (EMTU), Companhia Paulista de Trens Metropolitanos (CPTM), Companhia do Metropolitano de São Paulo (Metrô) que atuam na RMSP; e de sistematização de informações geográficas e cartográficas.</p>'),
