(437, 'pt_BR', 'abstract', '<p><em>Nanopartículas magnéticas (NPMs) suscitam um grande interesse para pesquisas científicas e tecnológicas para várias aplicações em diferentes áreas como biotecnologia, nanomedicina, nanotecnologia etc. A ferrita de manganês </em><em>apresenta </em><em>maior biocompatibilidade em comparação à hematita, ferrita de cobalto, magnetita e ferrita de níquel. Portanto, representa um dos candidatos mais eficiente para várias aplicações biomédicas como entrega de medicamentos, ressonância magnética (RM) e hipertermia magnética. A presente proposta de trabalho tem como objetivo a síntese e caracterização de nanopartículas de ferrita de manganês visando aplicação em hipertermia magnética. As NPMs são sintetizadas pelo método de co-precipitação e caracterizadas por análise morfológica e pela determinação das propriedades magnéticas por microscopia de força magnética e por magnetômetro de amostra vibrante (VSM). Os dados serão analisados em função das condições de síntese utilizadas. &nbsp;</em></p>'),
