(439, 'pt_BR', 'abstract', '<p>O presente projeto buscará trazer uma discussão sobre os modelos de estado de bem-estar social de Brasil e Argentina. Dentro de uma perspectiva comparada, será analisada as diferenças que esses dois países tiveram com políticas sociais, durante todo o período republicano até os dias atuais, até pela semelhança de conjuntura política que possuem em suas histórias. Perpassando por seus governos democráticos e autoritários, na busca de compreender o caráter político dessas ações, o cerne ideológico e o impacto na estrutura de <em>welfare state</em>. Além disso, há uma busca de decifrar a teoria de regimes democráticos reduzir as desigualdades, se ela terá encaixe na realidade dessas nações latinas. Portanto, essa pesquisa procura aprofundar as discussões sobre Estado de bem-estar, democracia e desigualdade, através de uma análise comparada com os dois principais países da América do Sul</p>'),
