(440, 'pt_BR', 'abstract', '<p>Em que pese o avanço dos loteamentos fechados, a lógica condominial, este processo tem extrapolado os limites geográficos das grandes metrópoles antes tidas como espaço das elites. Hoje, essa nova (e velha, ao mesmo tempo) forma-conteúdo tem se reproduzido em larga escala em cidades onde a terra é mais barata, em áreas rurais interioranas e periurbanas e em meio às amenidades naturais. Os condomínios são a representação máxima da separação,&nbsp; segregação e fragmentação do território e dos sujeitos que nele vivem. Bauru, cidade média no interior do Estado de São Paulo, tem intensificado seus condomínios em lotes cada vez mais longínquos do tecido urbano da cidade, apartados e totalmente intransponíveis aos olhos, em razão dos grandes muros que os cercam. Diante disso, esse projeto propõe uma pesquisa em torno da trajetória do território que explique essa massificação, que aponte as desigualdades socioespaciais reproduzidas por essa lógica e que contribua com o entendimento dos processos por detrás dela.&nbsp;</p>'),
