(441, 'pt_BR', 'abstract', '<p>Dentre as tecnologias de filtração e separação disponíveis, as membranas são filtros avançados que apresentam desempenho superior aos filtros convencionais, devido principalmente ao tamanho da área superficial e dos poros. Desta forma, neste trabalho serão diferentes condições experimentais utilizadas no processo de eletrofiação para a obtenção de membranas de poli(éter sulfona). Para a eletrofiação serão analisados diversos parâmetros, como o uso de diferentes solventes, a N,N-dimetilformamida (DMF) e o dimetilsufóxido (DMSO). Serão avaliadas diferentes condições do processo de eletrofiação, como o potencial elétrico aplicado (kV), a vazão (mL/h) e a distância de trabalho (cm). Será avaliado também o uso de diferentes frações mássicas de óxido de grafeno (OG), variando até 0,5 % em massa. Ao final as membranas preparadas utilizando-se diferentes condições experimentais serão comparadas. Serão avaliadas as características morfológicas, incluindo medidas de ângulo de contato, porosidade aparente e ensaios de tração (propriedades mecânicas).</p>'),
