(442, 'pt_BR', 'abstract', '<p>Embora grande parte da população do mundo nunca tenha voado, ainda assim sofre os efeitos da poluição causada pelas aeronaves, principalmente aqueles derivados do uso de combustíveis fósseis. Com o aumento previsto do uso do transporte aéreo, alternativas com vistas a mudar esta realidade vêm sendo estudadas: aviões a energia solar, a hidrogênio e inclusive nitrogênio.</p>\r\n<p>Nesta pesquisa se busca aprender os fundamentos da propulsão a hidrogênio, que é o elemento mais abundante na natureza e com maior capacidade energética, cerca de três vezes a do querosene usado normalmente na aviação. Ocorre que há vários obstáculos a superar antes de poder-se usar esse combustível, já que tanques, formas de processamento e distribuição do mesmo precisam ser desenvolvidas. Provavelmente acompanhadas de profundas modificações de desenho aerodinâmico e de máquinas antes de efetivamente se chegar às aeronaves requeridas. Assim neste momento conceitos experimentais lado a lado com modificações de aeronaves a querosene estão sendo testados. No trabalho se buscará modificar uma aeronave a querosene para propulsão a hidrogênio, e entender efeitos e alterações necessários. A aeronave objeto será desenhada em computador, a partir de desenhos de domínio público. Terá combustível, tanques, sistema de transmissão e propulsão adequados ao uso de hidrogênio instalados. Então será modelada para que se possa verificar sua adequabilidade ao uso nas novas condições.</p>'),
