(443, 'pt_BR', 'abstract', '<p><span style=\"font-weight: 400;\">Um dos aspectos que vem ganhando proeminência dentro da literatura científica é a interconexão entre cérebros durante tarefas realizadas em conjunto. Para entender mais a fundo como a sincronia entre cérebros funciona num contexto social, o presente trabalho irá realizar, por meio de uma técnica de neuroimagem chamada espectroscopia funcional por infravermelho próximo (fNIRS), uma análise da atividade cerebral de músicos tocando duetos de piano. A </span><em><span style=\"font-weight: 400;\">performance</span></em><span style=\"font-weight: 400;\"> musical é um método interessante para avaliar os correlatos neurais de tarefas conjuntas por se tratar de um modelo com intervalos temporais bem definidos, o que irá facilitar o desenvolvimento do experimento e o entendimento dos resultados. O objetivo é explorar se as correlações das atividades cerebrais durante a </span><em><span style=\"font-weight: 400;\">performance</span></em><span style=\"font-weight: 400;\"> musical advém de uma exposição conjunta de estímulos sensoriais e motores idênticos ou se o cérebro se adapta ao contexto social de modo codependente. Durante o experimento, a atividade cerebral de 20 pares de pianistas será registrada de forma simultânea enquanto serão executados trechos musicais em duo. Serão realizadas algumas manipulações nos estímulos temporais para provocar mudanças no grau de cooperatividade durante a </span><em><span style=\"font-weight: 400;\">performance</span></em><span style=\"font-weight: 400;\">, buscando identificar possíveis diferenças nos padrões da atividade de regiões associadas aos sistemas de neurônios-espelho e mentalização de acordo com mudanças referentes à adaptação temporal e cooperação. O projeto busca abrir caminhos para futuras pesquisas acerca das bases neuronais de processos cognitivos essenciais durante interações sociais, visto que ainda não há muitos estudos nessa área.</span></p>'),
