(444, 'pt_BR', 'abstract', '<p><span style=\"font-weight: 400;\">Em 2008, o Ministério da Saúde, através do Sistema Único de Saúde (SUS) implementou a política pública de saúde integral para transexuais, através da regulamentação do processo transexualizador para mulheres trans, e em 2013 para travestis e homens trans. As experiências vivenciadas por usuárias e usuários do Sistema Único de Saúde em relação ao processo transexualizador são plurais. No entanto, carregam consigo variáveis em comum, como o racismo e a transfobia institucionais. Através dos aportes teóricos de gênero e raça trazidos por autorias como Michel Foucault, Joan Scott, Achille Mbembe, Maria Lugones, Berenice Bento, Lélia Gonzalez, etc, este trabalho visa compreender de forma comparada a dinâmica entre raça e gênero que tangencia as experiências cotidianas nas Unidades Básicas de Saúde (UBS) da capital paulista. Para isso, foram escolhidas como estudos de caso a UBS Dr. José de Barros Magaldi que está situada no bairro Itaim Bibi, zona oeste de São Paulo, e a UBS Vila Nova Curuçá, extremo leste da capital paulista. Para a viabilidade deste estudo, a metodologia considerará pesquisa bibliográfica, documental e levantamento empírico através de observação direta e realização de entrevistas semi-estruturadas. O desenvolvimento e os resultados desta pesquisa serão compartilhados com o Núcleo de Estudos de Gênero Esperança Garcia.</span></p>'),
