(445, 'pt_BR', 'abstract', '<p><span class=\"fontstyle0\">Este projeto faz parte do programa de Iniciação Científica, promovido pela<br>Universidade Federal do ABC, onde, de maneira interdisciplinar, o estudante irá<br>desenvolver-se na área de pesquisa científico acadêmica. Neste projeto, aqui apresentado,<br>o aluno ampliará seus conceitos no campo do Planejamento Territorial e das Políticas<br>Públicas realizando um estudo sobre os conflitos pelo uso do espaço público,<br>nomeadamente a Praça Princesa Isabel, na cidade de São Paulo</span> </p>'),
