(446, 'pt_BR', 'abstract', '<p>Diante de um cenário de intensificação da competição interespacial, e dos fenômenos de reterritorilização e reescalonamento, os conceitos de <em>Soft space</em> e Soft planning vêm se destacando como abordagens chaves do sistema de planejamento emergente internacional. Tais conceitos vêm sendo utilizados para descrever a emergência de novos espaços de planejamento à margem dos sistemas estatutários. Apesar de sua origem estar relacionada ao campo do planejamento do Reino Unido, os espaços de planejamento ‘<em>soft’</em> parecem ser um fenômeno internacional ao serem vistos como parte de uma mudança mais ampla relacionada à reformulação do papel do Estado e à ascensão dos paradigmas do planejamento territorial estratégico e da governança. No entanto, tais conceitos ainda não são utilizados no campo teórico e prático do planejamento brasileiro. Desse modo, a partir de uma revisão sistemática de literatura com base na Systematic Search Flow (SSF), a presente pesquisa pretende compreender os fundamentos teóricos do conceito e seu estado da arte, e sua relação com as mudanças mais recentes do campo do planejamento e da governança. Espera-se que a sistematização da literatura sobre<em> soft spac</em>es e <em>soft planning </em>permita expandir esse debate para a realidade latino-americana, mais especificamente à realidade do planejamento na Macrometrópole paulista.</p>'),
