(448, 'pt_BR', 'abstract', '<p>Apresenta-se aqui o processo de projeto, construção e desenvolvimento de um protótipo de uma cauda artificial que quando vestida se torna uma extensão da coluna. Devido ao seu uso inicial ser destinado a pesquisas sensoriais e corpóreas, busca-se simular a sensação de ter um membro externo que segue estendendo a coluna para além do cóccix. Utilizando a natureza como inspiração e biologia comparada, serão estudadas algumas propostas de modelo físico em tamanho reduzido. Em seguida, um deles será escolhido para construção de um acessório cênico em escala real que será testado por atores e dançarinos.</p>'),
