(449, 'pt_BR', 'abstract', '<p><span style=\"font-weight: 400;\">Perceber o tempo é uma das habilidades mais importantes para animais humanos e não humanos, sendo essencial para a execução de suas tarefas cotidianas. Apesar disso, os mecanismos responsáveis por esse processamento ainda não são conhecidos. Um efeito notável na literatura é o de </span><em><span style=\"font-weight: 400;\">assimilação</span></em><span style=\"font-weight: 400;\">, que ocorre quando um intervalo aparenta ser mais curto do que realmente é, quando precedido por algum intervalo prévio mais curto. Em um estudo realizado anteriormente, utilizando apenas estímulos auditivos e visuais, constatamos que mudar a modalidade sensorial entre distrator e alvo elimina, em média, a influência que um tem sobre o outro. A partir dessa observação, podemos testar a generalizabilidade desse efeito ao incluir a modalidade tátil.&nbsp;</span></p>\r\n<p><span style=\"font-weight: 400;\">Sendo assim, no presente trabalho temos como objetivo desenvolver um dispositivo vibratório para uso em pesquisa no Laboratório de Cognição Humana da UFABC, capaz de nos auxiliar a identificar os efeitos da apresentação de estímulos bimodais em uma tarefa de bissecção temporal e possíveis dissociações causadas por efeitos de curto prazo na presença de um distrator em modalidade sensorial diferente das referências e do alvo. O desenho e o software de controle do dispositivo serão publicados online como projeto de </span><em><span style=\"font-weight: 400;\">open hardware</span></em><span style=\"font-weight: 400;\">.</span></p>\r\n<p><span style=\"font-weight: 400;\">Ao final do desenvolvimento do aparelho, um pequeno número de voluntários com funções visuais, auditivas e motoras compatíveis com a execução da tarefa desempenharão uma tarefa de bissecção que consiste em indicar a qual das referências os intervalos alvos mais se aproximam: curto ou longo. Uma curva psicométrica será ajustada aos resultados, e os dados serão posteriormente analisados com medidas mais específicas, como o Ponto de Igualdade Subjetivo (PIS). Se o resultado anteriormente obtido com distratores auditivos e alvos visuais, notadamente de um efeito de assimilação exclusivamente intra-modal, for replicado com distratores tácteis, fornecerá evidência forte pela generalizabilidade do fenômeno, com implicações teóricas relevantes. </span></p>\r\n<p>&nbsp;</p>'),
(449, 'pt_BR', 'areaSubarea', 'Neurociência; Psicologia Experimental; Psicofísica; Cognição'),
