(450, 'pt_BR', 'abstract', '<p>Neste projeto, a aluna ampliará seus conhecimentos sobre química computacional realizando um estudo sobre a interação entre ácidos naftênicos, surfactantes e sistemas micelares. Estes sistemas podem ser uma estratégia para despoluição de águas de produção petrolífera. Assim, neste projeto, serão avaliados diferentes ácidos naftênicos que são majoritariamente encontrados na água de produção do petróleo nacional, notadamente com cadeias de 9 a 14 carbonos. Para tanto, serão realizados cálculos computacionais, tanto baseados na mecânica quântica, quanto em dinâmica molecular. No primeiro caso, serão determinadas geometrias e cargas dos ácidos naftênicos e de diferentes surfactantes. Já no segundo caso, serão realizadas simulações em soluções salinas, procurando modelar o sistema real, de forma a verificar a agregação dos ácidos e sua interação com o surfactante, inclusive em sua forma micelar.</p>'),
