(451, 'pt_BR', 'abstract', '<p>Em 2018 foi anunciada a proposta de fusão entre a nacional Embraer e a companhia estadunidense Boeing. No contexto dos processos de desconcentração industrial no Brasil, observados desde 1970, cidades-regiões foram impactadas pela reconfiguração, dissolução e realocação de indústrias em diversos setores. Dada a centralidade da Embraer, em conjunto com todo o setor aeroespacial instalado, para a economia, desenvolvimento urbano e social do município de São José dos Campos, a tentativa de fusão traz um novo debate a respeito do processo industrial na região em relação aos atores externos e internos. Este estudo irá investigar os impactos da tentativa de fusão da Embraer sobre as especificidades regionais de São José dos Campos, município intimamente ligado à sua indústria de alta tecnologia, relações dos atores internos com o processo de fusão e viabilidade da região como polo de desenvolvimento científico e tecnológico.</p>'),
