(452, 'pt_BR', 'abstract', '<p>As propriedades químicas, ópticas e eletrônicas de sistemas moleculares são fundamentalmente determinadas pelos orbitais de fronteira. Indiscutivelmente, o método experimental mais direto para acessar os orbitais de fronteira preenchidos é a espectroscopia de fotoemissão excitada por radiação ultravioleta. Conhecer a estrutura dos orbitais moleculares é fundamental para entender a estrutura geométrica de filmes moleculares e das próprias ligações químicas em si. Neste projeto, propomos utilizar a abordagem de tomografia orbital por fotoemissão para obter, via simulações de primeiros princípios, mapas de momentum para o nitreto de boro hexagonal. As simulações serão comparadas com resultados experimentais já obtidos. Queremos entender qual(is) orbital(is) do h-BN contribuem para a fotoemissão observada, já que os resultados experimentais foram obtidos na condição de ressonância com a borda-K do boro.</p>'),
