(453, 'pt_BR', 'abstract', '<p style=\"font-weight: 400;\">A impressão 3D demonstrou ser uma plataforma de tecnologia muito versátil<br>para fabricação rápida de peças customizadas de polímeros, metais ou cerâmicas, sem necessidade do uso de moldes. Tendo isso em vista, o objetivo deste projeto é a realização uma revisão bibliográfica do uso de polímeros termoplásticos usados em métodos de impressão 3D. Serão investigadas tanto a literatura científica como a de patentes industriais.</p>'),
