(454, 'pt_BR', 'abstract', '<p><span style=\"font-weight: 400;\">O cenário da pandemia da COVID-19 trouxe o foco da pesquisa científica para o agente etiológico, o coronavírus SARS-CoV-2, com destaque para os estudos que buscaram monitorar a presença do SARS-CoV-2 na rede de esgoto. Este projeto busca identificar e quantificar a presença do vírus no efluente antes e após o tratamento do sistema de lodo ativado, um estudo de caso na ETE Itatinga, localizada no Município de São Sebastião do Estado de São Paulo.</span></p>'),
