(455, '', 'categoryIds', '[]'),
(455, 'pt_BR', 'abstract', '<p>Quando um cilindro rígido suportado elasticamente está imerso em uma correnteza de água, ocorre que vórtices são desprendidos da superfície do cilindro, gerando-se forças hidrodinâmicas cíclicas sobre o corpo, produzindo-se a vibração do cilindro na direção transversal ao escoamento. Se a frequência de desprendimento de vórtices é próxima da frequência de vibração natural do cilindro, então entra-se em ressonância. Há uma faixa de velocidades intermediarias de correnteza na qual ocorre a ressonância, fora dessa faixa, para baixas e altas velocidades, o cilindro não vibra.</p>\r\n<p>Ao adicionar um cilindro estacionário na frente do cilindro permitido a vibrar, a esteira à jusante do cilindro da frente afeta o escoamento que impacta o cilindro de trás interferindo na sua dinâmica.</p>\r\n<p>Dependendo da distância de separação entres ambos os cilindros, da elasticidade e o amortecimento do suporte do cilindro de trás, e da massa do cilindro, a vibração natural do cilindro de trás pode mudar drasticamente. Como deseja-se maximizar a captação de energia vibracional do cilindro de trás e posteriormente convertê-la em energia elétrica, surge a necessidade de determinar o melhor grupo de valores desses parâmetros para maximizar a vibração e com isso a potência elétrica fornecida.&nbsp;&nbsp;&nbsp;</p>\r\n<p>Dentro desse contexto, o presente projeto de pesquisa visa conduzir um estudo numérico da influência da esteira do cilindro da frente sobre a vibração induzida por vórtices do cilindro de trás, buscando maximizar a vibração deste último cilindro. O estudo aborda somente a vibração do cilindro de trás na direção transversal à correnteza. Uma análise bidimensional de interação fluido-estrutura é considerada, e as simulações numéricas serão conduzidas por Dinâmica de Fluidos Computacional usando o software ANSYS FLUENT.</p>'),
(455, 'pt_BR', 'areaSubarea', 'Engenharia Mecânica, Estruturas, Interação Fluido-Estrutura'),
