(457, '', 'categoryIds', '[]'),
(457, 'pt_BR', 'abstract', '<p>Os problemas socioambientais enfrentados pela atualmente, tornam urgente a necessidade da &nbsp;criação de empreendimentos sociais que tenham o intuito de&nbsp; desenvolver inovações sociais com vistas a mitigar os problemas socioambientais da sociedade atual. Tais empreendimentos sociais ainda têm pouca estruturação no Brasil e isso pode estar relacionada ao desafio na identificação e classificação dos atores que compõem esse ecossistema. A urgência em desenvolver e colocar em prática novas soluções, entre elas as tecnologias verdes, vem sendo discutida desde a Revolução Industrial, os avanços tecnológicos têm ampliado também os níveis de poluição e destruição ambiental, e a necessidade de reverter a situação é crescente, a fim de reduzir esse problema um ator importante são os chamados negócios sociais ou empreendimento sociais, que são organizações que têm como missão solucionar um problema social, são autossustentáveis financeiramente e não distribuem dividendos. Os negócios sociais são um tipo de empresa na qual o investidor recupera seu investimento inicial, mas o lucro gerado é reinvestido na própria empresa para ampliação do impacto social. Nesse contexto, o objetivo da presente pesquisa é mapear os ecossistemas de inovação social voltados às tecnologias verdes, com ênfase nos empreendimentos sociais, a fim de compreender como estes se configuram a cidade de São Paulo em relação ao seu papel no ecossistema, tipo de iniciativa, área de abrangência, escala de atuação, entre outros fatores. Para tal, será adotado como estratégia de coleta de dados uma <em>survey</em> com perguntas estruturadas. Os dados serão coletados a partir da lista de empreendimentos sociais gerados pela pesquisa da PIPE Social 2021, adicionalmente, novos empreendimentos podem ser mapeados a partir da técnica <em>snowball.</em></p>'),
(457, 'pt_BR', 'areaSubarea', 'Inovação Social; Negócios sociais; Setor financeiro; inclusão financeira'),
