(459, 'pt_BR', 'abstract', '<p>O consumo de álcool durante a gravidez provoca consequências cognitivas e física, como o comprometimento da memória espacial ligado principalmente à disfunção do hipocampo. Nos Estados Unidos, estima-se que a cada 1000 nascidos vivos, nascem cerca de 0,2 à 1,5 crianças com a Síndrome Fetal Alcoólica. Já no Brasil, de acordo com a Associação Médica Brasileira, em algumas regiões esse número pode corresponder a 38 para cada nascidos vivos, no entanto, acredita-se que este número esteja subnotificado. A utilização de modelos animais permite investigar quais as consequências do álcool durante o desenvolvimento, podendo ser abordado em diferentes momentos da gravidez, primeiro, segundo ou terceiro trimestre, prejudicando processos específicos que ocorrem em cada uma das etapas do neurodesenvolvimento. Assim, utilizando o modelo em camundongo, nós iremos avaliar primariamente as consequências da ingestão de álcool que corresponderia ao primeiro e segundo trimestre de gestação em humanos, iremos quantificar o número de células em processo de morte celular no hipocampo, a morfologia, volume e peso hipocampal, além de realizar testes de desenvolvimento somático e reflexos neurológicos. Este projeto irá contribuir para a padronização de um modelo possibilitando a criação de propostas terapêuticas que possam minimizar as sequelas causadas pelo consumo de álcool durante a gestação.</p>'),
