(460, 'pt_BR', 'abstract', '<p>A proposta de pesquisa investiga a participação social como a expressão das instituições e práticas políticas de uma sociedade em um dado contexto e tempo histórico, sendo uma possível geradora de oportunidades para transformações que podem mudar as bases sociopolíticas e culturais (MILANI, 2008), especialmente nas instituições públicas em si. A pesquisa foca as teorias de capital social e de democracia participativa, bem como relatos de experiências, para discutir se iniciativas experimentais no planejamento e desenho de políticas públicas podem trazer oportunidades para o aprendizado em práticas de participação social. Algumas das questões que norteiam a pesquisa são: como inovar nas formas de participação social? Essas inovações podem fortalecer o modelo de democracia representativa? Podemos usar desenhos de políticas experimentais para estimular a participação social? O objetivo é fornecer elementos que testem essas hipóteses em um caso aplicado em dois projetos de pesquisa integrados e em andamento, cujo objeto é a revisão participativa do Plano Municipal de Gestão Integrada de Resíduos Sólidos (PMGIRS) no município de Ribeirão Pires. Para responder essas questões, propõe-se a realização de pesquisa bibliográfica e documental sobre experimentos e inovação em políticas públicas, teorias e práticas de participação social, Planos Municipais de Gestão Integrada de Resíduos Sólidos. Os resultados dessa pesquisa serão integrados aos resultados dos projetos supracitados, visando contribuir para a geração de propostas de instrumentos participativos no processo de revisão do PMGIRS. Para a aplicação também estão previstas entrevistas com gestores públicos municipais. Complementarmente, será avaliada ao longo da pesquisa a possibilidade de se entrevistar membros de organizações públicas de inovação e experimentação (ver objetivo 2.2.5., na seção 2, Objetivos). &nbsp;&nbsp;&nbsp;</p>'),
