(461, 'pt_BR', 'abstract', '<p>Os peptídeos antimicrobianos (PAM) são biomoléculas, com menos de 100 resíduos de aminoácido, que apresentam função importante no sistema imune de resposta de diversos micro-organismos, como bactérias, fungos e vírus, além de serem potenciais agentes anticâncer, o que torna cada vez mais relevante a busca por novos compostos ativos.</p>\r\n<p>O projeto tem como proposta o estudo dos PAM (VmCT1, IsCT1 e Polybia-CP), em combinação com a terapia fotodinâmica, no intuito de verificar a sinergia que essas estratégias podem proporcionar contra diversas cepas de bactérias patogênicas. Existem, na literatura, alguns estudos que comprovaram um efeito sinérgico entre as duas terapias contra bactérias, mas ainda não está muito claro como isso acontece. Nesse trabalho, os peptídeos serão sintetizados pelo método em fase sólida, purificados em Cromatografia Líquida de Alta Eficiência (HPLC) e caracterizados por Espectrometria de Massas (LC/ESI-MS). Os ensaios biológicos, para verificar a atividade antimicrobiana, serão realizados em bactérias gram-positivas e negativas e, como agente fotossensibilizador na terapia fotodinâmica, será usado a hipericina. Os estudos serão conduzidos para se verificar a influência na ordem terapêutica, concentração de drogas e tempo de exposição.</p>'),
