(462, 'pt_BR', 'abstract', '<p>A pesquisa se propõe a realizar uma leitura da obra <em>O capital</em>, de Karl Marx, buscando examinar o papel desempenhado pelo colonialismo na construção do argumento geral de seu Livro I de crítica da economia política. Trata-se de mapear os aspectos políticos e epistemológicos do colonialismo e suas consequências nesta obra. Nesse sentido, busca-se investigar a existência de semelhanças e genealogias entre as formas de dominação e exploração nas colônias e metrópoles e na constituição dos sujeitos que habitam cada um desses polos. Nesse sentido, avançamos com a perspectiva de lutas de classes na Rússia, considerando os aspectos deste campo vindos de uma sociedade não-ocidental em contraste com a crítica de Marx ao colonialismo.</p>'),
