(463, 'pt_BR', 'abstract', '<p>A presente proposta se preocupa com a qualidade de vida nos grandes centros urbanos. Entende que haja oportunidades e dificuldades associadas à infraestrutura de transporte disponível. Estabelece como objetivo geral identificar índices que permitam descrever as oportunidades que a infraestrutura de transportes disponibilizaria à cidade. Através da análise da literatura de economia urbana&nbsp; e a aplicação da abordagem das capacitações, buscam-se os indicadores de acessibilidade que sirvam a compreensão das oportunidades disponíveis às &nbsp;pessoas para realizarem suas capacidades, ao permitir acesso a emprego, saúde e educação. A reflexão proposta pretende contribuir para compreender melhor a dinâmica econômica e social que condiciona as dificuldades existentes em se viver em grandes cidades.</p>'),
