(464, '', 'categoryIds', '[]'),
(464, 'pt_BR', 'abstract', '<p>O presente projeto, busca investigar à luz do pensamento do teórico crítico Herbert Marcuse as fundamentações do conceito de trabalho no conjunto da existência humana. Trata-se de uma questão difícil quando, do ponto de vista marxista, consideramos tanto o papel social que o trabalho desempenha na constituição da vida social, mas também como este papel se efetiva como forma alienada de vida no capitalismo. Sob essa duplicidade do conceito de trabalho, nossa questão central é: o trabalho é alienante e libertador ao mesmo tempo? Para responder nossa pesquisa, abordaremos o ensaio de Herbert Marcuse, <em>Sobre os fundamentos filosóficos do conceito de trabalho da ciência econômica </em>(1933), incluído no primeiro período da obra do filósofo. No ensaio, Marcuse problematiza uma perspectiva generalista do trabalho nas ciências econômicas. Para o autor, o contraponto à visão generalista da economia sobre o trabalho, que abstrai o conceito ao articulá-lo em diversas dimensões da esfera econômica (da produção de valor à ordem dos preços) estaria na fundamentação filosófica e recorre a Hegel e Marx para fundamentar este conceito. Além disso, Marcuse analisa o conceito dentro do contexto da existência humana recorrendo aos seus estudos ontológicos orientados por Martin Heidegger, movimento que aprofunda com a posterior descoberta e publicação dos<em> Manuscritos econômico-filosóficos </em>de Karl Marx, o autor aproxima-se do pensamento marxista para delinear sua busca pelo conceito. Espera-se, com o presente projeto, discutir os fundamentos do trabalho investigados por Marcuse naquele período, evidenciando as articulações críticas entre economia e filosofia central para nossa investigação.</p>'),
