(465, 'pt_BR', 'abstract', '<p>O estudo objetiva analisar s participação das mulheres dos países lusófonos como membros com ou sem direito de voto em organizações internacionais, conforme a meta do Objetivo de Desenvolvimento Sustentável 16: “ampliar e fortalecer a participação dos países em desenvolvimento nas instituições de governança global”. O trabalho consiste em uma investigação sobre a promoção de igualdade de gênero e equilíbrio de poder entre países desenvolvidos e em desenvolvimento a partir do ponto de vista teórico do novo-estruturalismo latino-americano e do ponto de vista empírico, com base nas metas e indicadores da Agenda 2030.</p>'),
