(466, 'pt_BR', 'abstract', '<p><sub>A demanda crescente por fontes sustentáveis de energia tem impulsionado a descoberta e o <br>desenvolvimento de novos materiais termoelétricos de alta performance. Diversos experimentos da ciência espacial requerem um controle preciso e constante da temperatura do ambiente para aplicações em naves espaciais, sondas e satélites. Nessa área, é extremamente desejável desenvolver materiais termoelétricos de baixo custo e baixa toxicidade, usando substâncias abundantes, pouco tóxicas e fáceis de manipular. Nesse sentido, destacam-se os materiais de calcogenetos de metais de transição, que têm recentemente recebido destaque na academia devido às suas propriedades eletrônicas e térmicas vantajosas para diversas aplicações em termoeletricidade. No presente projeto, propomos prospectar a viabilidade de crescer monocristais do termoelétrico SnSe através do método de flux-melt, avaliando a influência do fluxo na natureza e concentração de portadores de carga. Estão previstas sínteses utilizando auto fluxo de Sn e Se, e fluxo de haletos-alcalinos. A identificação da fase e pureza dos materiais obtidos serão aferidas por medidas de difração de pó de raios-X à temperatura ambiente. Através de análise por refinamento de Rietveld dos difratogramas, poderão ser determinados a estrutura cristalina, o grupo espacial e os parâmetros de rede da(s) fase(s) formada(s). Caso obtido monocristais da fase desejada, serão realizadas medidas de efeito Hall para identificar a natureza dos portadores de carga (elétrons ou lacunas) e sua concentração.</sub></p>'),
