(468, 'pt_BR', 'abstract', '<p>No contexto de disseminação do projeto de smart cities no planejamento urbano do início do século XXI e o novo evento da dataficação, este projeto procura compreender a difusão de imaginários, crenças e informações que consolidam em fatos o modelo de cidades inteligentes. Para isso, olharemos para os discursos hegemônicos presentes nas mídias, nas plataformas difusoras do modelo e dos projetos em andamento nas cidades, além de investigar o papel de correntes contra-hegemônicas neste cenário. O recorte deste trabalho é a Região Metropolitana de São Paulo, um dos pólos da profusão deste modelo.</p>'),
