(469, 'pt_BR', 'abstract', '<p>As fábricas inteligentes passam a se tornar cada vez mais realidade com o <br>conceito de Indústria 4.0. A ideia de incorporar a tecnologia da informação em <br>automação e aplicar aos sistemas de montagem que alteram a matéria-prima visando <br>tranformar em produtos que possuam valor agregado, tem forte influência da Quarta <br>Revolução Industrial que conta com inovações nas áreas de robótica, computação em <br>nuvem, internet das coisas e inteligência artificial. Sendo assim, as formas de produção<br>passam a absorver o desenvolvimento de novas soluções de ferramentas em máquinas <br>e computadores integrados, que são benéficas em virtude da diminuição de <br>complexidade na realização de atividades e no aumento da qualidade de produtos<br>manufaturados. Partindo desta premissa, o projeto refere-se a utilização de um <br>torquímetro - sistema de aperto eletrônico - em um laboratório de manufatura <br>computacional aplicado a sistemas com foco no lean manufacturing, com o objetivo de<br>integrar inovações da indústria 4.0 aos sistemas do grande polo indutrial da região do <br>ABC, visando preparar empresas para impulsionar vantagens competitivas mediante ao <br>mercado.</p>'),
