(471, '', 'categoryIds', '[]'),
(471, 'pt_BR', 'abstract', '<p>A consolidação de memórias é um processo gradual que envolve o lobo temporal<br>medial, em especial o hipocampo. Estudos em ratos mostram que, na tarefa de<br>condicionamento de medo ao contexto (CMC), lesões do hipocampo realizadas logo após o<br>treino prejudicam a evocação desta memória, porém se estas mesmas lesões são feitas um<br>mês após o treino, não há prejuízo da memória contextual. Dessa forma, a teoria clássica<br>sobre consolidação da memória contextual é a de que, direcionadas pelo hipocampo,<br>gradualmente, as memórias tornam-se independentes dessa estrutura e são transferidas para<br>áreas específicas do neocórtex. No entanto, os dados de estudos envolvendo lesão de<br>hipocampo, realizadas após o treino, têm sido controversos, e algumas hipóteses foram<br>levantadas para explicar essas divergências, como a força do treino e diferenças no tipo e<br>extensão da lesão. Estudos realizados previamente em nosso laboratório com a tarefa de<br>CMC com três intensidades de choques distintas (0,3, 0,6 e 1,0 mA) mostraram que, após 28<br>dias, os animais treinados com choques mais fortes (0,6 e 1,0 mA) apresentaram uma<br>memória contextual generalizada, podendo refletir uma perda de dependência hipocampo e,<br>consequentemente, perda de detalhes contextuais. Entretanto, animais treinados com 0,3 mA<br>apresentaram uma memória contextual específica após 28 dias, sugerindo que, com essa<br>intensidade de treino, a memória contextual remota pode continuar dependendo do<br>hipocampo. O presente projeto pretende verificar, através da inativação do hipocampo com o<br>agonista gabaérgico muscimol, administrado antes do teste, se essa estrutura participa da<br>evocação da memória de CMC 28 dias após o treino, em animais treinados com um choque<br>fraco (0,3 mA) ou forte (1,0 mA). Estudos estatísticos de saúde pública salientam o aumento<br>na incidência de casos de transtornos de ansiedade durante a pandemia do SARS-COV e<br>esses transtornos têm como um dos principais sintomas a generalização da memória de<br>medo, isto é, dado uma pouca especificidade da memória contextual o indivíduo é induzido,<br>mesmo em um contexto seguro, a sentir-se ameaçado e com medo. Nesse sentido, a análise<br>que esse projeto propõe permitirá entender a atuação do hipocampo frente a evocação da<br>memória contextual, contribuindo, também, para o entendimento acerca da generalização da<br>memória e, por conseguinte, dos transtornos que afligem a sociedade pós-moderna.</p>'),
