(472, '', 'categoryIds', '[]'),
(472, 'pt_BR', 'abstract', '<p>O escopo do projeto consiste no estudo teórico de proteínas transportadoras de metais de transição do tipo ABC, envolvidas na sobrevivência de bactérias ESKAPE no hospedeiro. Trata-se de bactérias de grande importância no cenário nosocomial, especialmente após a aquisição de genes de resistência a antibióticos, mas que também são responsáveis por infecções na comunidade. Por essa razão, estudar esses aspectos da biologia destas bactérias constitui um intento relevante e promissor.</p>\r\n<p>De certa forma, pode-se dizer que este projeto é uma continuação dos estudos da aluna, realizados no âmbito do programa PDPD e da IC, onde vários fatores de virulência foram selecionados do proteoma de <em>Klebsiella pneumoniae</em>, depositado no UniProt. No projeto de PDPD, foi feita uma boa busca bibliográfica sobre a bactéria <em>Klebsiella pneumoniae</em>, aspectos das infecções causadas por ela, incidência de casos e dados proteômicos – de forma preliminar. Na Iniciação científica, diversas ferramentas, disponibilizadas principalmente no Portal Expasy, foram utilizadas para caracterizar as proteínas em termos de dados físico-químicos, estruturais e funcionais. Além disso, foram buscados ortólogos por meio de alinhamentos em bancos de dados. No momento, como o projeto está em andamento, a busca por epitopos será realizada ainda e as análises no Portal Expasy estão sendo finalizadas.</p>\r\n<p>Neste projeto, objeto desta análise, serão buscados no proteoma das bactérias ESKAPE proteínas de ligação a metais de transição que façam parte de transportadores do tipo ABC. Estas proteínas serão caracterizadas por ferramentas de Bioinformática para determinar aspectos físico-químicos, distribuição de domínios e epitopos, além da estrutura de RNA mensageiro e análise de códons preferenciais. Visa-se com isso contribuir para o metaloma destas espécies.</p>\r\n<p>Há grandes possibilidades de que os resultados desse trabalho sirvam de subsídio para projetos maiores, uma vez que essa é uma parte da linha de pesquisa da orientadora que está iniciando. Também pretende-se utilizar esses dados de forma complementar a dados experimentais futuros com as proteínas deste estudo.</p>\r\n<p>&nbsp;</p>'),
