(475, 'pt_BR', 'abstract', '<p>Memórias episódicas são memórias declarativas, ou seja, memórias de longo-prazo<br>que podem ser acessadas conscientemente e que possuem informações específicas sobre o<br>espaço e tempo (contexto) do evento que gerou sua aquisição. Estas memórias são moduladas<br>pelo hormônio adrenal Corticosterona (CORT). Estudos sugerem que os receptores de<br>glicocorticóides do tipo II, conhecido como GRs, estão relacionados com a consolidação<br>sináptica e estão presentes em grande densidade no hipocampo, amígdala e córtex pré-frontal,<br>áreas relacionadas com a aquisição, consolidação e evocação da memória. Além disso,<br>estudos recentes sugerem a participação de uma região específica neocortical, denominada<br>Córtex Pré-Límbico (PrL), na liberação de CORT e na retroalimentação negativa, de modo<br>que PrL funciona inibindo a atividade de regiões que ativam a resposta do estresse, além de<br>sugerir que esta área também se relaciona com processos de memória. O presente projeto tem<br>o objetivo de identificar e analisar os efeitos do bloqueio de GRs no PrL, imediatamente após<br>o treino da tarefa de condicionamento de medo ao contexto (CMC), sobre a ativação de<br>regiões hipocampais e amígdalares durante a evocação da memória contextual recente. Para<br>isso, serão utilizados cortes de encéfalos retirados de animais que receberam infusões<br>pós-treino de um antagonista GR diretamente no PrL e foram testados após 2 dias para<br>verificar tanto a força como a especificidade da memória contextual recente. Nestes cortes<br>serão realizados ensaios de imunohistoquímica, com a finalidade de identificar a proteína<br>FOS, indicativa de ativação neural, nas áreas de interesse. Os resultados deste projeto poderão<br>auxiliar na compreensão das bases neuroanatômicas da memória emocional recente na teoria<br>de consolidação sistêmica.</p>'),
