(476, '', 'categoryIds', '[]'),
(476, 'pt_BR', 'abstract', '<div class=\"page\" title=\"Page 2\">\r\n<div class=\"section\">\r\n<div class=\"layoutArea\">\r\n<div class=\"column\">\r\n<p>A garantia constitucional da moradia como um direito básico, não é suficiente para evitar um alto índice de déficit e inadequação habitacional no Brasil. Em regiões centrais do Município de São Paulo, o cenário de edifícios vazios e subutilizados, cria a realidade das ocupações verticais, na luta pelo direito à moradia. Nesse sentido, a pesquisa visa explorar práticas participativas que vêm sendo feitas dentro do campo da Assessoria Técnica de Interesse Social (ATHIS), assegurada pela lei no 11.888 de 2008, no contexto das ocupações verticais no centro de São Paulo, tendo como estudo de caso as ações que ocorreram na ocupação Penaforte Mendes. A pesquisa também pretende entender a relação entre os agentes que compõem esse campo de atuação e os diferentes papéis desempenhados nesse meio. Essa pesquisa vincula-se ao projeto “Co-Polis - co-produção social da cidade e ciência cidadã: uma perspectiva comparada sobre classe trabalhadora e bairros precários na França e no Brasil”.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>'),
