(477, '', 'categoryIds', '[]'),
(477, 'pt_BR', 'abstract', '<p class=\"p1\">&nbsp;</p>\r\n<p class=\"p2\">O desenvolvimento da requerida<span class=\"Apple-converted-space\">&nbsp; </span>Iniciação Científica, identificará<span class=\"Apple-converted-space\">&nbsp; </span>de forma sólida as principais <span class=\"Apple-converted-space\">&nbsp; </span>diferenças das práticas extensionistas propostas ou já aplicadas nas ocupações vinculadas ao projeto Co-polis e os diferentes significados de extensão para os pesquisadores. Identificados os meandros da questão, a pesquisa irá propor dois argumentos, um voltado para as<span class=\"Apple-converted-space\">&nbsp; </span>ocupações do centro e outro para ocupações das<span class=\"Apple-converted-space\">&nbsp; </span>regiões periféricas que contemplem modificações e apontem manutenções nas práticas atualmente aplicadas, além do levantamento do debate sobre o significado de extensão no cenário dos pesquisadores brasileiros e franceses.<span class=\"Apple-converted-space\">&nbsp;</span></p>\r\n<p class=\"p2\">Esta proposta de pesquisa nasce a partir de uma questão interna do projeto já existente (Co-polis) que é: a<span class=\"Apple-converted-space\">&nbsp; </span>construção de uma maior<span class=\"Apple-converted-space\">&nbsp; </span>integração dos envolvidos em extensões com a temática habitacional.<span class=\"Apple-converted-space\">&nbsp; </span>Em uma das<span class=\"Apple-converted-space\">&nbsp; </span>tônicas estruturais, o projeto analisa a comparativa no que tange o quadro habitacional das classes trabalhadoras e bairros precários no Brasil e na França, promovendo a importância e urgência da produção urbana social da cidade e da ciência cidadã. <span class=\"Apple-converted-space\">&nbsp;</span></p>\r\n<p class=\"p3\">Considerando os elementos<span class=\"Apple-converted-space\">&nbsp; </span>sociais, ambientais, políticos e culturais presentes nos territórios supracitados, foi possível identificar assimetrias e simetrias quanto aos modos de ação, estratégias de intervenção, e produção de conhecimento dos pesquisadores envolvidos.<span class=\"Apple-converted-space\">&nbsp;</span></p>'),
