(478, 'pt_BR', 'abstract', '<p><span style=\"font-weight: 400;\">Tendo em vista a crise habitacional vigente na cidade de São Paulo, vê-se a necessidade de movimentos de moradias organizados para garantirem o acesso à moradia digna à população menos abastada. Neste contexto, as ocupações de edifícios ociosos não só denunciam a problemática, como também configuram uma alternativa tangível de habitação popular. No entanto, as ocupações são muito diferentes entre si e o perfil social de seus habitantes, como idade, renda, trabalho, deslocamento, motivações e expectativas, não é bem catalogado. Assim, esta pesquisa de iniciação científica pretende traçar o perfil das ocupações estudadas pelo grupo de pesquisa, realizando uma análise comparativa às habitações equivalentes nas zonas periféricas. Complementarmente, este trabalho estudará os desdobramentos do acesso à mobilidade dos moradores para a permanência destes nas regiões centrais da cidade, analisando as condições de deslocamento exercido entre moradia-trabalho e moradia-estudo. A pesquisa incluiu revisão bibliográfica sobre déficit habitacional na cidade de São Paulo, desigualdade de acesso a serviços de transporte, assim como a relevância dos movimentos de luta por moradia na conquista do território e acesso à cidade. Os métodos de pesquisa incluirão a aplicação de um questionário, análises quali-quantitativas dos dados coletados e o mapeamento espacial do acesso aos serviços públicos, postos de trabalho e desigualdades territoriais. Desta maneira, o conhecimento e monitoramento de indicadores sociais das ocupações têm potencial de embasar bons argumentos em prol das pautas de luta de seus moradores, além de proporcionar um bom panorama em relação às necessidades sócio-habitacionais específicas deste grupo.</span></p>'),
