(479, 'pt_BR', 'abstract', '<p>Este trabalho propõe a aplicação de um sistema embarcado no reconhecimento <br>em tempo real do estado dos semáforos para pedestres. Por meio da utilização <br>de uma rede neural, identificaremos o estado dos semáforos em imagens <br>capturadas por uma câmera. Uma vez realizada a análise por meio do algoritmo <br>desenvolvido, sinais sonoros e vibratórios serão disparados de forma a <br>informar o estado atual do semáforo. Nessa fase será realizada uma pesquisa <br>nas áreas de rede neurais, o funcionamento, o treinamento e a implementação <br>delas, junto com uma pesquisa sobre base de dados de imagens dinâmicas, que <br>será usado para treinar a rede neural. Será definido também um sistema <br>embarcado usando Raspberry Pi e seus módulos de câmeras, e também será <br>elaborado um teste de desempenho e viabilidade para garantir o funcionamento <br>perfeito do sistema embarcado com a rede neural. Com este trabalho esperamos <br>desenvolver um dispositivo de baixo custo capaz de auxiliar pessoas com <br>deficiência visual durante a travessia de rua informando o estado atual do <br>semáforo, e portanto ampliando sua autonomia e segurança.</p>'),
