(480, '', 'categoryIds', '[]'),
(480, 'pt_BR', 'abstract', '<p>Vírus constantemente sofrem mutações e até recombinação<br>genômica por transmissão horizontal, como é possível verificar no caso das<br>glicoproteínas hemaglutinina (em Influenza A e B), hemaglutinina-esterase<br>de fusão (em influenza C e D) e hemaglutinina-esterase (em<br>Betacoronavirus e Torovirus), homólogas entre si. Por serem proteínas de<br>membrana do vírus e que atuam se ligando aos receptores do hospedeiro,<br>possuem regiões que constantemente podem sofrer com a ação da seleção<br>positiva, o que permite aumentar a afinidade do vírus com o hospedeiro, ou<br>permitir afinidade do vírus com novos hospedeiros e até um escape do<br>sistema imunológico. O objetivo do projeto é entender essas mutações ao<br>longo da história evolutiva do vírus, através de análise filogenética, e<br>correlacionar com informações biológicas importantes para verificar um<br>possível potencial pandêmico destes.</p>'),
(480, 'pt_BR', 'areaSubarea', 'Evolução Molecular , genética molecular'),
