(481, 'pt_BR', 'abstract', '<p>Este projeto consiste na utilização de grafeno, um material com propriedades <br>marcantes, para a manufatura de músculos artificiais, mecanismos que se contraem <br>e expandem a partir de uma força externa. Trata-se da continuação de um projeto <br>PDPD do mesmo autor, que tratou-se da síntese de grafeno e o desenvolvimento de <br>filamentos de grafeno para impressão 3D, que inclusive será utilizado na aplicação <br>final deste IC. Tal PDPD atraiu a atenção de acadêmicos da área de “Soft Robotics” <br>(robótica de materiais moles) da Harvard University em Boston e da Leibniz University <br>Hannover, na Alemanha. Após verem as possibilidades da aplicação do grafeno em <br>músculos artificiais, ambas instituições deram 2 workshops que auxiliaram a idealizar <br>o caminho descrito neste documento.</p>'),
(481, 'pt_BR', 'areaSubarea', 'Materiais; biotecnologia;'),
