(482, '', 'categoryIds', '[]'),
(482, 'pt_BR', 'abstract', '<p>O controle da pandemia causada pelo novo betacoronavírus causador da Sindrome Respiratória Severa Aguda (SARS-CoV-2), tem como base a vacinação, associada a diminuição da circulação do vírus por distanciamento social e bloqueio da transmissão após diagnóstico. Diferente de outras doenças infecciosas, onde as vacinas impedem a transmissão do agente infeccioso, no caso do SARS-CoV-2, as vacinas disponíveis e o a infecção natural resultam na diminuição da morbidade associada a infecção pelo vírus, diminuindo as internações e óbitos, mas não impedem sua transmissão. Além disso, a imunidade adquirida contra o vírus tem duração de até seis meses, a partir do qual há aumento de risco de infecção com casos graves. Nesse contexto, é importante monitorar a evolução genética do SARS-CoV-2. Assim, com o intuito de investigar a variabilidade genética do gene que codifica a proteína do Nucleocapsídeo de SARS-CoV-2, este projeto tem por objetivo amplificar o gene por técnica de RT-PCR convencional a partir de amostras de RNA positivas para SARS-CoV-2, cedidas pelo Instituto Adolfo Lutz em julho e novembro de 2021, para sequenciamento pelo método de Sanger. &nbsp;</p>'),
