(483, 'pt_BR', 'abstract', '<p>O SARS-CoV-2 é um vírus de RNA fita simples e sentido positivo, pertencente ao gênero beta-coronavírus e à família <em>Coronavidae. </em>Desde a sua descoberta, em dezembro de 2019 na China, este vírus se disseminou rapidamente ao redor do mundo, infectando milhares de pessoas e levando ao óbito cerca de 2% dos infectados. Uma das formas de evitar a dispersão do vírus é através do diagnóstico e isolamento das pessoas infectadas. O método recomendado pela Organização Mundial da Saúde para identificação do vírus é amplificação de ácidos nucleicos realizada em equipamentos capazes de identificar a presença do vírus em tempo real. A grande dificuldade na realização deste diagnóstico é o alto custo dos materiais utilizados, que são geralmente importados. Além disso, este método não possibilita a caracterização molecular do vírus, a fim de distinguir possíveis mutações. Considerando as limitações diagnósticas e o alto índice de casos subnotificados da COVID-19 no Brasil, é de extrema importância o desenvolvimento de métodos alternativos que possibilitem a identificação de infecção comunitária em indivíduos sintomáticos e assintomáticos. A caracterização do SARS-CoV-2, mediante sequenciamento genético do vírus permite também a constatação de possíveis mutações que possam interferir na eficácia de vacinas e esquemas terapêuticos. Este projeto tem como objetivo a padronização de método de diagnóstico molecular qualitativo para a detecção do SARS-CoV-2 com utilização do gene que codifica a proteína do envelope viral (E), e a investigação de polimorfismo genético em amostras coletadas em 2021.</p>'),
