(485, 'pt_BR', 'abstract', '<p>Este projeto busca investigar as principais disputas acerca do planejamento territorial de Taboão da Serra (SP) no período do Plano Diretor vigente (sancionado em 2006). Para isso, será analisado o processo de urbanização do município, o ordenamento territorial no marco do atual Plano Diretor e realizaremos um mapeamento dos principais agentes envolvidos nos conflitos territoriais no marco desse ordenamento e seus respectivos interesses. Pretende-se, desse modo, contribuir à compreensão dos desafios ao planejamento urbano nesse município.</p>'),
