(485, 'pt_BR', 'title', 'Conflitos no planejamento urbano de Taboão da Serra (SP) no marco do Plano Diretor vigente: agentes e projetos em disputa'),
(486, '', 'categoryIds', '[]'),
(486, 'pt_BR', 'abstract', '<p>Este documento apresenta o projeto de iniciação científica cujo tema é a produção do imaginário dominante no contexto da plataformização e da cidade corporativa, analisando as estratégias da empresa iFood no contexto da ação anti-mobilização dos entregadores com a campanha “Não Breca Meu Trampo”. A difusão do meio técnico-científico informacional acompanha, nesse contexto mais recente, a difusão de uma série de plataformas digitais, que são responsáveis por mudanças significativas tanto nos territórios quanto na construção do imaginário a eles associados. Assim, diante desse contexto, pretende-se estudar qual produção de imaginário está sendo posta por essas plataformas e suas imbricações no território. </p>'),
(486, 'pt_BR', 'areaSubarea', 'Planejamento Territorial'),
