(487, 'pt_BR', 'abstract', '<p>Neste projeto, propomos estudar superfícies a partir de um ponto de vista topológico, explorando alguns invariantes topológicos, bem como estudar a classificação de superfícies fechadas e suas implicações. No estudo de superfícies fechadas (compacta sem bordo), três superfícies básicas são usadas como blocos básicos: a esfera, o toro e o plano projetivo. Como, essencialmente, qualquer superfície pode ser construída a partir desses blocos básicos, faz se necessário ter um bom entendimento desses blocos. </p>'),
(487, 'pt_BR', 'areaSubarea', 'Matemática - Topologia'),
