(115, 'pt_BR', 'biography', 0, 0, '<p>Professor Adjunto da Universidade Federal do ABC. Pós-doutorado no Stockholm Environment Institute. É doutor em Ciências Naturais com concentração em Geologia Ambiental e Conservação de Recursos Naturais pela Universidade Federal de Ouro Preto, com doutorado-sanduíche em Engenharia de Recursos Hídricos na Universidade de Chulalongkorn (Tailândia). Sua linha de pesquisa principal consiste na modelagem espacial de informações ambientais para avaliação de impactos socioambientais e planejamento de uso do solo. Tem experiência na área de Ciências Ambientais, Ecologia, Computação, Estatística, Direito e Epistemologia atuando principalmente nos seguintes temas: meio ambiente, recursos hídricos, desenvolvimento sustentável. Possui formação como Mestre em Geografia, Especialista em Solos e Meio Ambiente, Licenciatura em Geografia, Bacharel em Ciências Ambientais, Bacharel em Filosofia, Técnico em Meio Ambiente e Técnico em Informática Industrial.</p>', 'string'),
