(478, 1048585, 155, 1, '2022-07-03 17:57:07', NULL, 'propes <submissoescpic@gmail.com>', 'Avaliador1 <dnredson@hotmail.com>', NULL, NULL, '[TI] A revista Edital XX solicita avaliação de artigo', '<p>Avaliador1:<br><br>Acredito que você poderia servir como um(a) excelente avaliador(a) do manuscrito, \"Teste,\" que foi submetido ao periódico Edital XX. O resumo da submissão está inserido abaixo e espero que você considere realizar essa importante tarefa para nós.<br><br>Faça o login no site do periódico antes de 2022-07-10 para indicar sua disponibilidade, bem como para acessar submissão e registrar sua avaliação e recomendação. O site é <a class=\"contextUrl-style-class\" href=\"https://submissoesic.propes.ufabc.edu.br/index.php/ti\">https://submissoesic.propes.ufabc.edu.br/index.php/ti</a><br><br>A avaliação em si tem como prazo 2022-07-17.<br><br>Se você não tiver seu nome de usuário e senha para o site do periódico, poderá usar este link para redefinir sua senha (que será enviada por e-mail juntamente com seu nome de usuário). <a class=\"passwordResetUrl-style-class\" href=\"https://submissoesic.propes.ufabc.edu.br/index.php/ti/login/lostPassword\">https://submissoesic.propes.ufabc.edu.br/index.php/ti/login/lostPassword</a><br><br>URL da submissão: <a href=\'https://submissoesic.propes.ufabc.edu.br/index.php/ti/reviewer/submission?submissionId=155\' class=\'submissionReviewUrl-style-class\'>https://submissoesic.propes.ufabc.edu.br/index.php/ti/reviewer/submission?submissionId=155</a><br><br>Agradeço por considerar esta solicitação.<br><br>propes<br>submissoescpic@gmail.com<br><br>\"Teste\"<br><br></p>\r\n<p></p><br/><br>\n________________________________________________________________________<br>\n<a href=\"https://submissoesic.propes.ufabc.edu.br/index.php/ti\">TesteInterno</a>'),
(479, 1048585, 155, 7, '2022-07-03 22:16:55', 1073741829, 'Dener3 <dnredson@gmail.com>', 'Avaliador1 <dnredson@hotmail.com>, Avaliador1 <dnredson@hotmail.com>', NULL, NULL, '[TI] Disponível para realizar avaliação', 'Prezados editores, <br />\n<br />\nEu tenho disponibilidade para dar um parecer para a submissão, &quot;Teste,&quot; para o periódico Edital XX. Agradeço por lembrar de mim, e pretendo enviar o parecer até 2022-07-17, se não antes.<br />\n<br />\nAtenciosamente,\n<br />\nDener3<br/><br>\n________________________________________________________________________<br>\n<a href=\"https://submissoesic.propes.ufabc.edu.br/index.php/ti\">TesteInterno</a>'),
