(311, 'pt_BR', 'sisgen', ''),
(311, 'pt_BR', 'title', 'PEQUENO INVENTÁRIO DE TEXTOS-PARA-(EN)CANTAR A CIÊNCIA'),
(312, '', 'categoryIds', '[]'),
(312, 'pt_BR', 'abstract', '<p><span style=\"font-weight: 400;\">Apesar de normalmente os jogos digitais serem utilizados para prazer e lazer, eles possuem um enorme potencial para incentivar e impactar positivamente a área da saúde. Os jogos podem incentivar a recuperação de pacientes e o desenvolvimento de crianças e adolescentes de um jeito divertido e prático. Inclusive, a diversão digital pode ajudar na estimulação de crianças com deficiências.</span> <span style=\"font-weight: 400;\">Portanto, neste trabalho iremos falar sobre os jogos na área da saúde, principalmente do Jecripe, um jogo digital baseado na Inspeção Semiótica, que utiliza o método da Interação Humano-Computador para estimular habilidades cognitivas de crianças com Síndrome de Down entre 3 e 7 anos.</span></p>'),
