(313, '', 'categoryIds', '[]'),
(313, 'pt_BR', 'abstract', '<p>A doença de Alzheimer é a patologia mais comum quando se trata de demência neurodegenerativa, observada com maior frequência em pessoas de idade. Embora descrita há mais de um século até hoje ainda não existe cura ou ratamento eficaz. Para melhor entendimento dos processos celulares e moleculares envolvidos na morte celular na doença de Alzheimer, o uso de modelos e culturas de linhagem celular são de crucial importância. Neste projeto, iremos expandir células da linhagem SH-SY5Y &nbsp;(derivadas de neuroblastoma humano) indiferenciadas, e padronizar protocolo de diferenciação celular, com o objetivo de fornecer ao aluno treinamento adequado em técnicas de cultura celulas e embasamento teórico-prático para realização de estudos futuros utilizando cultura celular.</p>'),
(313, 'pt_BR', 'areaSubarea', 'Ciências Biológicas; biologia celular e molecular'),
