(313, 'pt_BR', 'title', 'Padronização de modelo celular para estudo de  neuropatologias'),
(314, '', 'categoryIds', '[]'),
(314, 'pt_BR', 'abstract', '<p>A doença de Alzheimer é uma doença neurodegenerativa que acomete milhões de pessoas. Essa patologia, objeto de inúmeros estudos científicos, progride causando a morte de células neuronais e atrofia de tecidos cerebrais e ainda não possui cura ou tratamento eficaz, tornando relevante a compreensão de aspectos biológicos e fatores agravantes do desenvolvimento dessa patologia. Portanto, serão abordadas neste projeto análises de bioinformática de transcriptomas de célula única através da plataforma de sequenciamento de última geração (NGS), utilizando dados de acesso público de amostras de cérebro post-mortem de pacientes com a doença de Alzheimer.</p>'),
(314, 'pt_BR', 'areaSubarea', 'Ciências Biológicas, biologia celular'),
