(315, 'pt_BR', 'abstract', '<p>O presente estudo dá continuidade ao projeto “Adaptação de teste de nomeação multilingue (MINT) para língua portuguesa no contexto do bilinguismo espanhol-português”, que teve como objetivo adaptar o teste de vocabulário MINT para falantes nativos de português brasileiro, a fim de que possa ser usado em estudos sobre bilinguismo e multilinguismo. O teste foi adaptado e aplicado preliminarmente em bilíngues. Neste projeto, seguiremos com a aplicação do teste adaptado em bilíngues e investigaremos o acesso lexical na mesma população, comparando-a a monolingues. Os participantes (30 bilíngues adultos) realizarão o MINT e testes de fluência verbal nas duas línguas. Paralelamente, um grupo de monolíngues (n=30, língua materna português) será usado como controle. Os participantes bilingues e monolingues realizarão o teste de Simon para investigar as funções executivas, além do preenchimento de questionários de experiência linguística e proficiência. Serão avaliadas diferenças entre monolingues e bilingues nos testes de vocabulário, e como estas diferenças se relacionam com as medidas de proficiência, experiência linguística e funções executivas. Espera-se replicar, em nosso meio, diferenças já observadas no acesso lexical entre monolingues e bilingues. Por um lado, bilíngues apresentariam maior lentidão quando comparados a monolíngues, além de estarem sujeitos a interferências interlinguísticas. Por outro lado, espera-se que bilíngues com maior proficiência e melhores funções executivas tenham menor interferência entre as línguas. As funções executivas serão avaliadas pelo teste de Simon (versão computadorizada).</p>'),
