(316, 'pt_BR', 'abstract', '<p>A doença de Parkinson (DP) é neurodegenerativa e afeta o sistema dopaminérgico na substância negra. Caracteriza-se por alterações cognitivo-motoras incluindo agrafia. O objetivo deste estudo é caracterizar as alterações da escrita em pacientes com DP. Este projeto faz parte de um estudo maior que investiga os correlatos neurais das manifestações cognitivo- motoras na DP e os efeitos da neuromodulação não-invasiva na melhora destes sintomas. Serão recrutados 30 pacientes com DP e 30 idosos sadios pareados por idade, sexo e escolaridade. Os participantes realizarão tarefas de 1) escrita espontânea, ditado e avaliação de parâmetros cinemáticos da escrita com registro e análise com o software movalyzer. O protocolo já foi aprovado pelo Comitê de Ética em Pesquisa da UFABC. Os resultados poderão subsidiar o desenvolvimento de uma metodologia de avaliação da escrita manual na Doença de Parkinson que poderá contribuir para o monitoramento dos sintomas e para avaliar o efeito de intervenções. &nbsp;</p>'),
