(317, 'pt_BR', 'abstract', '<p>Após mais de um século desde a descoberta do primeiro representante da família Spinosauridae, diversas pesquisas continuam sendo divulgadas e novas informações surgem, seja complementando ou enfatizando conhecimentos prévios, ou mudando drasticamente o nosso conhecimento sobre o grupo. Somente nos últimos três anos, quatro novas espécies de espinossaurídeos foram descritas na literatura: <em>Vallibonavenatrix cani, Ceratosuchops inferodios</em>, <em>Riparovenator milnerae </em>e <em>Iberospinus natarioi</em>. Essas descobertas ressaltam a importância de estudos de revisão, compilando novas e velhas informações que podem nortear trabalhos futuros. Dessa forma, o objetivo do presente estudo é realizar o estado da arte da família Spinosauridae, compilando informações desde a primeira publicação sobre o grupo em 1915 até os dias atuais, além de comparar criticamente as diferentes interpretações, morfológicas ou funcionais, acerca deste grupo. Inicialmente será realizada uma revisão sobre as características gerais do grupo e, posteriormente, a revisão será aprofundada com informações disponíveis sobre morfologia, hábitos, alimentação, classificação do grupo, distribuição geográfica e afins. Também serão elaboradas tabelas que informarão aos demais pesquisadores quais temas já foram exaustivamente estudados e quais outros podem representar um ineditismo científico.</p>'),
