(318, 'pt_BR', 'abstract', '<p>A retinose pigmentar é uma doença degenerativa que atinge milhares de pessoas no mundo. Ainda sem cura ou tratamentos eficientes e que sejam acessíveis à população, o diagnóstico desse quadro leva a sentimento de desesperança no paciente. Durante o processo degenerativo, as principais células afetadas são os fotorreceptores do tipo bastonetes e cones, não havendo em mamíferos maneiras intrínsecas de substituir estas células perdidas. Entretanto, outras espécies, como peixes e anfíbios, apresentam uma cascata intracelular que caracterizam as glias radiais a terem uma capacidade de reprogramação celular, voltando à característica de progenitores neurais e, portanto, possibilidade de regenerar os subtipos perdidos. Entre as vias envolvidas neste processo, destaca-se a via Hippo, em especial as proteínas LATS e YAP. Portanto, o objetivo deste presente projeto é estudar a atuação desta via durante um modelo animal de retinose pigmentar autossômica recessiva (uso de camundongos C3H/HeJ), e observar se o bloqueio da não-fosforilação da proteína YAP da via Hippo altera o padrão de <br>proliferação e reprogramação celular das células de Müller em diferentes períodos pós￾tratamento. Para isso, a proliferação das células de Müller será analisada pelo tratamento com o fármaco Verteporfina ou seu controle em culturas puras deste tipo celular frente ao estímulo de estresse oxidativo a fim de mimetizar um dos processos que ocorrem durante a progressão da retinose pigmentar. Ainda, estudos in vivo também estão sendo propostos através da injeção subretiniana do fármaco e observação de imunofluorescência dupla das células de Müller com marcadores de ciclo celular e proliferação 24 horas e sete dias depois da intervenção. Com isso, espera-se, ao final desta iniciação científica, observar as consequências da fosforilação do componente central da via Hippo em células de Müller, além de possíveis aplicações terapêuticas desta manipulação no tratamento da retinose pigmentar.</p>'),
