(488, 'pt_BR', 'abstract', '<p>As mulheres enfrentam diversos obstáculos para assumir cargos das áreas de STEM (Science, Technology, Engineering and Math),&nbsp; representando apenas 28,8% dos pesquisadores acadêmicos do mundo. Além disso, algumas profissões ainda são vistas como exclusivamente para homens, o que reduz a busca feminina por graduações e especializações em cursos de ciências exatas, por exemplo. Com o intuito de ampliar a representatividade feminina na ciência e minimizar questões dessa natureza, o projeto Menina Ciência - Ciência Menina, da Universidade Federal do ABC promove encontros e atividades práticas para meninas estudantes do ensino fundamental, de forma a aproximá-las da ciência e lhes apresentar as trajetórias de mulheres cientistas de sucesso. O projeto é organizado por uma equipe formada por mulheres cientistas; com o apoio de monitoras, estudantes da&nbsp; raduação e pós-graduação, além da realização de palestras, ministradas por mulheres cientistas de diferentes áreas. Esse&nbsp; trabalho de iniciação científica tem como objetivo entrevistar essas mulheres, levantando informações sobre suas trajetórias, referências e experiências, bem como investigando as influências e desafios do gênero em suas escolhas acadêmicas e&nbsp; profissionais para compreender suas percepções sobre a influência que podem exercer nas meninas do projeto e suas visões sobre as suas potencialidades. Com isso, espera-se entender quais as motivações dessas cientistas para colaborar com o projeto e verificar suas crenças m no caráter inovador e incentivador de propostas desta natureza.</p>'),
