(490, 'pt_BR', 'abstract', '<p><span style=\"font-weight: 400;\">O ácido gama-aminobutírico (GABA) é um aminoácido não proteico presente em diversas espécies na natureza. É conhecido por ser o principal neurotransmissor inibitório do sistema nervoso central (SNC) em mamíferos, desempenhando papéis importantes na modulação sináptica, desenvolvimento neuronal, relaxação e tônus muscular.</span><span style=\"font-weight: 400;\">1</span><span style=\"font-weight: 400;\"> Baixos níveis de GABA no cérebro está associado a alguns transtornos como ansiedade, mania, depressão e convulsões, principalmente devido a superexpressão de alguns receptores, transportadores e enzimas.</span><span style=\"font-weight: 400;\">Existe na literatura&nbsp; um grande número de ligantes conhecido para receptor GABA</span><span style=\"font-weight: 400;\">A </span><span style=\"font-weight: 400;\">. Além disso&nbsp; dispomos de varias estruturas experimentais heteropentamericas. Como o arranjo de combinações&nbsp; das subunidades heteropentamericas poder determinar diferentes efeitos biologicos poderia ser de extema importância identificar ligantes que possam ser especificos a determianas combinações pentamericas seja por ligação especifica ou por diminuição de afindade. Nesse caso temos interesse especial&nbsp; em ligantes que atuem dentro do canal de Cl como observado na estrutra 6hug(pdb)</span><span style=\"font-weight: 400;\">12</span><span style=\"font-weight: 400;\">.&nbsp;</span></p>\r\n<p><span style=\"font-weight: 400;\">Estudar os mecanismo&nbsp; estruturais e moleculares que podem levar a uma especificidade para hetero-pentameros pode ser de grande importancia para o desenvolvimento futuro de drogas mais especificas. </span></p>'),
