(491, 'pt_BR', 'abstract', '<p>Este projeto busca analisar os limites à efetivação do direito à educação em função das desigualdades tecnológicas evidenciadas no período da pandemia de Covid-19. Esse contexto acompanhou a implementação do ensino remoto emergencial, que acarretou situações de ampliação da desigualdade e do abandono escolar, dadas as desigualdades sociais e tecnológicas já existentes no território, corroborando ao cenário do ensino brasileiro de perpetuação da vulnerabilidade social e educacional. Analisaremos, assim, as políticas de acesso à educação dentro da região periférica de São Paulo sobre a universalidade do acesso à internet; a qualidade e modalidades de acesso à internet; a distribuição dos objetos técnicos-informacionais — smartphones e computadores — para acesso; e a exposição e acesso a canais de cultura e educação.</p>'),
