(493, 'pt_BR', 'abstract', '<p>Detectores de Fótons Únicos por Nanofios Supercondutores (do inglês<br>Superconducting Nanowire Single-Photon Detectors: SNSPD) são<br>dispositivos sensores baseados em nanoestruturas supercondutores para<br>detectar baixo número de fótons de determinada faixa de comprimento de<br>onda com alta eficiência e de forma ultrarrápida. Eles operam em<br>temperaturas extremamente baixas e com resistência elétrica nula que<br>sofre alteração ao ser atingida por um fóton, permitindo a sua<br>aplicação em computadores quânticos, comunicação e transmissão óptica<br>de dados.</p>Com o propósito de utilizar esse nanodispositivo para comunicação e transmissão de dados, nesse projeto de iniciação científica pretende-se inicialmente efetuar uma série de caracterizações físicas, químicas, estruturais e morfológicas nos nanofios supercondutores de YBa2Cu3O7-d (YBCO) sintetizados pelo grupo de pesquisa utilizando preenchimento de moldes nanométricos e por eletrofiação, de forma a garantir as propriedades ideias para a aplicação. Em seguida, utilizando de processos de litografia e deposição dos nanofios em eletrodos interdigitais de ouro sobre substrato de silício, executar os testes óticos no circuito montado com o nanodispositivo. Em paralelo, aprofundar o estudo nas referências bibliográficas correlacionadas para confrontar os resultados obtidos com os da literatura e aprimorar o desenvolvimento do projeto. Levantamento inicial mostrou poucos trabalhos publicados neste tema, o que reforça a importância do estudo. O circuito será montado com diferentes configurações de nanofios e testes de transmissão/detecção de fótons serão efetuados para mensurar a eficiência das diferentes montagens. Espera-se inicialmente obter resultados equivalentes à literatura e caso seja necessário, durante o desenvolvimento do projeto, o processo de síntese do material ou de confecção do nanodispositivo serão readequados para otimizar o uso como SNSPD. E dessa forma, pretende-se analisar os resultados visando comparar o método de síntese dos nanofios de YBa2Cu3O7-d com as fotorespostas, determinando a melhor configuração para o equipamento construído. Espera-se que com esse trabalho de Iniciação Científica o aluno possa ter contato com as diversas técnicas de síntese e caracterização de nanomateriais e desenvolver uma aplicação avançadas que, além de agregar o seu conhecimento, possa contribuir para o desenvolvimento dessa área no Brasil.'),
