(495, 'pt_BR', 'abstract', '<p>As concepções de crianças em idade escolar acerca da Ciência são descritas<br>na bibliografia como comumente estereotipadas e pouco próximas à realidade. De<br>acordo com a descrição de “cientista maluco” de Chambers (1983) essa figura é muito<br>excêntrica e caricata. Embora essa representação esteja presente em muitos meios<br>midiáticos, e por consequência, presente no imaginário das crianças, Rosa, Ludwig,<br>Wirth, Franco e Duarte (2003) sugerem que isso se dá, entre muitos fatores, ao perfil<br>socioeconômico da criança. Dessa forma, crianças com ou sem acesso a canais e<br>outras plataformas pagas, normalmente apresentam uma concepção sobre o cientista<br>mais próxima de suas respectivas realidades, descrevendo-o como o cientista<br>desumanizado de Chambers ou até como “cientista-mestre-de-obras”. Bian, Leslie e<br>Cimpian (2017) destacam que essas representações estereotipadas aparecem cedo<br>na infância, por volta dos seis anos de idade e normalmente persistem ao longo da<br>vida adulta. Isso, pode resultar em chances maiores de que a menina, quando diante<br>da escolha de carreira, opte por carreiras mais “adequadas” ao seu gênero,<br>desconsiderando profissões vistas como tipicamente masculinas. Essas concepções,<br>podem acabar por desestimular o ingresso de mais mulheres na Ciência. De acordo<br>com o UIS - Unesco Institute for Statistics (2018), no ano de 2016 as mulheres<br>representavam menos de 30% de todos os pesquisadores do planeta. E quando se<br>olha mais especificamente para as áreas da STEM essa porcentagem é ainda menor.<br>Tais dados reforçam a importância de iniciativas voltadas ao incentivo a mulheres na<br>Ciência, através da alfabetização científica, que diante das diversas realidades<br>presentes no Brasil, para Chassot (2003) só será possível quando o ensino de ciências<br>for um agente contribuinte para a compreensão dos saberes científicos, suas</p>\r\n<p>utilidades e limitações. Assim, projetos como o projeto de extensão “Menina Ciência-<br>Ciência Menina” da Universidade Federal do ABC se mostram fundamentais. Em sua</p>\r\n<p>terceira edição (2021), contou com a participação de 150 meninas alunas de escolas<br>públicas e particulares matriculadas no Ensino Fundamental II (6° ao 9° ano),<br>juntamente com monitoras e mulheres cientistas de diversas áreas de atuação. Diante<br>disso e dos resultados obtidos anteriormente em uma pesquisa de Iniciação Científica<br>realizada pela atual candidata, observou-se certas diferenças de concepções, bem<br>como similaridades, entre as participantes do MCCM que eram provenientes de<br>instituições de ensino públicas e privadas. Em consonância a estes aspectos, o</p>\r\n<p>presente projeto busca investigar e analisar como o perfil socioeconômico de meninas<br>do Ensino Fundamental II (6o ao 9o ano) participantes do projeto de extensão da<br>Universidade Federal do ABC (UFABC), “Menina Ciência-Ciência Menina”, onde a<br>candidata à bolsa do atual edital Programa de Iniciação Científica da Universidade<br>Federal do ABC (PIC) edital no 04/2022 atuou como monitora voluntária, e como a</p>\r\n<p>caracterização da figura do cientista podem estar relacionados. Desta maneira visa-<br>se incentivar que outras propostas de mesma natureza sejam viabilizadas, de forma</p>\r\n<p>ampliar a alfabetização científica. E, por consequência, reduzindo tanto paradigmas<br>de gênero acerca de carreiras científicas quanto concepções estereotipadas e pouco<br>realistas relacionadas a fatores socioeconômicos.</p>'),
