(501, 'pt_BR', 'abstract', '<p>A investigação proposta tem como objetivo compreender a influência dos divulgadores <br>científicos e dos meios de comunicação digitais e seu papel na circulação de informações <br>científicas sobre a Covid-19 entre o público jovem de um bairro periférico da cidade de São <br>Paulo. Para tanto, a pesquisa utilizará uma abordagem qualitativa de carater descritivo e <br>exploratório. Os dados serão coletados junto aos alunos da “Escola Técnica Estadual (ETEC) de <br>Sapopemba”, localizada no bairro Fazenda da Juta, Distrito de Sapobemba, município de São <br>Paulo – SP, com a utilização de questionários eletrônicos com questões fechadas e abertas <br>sobre o tema investigado. A análise das respostas obtidas será conduzida com a utilização da <br>Análise Textual Discussiva. O projeto de investigação tem resultados esperados a identificação <br>de quais divulgadores científicos exerceram maior influência sobre o público no contexto da <br>Pandemia; determinar quais foram os aspectos determinantes de tais atores para que as suas <br>informações sobre a Covid - 19 fossem consideradas confiáveis pelo público; identificar os <br>principais canais utilizados para obtenção de informações sobre a Pandemia; e elencar quais os <br>principais critérios utilizados pelo público para a escolha destes canais.</p>'),
