(502, 'pt_BR', 'abstract', '<p>Este projeto de pesquisa tem por objetivo introduzir ao estudante as técnicas e conceitos fundamentais da Análise de Curto-Circuito em Sistemas Elétricos de Potência. Ao final deste projeto, o estudante será capaz de utilizar diferentes softwares simuladores de curto-circuito, considerando as principais características e recursos disponíveis em cada um deles. Essas simulações serão realizadas utilizando os softwares ANAFAS, PowerWorld e PSCAD.</p>'),
